INSERT INTO `agreements` (`id`, `approved_agreement`, `agreement_day`, `agreement_date`, `dayoff`, `yearoff`, `between`, `msm_manager`, `msm_address`, `msm_email`, `msm_phone`, `msm_contactperson`, `msm_and`, `provider_data`, `pro_address`, `pro_email`, `pro_phone`, `pro_contactperson`, `background`, `back_1`, `service_pro`, `compesation`, `compesation_pro`, `provider_charge`, `compesation_commission`, `subscription_fee`, `compesation_end`, `compesation2`, `plan`, `subscription_name`, `subscription_info`, `subscription_charge`, `subscription_end`, `subscription_premium`, `premium_charge`, `premium_subscription`, `premium_subscription1`, `penlaties`, `penlaties_info`, `confidentiality`, `confidentiality1`, `confidentiality2`, `confidentiality3`, `ownership`, `ownership1`, `ownership2`, `property`, `property_info`, `relationship`, `relationship_info`, `liability`, `liability_info`, `force`, `force_info`, `law`, `law_info`, `agreement_mod`, `agreement_modinfo`, `inwitness`, `witness_day`, `witness_date`, `witness_day1`, `witness_date1`, `provider_id`, `msm_sign`, `provider_sign`, `send_admin`, `send_provider`, `agreement_success`) VALUES
(1, 'THIS PROVIDER AGREEMENT (the \"Agreement\") dated this', '', '', 'day of', '2020 ', 'BETWEEN:', '', '<p>A. HEALTH SUPPLY MANAGER LLC </p>\r\n<p>Address: 2578 Broadway #525 New York, New York 10025</p> \r\n<p>Email: sales@healthsupplymanager.com</p>\r\n<p>Phone:+1 5854405636</p>\r\n</p>Contact Person: Shaka Eroje</p>', '', '', '', 'AND', 'B. PROVIDER', '', '', '', '', 'BACKGROUND', '<p>Health Supply Manager LLC (HSM) is the administrator of www.medicalsupplymanager.com - an eCommerce marketplace platform. Based upon information and assurances from Provider, Health Supply Manager believe that the Provider whose details appears in this agreement has the necessary accreditation needed for licenses and permits as a Pharmacy, DMEPOS or Medical Supply Provider. Provider is responsible for ensuring compliance with any state or federal licenses, permits and regulation. Health Supply Manager also believes Provider has the experience, staff, and materials required to provide quality services to our users which includes Doctors and Patients.</p>\r\n<p>Health Supply Manager (HSM) is agreeable to providing the software, technology and logistics needed to manage both prescribed and non - prescribed items ordered from the Provider. Providers are responsible for fulfilling all orders in a timely and profess</p>\r\n<p>In consideration of the matters described above and of the mutual benefits and obligations set forth in this Agreement, Health Supply Manager (HSM) LLC and the Provider (individually the </p>', '<p><b>1. SERVICES PROVIDED</b></p>  \r\n<p>Health Supply Manager (HSM) hereby agrees to provide an online platform whereby Provider can display their products for sale, receive orders from customers and be able to process orders promptly. Providers agrees to pay a stipulated fee to Health Supply M\r\n</p>\r\n<p><b>2. TERM OF AGREEMENT</b></p>  \r\n<p>i. The term of this Agreement (the \"Term\") will begin on the date of this Agreement and will remain in full force and effect indefinitely until terminated as provided in this Agreement.\r\n</p>\r\n<p>ii. If either Party wishes to terminate this Agreement, that Party will be required to provide written notice to the other Party.\r\n</p>\r\n<p>iii. If either Party breaches a material provision under this Agreement, the non-defaulting Party may terminate this Agreement immediately and require the defaulting Party to indemnify the non-defaulting Party against all reasonable damages. \r\n</p>\r\n<p><b>3. PERFORMANCE</b></p>\r\n<p>The Parties agree to do everything necessary to ensure that the terms of this Agreement take effect.</p>\r\n<p><b>4. CURRENCY</b></p>\r\n<p>Except as otherwise provided in this Agreement, all monetary amounts referred to in this Agreement are in USD (US Dollars).\r\n</p>', '<p><b>5. COMPENSATION</b></p>', 'i. Health Supply Manager (HSM) will charge the Provider $', '', 'per order received from customers. A 0.5% processing fee for online payment orders, and an agreed monthly subscription fee of $', '', 'per month if registered for a premium plan. ', '<p>ii. The Provider will be invoiced for payment due. Invoices should be settled in full within one (1) week of receipt and must be paid electronically. </p>\r\n<p>iii. All payment due to Provider shall also be paid in full within one week and payment must be done electronically.</p>\r\n<p>iii. The service fees as stated in this Agreement does not include sales tax, or other applicable duties as may be required by law. Any sales tax and duties required by law will be charged to the Provider in addition to the fee as applicable.\r\n</p>', '', '<p><b>6. SUBSCRIPTION PLAN (SELECT A PLAN) </b></p>', 'i. Free User Account: This plan allows Provider to register and list store products online for free without a monthly subscription fee. Provider is responsible for the delivery of orders received but will be charged a $ ', '', ' commission for orders received.', 'ii. Premium Account: This subscription plan allows Provider to register and post store products online for free. HSM LLC is responsible for delivery of orders received. Provider will be charged a $', '', 'commission for orders received and a monthly subscription fee of $', '', '<p><b>7. PENALTIES FOR LATE PAYMENT</b></p>\r\n<p>Late payment will result into suspension of account and possible termination of this contract/agreement. In the event the services of an attorney or collection agency are necessary for collection of unpaid invoices, HSM or the injured party shall be entitled to all collection costs and fees including actual attorney fees, litigation fees, court cost and any other similar or related expenses.</p>\r\n<p><b>8. CONFIDENTIALITY</b></p>\r\n<p>i. Confidential information (the \"Confidential Information\") refers to any data or information relating to the business of the Provider which would reasonably be considered to be proprietary to the Provider including, but not limited to, Patients / Doctor\r\n</p>\r\n<p>ii. HSM and Provider agrees that they will not disclose, divulge, reveal, report or use, for any purpose, other than processing of orders received any Confidential Information obtained from Clients, except as authorized by the Client or as required by law\r\n</p>\r\n<p>iii. All written and oral information and material disclosed or provided by HSM to the Provider under this Agreement is Confidential Information regardless of whether it was provided before or after the date of this Agreement or how it was provided to the\r\n</p>\r\n<p><b>9. OWNERSHIP OF INTELLECTUAL PROPERTY\r\n</b></p>\r\n<p>i. All intellectual property and related material (the \"Intellectual Property\") that is developed or produced under this Agreement, will be the property of HSM. The Provider is granted a non-exclusive limited-use license of this Intellectual Property. \r\n</p>\r\n<p>ii. Title, copyright, intellectual property rights and distribution rights of the Intellectual Property remain exclusively with HSM.</p>\r\n<p><b>10. RETURN OF PROPERTY</b></p>\r\n<p>Upon the expiry or termination of this Agreement, the Provider will return to HMS or stop the use of any Password, and User name or any link associated with their account with HSM. All materials, documentation, records, or confidential information that is\r\n</p>\r\n<p><b>11. RELATIONSHIP</b></p>\r\n<p>In providing the services under this Agreement it is expressly agreed that the Provider is not  an employee of HSM LLC. HSM and the Provider acknowledge that this Agreement does not create a partnership or joint venture between them and is exclusively a contract for service. HSM is not required to pay, or make any contributions to, any social security, local, state or federal tax, unemployment compensation, workers\' compensation, insurance premium, profit-sharing, pension or any other employee benefit for the Provider during the Term. The Provider is responsible for paying, and complying with reporting requirements for all local, state, and federal taxes related to payments made to the Provider under this Agreement.\r\n</p>\r\n<p><b>12. LIABILITY AND INDEMNIFICATION</b></p>\r\n<p>In connection with the services provided generally under this Agreement and specifically by a particular personnel, in no event shall HSM, its contractors, subcontractors, agents, reps and employees be liable to Provider for any damages or for indemnification in any amount in connection with the performance of such services. HSM shall not be liable for any indirect damages or for any general, punitive, special, or consequential damages, loss of profits, interest, penalties or fines. The terms of this section shall survive any termination of this agreement.</p>\r\n<p><b>13. FORCE MAJEURE HSM</b></p>\r\n<p>HSM shall not be deemed in breach of this agreement if HSM is unable to complete the services or any portion thereof by reason of hurricane, blizzard, fire, earthquake labor dispute, act of God or public enemy, or by reason of death, serious illness or incapacity o