uthorized by the Client or as required by law', 'iii. All written and oral information and material disclosed or provided by HSM to the Provider under this Agreement is Confidential Information regardless of whether it was provided before or after the date of this Agreement or how it was provided to the', '9. OWNERSHIP OF INTELLECTUAL PROPERTY ', 'i. All intellectual property and related material (the \"Intellectual Property\") that is developed or produced under this Agreement, will be the property of HSM. The Provider is granted a non-exclusive limited-use license of this Intellectual Property. ', 'ii. Title, copyright, intellectual property rights and distribution rights of the Intellectual Property remain exclusively with HSM. ', '10. RETURN OF PROPERTY ', 'Upon the expiry or termination of this Agreement, the Provider will return to HMS or stop the use of any Password, and User name or any link associated with their account with HSM. All materials, documentation, records, or confidential information that is', '11. RELATIONSHIP', 'In providing the services under this Agreement it is expressly agreed that the Provider is not an employee of HSM LLC. HSM and the Provider acknowledge that this Agreement does not create a partnership or joint venture between them and is exclusively a co', '12. LIABILITY AND INDEMNIFICATION', 'In connection with the services provided generally under this Agreement and specifically by a particular personnel, in no event shall HSM, its contractors, subcontractors, agents, reps and employees be liable to Provider for any damages or for indemnifica', '13. FORCE MAJEURE HSM', 'shall not be deemed in breach of this agreement if HSM is unable to complete the services or any portion thereof by reason of hurricane, blizzard, fire, earthquake labor dispute, act of God or public enemy, or by reason of death, serious illness or incapa', '14. GOVERNING LAW', 'This agreement shall be binding upon the heirs and assigns of the parties and shall be governed by and interpreted according to the laws of the United States of America and the State of New York. In the event of a dispute hereunder, the parties agree that', '15. MODIFICATION OF AGREEMENT', 'Any amendment or modification of this Agreement or additional obligation assumed by either Party in connection with this Agreement will only be binding if evidenced in writing signed by each Party or an authorized representative of each Party. ', 'IN WITNESS WHEREOF the Parties have duly affixed their signatures on this', 'day of ', ',2020 ', '', '', '1', '', '', '0', '0', '0'),
