(12, 'THIS PROVIDER AGREEMENT (the \"Agreement\") dated this', '04', 'August', 'day of', '2020 ', 'BETWEEN:', '', '<p>A. HEALTH SUPPLY MANAGER LLC</p>\n\n<p>Address: 2578 Broadway #525 New York, New York 10025</p>\n\n<p>Email: sales@healthsupplymanager.com</p>\n\n<p>Phone:+1 5854405636</p>\n\n<p>&nbsp;</p>\n\n<p>Contact Person: Shaka Eroje</p>\n\n<p>&nbsp;</p>\n', '', '', '', 'AND', 'Lifeline Medical Supply', '702 Vermont Street, Brooklyn, NY 11207', 'lifelinemedicalsupply@post.com', '6467027518', 'Lifeline Medical Supply', 'BACKGROUND', '<p>Health Supply Manager LLC (HSM) is the administrator of www.medicalsupplymanager.com - an eCommerce marketplace platform. Based upon information and assurances from Provider, Health Supply Manager believe that the Provider whose details appears in this agreement has the necessary accreditation needed for licenses and permits as a Pharmacy, DMEPOS or Medical Supply Provider. Provider is responsible for ensuring compliance with any state or federal licenses, permits and regulation. Health Supply Manager also believes Provider has the experience, staff, and materials required to provide quality services to our users which includes Doctors and Patients.</p>\n\n<p>Health Supply Manager (HSM) is agreeable to providing the software, technology and logistics needed to manage both prescribed and non - prescribed items ordered from the Provider. Providers are responsible for fulfilling all orders in a timely and profess</p>\n\n<p>In consideration of&nbsp;the matters described above and of the mutual benefits and obligations set forth in this Agreement, Health Supply Manager (HSM) LLC and the Provider (individually the &quot;party&quot; and collectively the parties to this Agreement) agree as follows:</p>\n', '<p><strong>1. SERVICES PROVIDED</strong></p>\n\n<p>&nbsp;</p>\n\n<p>Health Supply Manager (HSM) hereby agrees to provide an online platform whereby Provider can display their products for sale, receive orders from customers and be able to process orders promptly. Providers agrees to pay a stipulated fee to Health Supply M</p>\n\n<p><strong>2. TERM OF AGREEMENT</strong></p>\n\n<p>&nbsp;</p>\n\n<p>i. The term of this Agreement (the &quot;Term&quot;) will begin on the date of this Agreement and will remain in full force and effect indefinitely until terminated as provided in this Agreement.</p>\n\n<p>ii. If either Party wishes to terminate this Agreement, that Party will be required to provide written notice to the other Party.</p>\n\n<p>iii. If either Party breaches a material provision under this Agreement, the non-defaulting Party may terminate this Agreement immediately and require the defaulting Party to indemnify the non-defaulting Party against all reasonable damages.</p>\n\n<p><strong>3. PERFORMANCE</strong></p>\n\n<p>The Parties agree to do everything necessary to ensure that the terms of this Agreement take effect.</p>\n\n<p><strong>4. CURRENCY</strong></p>\n\n<p>Except as otherwise provided in this Agreement, all monetary amounts referred to in this Agreement are in USD (US Dollars).</p>\n', '<p><b>5. COMPENSATION</b></p>', 'i. Health Supply Manager (HSM) will charge the Provider $', '1', 'per order received from customers. A 0.5% processing fee for online payment orders, and an agreed monthly subscription fee of $', 'NA', 'per month if registered for a premium plan. ', '<p>ii. The Provider will be invoiced for payment due. Invoices should be settled in full within one (1) week of receipt and must be paid electronically.</p>\n\n<p>iii. All payment due to Provider shall also be paid in full within one week and payment must be done electronically.</p>\n\n<p>iii. The service fees as stated in this Agreement does not include sales tax, or other applicable duties as may be required by law. Any sales tax and duties required by law will be charged to the Provider in addition to the fee as applicable.</p>\n', 'free_plan', '<p><b>6. SUBSCRIPTION PLAN (SELECT A PLAN) </b></p>', '                    i. Standard Account: This plan allows Provider to register and list store products online for free without a monthly subscription fee. Provider is responsible for the delivery of orders received but will be charged a $                 ', '1', ' commission for orders received.', '                  ii. Premium Account: This subscription plan allows Provider to register and post store products online for free. HSM LLC is responsible for delivery of orders received. Provider will be charged a $                ', 'NA', 'commission for orders received and a monthly subscription fee of $', '', '<p><strong>7. PENALTIES FOR LATE PAYMENT</strong></p>\n\n<p>Late payment will result into suspension of account and possible termination of this contract/agreement. In the event the services of an attorney or collection agency are necessary for collection of unpaid invoices, HSM or the injured party shall be entitled to all collection costs and fees including actual attorney fees, litigation fees, court cost and any other similar or related expenses.</p>\n\n<p><strong>8. CONFIDENTIALITY</strong></p>\n\n<p>i. Confidential information (the &quot;Confidential Information&quot;) refers to any data or information relating to the business of the Provider which would reasonably be considered to be proprietary to the Provider including, but not limited to, Patients / Doctor</p>\n\n<p>ii. HSM and Provider agrees that they will not disclose, divulge, reveal, report or use, for any purpose, other than processing of orders received any Confidential Information obtained from Clients, except as authorized by the Client or as required by law</p>\n\n<p>iii. All written and oral information and material disclosed or provided by HSM to the Provider under this Agreement is Confidential Information regardless of whether it was provided before or after the date of this Agreement or how it was provided to the</p>\n\n<p><strong>9. OWNERSHIP OF INTELLECTUAL PROPERTY </strong></p>\n\n<p>i. All intellectual property and related material (the &quot;Intellectual Property&quot;) that is developed or produced under this Agreement, will be the property of HSM. The Provider is granted a non-exclusive limited-use license of this Intellectual Property.</p>\n\n<p>ii. Title, copyright, intellectual property rights and distribution rights of the Intellectual Property remain exclusively with HSM.</p>\n\n<p><strong>10. RETURN OF PROPERTY</strong></p>\n\n<p>Upon the expiry or termination of this Agreement, the Provider will return to HMS or stop the use of any Password, and User name or any link associated with their account with HSM. All materials, documentation, records, or confidential information that is</p>\n\n<p><strong>11. RELATIONSHIP</strong></p>\n\n<p>In providing the services under this Agreement it is expressly agreed that the Provider is not an employee of HSM LLC. HSM and the Provider acknowledge that this Agreement does not create a partnership or joint venture between them and is exclusively a contract for service. HSM is not required to pay, or make any contributions to, any social security, local, state or federal tax, unemployment compensation, workers&#39; compensation, insurance premium, profit-sharing, pension or any other employee benefit for the Provider during the Term. The Provider is responsible for paying, and complying with reporting requirements for all local, state, and federal taxes related to payments made to the Provider under this Agreement.</p>\n\n<p><strong>12. LIABILITY AND INDEMNIFICATION</strong></p>\n\n<p>In connection with the services provided generally under this Agreement and specifically by a particular personnel, in no event shall HSM, its contractors, subcontractors, agents, reps and employees be liable to Provider for any damages or for indemnification in any amount in connection with the performance of such services. HSM shall not be liable for any indirect damages or for any general, punitive, special, or consequential damages, loss of profits, interest, penalties or fines. The terms of this section shall survive any termination of this agreement.</p>\n\n<p><strong>13. FORCE MAJEURE HSM</strong></p>\n\n<p>HSM shall not be deemed in breach of this agreement if HSM is unable to complete the services or any portion thereof by reason of hurricane, blizzard, fire, earthquake labor dispute, act of God or public enemy, or by reason of death, serious illness or incapacity of a customer of the Provider, or by any local, state, federal , national or international law, governmental order or regulation, or any other event beyond Provider&#39;s control (Collectively, &quot;Force Majeure Event&quot;). Upon occurrence of any Force Majeure Event, HSM shall give notice to Provider of its inability to perform and of the expected delay in completing the services. , if applicable, and shall propose revisions to the schedule for completion of the services.</p>\n\n<p><strong>14. GOVERNING LAW</strong></p>\n\n<p>This agreement shall be binding upon the heirs and assigns of the parties and shall be governed by and interpreted according to the laws of the United States of America and the State of New York. In the event of a dispute hereunder, the parties agree that the exclusive jurisdiction and venue for the resolution thereof shall be New York County, NY. The terms of this section shall survive any termination of this agreement</p>\n\n<p><strong>15. MODIFICATION OF AGREEMENT</strong></p>\n\n<p>Any amendment or modification of this Agreement or additional obligation assumed by either Party in connection with this Agreement will only be binding if evidenced in writing signed by each Party or an authorized representative of each Party.</p>\n', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'IN WITNESS WHEREOF the Parties have duly affixed their signatures on this', 'day of ', ',2020 ', '5TH', 'August', '139', 'msm_5f2a3502c0efb.png', 'pro_5f2a355b468fa.png', '1', '1', '1'),
