(25, '169', 'vishal', '<p>tgf rfhg hjgjgh vk style</p>\r\n'),
(26, '141', 'vishal', '<p>fsdsdgdgdfdv vssvdf</p>\r\n'),
(30, '171', 'prishu', '<p>e-Prescribing (eRx) is the electronic transmission of a drug prescription directly to a pharmacy through EHR technology. eRx has potential advantages in making prescribing more efficient and safer: calls from the pharmacist to clarify prescriptions could be significantly reduced; it&rsquo;s less likely scripts will be filled incorrectly; and clinicians should receive notifications at the point of care for potential interactions with medications prescribed by other physicians. Electronic prescribing is still a requirement for eligible professionals (EPs) in order to achieve meaningful use (Stages 1 and 2) under the Medicare and Medicaid EHR Incentive Programs.</p>\r\n\r\n<p>In addition, some states have started to require that physicians use eRx for all prescriptions. Check with your <a href=\"http://google.com\">district branch</a> if this is a concern or issue for you.</p>\r\n\r\n<p>With the CMS eRx Incentive Program ending in 2013, there were no longer incentive or payme</p>\r\n'),
(31, '173', 'Victor Adeye', '<p>metro@gmail.com</p>\r\n'),
(32, '1', 'Super Admin', '<p>info@medicalsupplymanager.com</p>\r\n'),
(33, '190', 'Jonhn', '<p>Test</p>\r\n'),
(34, '192', 'Funso', '<p>support@accordmedicalsupply.com</p>\r\n\r\n<p><strong>Accord Medical Supply Inc.</strong> is dedicated to providing you with high quality medical supplies and exceptional customer service. We are accredited by The Compliance Team and have been proudly serving patients in Brooklyn, the Bronx, Manhattan, Queens, Staten Island, and Long Island since 2012.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n'),
(36, '177', 'Prishu', '<p>Demo</p>\r\n');
