(6, '9345686686', 'Organic Smooth Move Senna', 'Senna', 'It is advisable to read Item label instruction and packaging for product composition', '', 'Tea bags', '10', '', '<p>Do not use if suffering from Ileus, acute intestinal inflammation (e.g. Crohn?s disease, ulcerative colitis), appendicitis, abdominal pain of unknown origin, severe dehydration states with water and electrolyte depletion.</p>\r\n\r\n<p>As with any drug, if you are pregnant or nursing a baby, seek the advice of a health professional before using this product. Do not use laxative products when abdominal pain, nausea, or vomiting are present unless directed by a doctor.</p>\r\n\r\n<p>If you have noticed a sudden change in bowel habits that persists over a period of two weeks, please consult a doctor before using a laxative. If rectal bleeding or failure to have a bowel movement occurs after use of this laxative product it may indicate a serious condition. Discontinue use and consult your doctor.</p>\r\n\r\n<p>In case of overdose, get medical help or contact a Poison Control Center right away</p>\r\n', '<p>To be used as recommended</p>\r\n', '<p>This natural herbal product works as a gentle overnight relief from occasional constipation. Senna leaf is the &quot;move&quot; in this tea, and it works by direct action on the intestine, which is why it is called a stimulant laxative.. It relieves occasional constipation (irregularity)</p>\r\n', '<p>This product is usually combined with fennel, orange peel, cinnamon, coriander and ginger for digestive support. It should not be used except directed by a doctor. Keep out of the reach of children.</p>\r\n', ' 1592760363749.jpg,', '', '4267269884', '6829334714', '8565834914', '9996318464', 50, 40, 40, 0, '0', 'health', 0, '', '', '2020-06-16 04:45:34', '1', '2020-06-21 13:26:15', '1', 1, 0, '$40 for 16 wrapped Tea bags', 'https://youtu.be/Guqo6UavhJs'),
(7, '1208482893', ' Bone Broth', ' Bone Broth', '20g of Protein per serving 100% Natural, Dairy Free, Soy Free, Grain Free, Nut Free, Gluten Free. Contains 15,900mg of Collagen Hydrolysate per serving. Contains 1,256mg of Chondroitin Sulfate per serving. Contains Over 19 Amino Acids, Key Minerals, PLUS Hyaluronic Acid and Glucosamine. Tested free of Genetically Modified Ingredients', '', 'Plastic container', '8', '', '<p>Some noticeable side effects may be as a result of red meat and pork sources that contain potentially dangerous Neu5Gc. Consumption may increase exposure to lead. Increase in headaches, including migraines. Excess glutamates may exasperate ADD/ADHD, autism, epilepsy, multiple sclerosis, and other neurological disorders. People with MSG sensitivities may suffer similar reactions.</p>\r\n', '<p>The suggested serving for baone broth is to mix one scoop in 12 ounces of hot or cold water. Mix with water and use broth as a base for soups, stews and casseroles. Season with salt and pepper for a savory drink. It is recommended that it is used before or after working out.</p>\r\n', '<p>Bone broth is believed to have a wide range of health benefits, including maintaining a healthy gut, promoting healthy joints, fortifying immune system and functioning and improving overall wellness</p>\r\n', '<p>Bone broth is a highly nutritious product made by simmering animal bones and connective tissue. Using acid, such as vinegar or lemon juice, breaks down the collagen and connective tissue. This leaves you with a tasty, nutritious liquid commonly used in soups and sauces.</p>\r\n', ' 1592756187116.jpg,', '', '4048592459', '1808207255', '4331645934', '4533645267', 55, 45, 45, 0, '0', 'health', 0, '', '', '2020-06-16 05:36:35', '1', '2020-06-21 12:20:04', '1', 1, 0, '$45 for 460g', 'https://youtu.be/eTfz2pVCY40'),
(8, '4824121211', 'Metagenics - Wellness Essentials Men\'s Vitality', 'Metagenics - Wellness Essentials Men\'s Vitality', ' Each packet contains: 1 PhytoMulti tablet (green), 2 OmegaGenics EPA-DHA 500 softgels (golden yellow), 1 Testralin tablet (green), 1 Zinc A.G. tablet (cream), and 1 HisSynergy tablet (brown). ', '', 'Packet', '7', '', '<p>No adverse side effects have been reported if used as recommended.</p>\r\n', '<p>Do not exceed <em>recommended dose</em></p>\r\n', '<p>Each one daily packets support vitality, libido, and overall men wellness.</p>\r\n', '<p>This product has not been &nbsp;evaluated by the Food and Drug Administration. It is not intended to diagnose, treat, cure, or prevent any disease.</p>\r\n', '1592368028695.Jpg,', '', '4946100794', '2395258637', '7045930346', '4449555266', 300, 250, 250, 0, '0', 'health', 0, '4', '1', '2020-06-17 04:41:11', '1', '2020-06-17 00:52:06', '1', 1, 0, '$250 for packet of 30 Tablets', 'https://youtu.be/VTBIL6XyPWY'),
(9, '3158163463', 'UltraFlora Women\'s', 'UltraFlora® Women\'s', '1 capsule contains A 50:50 Blend of 2 billion live organisms', '', 'Plastic container', '7', '', '<p>Some of the reported symptoms associated with this product include excessive gas, upset stomach or throwing up, loss of appetite, stomach cramps, dry mouth, dizziness and headache. If you are allergic to UltraFlora Immune Health (probiotic capsules); any part of UltraFlora Immune Health (probiotic capsules); or any other drugs, foods, or substances. It is important that you tell your doctor about the allergy and what signs you had.</p>\r\n', '<p>Use as recommended.</p>\r\n', '<p>There are many different probiotics UltraFlora Women&rsquo;s is a unique blend of probiotics taken orally to help maintain a healthy vaginal microflora and support urogenital health.</p>\r\n', '<p>The safety and efficacy of this probiotic combination for women&rsquo;s health is supported by laboratory research and clinical evaluation</p>\r\n', '1592370863101.jpg,', '', '3032356223', '2395258637', '6444025255', '4449555266', 85, 80, 80, 0, '0', 'health', 0, '', '', '2020-06-17 05:32:33', '1', '', '', 1, 0, '$80 for 30 Capsules', ''),
(10, '1825567530', 'RhinAllergy® Tablets', 'RhinAllergy® Tablets', 'Allium cepa 5C HPUS. Ambrosia artemisiaefolia 5C HPUS. Euphrasia officinalis 5C HPUS. Histaminum hydrochloricum 9C HPUS. Sabadilla 5C HPUS. Solidago virgaurea 5C HPUS', '', 'Blister pack', '8', '', '<p>The medicine should be used with the supervision of a doctor. If allergy symptoms persist after several days, Stop use and ask a doctor.&nbsp;</p>\r\n', '<p>Dosage should be as recommended.&nbsp;</p>\r\n', '<p>RhinAllergy tablets helps with relieving allergies and related symptoms such as &nbsp;itchy, watery, burning and irritated eyes; sneezing; runny nose; and itchy throat and nose.</p>\r\n', '<p>Unlike most conventional medicine that mask full-blown symptoms, Boiron RhinAllergy tablets target specific symptoms of hay fever or other upper respiratory allergie.</p>\r\n', '1592750414369.jpg,', '', '6762838384', '2395258637', '7045930346', '5701121855', 20, 18, 18, 0, '0', 'health', 0, '3', '1', '2020-06-21 14:50:52', '1', '2020-06-21 10:54:26', '1', 1, 0, '$18 for 60 Tablets', ''),
(11, '8772961609', 'Zyrtec', 'Cetrizine', 'Cetirizine HCl - 5 mg (Antihistamine', '', 'Solution in bottle', '14', '', '<p>This product should not be used if you have an allergic reaction to this product or any of its ingredients or to an antihistamine containing hydroxyzine. Contact your doctor if symptoms persist/</p>\r\n', '<p>Use only as recommended by your doctor or pharmacist.</p>\r\n', '<p>Zyrtec relieves allergy symptoms in children. Zyrtec is effective for treating symptoms such as runny nose, sneezing, itchy watery eyes, and itchy nose and throat.</p>\r\n', '<p>With 5 milligrams of cetirizine hydrochloride in each 5 mL, this over the counter medicine offers 24-hour relief from common symptoms of hay fever and other upper respiratory allergies.</p>\r\n', '1592753420888.jpg,', '', '6619055552', '2395258637', '8599875226', '8077160980', 20, 17, 17, 0, '0', 'health', 0, '4', '1', '2020-06-21 15:42:38', '1', '', '', 1, 0, '$17 for a 8 oz ', 'https://youtu.be/TOMmCHoSnFs'),
(12, '5169561803', 'Listerine Antiseptic Mouthwash', 'Listerine Antiseptic Mouthwash', 'Menthol', '', 'Plastic bottle', '10', '', '<p>If persist mouth sores, and bad breath persist or worsens, listerine should be discontinued. Consult your doctor or pharmacist immediately.</p>\r\n', '<p>It is recommended that adding a 30-second rinse of listerine to your morning and nighttime routines is all it takes to get 24-hour protection against germs that cause plaque and gingivitis.</p>\r\n', '<p>When used on regular basis it protects your mouth from germs and gives fresh breath.</p>\r\n', '<p>Listerine kills 99.9% of germs that cause bad breath, plaque, and gingivitis for a fresher and cleaner mouth than brushing alone. It is shown clinically to reduce 52 percent more plaque and 21 percent more gingivitis than brushing and flossing alone, this refreshing mouthwash, which comes in different flavors, provides a deep clean that cares for your whole mouth.</p>\r\n', '1592758913880.jpg,', '', '1434557584', '2055045134', '8599875226', '8077160980', 10, 8, 8, 0, '0', 'health', 0, '', '', '2020-06-21 17:20:20', '1', '2020-06-21 13:21:04', '1', 1, 0, '$8 for 1.5L bottle', 'https://youtu.be/BEy3neOGEHU'),
(13, '5264176055', 'Bolthouse Farms 100% Pomegranate Juice', 'Bolthouse Farms 100% Pomegranate Juice', '100% pomegranate juice', '', 'Plastic Bottle', '9', '', '<p>Do not consume this juice if you are allergic to&nbsp;pomegranate because you may experience itching, swelling, runny nose, and difficulty breathing.</p>\r\n', '<p>Consume in moderation as recommended</p>\r\n', '<p>Pomegranate juice is rich in antioxidant polyphenols, which can reverse atherosclerosis as well as vascular inflammation, thereby lower blood pressure.</p>\r\n', '<p>Pomegranate juice&nbsp;is known to contain higher levels of antioxidants than most other fruit&nbsp;juices. It is also believed to have three times more antioxidants than red wine and green tea. The antioxidants in&nbsp;pomegranate juice&nbsp;can help remove free radicals, protect cells from damage, and reduce inflammation.</p>\r\n', '1592761420765.png,', '', '7348257792', '2395432793', '3788983871', '7530375938', 15, 12, 12, 0, '0', 'health', 0, '', '', '2020-06-21 17:52:58', '1', '2020-06-21 13:55:33', '1', 1, 0, '$12 for 52 oz Bottle', 'https://youtu.be/ba8JRT0VEwk'),
(14, '8479364766', 'Nicorette Nicotine Gum', 'Nicorette Nicotine Gum', 'Nicotine polacrilex ', '', 'Blister pack', '10', '', '<p>The common symptoms associated with tobacco withdrawal are common with the use of Nicorette. It include unexpected cravings or urges for cigarettes, anxiety, irritability, restlessness, mood changes, nervousness, drowsiness, trouble concentrating, increased appetite and weight gain. Headaches, muscular pain, constipation, and fatigue may also occur. Discontinue usage if symptoms worsen and consult your doctor.</p>\r\n', '<p>To be used as recommenmded only.</p>\r\n', '<p>Nicorette Gum is a smoking cessation aid. It is formulated with nicotine to help you kick your smoking habit. Nicorette Nicotine Gum helps relieve the cravings, anxiety, frustration, irritability and restlessness associated with quitting smoking.</p>\r\n', '<p>Nicotine gum is a medicine and must be used in a certain way to be effective. Read the label and instructions provided to achieve the best result.</p>\r\n', '1592763832153.jpg,', '', '5908356348', '4410921394', '5393014359', '3523267192', 70, 50, 50, 0, '0', 'health', 0, '', '', '2020-06-21 18:39:59', '1', '2020-06-21 14:41:24', '1', 1, 0, '$50 for 100 pieces 4mg pack', 'https://youtu.be/b1rjyVdhpVw'),
