INSERT INTO `medicine_master` (`id`, `medicine_id`, `medicine_name`, `generic_name`, `box_size`, `strip`, `unit`, `medicine_type`, `medicine_category`, `manufacturer`, `medicine_Image`, `purchase_quantity`, `composition`, `medicine_details`, `benifites`, `side_effects`, `recommended_dosage`, `isPrescriptionOrder`, `rating_point`, `rating_users`, `medicine_video`, `store_price`, `sale_price`, `price`, `delivery_charge`, `tax`, `p_type`, `isActive`, `isDelete`, `added_date`, `added_by`, `updated_at`, `updated_by`, `link`) VALUES
(110, '2316911926', 'Plavix', 'clopidogrel', '14 Tablets in blister pack in cardboard cartons', '$2 per pill', '8472491319', '7540454671', '4061684023', '1914869694', ' 1592464993626.jpeg,', '4', 'tablets containing 97.875 mg of clopidogrel bisulfate', '<p>&nbsp; Plavix works by blocking platelets from sticking together and prevents them from forming harmful clots. It is an antiplatelet drug. It helps keep blood flowing smoothly in your body.</p>\r\n', '<p>Plavix prevents formation of blood clots and is prescribed to reduce the risk of circulation problems, stroke and heart attack. It &nbsp;is used to prevent heart attack and strokes in persons with heart disease (recent heart attack), recent stroke, or blood circulation disease (peripheral vascular disease).</p>\r\n\r\n<p>It is also used with aspirin to treat new/worsening chest pain (new heart attack, unstable angina) and to keep blood vessels open and prevent &nbsp;blood clots after certain procedures (such as cardiac stent).</p>\r\n', '<p>You should not use this medicine if you have any active bleeding such as a stomach ulcer or bleeding in the brain. Check with your doctor immediately if any of the following side effects occur while taking Plavix:</p>\r\n\r\n<ul>\r\n	<li>Chest pain</li>\r\n	<li>collection of blood under the skin</li>\r\n	<li>deep, dark purple bruise</li>\r\n	<li>itching, pain, redness, or swelling</li>\r\n	<li>pain in general</li>\r\n	<li>red or purple spots on the skin, varying in size from pinpoint to large bruises</li>\r\n</ul>\r\n', '<p>Read the guide provided by your doctor or pharmacist before you start taking this medicine and each time you get a refill. If you have any questions, ask your doctor or pharmacist. It is usually to be taken once a day with or without food</p>\r\n\r\n<p>&nbsp;</p>\r\n', 1, 3, 2, '', 28, 28, 35, 10, '4', 'pharmacy', 1, 0, '2020-06-03 05:31:42', '1', '2020-07-20 05:11:16', '1', 'https://youtu.be/KTpaJae3h_4'),
(112, '1213727499', 'Tessalon', 'Benzonatate', 'Blister Pack in a plastic containers', '$2.50 per Capsule of 100mg', '4543870793', '8339963217', '7343926853', '3995597475', ' 1592465884692.jpeg,', '28', 'Each Benzonatate capsule USP contains', '<p>This medication It works by reducing the reflex in the lungs that causes the urge to cough</p>\r\n', '<p>Benzonatate is a generic drug used for the treatment of coughs caused by the common flu. It can also be recommended to treat breathing problems such as pneumonia or bronchitis. Tessalon Perles is the brand-name version while Benzonatate is the generic version</p>\r\n', '<p>This medication is not recommended for use in children younger than 10 years.&nbsp; Risks and benefits of using this medication should be discussed with your doctor or pharmacist</p>\r\n\r\n<p>More serious side effects of benzonatate include choking feeling, chest pain or numbness feeling like you might pass out, confusion, or hallucinations. Some of these side effects may result from chewing or sucking on a capsule.</p>\r\n', '<p>Take this medication as recommended by your doctor or pharmacist. It is to be taken by mouth with or without food, usually 3 times daily as needed or as directed by your doctor</p>\r\n', 1, 0, 0, '', 75, 75, 85, 0, '4', 'pharmacy', 1, 0, '2020-06-05 00:04:12', '1', '2020-06-18 03:38:09', '1', 'https://youtu.be/8ChnbkTO_tY'),
(113, '7755856059', 'Benadryl	', 'Diphenhydramine', 'Blister pack in a box', '$15 for pack of 100 Tablets', '1369481621', '7540454671', '7060739973', '8077160980', '1591319860905.jpg,', '9', 'Antihistamine', '<p>Benadryl with diphenhydramine HCl 25 mg are intended for adults and children ages six and up.</p>\r\n', '<p>Benadryl (diphenhydramine) is an antihistamine that reduces the effects of natural chemical histamine in the body. Histamine can produce symptoms of sneezing, itching, watery eyes, and runny nose.</p>\r\n\r\n<p>Benadryl is used to treat sneezing, runny nose, watery eyes, hives, skin rash, itching, and other cold or allergy symptoms.</p>\r\n\r\n<p>Benadryl is also used to treat motion sickness, to induce sleep, and to treat certain symptoms of Parkinson&#39;s disease.</p>\r\n', '<p>If you have other underlying health conditions ask your doctor or pharmacist if it is safe for you to take this medicine.</p>\r\n', '<p>Should be used as recommended by a doctor or pharmacist.</p>\r\n', 0, 0, 0, '', 15, 15, 18, 0, '0', 'pharmacy', 1, 0, '2020-06-05 01:38:29', '1', '2020-06-14 15:22:36', '1', 'https://youtu.be/JhArszNMeHk'),
(114, '5159124742', 'Dentagel Gel', 'Fluoride (Sodium)', 'Tube', '$18 for a supply of 56 grams', '9967802042', '5552412404', '5730500627', '4565823073', '1591325983290.jpg,', '21', 'Fluoride', '<p>It is a member of the mouth and throat products drug class for the &nbsp;Prevention of Dental Caries</p>\r\n', '<p>Dentagel (fluoride topical) is used to prevent cavities. It makes teeth stronger and more resistant to decay caused by acid and bacteria. .</p>\r\n', '<p>Mouth/gum irritation may rarely occur. If this effect persists or worsens, contact your doctor/dentist or pharmacist promptly.</p>\r\n\r\n<p>Tell your doctor/dentist right away if your teeth become stained or pitted. This is often a result of too much flouride.</p>\r\n', '<p>To be used as recommended by your doctor, dentist or pharmacist</p>\r\n', 1, 0, 0, '', 18, 18, 20, 0, '4', 'pharmacy', 1, 0, '2020-06-05 03:10:19', '1', '', '', ''),
(115, '9998861746', 'Prinivil, Zestril', 'Lisinopril Tablets', 'Plastic Container of 100 Tablets', '$0.35 per Tablets', '5788403127', '7540454671', '6613850492', '1132037580', ' 1592768709676.jpg,', '00', ' and starch. The 10 mg and 20 mg tablets also contain iron oxide., magnesium stearate, mannitol,calcium phosphate', '<p>This medicaion is an ACE inhibitor. ACE stands for angiotensin converting enzyme.</p>\r\n', '<p>Lisinopril Tablets is an oral medication recommended for the treatment of &nbsp;high blood pressure as well as certain types of diseases related to the heart valve. It may also be prescribed for certain kidney diseases.</p>\r\n', '<p>Do not use this medication if you are allergic to it. If you have diabetes, do not use lisinopril together with any medication that contains aliskiren (such as Amturnide, Tekturna, Tekamlo).</p>\r\n\r\n<p>Call your doctor if you have ongoing vomiting or diarrhea, or if you are sweating more than usual</p>\r\n', '<p>Use as recommended by your doctor or pharmacist</p>\r\n', 1, 5, 1, '', 35, 35, 38, 0, '4', 'pharmacy', 1, 0, '2020-06-05 04:50:09', '1', '2020-06-21 15:49:13', '1', 'https://youtu.be/oTSew7t6u4g'),
(116, '3294894435', 'ProAmatine', 'Midodrine', 'Plastic container of 100 Tablets', '$120 for 100 Tablets', '1591593358', '7540454671', '5956113389', '3276543485', ' 1592465708100.jpg,', '4', ' each tablet contains the non-medicinal ingredients: colloidal silicon dioxide, magnesium stearate, microcrystalline cellulose and starch,In addition to midodrine hydrochloride', '<p>This medication works by constricting (narrowing) the blood vessels and increasing blood pressure.</p>\r\n', '<p>This medication is used to treat low blood pressure in patients who have symptoms like dizziness when going from a sitting to a standing position.</p>\r\n', '<p>Some of the common side effects of this medication include Skin tingling, chills, stomach pain, or urinary problems (strong/frequent urge to urinate, frequent urination, trouble urinating) may occur. Less common side effects include dry mouth, dizziness, drowsiness, trouble sleeping, or leg cramps. If any of these effects persist or worsen, tell your doctor or pharmacist immediately.</p>\r\n', '<p>Use only as recommended by your doctor or pharmacist.</p>\r\n', 1, 0, 0, '', 120, 120, 130, 0, '00', 'pharmacy', 1, 0, '2020-06-05 05:29:22', '1', '2020-06-18 03:35:14', '1', 'https://youtu.be/6TrAowiE4Rk'),
(117, '7567652548', 'Amoxil, Trimox, Moxatag', 'Amoxicillin', 'plastic container of 100 capsules', '$0.3 per capsule', '8675574870', '8339963217', '3563904083', '2386144886', ' 1592465450191.jpeg,', '5', ' erythrosin (E127), gelatin, maize starch, quinoline yellow (E104), red iron oxide (E172)., titanium dioxide (E171),Each 500 mg capsule  of Amoxicillin contains Amoxicillin trihydrate and the following inactive ingredients: magnesium stearate', '<p>Amoxil is a penicillin antibiotic that fights bacteria. Amoxicillin is indicated in the treatment of infections due to susceptible (ONLY b-lactamase&ndash;negative) isolates of Streptococcus species. (a? and b?hemolytic isolates only), Streptococcus&nbsp;pneumoniae, Staphylococcus spp., or Haemophilus&nbsp;influenzae.&nbsp;</p>\r\n', '<p>Amoxicillin is used to treat many different types of infection caused by bacteria, such as tonsillitis, bronchitis, pneumonia, and infections of the ear, nose, throat, skin, or urinary tract.</p>\r\n', '<p>Some of the side effects noticeable includes nausea, vomiting, or diarrhea. If any of these symptoms persist or worsen, tell your doctor or pharmacist immediately.</p>\r\n', '<p>As recommended by your doctor or pharmacist</p>\r\n', 1, 0, 0, '', 30, 30, 40, 0, '4', 'pharmacy', 1, 0, '2020-06-05 05:59:44', '1', '2020-06-18 03:30:58', '1', 'https://youtu.be/jppFvY_lKws'),
(118, '5522017294', 'Terbinafine', 'Lamisil', 'Plastic container', '$50 for 100 Tablets', '3080763172', '7540454671', '8277889578', '8254415683', ' 1592464742748.jpg,', '10', ' as terbinafine hydrochlorid,Each tablet contains 250 mg terbinafine', '<p>It is important that you inform your doctor/pharmacist about all other your drugs you are taking and any other health problems before you take this medicine. Most importantly do not stop or change the dose as prescribed.It is important that you inform your doctor/pharmacist about all other your drugs you are taking and any other health problems before you take this medicine. Most importantly do not stop or change the dose as prescribed.</p>\r\n', '<p>This medication is beneficial for the treatment of&nbsp;fungal infections of the nails. It may be prescribed for other types of fungal conditions.</p>\r\n', '<p>Some of the known side effects include diarrhea or stomach. There may be a change in your sense of taste and smell. . If you notice any change in your body and it is getting worse, tell your doctor or pharmacist immediately.</p>\r\n', '<p>Use as prescribed only.</p>\r\n', 1, 0, 0, '', 50, 50, 65, 0, '4', 'pharmacy', 1, 0, '2020-06-06 15:22:42', '1', '2020-06-18 03:19:10', '1', 'https://youtu.be/tmsrXi35fR4'),
(119, '9856484501', 'Percocet', 'Oxycodone-Acetaminophen', 'Plastic container', '$160 for 100 Tablets', '3730947769', '7540454671', '6585972484', '9856708011', ' 1592464723483.jpeg,', '4', ' and stearic acid.;  2.5/325mg contains FD&C Red #40; 5/325MG contains FD&C Blue #1; 7.5/325MG contains FD&C Yellow #6; 10/325MG contains D&C Yellow #10, croscarmellose sodium, crospovidone, microcrystalline cellulose, povidone, pregelatinized starch,colloidal silicon dioxide', '<p>Oxycodone works in the&nbsp;brain&nbsp;to regulate&nbsp;how your body feels and responds to pain while&nbsp;Acetaminophen&nbsp;helps in reducing&nbsp;feverish condition.</p>\r\n', '<p>This combination&nbsp;medication of oxycodone and acetaminophen&nbsp;is commonly&nbsp;used to help relieve moderate to severe pain.</p>\r\n', '<p>This medicine may result in nausea,&nbsp;vomiting,&nbsp;constipation,&nbsp;lightheadedness,&nbsp;dizziness, or drowsiness. After using this medication for some time, some of these side effects may reduce. If any of these effects continues and gets worse, contact your doctor or&nbsp;pharmacist&nbsp;immediately.</p>\r\n', '<p>Use only as recommended. Do not use in combination with other medication and alchohol of any type.</p>\r\n', 1, 3, 3, '', 160, 160, 180, 0, '4', 'pharmacy', 1, 0, '2020-06-06 16:12:55', '1', '2020-06-18 03:18:48', '1', 'https://youtu.be/fGa3DZUy_ZM'),
(120, '5387211955', 'Fioricet', 'Codeine phosphate 30mg, butalbital 50mg, acetaminophen 325mg, caffeine 40mg', 'Plastic container', '$550 for 100 Tablets', '3134694614', '8339963217', '9525623801', '6313176992', ' 1592465811642.jpeg,', '0', ' acetaminophen, acetaminophen 325 mg and caffeine 40 mg, and codeine phosphate) is a combination drug product intended as a treatment for tension headache. Fioricet® consists of a fixed combination of butalbital 50 mg, caffeine,Fioricet® with Codeine (butalbital', '<p>Fioricet contains a combination of acetaminophen, butalbital, caffeine&nbsp;and Codeine. Codeine is an&nbsp;opioid&nbsp;(narcotic) which helps to relieve pain reliever by acting on certain centers in the&nbsp;brain&nbsp;to give you pain relief. &nbsp;Acetaminophen is a pain reliever and fever reducer. Butalbital is in a group of drugs called barbiturates, it act as a sedative, which helps to decrease anxiety and cause sleepiness. It also relaxes muscle contractions involved in a tension headache. Caffeine is a central nervous system stimulant, which helps to increase the effects of&nbsp;acetaminophen.</p>\r\n', '<p>This medication is recommended for tension (or muscle contraction) headaches such as migraine..</p>\r\n', '<p>Some of the commonly reported side effects of this medicine includes lightheadedness, shortness of breath, dizziness, drowsiness, or&nbsp;trouble sleeping nausea,&nbsp;vomiting,&nbsp;abdominal pain, shaking (tremor), constipation,&nbsp;and dry mouth&nbsp;may occur. If any of these effects persist or worsen, contact your doctor or&nbsp;pharmacist&nbsp;immediately.</p>\r\n', '<p>Use only as prescribed. Avoid mixing with other medications.</p>\r\n', 1, 0, 0, '', 550, 550, 600, 0, '4', 'pharmacy', 1, 0, '2020-06-06 17:19:49', '1', '2020-06-18 03:36:57', '1', 'https://youtu.be/eivZB6gLUYA'),
(121, '4857988671', 'Cipro', 'Ciprofloxacin', 'Blister pack', '$25 for 100 Tablets', '3080763172', '7540454671', '8221360350', '6166676171', ' 1592464676346.jpg,', '7', 'Each Ciprofloxacin 250mg Tablet contains 291.1mg ciprofloxacin hydrochloride equivalent to 250mg Ciprofloxacin (INN', '<p>This medicine belongs a group of antibiotics known as&nbsp;fluoroquinolone. It fights bacteria in the body.</p>\r\n', '<p>It is used to treat different types of bacterial infections, including skin infections, bone and joint infections, respiratory or sinus infections, urinary tract infections, and certain types of diarrhea. It is also used to treat gonorrhea.</p>\r\n\r\n<p>Ciprofloxacin is also used to treat people who have been exposed to&nbsp;anthrax&nbsp;or certain types of&nbsp;plague</p>\r\n', '<p>If you start feeling nausea,&nbsp;diarrhea,&nbsp;dizziness,&nbsp;lightheadedness,&nbsp;headache, or&nbsp;trouble sleeping or see rashes after taking this medicine and it persist or worsen, contact your doctor or&nbsp;pharmacist&nbsp;immediately</p>\r\n', '<p>Use only as recommended</p>\r\n', 1, 1, 1, '', 25, 25, 30, 0, '4', 'pharmacy', 1, 0, '2020-06-06 18:01:02', '1', '2020-06-18 03:18:04', '1', 'https://youtu.be/fwuzRs0YZoM'),
(122, '7956905912', 'Coartem', 'artemether and lumefantrine 20mg/120mg', 'Plastic container', '$150 for tablets of 24', '3134694614', '7540454671', '6782026842', '9444387418', ' 1592464655942.jpeg,', '8', ' and polysorbate 80., croscarmellose sodium, hypromellose, magnesium stearate, microcrystalline cellulose,Each Coartem Tablet contains 20 mg of artemether and 120 mg lumefantrine. The inactive ingredients are colloidal silicon dioxide', '<p>The two active ingredients in this medication (artemether and lumefantrine) belong to a class of drugs known as antimalarial.&nbsp;Malaria is caused by parasites that enter the body through the bite of a mosquito.</p>\r\n', '<p>This medication&nbsp;is recommended for the treatment of malaria&nbsp;in adults and children. It should not be used to prevent malaria.</p>\r\n', '<p>Do not use Coartem if you are allergic to artemether or lumefantrine. Some common side effects of this medication include headache,&nbsp;dizziness, loss of appetite,&nbsp;weakness, fever, chills, tiredness, muscle/joint pain,&nbsp;nausea,&nbsp;vomiting,&nbsp;abdominal pain,&nbsp;cough, and&nbsp;trouble sleeping&nbsp;may occur. If any of these effects persist after stopping the&nbsp;medication&nbsp;or if these effects worsen while taking this medication, tell your doctor or&nbsp;pharmacist&nbsp;immediately.</p>\r\n', '<p>Use as recommended by your doctor or pharmacist.</p>\r\n', 1, 0, 0, '', 150, 150, 180, 0, '4', 'pharmacy', 1, 0, '2020-06-06 19:18:55', '1', '2020-06-18 03:17:40', '1', 'https://youtu.be/TFotIBA-AHE'),
(123, '6027673497', 'Tegretol', 'Carbamazepine', 'Plastic container', '$40 for 100 Tablets', '4334489552', '7540454671', '4251140707', '9444387418', '1591540231180.png,', '10', 'The active ingredient is 5H-dibenzo[b,f]azepine-5-carboxamide.', '<p>Carbamazepine is known as an anti-convulsion or anti-epileptic drug. It is a medication that works by reducing the spread of&nbsp;seizure&nbsp;activity in the&nbsp;brain&nbsp;and restoring the normal balance of nerve activity in the body. It actually&nbsp;decreases&nbsp;nerve impulses that cause seizures and nerve pain, such as trigeminal neuralgia and diabetic neuropathy.</p>\r\n', '<p>Carbamazepine&nbsp;is used to prevent and control&nbsp;seizures. It is also used to relieve certain types of&nbsp;nerve pain&nbsp;such as&nbsp;trigeminal neuralgia and for the treatment of bipolar disorder.</p>\r\n', '<p>Some of the commonly reported side effects of carbamazepine include&nbsp;dizziness, drowsiness, nausea, constipation,&nbsp;dry mouth and vomiting.&nbsp;Other reported side effects are&nbsp;pruritus, speech disturbance, amblyopia, ataxia or unsteadiness. If any of these condition last or get worse, contact your doctor or&nbsp;pharmacist&nbsp;immediately.</p>\r\n', '<p>Use only as recommended by your doctor or pharmacist.</p>\r\n', 1, 0, 0, '', 40, 40, 50, 0, '4', 'pharmacy', 1, 0, '2020-06-07 15:03:15', '1', '2020-06-07 11:05:56', '1', 'https://youtu.be/KS3o4eqzccQ'),
(124, '4591698318', 'Proglycem', 'Diazoxide', 'Bottled ', '$400 for a 50mg/ml Suspension 30 ml Bottle', '6497881024', '7170808420', '9891485939', '7110837641', '1591545845801.jpg,', '8', ' USP in each milliliter and has a chocolate-mint flavor; alcohol content is approximately 7.25%,The Suspension contains 50 mg of diazoxide', '<p>This medication works by raising blood sugar in the body and slowing the release of&nbsp;insulin&nbsp;from the pancreas.</p>\r\n', '<p>This medication is used for the treatment of&nbsp;low blood sugar&nbsp;(a condition known as hypoglycemia), which is caused by certain cancers or other conditions that can make the pancreas release too much&nbsp;insulin.</p>\r\n\r\n<p>This medication is not recommended for the treatment of&nbsp;low blood sugar&nbsp;from poor&nbsp;nutrition or diet</p>\r\n', '<p>Some of the side effect associated with this medication do not need immediate medical attention as they do go away as treatment and usage progresses. Some common side effects include increased hair growth, especially on the forehead, back, arms, and leg.</p>\r\n', '<p>Use as recommended and prescribed by your doctor or pharmacist</p>\r\n', 1, 0, 0, '', 400, 400, 480, 0, '4', 'pharmacy', 1, 0, '2020-06-07 16:21:58', '1', '', '', ''),
(125, '8377471382', 'Ventolin', 'Albuterol Sulfate', 'Canister in a pack', '$55 for 200 Metered Inhalation', '1344146354', '6251955883', '6817215629', '3523267192', ' 1592464367518.jpeg,', '10', ' and the empirical formula is (C13H21NO3)2•H2SO4. It is soluble in water and slightly soluble in ethanol. ... Each canister contains a microcrystalline suspension of albuterol sulfate in propellant HFA-134a (1,1,2-tetrafluoroethane,Albuterol sulfate is a white crystalline powder with a molecular weight of 576.7', '<p>This medication belongs to a class of drugs known as&nbsp;bronchodilators. It works in the airways by making breathing easy and relaxing muscles.</p>\r\n', '<p>Albuterol&nbsp;(also known as salbutamol) is used to treat&nbsp;wheezing&nbsp;and shortness of breath caused by&nbsp;breathing problems&nbsp;such as&nbsp;asthma. It is a quick-relief&nbsp;medication that can be dispenses in different forms.</p>\r\n', '<p>Some of the known side effects include nervousness, shaking,&nbsp;headache,&nbsp;nausea&nbsp;or&nbsp;dizziness. If any of these symptoms persist or worsen, please contact your doctor or&nbsp;pharmacist&nbsp;immediately</p>\r\n', '<p>Use as recommended and prescribed only.&nbsp;</p>\r\n', 1, 0, 0, '', 55, 55, 65, 0, '4', 'pharmacy', 1, 0, '2020-06-07 17:11:29', '1', '2020-06-18 03:12:55', '1', 'https://youtu.be/71M8elW6BQo'),
(126, '1135673425', 'Niazid', 'Isoniazid', 'Plastic container', '$15 for 100 Tablets', '4543870793', '7540454671', '2937369856', '7110837641', '1591551388161.jpg,', '9', 'The active substance in Isoniazid Tablets BP is isoniazid', '<p>This medication is an antibiotic that works by stopping the growth of bacteria.&nbsp;Isoniazid&nbsp;(isoniazid systemic) is a member of the drug class&nbsp;as hydrazide derivatives. It is typically used for the treatment of both active and latent tuberculosis such as Mycobacterium kansasii, and Prophylaxis.</p>\r\n', '<p>This medication is used in combination with other&nbsp;medications&nbsp;for the treatment of active tuberculosis&nbsp;(TB) infections. It is also used alone to prevent active TB infections in people who may be infected with the bacteria.</p>\r\n', '<p>If after taking this medication you start experiencing any of the following symptoms persistently - nausea, vomiting, yellowing of the skin or whites of the eyes, or urine getting darker and stools paler, fatigue, weakness, malaise, loss of appetite or&nbsp;stomach&nbsp;upset. Please contact your doctor or pharmacist immediately</p>\r\n', '<p>Only use as presribed by your doctor or pharmacist.</p>\r\n', 1, 0, 0, '', 15, 15, 20, 0, '4', 'pharmacy', 1, 0, '2020-06-07 18:04:13', '1', '', '', 'https://youtu.be/AC8Qr_Xt4nw'),
(127, '8675022541', 'Gaviscon Antacid', 'Calcium Carbonate', 'Plastic container', '$15 for 100 chew able Tablets', '3134694614', '7540454671', '2628986471', '5176593082', ' 1592466017920.jpeg,', '10', ' 133.5mg sodium bicarbonate and 80mg calcium carbonate per 5ml. For excipients, see Section 6.1.,Gaviscon Peppermint Liquid Relief contains 250mg sodium alginate', '<p>This antacid works by lowering the amount of acid in the&nbsp;stomach.</p>\r\n', '<p>This&nbsp;medication&nbsp;is used to relieve the symptoms caused by too much&nbsp;stomach&nbsp;acid such as&nbsp;heartburn,&nbsp;upset stomach, sour stomach, or&nbsp;acid indigestion</p>\r\n', '<p>Constipation, gas, and burping may occur. If any of these symptoms persist or worsen, contact your doctor or&nbsp;pharmacist&nbsp;immediately</p>\r\n', '<p>Use as recommwended</p>\r\n', 0, 0, 0, '', 15, 15, 20, 0, '4', 'pharmacy', 1, 0, '2020-06-07 19:35:16', '1', '2020-06-18 03:40:22', '1', 'https://youtu.be/jAiEj20HdyA'),
(128, '9882375235', 'Femara', 'Letrozole', 'Plastic container', '$120 for 30 Tablets', '1793957369', '7540454671', '9626275369', '2238878648', ' 1592464173488.png,', '-16', 'Letrozole 2.5 mg Film-Coated Tablets contains an active. substance called letrozole', '<p>This medication works by decreasing the amount of estrogen the body makes and helps to slow or reverse the growth of these breast cancers.</p>\r\n', '<p>Letrozole tablet is an aromatase inhibitor indicated for the adjuvant treatment of postmenopausal women with hormone receptor positive early breast cancer. It may also be prescribed for other medical conditions.</p>\r\n', '<p>Do not use letrozole if you are allergic to it. Tell your doctor if you have ever had liver disease, low bone mineral density or if you also take tamoxifen.</p>\r\n\r\n<p>Some of the most common side effcts are hot flashes, arthralgia, flushing, asthenia, edema, arthralgia, headache, dizziness, hypercholesterolemia, sweating increased, and bone pain</p>\r\n\r\n<p>&nbsp;</p>\r\n', '<p>Use only as prescribed.</p>\r\n', 1, 0, 0, '', 120, 120, 145, 0, '12', 'pharmacy', 1, 0, '2020-06-09 06:21:23', '1', '2020-06-18 03:09:43', '1', 'https://youtu.be/6ajcP_1rM5U'),
(129, '7438523314', 'Cordarone', 'Amiodarone ', 'Plastic container', '$50 for 30 Tablets', '4334489552', '7540454671', '9427472524', '1914869694', ' 1592464148660.jpg,', '5', ' FD&C Red 40 (for 200 mg only, magnesium stearate, povidone, pregelatinized corn starch, sodium starch glycolate, stearic acid,Active Ingredient: amiodarone hydrochloride Inactive Ingredients: lactose monohydrate', '<p>Pacerone tablets are an antiarrhythmic drug. It workks by regulating the rhythm of heartbeats</p>\r\n', '<p>This medication is commonly &nbsp;used to help keep the heart beating normally in people with life-threatening heart rhythm disorders of the ventricles. It is used to treat ventricular tachycardia or ventricular fibrillation.</p>\r\n', '<p>Do not take this medicine if you are allergic to iodine, or if you have heart block, a history of slow heartbeats that have caused you to faint, or if your heart cannot pump blood properly. Pacerone can cause dangerous side effects on your heart, liver, lungs, or vision.</p>\r\n', '<p>Use only as prescribed by your doctor or pharmacist.</p>\r\n', 1, 0, 0, '', 50, 50, 65, 0, '4', 'pharmacy', 1, 0, '2020-06-09 06:47:54', '1', '2020-06-18 03:09:13', '1', 'https://youtu.be/Tui_3h1CYuY'),
(130, '3049910585', 'Keflex', 'Cephalexin', 'Plastic container', '$950 for 100 Tablets', '8675574870', '8339963217', '4575810296', '1132037580', ' 1592464124297.jpg,', '15', 'Cephalexin capsules 500mg contain the active ingredient cephalexin monohydrate', '<p>&nbsp; This medication workd by stopping the growth of bacteria in the body.</p>\r\n', '<p>This medication is used to treat a wide range of bacterial infections. &nbsp;These includes &nbsp;upper respiratory infections, ear infections skin infections, urinary tract and bone infections.It should not be used to treat any condition that has not been checked by a doctor.</p>\r\n', '<p>This medication may show the following symptomatic side effects diarrhea, nausea &nbsp;or stomach upset may occur. If any of these symptoms persist , contact your doctor or pharmacist promptly.</p>\r\n', '<p>As only as recommended by your doctor or pharmacist.</p>\r\n', 1, 3, 1, '', 950, 950, 1030, 0, '4', 'pharmacy', 1, 0, '2020-06-09 08:07:44', '1', '2020-06-18 03:08:49', '1', 'https://youtu.be/eWQGP8lO9SA'),
(131, '5105940008', 'Soma', 'Carisoprodol', 'Plastic container', '$250 for 100 Tablets ', '7108747463', '7540454671', '4237663801', '4040561351', ' 1592465237417.jpg,', '7', ' a pain reliever and a fever reducer (analgesics antipyretics).,350mg of this medicine contains Acetaminophen', '<p>&nbsp;Carisoprodol is a muscle relaxer it blocks pain sensations between the nerves and the brain.</p>\r\n', '<p>This medication is &nbsp;used together with rest and physical therapy to treat pain and stiffness in muscles caused by strains, sprains, or other injury.</p>\r\n', '<p>Dizziness, drowsiness, or &nbsp;headache are some of the side effects that may occur. If any of these persist contact &nbsp;your doctor or pharmacist immediately.</p>\r\n', '<p>Use only as recommemnded by your doctor or pharmacist.</p>\r\n', 1, 3, 1, '', 250, 250, 300, 12, '4', 'pharmacy', 1, 0, '2020-06-09 08:33:12', '1', '2020-07-20 05:11:53', '1', 'https://youtu.be/Tnba44Yqk44'),
(132, '8457125515', 'Flomax', 'Tamsulosin', 'Plastic container', '$950 for 100 Tablets', '7073311630', '8339963217', '7230401495', '3173993179', ' 1592464064361.jpeg,', '10', ' FD&C blue No. 2, and the following inactive ingredients: methacrylic acid copolymer dispersion NF, calcium stearate, microcrystalline cellulose, talc, titanium, triacetin,Each FLOMAX capsule for oral administration contains tamsulosin hydrochloride 0.4 mg', '<p>Flomax is an alpha- adrenergic antagonist, also called &alpha;-blocker that relaxes muscles in the gland and in the bladder, making it easier for men to&nbsp; urinate. This conjoined effort results in urinary urgency and urinary frequency related to symptomatic benign prostatic hyperplasia (BPH)</p>\r\n', '<p>Flomax is used to treat men with benign prostatic hyperplasia (enlarged prostate) which is characterized by difficulties in urinating. This medication is not for women and children.</p>\r\n', '<p>This medication should not be used if you are allergic to tamsulosin. Some of the common side effects are dizziness, rhinitis, nausea, rhinorrhea, weakness, headache, sinus congestion. Drowsiness is another unwanted symptom, especially when you first start taking it or when you start taking it again.</p>\r\n', '<p>Use only as prescribed by your doctor or phaymacist.</p>\r\n', 1, 0, 0, '', 950, 950, 1050, 0, '000', 'pharmacy', 1, 0, '2020-06-10 05:40:56', '139', '2020-08-08 06:46:59', '1', 'https://youtu.be/S7UsgjFeV_8'),
(133, '9566322696', 'Allegra', 'Fexofenadine Tablets', 'Plastic bottle', '$50 for 100 Tablets', '8890688135', '7540454671', '8213912476', '4608839643', ' 1592464032820.jpg,', '9', ' Each tablet contains 180 mg fexofenadine hydrochloride and the following excipients: croscarmellose sodium, and pregelatinized starch., magnesium stearate, microcrystalline cellulose', '<p>This medication is an antihistamine, it is usually prescribed for seasonal allergic reactions such as runny nose, sneezing, red, itchy, or watery eyes; itching.&nbsp;It works by blocking histamine&#39;s action, which reduces allergy symptoms.</p>\r\n', '<p>It is used to ease allergy signs and treatment of hives.</p>\r\n', '<p>Some of the side effects include &nbsp;headache, fatigue, drowsiness, dizziness, sleeplessness and nervousness. stomach discomfort, vomiting and diarrhea. &nbsp;Others include painful menstrual period. cough, upper respiratory tract infection and runny nose. If any of these symptoms worsen please contact your doctor or pharmacist immediately</p>\r\n', '<p>Use only as recommended</p>\r\n', 1, 0, 0, '', 50, 50, 65, 0, '00', 'pharmacy', 1, 0, '2020-06-10 06:24:03', '1', '2020-06-18 03:08:09', '1', 'https://youtu.be/Q6Xs8FyiUP0'),
(134, '9970823616', 'Moxeza', 'Moxifloxacin ophthalmic', 'Solution in bottle', '$200 for 3ml', '5733454709', '7434951825', '4658727879', '7873041655', ' 1592463899898.jpeg,', '9', ' Sodium chloride, and hydrochloric acid and/or sodium hydroxide to adjust pH. Moxeza ® is a greenish-yellow, boric acid, isotonic solution with an osmolality of 300-370 mOsm/kg and a pH of approximately 7.4. Moxifloxacin hydrochloride is a slightly yellow to yellow crystalline powder., purified water, sorbitol, tyloxapol, xanthan gum', '<p>Moxeza (moxifloxacin hydrochloride ophthalmic solution) 0.5% is a topical fluoroquinolone anti-infective indicated for the treatment of bacterial conjunctivitis. The antibacterial action of moxifloxacin results from inhibition of the topoisomerase II (DNA gyrase) and topoisomerase IV.</p>\r\n', '<p>Moxifloxacin ophthalmic is a quinolone antibiotic used to treat bacterial infections of the eyes.</p>\r\n', '<p>some common side effects include blurred vision, watery eyes, &nbsp;eye pain, unusual dryness/redness/itchiness may occur. If any of these symptoms persist or worsen, contact your doctor or pharmacist immediately.</p>\r\n', '<p>Use as prescribed by your doctor or pharmacist.</p>\r\n', 1, 0, 0, '', 200, 200, 220, 0, '1', 'pharmacy', 1, 0, '2020-06-12 00:02:00', '1', '2020-06-18 03:05:08', '1', 'https://youtu.be/cUHqadFYqWg'),
(135, '3263327246', 'Sinemet', 'Carbidopa and levodopa', 'Plastic container', '$50 for 100 25mg-250mg Tablets', '3134694614', '7540454671', '5665024903', '4040561351', ' 1592463871599.jpeg,', '10', 'Each tablet of Co-Careldopa contains 13.5 mg carbidopa monohydrate. (equivalent to 12.5 mg of anhydrous carbidopa) and 50 mg levodopa. Each tablet of Co-Careldopa contains 10.8 mg carbidopa monohydrate. (equivalent to 10 mg of anhydrous carbidopa) and 100 mg levodopa. ', '<p>This medication works by Levodopa converted to dopamine in the brain while Carbidopa helps prevent the breakdown of levodopa before it can reach the brain and take effect.</p>\r\n', '<p>Levodopa and carbidopa is a combination medicine used to treat the symptoms of Parkinson&#39;s disease or Parkinson-like symptoms such as muscle stiffness, tremors, spasms, and poor muscle control. This combination may be used alone or with other drugs for Parkinson&#39;s disease which may be caused by low levels of a chemical called dopamine in the brain.</p>\r\n', '<p>Some common side effects include twitching, twisting, uncontrolled repetitive movements of the tongue, lips, face, arms, or legs, dizziness, nausea, vomiting, trouble sleeping, and headache may also occur. If any of these symptoms persist or worsen, contact your doctor or pharmacist immediately.</p>\r\n', '<p>Use only as prescribed by your doctor or pharmacist</p>\r\n', 1, 0, 0, '', 50, 50, 60, 0, '1', 'pharmacy', 1, 0, '2020-06-12 00:41:35', '1', '2020-06-18 03:04:39', '1', 'https://youtu.be/RcQxbmaiBnw'),
(136, '7906905349', 'Cytomel', 'Liothyronine', 'Plastic container', '$50 for 90 Tablets', '4763890808', '7540454671', '7850626396', '6772974954', ' 1592463622863.jpeg,', '10', ' 25 mcg, and 50 mcg. Inactive ingredients consist of calcium sulfate, corn starch, gelatin, stearic acid, sucrose and talc,CYTOMEL tablets contain liothyronine sodium equivalent to liothyronine in 5 mcg', '<p>Liothyronine is a man-made form of a hormone that is normally produced by your thyroid gland to regulate the body&#39;s energy and metabolism. It is given when the thyroid does not produce enough of this hormone on its own.</p>\r\n', '<p>Liothyronine is used to treat hypothyroidism (low thyroid hormone) a condition wherein the thyroid gland does not produce enough thyroid hormone . It is also given as part of a medical test for thyroid disorders. Liothyronine &nbsp;is used together with surgery and radioactive iodine therapy in people with thyroid cancer. It helps to decrease the size of enlarged thyroid glands (goiter).</p>\r\n', '<p>This medication should not be taken if you experience symptoms of thyroid toxicity. Some of the side effects of Liothyronine includes chest pain, fast or irregular heartbeat, excessive sweating, difficulty with breathing, heat intolerance, nervousness, leg cramps, headache, irritability, sleeplessness, tremors, change in appetite, weight gain or loss, vomiting, diarrhea, and fever</p>\r\n', '<p>This medicine should be used only as prescribed.</p>\r\n', 1, 0, 0, '', 50, 50, 60, 0, '1', 'pharmacy', 1, 0, '2020-06-12 02:14:50', '1', '2020-06-18 03:00:36', '1', 'https://youtu.be/x5ZV1mC_qT8'),
(137, '3347036340', 'Glucophage', 'Metformin', 'Plastic containers', '$110 for 100 Tablets', '1855707615', '3731677695', '6195152624', '8807308655', ' 1592463606423.jpeg,', '10', '1000mg of Glucophage contains 779.86 mg metformin. Each tablet contains the inactive ingredients povidone and magnesium stearate.', '<p>Glucophage is sometimes used together with&nbsp;insulin&nbsp;or other medications, but metformin is not for treating&nbsp;type 1 diabetes. It influences the body&#39;s sensitivity to&nbsp;insulin. Insulin is a hormone produced by the pancreas which controls glucose levels in the blood. It reduces the amount of glucose generated by the&nbsp;liver&nbsp;and by increasing the removal of glucose from the blood generated by muscle and fat tissues. Metformin acts by increasing the sensitivity of liver, muscle, fat, and other tissues to the uptake and effects of insulin. These actions helps to lower the level of&nbsp;sugar&nbsp;in the blood.</p>\r\n', '<p>Glucophage (metformin) is an&nbsp;oral diabetes medicine&nbsp;used to control blood sugar levels. It is used with a proper diet and exercise program and possibly with other medications. It is used in patients with&nbsp;type 2 diabetes</p>\r\n', '<p>Some common side effects includes&nbsp;lactic acidosis, nausea, vomiting, gas, bloating, diarrhea&nbsp;and, loss of appetite</p>\r\n', '<p>To be used as prescribed by your doctor or pharmacist.</p>\r\n', 1, 0, 0, '', 110, 110, 130, 0, '1', 'pharmacy', 1, 0, '2020-06-13 16:03:25', '1', '2020-06-18 03:00:11', '1', 'https://youtu.be/5C2CRPqt0is'),
(138, '7499784062', 'Deltasone', 'Prednisone', 'Plastic container', '$35 for 100 Tablets.', '5788403127', '3731677695', '2613307480', '4592681944', ' 1592463569151.jpg,', '10', ' and talc, colloidal silicon dioxide, magnesium stearate, microcrystalline cellulose, sodium starch glycolate,20 mg prednisone contains inactive ingredients such as anhydrous lactose', '<p>Prednisone belongs to a class of drugs known as corticosteroids. . It suppresses the immune system.&nbsp;It is also known as an anti-inflammatory medication.</p>\r\n', '<p>This medication prevents the release of substances in the body that cause inflammation. It is used to treat conditions such as&nbsp;arthritis, blood disorders, breathing problems, severe&nbsp;allergies, skin diseases, cancer, eye problems, and immune system disorders.</p>\r\n', '<p>While taking prednisone and other corticosteroids, contact your doctor or pharmacist immediately if you noticed any of the following symptoms and if they persist or worsens. Symptoms ranges from mild annoyances to serious, irreversible organ damage, and they occur more frequently with higher doses and more prolonged treatment. It may be in the form of aggression, agitation, blurred vision, decrease in the amount of urine, fast, slow, pounding, or&nbsp;irregular heart beat or pulse, persistent headache, irritability, mood changes, noisy, rattling breathing, and numbness.</p>\r\n', '<p>To be used as prescribed by your doctor or pharmacist only.&nbsp;</p>\r\n', 1, 0, 0, '', 35, 35, 45, 0, '1', 'pharmacy', 1, 0, '2020-06-13 17:05:22', '1', '2020-06-18 03:00:06', '1', 'https://youtu.be/3lS-RLjVM54'),
(139, '7211992311', 'Adriamycin', 'Doxorubicin', 'Solution in bottle', '$200 for 100ml bottle', '4854303035', '2821808883', '4066680101', '4592681944', ' 1592463517249.jpg,', '20', '100 mL (200 mg) multiple dose vial contains 200 mg Doxorubicin Hydrochloride', '<p>Adriamycin (doxorubicin&nbsp;hydrochloride) Injection is a cancer (antineoplastic) medication administered as an infusion into a vein.</p>\r\n', '<p>Adriamycin&nbsp;is used for the treatment of different types of cancers that affect the breast, bladder, kidneys, ovaries, thyroid, stomach, lungs, bones, nerve tissues, joints, and soft tissues. It is also used to treat Hodgkin lymphoma, non-Hodgkin lymphoma, and certain types of leukemia.</p>\r\n', '<p>Some common side effects of Adriamycin (doxorubicin hydrochloride) include: nausea and vomiting, diarrhea, missed menstrual periods, darkening of your skin or nails, lost of appetite, tiredness, weakness, and eye redness. Contact your doctor or pharmacist immediately if any of these symptoms persist or worsen.</p>\r\n\r\n<p>This medication should not be used if you have severe&nbsp;liver disease, or heart problems. If you are diagnosed with very low blood cell counts caused by prior&nbsp;chemotherapy, or if you recently had a&nbsp;heart attack.</p>\r\n', '<p>To be administered by your doctor or pharmacist</p>\r\n', 1, 0, 0, '', 200, 200, 240, 0, '1', 'pharmacy', 1, 0, '2020-06-13 17:36:23', '1', '2020-06-18 02:58:45', '1', 'https://youtu.be/_yD1SYCTXbE'),
(140, '6618537867', 'Zithromax', 'Azithromycin', 'Tablets in plastic container', '$40 for 30 Tablets', '3080763172', '7540454671', '9790213624', '2672941655', ' 1592463480703.jpg,', '9', ' and lactose monohydrate, croscarmellose sodium, dibasic calcium phosphate anhydrous, hypromellose,Azithromycin tablets contain azithromycin monohydrate equivalent to either 250 mg or the following inactive ingredients: cornstarch', '<p>Azithromycin is a macrolide-type antibiotic. It works by fighting and stopping the growth of bacteria. This medication will not work for viral infections.</p>\r\n', '<p>Azithromycin&nbsp;is used to treat a wide variety of&nbsp;bacterial infection such as respiratory infections, skin infections,&nbsp;ear infections, eye infections, and&nbsp;sexually transmitted diseases.</p>\r\n', '<p>The common side effects of azithromycin include&nbsp;diarrhea, loose stools, and nausea, abdominal pain, and vomiting. If any of these symptoms worsens or persist, contact your doctor immediately.</p>\r\n', '<p>Take this medication for the full prescribed length of time even if your symptoms improve before the infection is completely cleared do not stop but take dosage as prescribed.</p>\r\n', 1, 0, 0, '', 40, 40, 50, 0, '1', 'pharmacy', 1, 0, '2020-06-13 18:26:37', '1', '2020-06-18 02:58:10', '1', 'https://youtu.be/3hAt-9W-2y4'),
(141, '4713071281', 'Ziagen', 'Abacavir', 'Plastic container', '$300  for 60 Tablets', '5335676263', '7540454671', '6902900690', '6166676171', ' 1592463459363.jpg,', '10', ' Each tablet contains abacavir sulfate. 395 equivalent to 300 mg of abacavir as active ingredient ', '<p>Abacavir is in a class of&nbsp;<strong>medications</strong>&nbsp;called nucleoside reverse transcriptase inhibitors (NRTIs) - Antiretroviral. It works by decreasing the amount of&nbsp;<strong>HIV</strong>&nbsp;in the blood.</p>\r\n', '<p>Abacavir is an antiviral medicine that prevents human immunodeficiency virus (HIV) from multiplying in the human body. It is used along with other&nbsp;medications&nbsp;to treat&nbsp;human immunodeficiency virus (HIV) infection.</p>\r\n', '<p>This medication should not be used if you have ever had an allergic reaction to any medicine that contains abacavir, or if you have moderate to severe&nbsp;liver disease, or if you have a gene variation called HLA-B*5701 allele.</p>\r\n\r\n<p>Some of the common side effects include nausea, vomiting, sleep problems, headache, tiredness, fever, chills, general ill feeling; rash; or (in children) stuffy nose, sneezing, sore throat, or ear pain. If any of these symptoms persist or worsen contact your doctor of pharmacy immediately.</p>\r\n', '<p>To be used as recommended only.</p>\r\n', 1, 0, 0, '', 300, 300, 350, 0, '1', 'pharmacy', 1, 0, '2020-06-13 18:49:53', '1', '2020-06-18 02:57:52', '1', 'https://youtu.be/__XyJyUj24Y'),
(142, '8706073416', 'Zovirax', 'Acyclovir', 'Plastic container', '$50 for 100 Tablets', '7583048517', '7540454671', '3924389372', '9856708011', ' 1592463401100.jpg,', '10', ' croscarmellose sodium, magnesium stearate and microcrystalline cellulose,Each 800 mg tablet of acyclovir contains 800 mg of acyclovir and the inactive ingredients colloidal silicon dioxide', '<p>This medicine treats infections caused by certain types of viruses only. &nbsp;It decreases the severity and length of outbreaks and helps sores to heal faster while preventing new sores from forming. In people with a weakened immune system, acyclovir can decrease the risk of the virus spreading to other parts of the body and causing serious infections.</p>\r\n', '<p>This medication&nbsp;is an antiviral drug that can slow the growth and spread of the herpes virus in the body. It is used to treat virus infections of the genitals (sex organs), the skin, the brain, and mucous membranes -lips and mouth.</p>\r\n', '<p>Side effects depends on the way this medication is administered, However, some of the common side effects include&nbsp;nausea, phlebitis, and vomiting.</p>\r\n', '<p>Use only as precsribed.</p>\r\n', 1, 0, 0, '', 50, 50, 65, 0, '1', 'pharmacy', 1, 0, '2020-06-13 19:21:38', '1', '2020-06-18 02:56:58', '1', 'https://youtu.be/Rp3tdrNf89Y'),
(144, '1975617891', 'Fairness', 'Fairness', '10', '20', '9598636273', '1323502339', '4575810296', '2376714875', '1596285002922.jpg,', '75', 'Oil', '<p>kjasdfhlkjasdhflkajsdf</p>\r\n', '<p>sdlkjf;askdjf;a</p>\r\n', '<p>ahsdfkjasdhf;kjashfd</p>\r\n', '<p>lsjdfkjasdhflkjasdfh</p>\r\n', 1, 4, 5, '', 45, 45, 30, 5.5, '1', 'pharmacy', 1, 0, '2020-08-01 12:31:43', '197', '2020-08-04 04:30:28', '197', ''),
