INSERT INTO `pages` (`id`, `title`, `status`, `editor`, `slug`) VALUES
(8, 'About Us', 'active', '<p>Medical Supply Manager (MSM) is a product of Health Supply Manager LLC. It is a platform for ordering prescribed and non prescription items from&nbsp;providers with brick and mortal stores. Our goal is to leverage technology to deliver a delightful ordering experience for doctors and patients by improving service delivery from providers. MSM will be working in partnership with providers to eliminate bottlenecks resulting in delays in processing orders. All our providers are licensed and are expected to process all orders made on this platform with the highest industry standard possible.</p>\r\n\r\n<p>We manage orders from Doctors and Patients by first ensuring that the orders are assigned to the right provider with all needed information and documentation. Before making an order, Doctors and Patients can check if the item to be ordered is in stock, check the item online and store price, check if insurance pays for it, check product brand, complete/sign all documentations required to process orders online, decide on the mode of payment and delivery. MSM ensures that all orders are processed accurately and delivered promptly.</p>\r\n\r\n<p>We work with a Patient or&nbsp;Doctor Favorite Provider, or with one of our registered licensed Provider&nbsp;to process all orders. Our ultimate objective is to make sure our clients get that MSM premium service experience.</p>\r\n\r\n<p>At Health Supply Manager LLC, we believe ordering medical supplies should be easy, cost and time saving, without compromising quality of products and our health.</p>\r\n', 'about-us'),
(10, 'Terms of Use', 'active', '<p>If you visit and make an order from this platform, you agree to our terms and conditions.</p>\r\n\r\n<p>MSM is not responsible for redeeming products warranties. Our Providers are responsible individually for redeeming orders made from them. Insurance orders are subject to approval by Patients Health Insurance provider. Co- payment(s) and or additional charge(s) due after processing of insurance orders will be communicated to Patients directly.</p>\r\n\r\n<p>MSM have the right to cancel any order if it considers it not complete or appropriate for processing.</p>\r\n', 'terms'),
(12, 'Security/Privacy Policy', 'active', '<p>At MSM, your privacy is important to us.&nbsp;Users are responsible for protecting their passwords and should report any observed or suspected security breach immediately. All our registered providers are licensed and trained in data management in compliance to industry standard. We protect confidentiality and restrict release of personal data to only our licensed providers for order processing only. We do not share personal info to any third party that is not licensed and in compliance to standard security requirements needed for the protection of users information.</p>\r\n\r\n<p>We will continue to review our security/privacy policy as deemed necessary. Any changes to our privacy policy and information handling practices shall be made known to all parties in a timely manner. Last Updated February 2019.</p>\r\n', 'privacy-policy'),
(13, 'Return Policy', 'active', '<p>Item(s) ordered with Insurance payment option are not refundable but are exchangeable.</p>\r\n\r\n<p>Item(s) paid for by cash or card can be returned within 30 days of receipt of order in accordance to specific guideline dictated by the provider..</p>\r\n\r\n<p>Items(s) must be in original condition, and good for resale. Safety seals must be in place. All parts and accessories must be included and in original packaging. Delivery fees (if any) are non-refundable.</p>\r\n\r\n<p>Return orders may be subject to a restocking fee. MSM will not be held responsible for any restocking fees charged by Providers.</p>\r\n\r\n<p>If your return is the result of a defective product or a&nbsp;delivery error, MSM&nbsp;will rectify the issue promptly if contacted.</p>\r\n\r\n<p>Some items by their nature are simply non-returnable. It may or may not be stated explicitly in their description that they are non-returnable.</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'refund'),
(15, 'Help', 'active', '<p>If you want your business or favorite provider products to be listed on this platform, please email your company or favorite provider details to: &nbsp;<a href=\"mailto:info@medicalsupplymanager.com\">info@medicalsupplymanager.com</a></p>\r\n\r\n<p>For careers enquiries or request for technical support, send email to:&nbsp;c<a href=\"mailto:Contact@medicalsupplymanager.com\">ontact@medicalsupplymanager.com</a></p>\r\n\r\n<p>For return/refund, and sales issues, send email to:&nbsp; s<a href=\"mailto:Sales@medicalsupplymanager.com\">ales@medicalsupplymanager.com</a> or directly to favorite provider.</p>\r\n', 'help'),
(16, 'online insurance data', 'active', '<p><strong>ORDER WITH INSURANCE OR PAY ONLINE</strong>.</p>\r\n\r\n<p>ONLINE PRICES ARE NOT VALID FOR INSURANCE ORDERS</p>\r\n', 'online-insurance-data'),
(17, 'Shipping Policy', 'active', '<p>Medical Supply Manager is a platform for brick and mortal stores. You can order to pick up in stores or&nbsp;request immediate delivery&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'shipping-policy'),
(18, 'BENEFIT TO DOCTORS', 'active', '<p><strong>BENEFITS FOR DOCTORS</strong></p>\r\n\r\n<p>Medical Supply Manager make the work of doctors easier, better organized and improve service delivery to their patients. Some of the benefits to doctors include the following:</p>\r\n\r\n<ul>\r\n	<li>Complete Certificate of Medical Necessity (CMN) online and submit directly to Providers</li>\r\n	<li>Make orders for their Patients seamlessly</li>\r\n	<li>Track orders</li>\r\n	<li>Keep order history</li>\r\n	<li>Receive order updates</li>\r\n	<li>Know Insurance accepted by Providers before making order</li>\r\n	<li>Know if item is available in store before making orders</li>\r\n	<li>Choose delivery or store pick up&nbsp;options for Patients</li>\r\n	<li>Receive discounts on their orders</li>\r\n	<li>Improve service delivery to Patients</li>\r\n	<li>Access to direct communication with patients and providers.</li>\r\n</ul>\r\n', 'benefit-to-doctors'),
(19, 'BENEFIT FOR PATIENTS', 'active', '<p><strong>BENEFITS FOR PATIENTS</strong></p>\r\n\r\n<p>Medical Supply Manager allow Patients to manage their orders and submit required paperwork online. Additional benefit includes the following:</p>\r\n\r\n<ul>\r\n	<li>Upload prescription / Insurance information and submit to provider to start processing insurance payment option order before visit to Provider&rsquo;s store</li>\r\n	<li>Know if Providers accept their insurance and item is in stock</li>\r\n	<li>&nbsp;Receive notification on order status and co-payment due if any</li>\r\n	<li>Decide on how you want to pay. With Insurance, Cash or Credit Card</li>\r\n	<li>Schedule their delivery options - Store Pick Up or Delivery to House / Office Address.</li>\r\n	<li>&nbsp;See&nbsp;their order history</li>\r\n	<li>Track their orders</li>\r\n	<li>&nbsp;Submit any required additional documents needed to process their orders</li>\r\n	<li>Receive regular coupons and discounts on order made with cash/card payments.</li>\r\n	<li>Avoid waiting online in Providers store to process and collect orders.</li>\r\n	<li>Better direct communication with doctors and providers</li>\r\n</ul>\r\n', 'benefit-for-patients'),
(20, 'BENEFIT FOR PROVIDERS', 'active', '<p><strong>BENEFITS FOR PROVIDERS</strong></p>\r\n\r\n<p>The benefits of Medical Supply Manager to Providers includes:</p>\r\n\r\n<ul>\r\n	<li>Increase in store and online sale for Providers.</li>\r\n	<li>Providers will have corporate home page online</li>\r\n	<li>Receive managed ePrescription orders direct from doctors or patients with complete documentation.</li>\r\n	<li>Be able to display their store products online</li>\r\n	<li>&nbsp;Be able to indicate which one is covered with insurance payment</li>\r\n	<li>&nbsp;Be able to list the Insurance accepted</li>\r\n	<li>Allows customers know the price of products available in store</li>\r\n	<li>&nbsp;Sell their products online</li>\r\n	<li>&nbsp;Receive signed completed Quick Orders&nbsp;from Doctors / Patients.</li>\r\n	<li>Receive additional documents needed to process orders</li>\r\n	<li>Eliminate orders with incomplete information for processing</li>\r\n	<li>Allow customers to pay in advance and receive notifications of Co-payment(s) / Advance Payment Notice.</li>\r\n	<li>Allow customers to know if item/brand is in stock before placing orders.</li>\r\n	<li>Know the price/brand of items before visiting store or placing order.</li>\r\n	<li>Determine how orders should be delivered. Office or Home or Pick Up in Store.</li>\r\n	<li>&nbsp;Eliminate waiting time in provider store. Order can be processed in advance before customer arrives to pick up</li>\r\n	<li>Allow Providers to coordinate better with doctors and patients</li>\r\n</ul>\r\n', 'benefit-for-providers');
INSERT INTO `pages_trans` (`id`, `title`, `status`, `editor`, `slug`, `store_type`) VALUES
(2, 'about', 'active', '\n	   		<div style=\"position: relative;\">\n	   			<h5 class=\"headingmeds f-bold\" style=\"width: 100%;\">Se7amall </h5>\n	   			<hr style=\"border: 2px solid;color: #FF846F; width: 15%; position: absolute; top: 14px;\" class=\"aboutus_underline\">\n	   		</div>\n	   		  	\n	   	\n 		\n	 			<div class=\" totime door2 margin-t-15\">\n	 					<h5 class=\"time1\"> في يوليو 2017، بدأت جلال الدماني جنبا إلى جنب مع داري، Se7amall.com - أكبر سوق للتسوق عبر الإنترنت في الكويت، مع تشكيلة واسعة من 35 مليون زائد المنتجات عبر 800 بالإضافة إلى فئات متنوعة من أكثر من 125،000 العلامات التجارية وتجار التجزئة الإقليمية والوطنية والدولية. </h5>\n	 					\n	 			</div>\n	 			<div class=\" totime coddel\">\n	 				<div class=\"\">\n	 			\n	 					<span>مع الملايين من المستخدمين وأكثر من 300،000 الباعة، Se7a مول هو موقع للتسوق عبر الإنترنت لمستخدمي الإنترنت في جميع أنحاء البلاد، وتسليمها إلى 6000+ المدن والبلدات في الكويت.</span>\n	 				\n	 				</div>\n	 			</div>\n 		\n	 			<div class=\" totime coddel\">\n	 				<div class=\"\">\n	 			\n	 					<span>في رحلتها حتى الآن، شراكة مع Se7a مول مع العديد من المستثمرين الأجانب والأفراد مثل سوفتبنك، بلاك روك، تيماسيك، فوكسكون، علي بابا، شركة باي، Se7a مول هو الخيار المفضل لمئات الآلاف من المتسوقين عبر الإنترنت نظرا لتشكيلها الماموث من 15 مليون + المنتجات، والتسليم السريع حتى إلى زوايا النائية من البلاد، والصفقات اليومية، والخصومات والعروض لجعل المنتجات المتاحة في خفضت الأسعار إلى عملائنا الكرام.</span>\n	 				\n	 				</div>\n	 			</div>\n 		\n 		\n 			\n 			<!-- Second -->\n 			\n	 			<div class=\" totime coddel\">\n	 				<div class=\"\">\n	 			\n	 					<span>البدء! تسوق عبر الإنترنت اليوم في Se7a مول إذا كنت قد تم في عداد المفقودين على كل متعة التسوق عبر الانترنت التفكير فإنه يتطلب واحد ليكون محبا التكنولوجيا ثم لدينا أخبار جيدة بالنسبة لك.</span>\n	 				\n	 				</div>\n	 			</div>\n 		\n\n 			<!-- Third Tab -->\n 			\n	 			<div  class=\"totime coddel\">\n	 				<div class=\"\">\n	 				\n	 					<span> التسوق على الانترنت وخاصة في Se7a مول هو اللعب الطفل. كل ما تحتاجه هو الهاتف المحمول أو الكمبيوتر المحمول أو الكمبيوتر اللوحي مع اتصال بالإنترنت للبدء. ببساطة تسجيل الدخول إلى se7amall.com وتصفح من خلال تشكيلة واسعة من المنتجات عبر الفئات. </span>\n	 				\n	 				</div>\n	 			</div>\n 		<div  class=\"totime coddel\">\n	 				<div class=\"\">\n	 				\n	 					<span></span>\n	 				\n	 				</div>\n	 			</div>\n\n 			<!-- Fourth tab -->\n 			\n	 			<div  class=\"totime coddel\">\n	 				<div class=\"\">\n	 				\n	 					<span>بمجرد الانتهاء من عملية التسجيل، يمكنك البدء في بيع المنتجات الخاصة بك إلى البلد بأكمله من خلال الجلوس في منزلك أو مكتبك. لا يبدو مثيرة؟ وبطبيعة الحال، هو والإثارة سوف تتراكم مع كل أمر تتلقى! بدء بيع في Se7a مول اليوم ونرى عملك تصل مرتفعات مذهلة. تسوق على الذهاب - تثبيت Se7a مول التطبيق اليوم! يمكنك التسوق للمنتجات المفضلة لديك في Se7a مول حتى على الذهاب باستخدام Se7a مول التطبيقات.</span>\n	 				\n	 				</div>\n	 			</div>\n 			\n\n 			<!-- Fifth Tab -->\n 			\n	 			<div class=\" totime coddel\">\n	 				<div class=\"\">\n	 				\n	 					<span>ما هو أكثر من ذلك، والحصول على الإخطارات في الوقت المناسب على الهاتف أو الكمبيوتر اللوحي بحيث لا تفوت عروض مذهلة والعروض. تحميل التطبيق الآن وتجربة كيف متعة هو للتسوق على هاتفك النقال!</span>	 				\n	 				</div>\n	 			</div>\n	 			', 'about', 'KWT'),
(3, 'terms_condition', 'active', '<h4>\n  		1. لوريم إيبسوم دولور الجلوس أميت، كونسكتيتور أديبيسشينغ إليت. إينيان كومودو ليغولا إغيت دولور. إينان ماسا. كوم سوسييس ناتوك بيناتيبوس إت ماغنيس ديس بارتورينت مونتيس، ناسيت\n	<!-- </div>  --></h4>	\n		\n	<h5>2. من الحقائق الثابتة منذ فترة طويلة أن القارئ سوف يصرف من قبل محتوى مقروء للصفحة عند النظر في تخطيطها. نقطة استخدام أبجد هوز هو أنه يحتوي على توزيع طبيعي أكثر أو أقل من الحروف، بدلا من استخدام \"المحتوى هنا، المحتوى هنا\"، مما يجعلها تبدو وكأنها قابلة للقراءة الإنجليزية. العديد من حزم النشر المكتبي والمحررين صفحة ويب الآن استخدام لوريم ايبسوم كنص النموذج الافتراضي، والبحث عن \"لوريم إيبسوم\" سوف تكشف العديد من المواقع على شبكة الإنترنت لا تزال في مهدها.\n   </h5>			               \n										\n	<h5>3. من الحقائق الثابتة منذ فترة طويلة أن القارئ سوف يصرف من قبل محتوى قابل للقراءة من صفحة عند النظر في تخطيطها. نقطة استخدام أبجد هوز هو أنه يحتوي على توزيع طبيعي أكثر أو أقل من الحروف، بدلا من استخدام \"المحتوى هنا، المحتوى هنا\"، مما يجعلها تبدو وكأنها قابلة للقراءة الإنجليزية. العديد من حزم النشر المكتبي والمحررين صفحة ويب الآن استخدام لوريم ايبسوم كنص النموذج الافتراضي، والبحث عن \"لوريم إيبسوم\" سوف تكشف العديد من المواقع على شبكة الإنترنت لا تزال في مهدها.</h5>\n	\n	<h5>4. برنامج الإحالة لوريم والخصم الإحالة صالحة فقط على تطبيقات الهاتف المتحرك لوريم.</h5>\n	\n	<h5> 5. ومن الحقائق الثابتة منذ فترة طويلة أن القارئ سوف يصرف من قبل مقروء محتوى الصفحة عند النظر في تخطيطها. نقطة استخدام أبجد هوز هو أنه يحتوي على توزيع طبيعي أكثر أو أقل من الحروف، بدلا من استخدام \"المحتوى هنا، المحتوى هنا\"، مما يجعلها تبدو وكأنها قابلة للقراءة الإنجليزية. العديد من حزم النشر المكتبي والمحررين صفحة ويب الآن استخدام لوريم ايبسوم كنص النموذج الافتراضي، والبحث عن \"لوريم إيبسوم\" سوف تكشف العديد من المواقع على شبكة الإنترنت لا تزال في مهدها. & الظروف.</h5>\n	\n	<h5>6. من الحقائق الثابتة منذ فترة طويلة أن القارئ سوف يصرف من قبل محتوى مقروء من صفحة عند النظر في تخطيطها. نقطة استخدام أبجد هوز هو أنه يحتوي على توزيع طبيعي أكثر أو أقل من الحروف، ب