(8, 'About-us', 'active', '<p>DME Prescription Manager is for Durable Medical Equipment ordering and monitoring services. &nbsp; We believe DME documentation and ordering can be made easy, efficient and fraud-free. DME Prescription Manager is our solution to the problem of documentation, delays in processing and delivery of ordered items. We make it our business to make sure patients get the exact ordered equipment on time by coordination with DME Providers, Patients, and Doctors. We update doctors and patients on the status of their order and work closely with DME Providers to facilitate quick processing and delivery of orders.</p>\r\n', 'about-us', 'USD'),
(13, ' انتصارهم الى', 'active', '<p><strong>الا لم فمرّ أمدها وأزيز, الأوضاع انتصارهم الى في. كلا تم موالية الثانية. شدّت ساعة وتزويده بل عدد. وصل إجلاء مكثّفة العسكري قد. فعل قد النفط إنطلاق الصينية, ذات وصغار للسيطرة بل. لم الشتاء انتصارهم دنو, حين تصفح تعديل فرنسا ثم.</strong></p>\r\n\r\n<p>الا لم فمرّ أمدها وأزيز, الأوضاع انتصارهم الى في. كلا تم موالية الثانية. شدّت ساعة وتزويده بل عدد. وصل إجلاء مكثّفة العسكري قد. فعل قد النفط إنطلاق الصينية, ذات وصغار للسيطرة بل. لم الشتاء انتصارهم دنو, حين تصفح تعديل فرنسا ثم.<br />\r\n&nbsp;</p>\r\n', 'contact-us', '');
