(1, 'Silver Vein Finish  17', 139, 'LIFELINE MEDICAL SUPPLY', 36, 'HCPCS,E1038', 'ICD10', 0, '<p>17&quot; BLACK UPHOLSTERY</p>\r\n\r\n<p>* Silver Vein Frame * Back folds down for storage and transport</p>\r\n\r\n<p>* Swing-away footrests come standard</p>\r\n\r\n<p>* Comes with seat belt for added safety</p>\r\n\r\n<p>* Padded armrests provide additional comfort</p>\r\n\r\n<p>* 8&quot; casters in front and rear</p>\r\n\r\n<p>* Comes with attractive nylon upholstery that is durable and easy to clean</p>\r\n\r\n<p>* Standard rear wheel locks * Comes with upholstery handles to fold chair</p>\r\n\r\n<p>* Overall width w/ 17&quot; seat: 18&quot; (open), 8&quot; (closed)</p>\r\n\r\n<p>* Overall height: 39&quot;</p>\r\n\r\n<p>* Seat to floor height: 19&quot;</p>\r\n\r\n<p>* Back height: 18&quot;</p>\r\n\r\n<p>* Seat depth: 16&quot;</p>\r\n\r\n<p>* Overall length w/ riggings: 33&quot;</p>\r\n\r\n<p>* Weighs only 26 lbs</p>\r\n\r\n<p>* Carton shipping weight: 31 lbs</p>\r\n\r\n<p>* Weight Capacity: 250 lbs * Limited Lifetime Warranty</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'Recommended for people with mobility challenges whom walking is difficult or impossible due to illness', 300, 200, 0, 'instock', '10% Discount', 95, '', '', 0, 'silver-vein-finish-17-1', '', 'Complete Medical', '', '', 'fae3a6294037759e8e10a346c1da226b.jpg', '389c2ed3dbb904e5fdd5b9a507d77756.jpg,3de68a5b3eeb15854b8b10c2bb1eb460.jpg,7e02cc319ef6ec770942d063dd65ef5b.jpg', '2019-02-09 13:36:32', '0', '10950ASV', '', '', '', '10', '', '1', 'Covered by Most HMO', 'Black', '', '', '', '2219.mp4', '150', 1, '1', '1', '<p>17&quot; BLACK UPHOLSTERY</p>\r\n\r\n<p>* Silver Vein Frame * Back folds down for storage and transport</p>\r\n\r\n<p>* Swing-away footrests come standard</p>\r\n\r\n<p>* Comes with seat belt for added safety</p>\r\n\r\n<p>* Padded armrests provide additional comfort</p>\r\n\r\n<p>* 8&quot; casters in front and rear</p>\r\n\r\n<p>* Comes with attractive nylon upholstery that is durable and easy to clean</p>\r\n\r\n<p>* Standard rear wheel locks * Comes with upholstery handles to fold chair</p>\r\n\r\n<p>* Overall width w/ 17&quot; seat: 18&quot; (open), 8&quot; (closed)</p>\r\n\r\n<p>* Overall height: 39&quot;</p>\r\n\r\n<p>* Seat to floor height: 19&quot;</p>\r\n\r\n<p>* Back height: 18&quot;</p>\r\n\r\n<p>* Seat depth: 16&quot;</p>\r\n\r\n<p>* Overall length w/ riggings: 33&quot;</p>\r\n\r\n<p>* Weighs only 26 lbs</p>\r\n\r\n<p>* Carton shipping weight: 31 lbs</p>\r\n\r\n<p>* Weight Capacity: 250 lbs * Limited Lifetime Warranty</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'https://youtu.be/q2Je_72pEkY', 0, 1),
(2, '3-Wheeled Rollator W/Pouch & Basket Loop Brake', 139, 'LIFELINE MEDICAL SUPPLY', 55, ' E0143', 'R26.2', 0, '<p>Description:</p>\r\n\r\n<p>Rollator 3 Wheeled with pouch and basket loop brake</p>\r\n\r\n<p>Description:</p>\r\n\r\n<p>Comes standard with basket, tray, and pouch</p>\r\n\r\n<p>8&quot; casters with soft-grip tires are ideal for indoor and outdoor use</p>\r\n\r\n<p>Special loop lock made of internal aluminum casting operates easily and ensures safety</p>\r\n\r\n<p>Handles are adjustable in height</p>\r\n\r\n<p>Adjustable brakes</p>\r\n\r\n<p>Easy, one hand folding</p>\r\n\r\n<p>Limited Lifetime Warranty</p>\r\n\r\n<p>Lifetime Warranty on brake cable</p>\r\n\r\n<p>Weight capacity: 350</p>\r\n', 'Recommended for those who need assistance with balance and mobility. The 3-wheeled Rollator turns for easy use at home or outside.\r\n', 121, 110, 0, 'instock', '', 96, '', '', 0, '3-wheeled-rollator-w-pouch-basket-loop-brake', '', 'Complete Medical', '', '', 'fcdea3872d6ede95a9414bf300eae252.jpg', 'b316286d12c2375ddffbc089059a9987.jpg,e4d262a74ed930f56719bf1682090243.jpg,b85259e52bd9d0a27ec2948b7558b8b4.jpg,01758f4c2c54128997e30de0bb257722.jpg', '2019-02-10 15:37:10', '1', 'A100', '', '', '', '20', '', '1', 'Medicaid,Healthfirst', 'Black, Sky blue, Burgundy', '', '', '', '4693.mp4', '', 1, '5', '1', '<p>Description:</p>\r\n\r\n<p>Rollator 3 Wheeled with pouch and basket loop brake</p>\r\n\r\n<p>Description:</p>\r\n\r\n<p>Comes standard with basket, tray, and pouch</p>\r\n\r\n<p>8&quot; casters with soft-grip tires are ideal for indoor and outdoor use</p>\r\n\r\n<p>Special loop lock made of internal aluminum casting operates easily and ensures safety</p>\r\n\r\n<p>Handles are adjustable in height</p>\r\n\r\n<p>Adjustable brakes</p>\r\n\r\n<p>Easy, one hand folding</p>\r\n\r\n<p>Limited Lifetime Warranty</p>\r\n\r\n<p>Lifetime Warranty on brake cable</p>\r\n\r\n<p>Weight capacity: 350</p>\r\n', '', 0, 1),
(3, 'Zoom Rolling Walker', 139, 'LIFELINE MEDICAL SUPPLY', 54, 'E0143 ,EO156', 'R26.2', 0, '<p>&nbsp;</p>\r\n\r\n<p>This walker has adjustable height 18-24&#39;&#39;. Features include Seat pouch, padded seat, brakes, flip up back and height adjustment knob.&nbsp;</p>\r\n\r\n<ul>\r\n</ul>\r\n\r\n<p>Features</p>\r\n\r\n<ul>\r\n	<li>18&quot; Seat Height</li>\r\n	<li>Locking Hand Brakes</li>\r\n	<li>Large Padded Seat</li>\r\n	<li>Under Seat Pouch</li>\r\n	<li>Flip-up Back</li>\r\n	<li>Foldable</li>\r\n	<li>8&quot; Wheels</li>\r\n</ul>\r\n', 'Recommended for patients that requires extra mobility support. Walking is made easy when you have the Zoom Rolling Walker from NOVA. It is Idea l for both indoor and outdoor use.', 165, 125, 0, 'instock', '', 100, '', '', 0, 'zoom-rolling-walker', '', 'Nova Medical', '', '', '823be266364224b781dd21606d73d532.jpg', '07b0be6b507fe721b91a85a881263ec6.jpg', '2019-02-10 16:20:33', '1', 'A002', '', '', '', '10', '', '1', '', 'Black, Sky blue, Green', '', '', '', '3689.mp4', '175', 1, '0', '0', '<p>&nbsp;</p>\r\n\r\n<p>This walker has adjustable height 18-24&#39;&#39;. Features include Seat pouch, padded seat, brakes, flip up back and height adjustment knob.&nbsp;</p>\r\n\r\n<ul>\r\n</ul>\r\n\r\n<p>Features</p>\r\n\r\n<ul>\r\n	<li>18&quot; Seat Height</li>\r\n	<li>Locking Hand Brakes</li>\r\n	<li>Large Padded Seat</li>\r\n	<li>Under Seat Pouch</li>\r\n	<li>Flip-up Back</li>\r\n	<li>Foldable</li>\r\n	<li>8&quot; Wheels</li>\r\n</ul>\r\n', '', 0, 1),
(4, 'Adult Folding Walker', 139, 'LIFELINE MEDICAL SUPPLY', 58, 'HCPCS', 'R26.2', 0, '<p>&nbsp;</p>\r\n\r\n<p>Description</p>\r\n\r\n<p>The adult folding walker has a lightweight aluminum frame and different weight specification. Some of the features include:</p>\r\n\r\n<p>* 3 inch fixed wheels&nbsp;</p>\r\n\r\n<p>* Two-button release for great security.</p>\r\n\r\n<p>The walker folds to 4 inch in width for easy transport and storage.</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'Available in Store for Pick Up / Same Day Delivery. \r\n', 135, 105, 0, 'instock', '', 99, '', '', 0, 'adult-folding-walker', '', 'Nova Medical', '', '', '15ceb52cfb5aa2e559d38d59621316d3.jpg', '5a4ac1201801e020210821e965fce7e7.jpg,f07b87e1f04cfacfe338481ec4e85c6d.jpg,e85dff1d7009997cbca14e1339499aa3.jpg', '2019-02-10 16:38:25', '0', 'A003', '', '', '', '0', '', '1', '', 'Black, Sky blue, forestgreen, white', '', '', '', '5606.mp4', '135', 1, '0', '0', '', '', 0, 1),
(5, 'Light Weight Folding Transport Wheelchair', 209, 'Shaka', 55, 'K0003', 'Z99.3', 0, '<p>This lightweight dual axle transport wheelchair weighs less than 36 lbs. It has the following features:</p>\r\n\r\n<ul>\r\n	<li>Easy to Carry. Removable flip-back arms of this lightweight wheelchair allow for easy transfer and maneuverability</li>\r\n	<li>Convenient. Updated frame style of this manual wheelchair eliminates seat guides and allows for custom back inserts and accessories</li>\r\n	<li>safe. The wheelchair comes with push-to-lock wheel clasps. They save you braking time, provide extra safety and secure the wheelchair in place</li>\r\n	<li>Easy Assembling. The adjustable front legrests complete this lightweight wheelchair without the extra hassle of special tools</li>\r\n</ul>\r\n', 'Light Weight Wheelchair', 190.45, 165.5, 0, 'instock', '', 100, '', '', 0, 'light-weight-folding-transport-wheelchair', '', 'Healthline', '', '', '7841da571b21966c13ca64ba23fa5257.jpg', '', '2019-02-11 13:30:29', '1', 'A004', '', '', '', '0', '', '1', '', 'Black', '', '', '', '3837.mp4', '', 1, '0', '0', '', '', 0, 1),
(6, 'Folding Powered Wheelchair', 139, 'LIFELINE MEDICAL SUPPLY', 55, 'K0012', 'G83.0', 0, '<p>This Folding Cirrus Plus EC 18&quot; Power Chair by Drive Medical is foldable and lightweight making it ideal for transporting. It comes in an attractive, lightweight, carbon steel frame with a silver vein finish which is easy to maintain. This Power Chair comes standard with the following features:</p>\r\n\r\n<p>* A seat belt, seat cushion with a pouch for easy storage,</p>\r\n\r\n<p>* Swing away footrests with calf straps and heel loops.</p>\r\n\r\n<p>* Wheel locks and adjustable tension, padded, back upholstery, adding to users convenience, safety, and comfort.</p>\r\n\r\n<p>* The integrated, programmable PG controller and adjustable length joystick mount accommodates most user sizes.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'Lightweight Powered  Wheelchair', 1900, 1755, 0, 'instock', '', 100, '', '', 0, 'folding-powered-wheelchair', '', 'Drive', '', '', 'dff15dab6eac57aed1c0a0fafe3848dc.jpg', 'a9b24983f940d2bc12b15b4ebd12c51a.jpg,ffcabb27a3e3227062fe0d3992418241.jpg,bf3bb4df7dc28997cdf0ab4de75a33b3.jpg,88547d31e3c6b36666bf12abd217e860.jpg', '2019-02-11 14:24:33', '1', 'A006', '', '', '', '20', '', '1', '', 'Black', '', '', '', '0', '2,050', 1, '0', '0', '<p>This Folding Cirrus Plus EC 18&quot; Power Chair by Drive Medical is foldable and lightweight making it ideal for transporting. It comes in an attractive, lightweight, carbon steel frame with a silver vein finish which is easy to maintain. This Power Chair comes standard with the following features:</p>\r\n\r\n<p>* A seat belt, seat cushion with a pouch for easy storage,</p>\r\n\r\n<p>* Swing away footrests with calf straps and heel loops.</p>\r\n\r\n<p>* Wheel locks and adjustable tension, padded, back upholstery, adding to users convenience, safety, and comfort.</p>\r\n\r\n<p>* The integrated, programmable PG controller and adjustable length joystick mount accommodates most user sizes.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', '', 0, 1),
(7, 'Pride Powered Wheelchair', 139, 'LIFELINE MEDICAL SUPPLY', 55, '', '', 0, '<p>&nbsp;</p>\r\n\r\n<p>This chair is rugged and dependable. It comes with the following features:</p>\r\n\r\n<ul>\r\n	<li>OMNI-Casters (nylon, spherical-shaped casters) on front and rear to prevent wheel hang-ups</li>\r\n	<li>Choice of 6 colors</li>\r\n	<li>18&Prime; x 17&Prime;, 5-point swivel seat with a latch release</li>\r\n	<li>Increased 300 lb. weight capacity</li>\r\n	<li>Faster speed &ndash; up to 3.7 mph</li>\r\n	<li>Larger, 18 amp batteries</li>\r\n	<li>Improved agility &ndash; longer wheel base; wider stance; compact turning radius 25.4&Prime;</li>\r\n	<li>Dual swing-away, under seat storage bins</li>\r\n	<li>Larger, height &amp; width adjustable armrests</li>\r\n	<li>Larger footplate</li>\r\n	<li>One hand feather-touch disassembly</li>\r\n	<li>60&Prime; lap belt</li>\r\n</ul>\r\n', 'Rugged Powered Wheelchair', 1755, 1650, 0, 'instock', '', 100, '', '', 0, 'pride-powered-wheelchair', '', 'Jazzy', '', '', '83a5a0bc7281b4b5aa32b13f764f6c1d.jpg', '8d98b598b1442b4dc9e7f62398f0114c.jpg,6b0ef83039910f6a8b6f41620ea379e2.png', '2019-02-11 15:09:56', '1', 'B008', '', '', '', '10', '', '0', '', 'Sky blue', '', '', '', '0', '1950', 1, '0', '0', '', '', 0, 1),
(8, 'Golden Mobility Scooter', 139, 'LIFELINE MEDICAL SUPPLY', 5, 'K0800', 'G82.20', 0, '<p>This Scooter is durable and very reliable. It comes with the following features:</p>\r\n\r\n<ul>\r\n	<li>Outdoor Ruggedness</li>\r\n	<li>Speeds Up to 7MPH</li>\r\n	<li>Full Lighting Package</li>\r\n	<li>Standard Front Basket</li>\r\n	<li>Extra Roomy Seat</li>\r\n	<li>Oversized Tires</li>\r\n	<li>Swivel Seat</li>\r\n	<li>Flip-Up Armrests for Easy Transfers</li>\r\n	<li>Adjustable Seat Height</li>\r\n	<li>Bumper Guard Protection</li>\r\n	<li>Arms Adjust in Width and Height</li>\r\n	<li>Weight Capacity: 500 lbs</li>\r\n</ul>\r\n', 'Recommended for people with limited and deteriorating ability to walk reasonable distances. Scooters has been shown to improve a person’s abilities, social participation and aid with activities of daily living.', 2750, 2520, 0, 'instock', '', 100, '', '', 0, 'golden-mobility-scooter', '', 'Golden ', '', '', 'c5023072cb478780a1c122956678e7a2.jpg', 'bd7c507b59c7331498984a3e7a8038a4.jpg,42e119b0f1920b0de33ef10a4362d253.jpg', '2019-02-11 15:32:38', '1', 'B009', '', '', '', '0', '', '1', '', 'Black', '', '', '', '5362.mp4', '2899', 1, '0', '0', '', '', 0, 1),
(9, 'Drive Medical Scout Compact Travel Power Scooter', 139, 'LIFELINE MEDICAL SUPPLY', 5, 'K0801', 'ICD10', 0, '<p>This compact Scooter has the following features:</p>\r\n\r\n<ul>\r\n	<li>Interchangeable color panels hide scuffs and scratches; Quick and easy disassembly</li>\r\n	<li>Armrests are padded and adjustable; Height-adjustable swivel seat with fold-down backrest; Comes with large, plastic carry basket</li>\r\n	<li>Delta tiller is easily adjustable; Ergonomic throttle control with easy freewheel operation</li>\r\n	<li>Flat-free, non-marking tires and anti-tip wheels</li>\r\n	<li>Seat Width: 16.5&quot;; Max Speed: 4.25 mph; Climbing Angle: 6 degrees; Maximum Range: 15 miles; Motor: 24V x 270W x 4700rpm; Turning Radius: 45.5&quot;; Ground Clearance: 2.5&quot;; Weight Capacity: 300 lbs</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n', 'Compact Scooter', 910, 820, 0, 'instock', '', 100, '', '', 0, 'drive-medical-scout-compact-travel-power-scooter', '', 'Drive', '', '', '899f8882a743e5d234bbce782c68aacf.jpg', 'c58bba5fd446373ae47959f0f7a73395.jpg,0f2f26c5f480028052464632aec03755.jpg', '2019-02-11 16:02:49', '1', 'B009', '', '', '', '0', '', '1', '', 'Black, Sky blue', '', '', '', '2431.mp4', '1200', 1, '0', '0', '', '', 0, 1),
(10, 'Invacare Perfecto2 V Five Liter Oxygen Concentrator', 199, 'Nilesh', 1, 'E1390', 'ICD10', 0, '<p>Invacare Perfecto2 V Five Liter Oxygen Concentrator is designed for indoor individual use. This 5-Liter Oxygen Concentrator is intended to provide supplemental oxygen to patients with respiratory disorders, by separating nitrogen from room air, by way of a molecular sieve. It is small, quiet, lightweight and comes standard with the Invacare SensO2 Oxygen Sensor. <gwmw class=\"ginger-module-highlighter-mistake-type-3\" id=\"gwmw-15777088797924560880350\">Perfecto2</gwmw> provides <gwmw class=\"ginger-module-highlighter-mistake-type-3\" id=\"gwmw-15777088797920428908291\">high concentration</gwmw> of oxygen directly through a nasal cannula. The patient-accessible reset button helps minimize emergency service calls. It is a reliable concentrator with battery-free power loss alarm.</p>\r\n', '5-Liter Oxygen Concentrator', 1000, 750, 0, 'instock', '', 100, '', '', 0, 'invacare-perfecto2-v-five-liter-oxygen-concentrator', '', 'Invacre', '', '', 'f18cbb1bcf4d2076992942dba25f4578.jpg', 'cd16355473536fe11c8fd8348c8ec453.jpg', '2019-02-11 18:38:41', '0', 'C02', '', '', '', '10', '', '1', '', '', '', '', '', '566.mp4', '', 1, '0', '0', '', '', 0, 1),
(11, 'Invacare 820 DLX Hospital Bed ', 139, 'LIFELINE MEDICAL SUPPLY', 56, 'E0256', 'ICD10', 0, '<p>The Invacare 820 DLX Hospital Bed comes with the following unique features</p>\r\n\r\n<ul>\r\n	<li>Quiet motor system</li>\r\n	<li>&nbsp;Waterproof enclosures.</li>\r\n	<li>Fast Cycle Time&nbsp;for the lowering of the bed.&nbsp;</li>\r\n	<li>Emergency crank&nbsp;provided allows all motors to be operated manually in the event of a power failure.</li>\r\n	<li>Locking Casters&nbsp;so bed stays in place</li>\r\n	<li>Rapid tool-free assembly&nbsp;minimizes delivery set-up time and makes maintenance easier</li>\r\n	<li>6-Function Hand Control Pendant&nbsp;The DLX&#39;s electric Hand Control features bright, universal symbols and allows residents and staff to easily operate the comfort controls of the bed. Hand pendant can be plugged in either side of the bed</li>\r\n</ul>\r\n', 'Electric Bed', 1205, 1105, 0, 'instock', '', 96, '', '', 0, 'invacare-820-dlx-hospital-bed', '', 'Invacare', '', '', 'df5862c4e1ea7d62917b3f7817bc03d2.jpg', '853c849155835c95e23034ff9ff97da9.jpg,e5e1edc11e50db28eb2bbc0142679b36.jpg', '2019-02-13 08:37:17', '1', 'C54', '', '', '', '0', '', '1', '', 'Black', '', '', '', '1064.mp4', '', 1, '0', '0', '', '', 0, 1),
(12, 'Aluminum Quad Canes', 139, 'LIFELINE MEDICAL SUPPLY', 7, '', '', 0, '<p>&nbsp;Aluminum Quad canes&nbsp;are safe and reliable. They come with the following features:</p>\r\n\r\n<ul>\r\n	<li>Four feet which allow for greater weight-bearing and stability than single-point canes</li>\r\n	<li>Non-skid rubber tips on all four feet ensure long life</li>\r\n	<li>Small base design allows for a faster pace; large base design gives more stability at a slower pace</li>\r\n	<li>Quad canes stand up on their own</li>\r\n	<li>Contoured vinyl handgrips or foam handles</li>\r\n</ul>\r\n', 'Durable Cane\r\n\r\n', 40, 35, 0, 'instock', '', 100, '', '', 0, 'aluminum-quad-canes', '', 'Medline', '', '', 'a2e762c36b2f0372cbfa03a91da85ef0.jpg', '', '2019-02-13 08:54:12', '1', '', '', '', '', '0', '', '0', '', 'Black, Sky blue, forestgreen, Green', '', '', '', '1117.mp4', '45', 1, '0', '0', '', '', 0, 1),
(13, 'Offset Fashion Canes', 139, 'LIFELINE MEDICAL SUPPLY', 7, '', '', 0, '<p>Medline&#39;s cost-effective fashion canes act as reliable mobility aids and fashion accessories. They are known for the following features:</p>\r\n\r\n<ul>\r\n	<li>Colorful designs and unique patterns provide users the right cane for different occasions</li>\r\n	<li>Nice alternative to the institutional look of chrome walking aids</li>\r\n	<li>Foam handles and convenient wrist straps</li>\r\n	<li>Height adjustment, 29&quot; to 38&quot; (74-96.5 cm); Cane weight, 0.8 lb. (0.4 kg)</li>\r\n</ul>\r\n', 'Fashion Cane', 15, 12.5, 0, 'instock', '', 100, '', '', 0, 'offset-fashion-canes', '', 'Medline', '', '', 'd086dab89a1138a4508f376e0762c370.jpg', '628af367a437772964a0b891a6dc0cd0.JPG', '2019-02-13 09:21:07', '1', '', '', '', '', '0', '', '1', '', 'Black, Sky blue, white', '', '', '', '1298.mp4', '20', 1, '5', '1', '', '', 0, 1),
(14, 'Medline Aluminum Forearm Crutches', 139, 'LIFELINE MEDICAL SUPPLY', 8, '', '', 0, '<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Telescoping parts are manufactured with internal bushings and external lock nuts to provide totally silent usage</li>\r\n	<li>Vinyl-coated, tapered, contoured arm cuffs</li>\r\n	<li>Heavy-wall, high-strength aluminum tubing</li>\r\n	<li>Black components hide signs of wear and scratches;Height Range: 5 - 6&#39;2(Inches)</li>\r\n	<li>Tall Adult has a 250-lb. weight capacity, Patient height, 5&#39;10&quot;-6&#39;6&quot;; Adult has a 250-lb. weight capacity, Patient height, 5&#39;0&quot;-6&#39;2&quot;; Youth has a 250-lb. weight capacity, Patient height, 4&#39;2&quot;-5&#39;2&quot;</li>\r\n</ul>\r\n', 'Rugged Crutches', 40, 35, 0, 'instock', '', 100, '', '', 0, 'medline-aluminum-forearm-crutches', '', 'Medline', '', '', '5e3fd4510d5ad94ee36871bcebdeb58e.jpg', 'e9823f0f5e057f2dfb3871b36d65c510.jpg', '2019-02-13 09:31:04', '1', '', '', '', '', '0', '', '1', '', 'white', '', '', '', '8095.mp4', '45', 1, '5', '2', '', '', 0, 1),
(15, 'Drive Heavy Duty Shower Chair', 139, 'LIFELINE MEDICAL SUPPLY', 9, 'NA', 'NA', 0, '<ul>\r\n	<li>The frame has width/depth cross braces attached with aircraft-type rivets</li>\r\n	<li>Large seat with 16 5&quot; depth</li>\r\n	<li>Seat height adjusts in 1&quot; increments</li>\r\n	<li>Durable, blow-molded plastic bench</li>\r\n	<li>Tool-free removable back</li>\r\n	<li>Aluminum frame is lightweight, durable and corrosion proof</li>\r\n	<li>Drainage holes reduce slipping</li>\r\n	<li>Weight Capacity 600 lbs</li>\r\n</ul>\r\n', 'Bathroom Aid \r\n', 120, 110, 0, 'instock', '', 100, '', '', 0, 'drive-heavy-duty-shower-chair', '', 'Drive', '', '', '0c4cdaba25c52489d21306f516bcf0b7.jpg', '', '2019-02-13 09:42:56', '1', '', '', '', '', '0', '', '0', '', 'white', '', '', '', '227.webm', '130', 1, '0', '0', '', '', 0, 1),
