(24, 'Hooded Rain Poncho', 139, 'LIFELINE MEDICAL SUPPLY', 35, 'NA', 'NA', 0, '<p>Lightweight, single layer, polyethylene fabric has a drawstring hood</p>\r\n\r\n<p>* Measures 50&quot; x 80&quot; * One size fits most adults</p>\r\n\r\n<p>* Color assortment is blue, green, red, &amp; yellow</p>\r\n\r\n<p>* Comes carded in a poly bag with UPC code</p>\r\n', 'Lightweight, single layer, polyethylene fabric has a drawstring hood', 5, 3, 0, 'instock', '', 100, '', '', 0, 'hooded-rain-poncho', '', 'Complete Medical', '', '', 'fa1be5702a391edb0bcf9fe19d4814e3.jpg', '9534c19c79bc8e9134a600f0156d009b.jpg', '2019-02-23 19:55:03', '1', '10566', '', '', '', '0', '', '0', '', 'Black', '', '', '', '0', '1', 1, '0', '0', '', '', 0, 1),
(25, 'Universal Walker Tray with Cup Holder, Grey Drive', 139, 'LIFELINE MEDICAL SUPPLY', 58, '', 'ICD10', 0, '<p>Fits most manufacturers&#39; walkers</p>\r\n\r\n<p>* Allows you to carry personal items from room to room</p>\r\n\r\n<p>* Made of easy to clean durable plastic</p>\r\n\r\n<p>* One cup holder * Easy to install</p>\r\n\r\n<p>* Size: 23&quot; x 17&quot; x 1.5</p>\r\n\r\n<p>* Limited 1 Year Warranty</p>\r\n', 'Fits most manufacturers\' walkers * ', 45, 35, 0, 'instock', '', 100, '', '', 0, 'universal-walker-tray-with-cup-holder-grey-drive', '', 'Complete Medical', '', '', 'bc4d05f6de5cd4173bd2952cedeaf811.jpg', 'e0c7d1fc1f46b147372be5af62590611.jpg', '2019-02-23 20:23:26', '0', '1094A', '', '', '', '0', '', '0', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(26, 'Drop Arm Commode Deluxe-KD Steel', 139, 'LIFELINE MEDICAL SUPPLY', 9, 'HCPCS', 'ICD10', 0, '<p>* 300 pound weight capacity</p>\r\n\r\n<p>* Easy-to-release drop arms-either will drop down- mechanism allows for safe lateral patient transfers to and from commode</p>\r\n\r\n<p>* Legs are adjustable</p>\r\n\r\n<p>* 18&quot; width between arms</p>\r\n\r\n<p>* Easy-to-clean, chrome-plated, steel finish</p>\r\n\r\n<p>* Comes with commode pail w/carry handle</p>\r\n\r\n<p>* Limited Lifetime Warranty</p>\r\n\r\n<p>* Adjustable height</p>\r\n', 'Ideal for those with limited dexterity.\r\nAvailable in Store For Pick Up / Same Day Delivery\r\n', 165, 125, 0, 'instock', '', 100, '', '', 0, 'drop-arm-commode-deluxe-kd-steel', '', 'Complete Medical', '', '', 'a40a2f9e2ae1c4e4b0f14fb649756d9c.jpg', '2c9352b8ad43975f553a80f06744b002.jpg', '2019-02-24 13:47:15', '1', '1066', '', '', '', '0', '', '1', '', '', '', '', '', '6379.mp4', '180', 1, '0', '0', '', '', 0, 1),
