(31, 'Mini-Oxygen Regulator 0-8 LPM (Drive # 18301GM', 1, 'Super Admin', 1, '', '', 0, '<p>* 0-8 LPM * High strength lightweight aluminum alloy body with all brass core</p>\r\n\r\n<p>* Green * CGA 870 yoke and CGA 540 nut &amp; nipple</p>\r\n\r\n<p>* 6 year warranty</p>\r\n\r\n<p>* Click style and easy to read flow rates</p>\r\n\r\n<p>* Laser etched: no labels to come off</p>\r\n\r\n<p>* Protected contents, gauge</p>\r\n\r\n<p>* Ribbed flow selector for better grip</p>\r\n\r\n<p>* Viton rubber yoke seal with brass ring</p>\r\n', 'This product is for Respiratory Care', 32, 25, 0, 'instock', '', 100, '', '', 0, 'mini-oxygen-regulator-0-8-lpm-drive-18301gm', '', 'Complete Medical', '', '', 'c449d785e2389e4ac37d3acdce26b638.jpg', '', '2019-02-24 15:45:57', '1', '18311', '', '', '', '0', '', '0', '', '', '', '', '', '9290.mp4', '', 1, '0', '0', '', '', 0, 1),
(32, 'Liquid Oxygen (LOX) Carry Case', 139, 'LIFELINE MEDICAL SUPPLY', 1, 'NA', 'NA', 0, '<p>Light weight reinforced nylon carry case fits most name brand units</p>\r\n\r\n<p>* Has enough room to carry name brand units with plenty of room for accessories i/e tubing, headgear and mask etc</p>\r\n\r\n<p>* Height: 9&quot;</p>\r\n\r\n<p>* Circumference: 16&quot;&nbsp;</p>\r\n', 'This accessory is light weight. It is a reinforced nylon carry case that fits most name brand units', 65, 52, 0, 'instock', '', 100, '', '', 0, 'liquid-oxygen-lox-carry-case', '', 'Complete Medical', '', '', '6b291c416900390cec1fbcd46099e942.jpg', '', '2019-02-24 15:52:07', '1', '11611', '', '', '', '0', '', '0', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(33, 'TOTE Oxygen Tank Carrier fits E-Cylinder for Wheeled Walker', 1, 'Super Admin', 58, 'NA', 'NA', 0, '<p>Carrier for E- cylinder</p>\r\n\r\n<p>* Oxygen Cylinder Holder increased mobility and freedom for individuals who are required to use oxygen and a wheeled walker</p>\r\n\r\n<p>* Secures to the walker with 2 hook and loop fasteners and a safety buckle strap at the top, and a centering strap near the bottom of the walker</p>\r\n\r\n<p>* Convenient pocket for the wrench</p>\r\n', 'This is an accessory. It  fits E-Cylinder for Wheeled Walker', 62, 46, 0, 'instock', '', 100, '', '', 0, 'tote-oxygen-tank-carrier-fits-e-cylinder-for-wheeled-walker', '', 'Complete Medical', '', '', 'ff3ddef43249ed33931f5b43f3e45e95.jpg', '', '2019-02-24 16:02:09', '0', '8037A', '', '', '', '0', '', '0', '', '', '', '', '', '136.mp4', '', 1, '0', '0', '', '', 0, 1),
(34, 'Oxygen \'D\' Tank- 425 Liter w/Toggle (19', 139, 'LIFELINE MEDICAL SUPPLY', 1, 'HCPCS', 'ICD10', 0, '<p>With Toggle Post Valve (Easy to turn on/off manually)</p>\r\n\r\n<p>* &quot;D&quot; Tank, 425 Liters&nbsp;</p>\r\n', 'Respiratory care', 98, 75, 0, 'instock', '', 100, '', '', 0, 'oxygen-d-tank-425-liter-w-toggle-19-1', '', 'Complete Medical', '', '', 'b09641c97d4c913dcd643f7806b802b6.jpg', '', '2019-02-24 16:10:52', '1', '8046', '', '', '', '10', '', '1', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(35, 'Ultra-Light,Semi-Electric Bed w/Half Rails', 139, 'LIFELINE MEDICAL SUPPLY', 56, '', '', 0, '<p>The Delta 1000 is truly universal because the bed frame can be used with Drive&#39;s and most other manufacturers&nbsp;bed ends, old and new.</p>\r\n\r\n<p>* The transition box mounted on the foot section is key to interchangeability.</p>\r\n\r\n<p>* The transition box allows you to change the rotation of the high/low shaft.</p>\r\n\r\n<p>* Headboard is taller than footboard to better fit home decor.</p>\r\n\r\n<p>* The wood grain panels are break and scratch resistant.</p>\r\n\r\n<p>* Foot section weighs 50% less than conventional foot sections to make deliveries safe and easy.</p>\r\n\r\n<p>* Once installed, the high/low shaft will stay with the bed to eliminate loss or forgetting on future installations.</p>\r\n\r\n<p>* Labels and color-coded springs assure accurate installation of side rails for patient safety.</p>\r\n\r\n<p>* Unique motor is completely self-contained to reduce weight and noise.</p>\r\n\r\n<p>* The motor assembly can be installed and removed with patient in bed.</p>\r\n\r\n<p>* Bed, side rails and mattress safety-tested by SGS, a nationally recognized testing facility.</p>\r\n\r\n<p>* Satisfies all applicable FDA entrapment guidelines.</p>\r\n\r\n<p>* The motor is UL approved.</p>\r\n\r\n<p>* In the event of a power failure, a 9 volt battery, located in the motor, can lower the head and foot sections nine times.</p>\r\n\r\n<p>* No crank needed.</p>\r\n\r\n<p>* New and improved hand pendant has large, easy-to-use controls.</p>\r\n\r\n<p>* Bed ships in two cartons.</p>\r\n\r\n<p>* Channel frame construction provides superior strength and reduced weight.</p>\r\n\r\n<p>* Zinc-coated spring deck. * Patent Pending.</p>\r\n\r\n<p>* Weight Capacity 450 lbs</p>\r\n', 'This bed is truly universal because the bed frame can be used with Drive\'s and most other manufacturers bed ends, old and new.', 1048, 800, 0, 'instock', '', 88, '', '', 0, 'ultra-light-semi-electric-bed-w-half-rails', '', 'Complete Medical', '', '', '43d41edba940a1e3cacb13e9dde53f31.jpg', '', '2019-02-24 16:20:02', '1', '15030BVHR', '', '', '', '0', '', '0', '', 'empty', '', '', '', '4339.mp4', '', 1, '0', '0', '', '', 0, 1),
(36, 'Belkis TLSO Back Brace Orthotics ', 139, 'LIFELINE MEDICAL SUPPLY', 67, '', '', 0, '<p>Small, 19.5&quot; tall</p>\r\n\r\n<p>* LG-PRO-BELKIS: Professional Belkis TLSO Custom fits with Flex-E-Core Technology</p>\r\n\r\n<p>* All Sizes fit up to 52 inch waist</p>\r\n\r\n<p>* Dual Non-Stretch Straps fit new code requirements</p>\r\n\r\n<p>* Professional Belkis Back Brace System allows user to easily make adjustment for comfort fit after first fitting</p>\r\n\r\n<p>* Unloads discs, vertebrae and other spinal structures by non-stretch, low pressure compression of the vertebral assembly</p>\r\n\r\n<p>* Helps immobilize spine thereby stabilizing weak or injured structures and deformities stabilizing the lumbo-sacral spine; facilitates healing of injuries or after surgical procedures; reduces pain</p>\r\n\r\n<p>* Belkis-PRO-TLSO: a BOC Orthtist design for TLSO 2 Mod symphis-xipho</p>\r\n\r\n<p>* Flex-E-Core combines Ferrous Alloys laminated within lightweight copolymer plastics forming composite panels (anterior and posterior) which are malleable with high tensile resistance</p>\r\n\r\n<p>* Flex-E-Core panels allow hands on custom fitting with near unlimited adjustment</p>\r\n\r\n<p>* Soft and comfortable with Easy Don-Doff Quick Release Access</p>\r\n', 'This brace helps to immobilize spine thereby stabilizing weak or injured structures and deformities, stabilizing the lumbo-sacral spine; facilitates healing of injuries or after surgical procedures; reduces pain.', 202, 152, 0, 'instock', '', 100, '', '', 0, 'belkis-tlso-back-brace-orthotics-1', '', 'Complete Medical', '', '', '8fbc592166fea32754f8fa216e34be5d.JPG', '', '2019-02-25 10:42:20', '1', '1861A', '', '', '', '0', '', '0', '', 'Black', '', '', '', '7371.mp4', '', 1, '0', '0', '', '', 0, 1),
(37, 'Blue Jay Back Support with Supporting Stays Universal Blk', 139, 'LIFELINE MEDICAL SUPPLY', 67, 'HCPCS', 'ICD10', 0, '<p>Color: black</p>\r\n\r\n<p>* Criss-cross ventilated elastic creates firm compression and support on the back</p>\r\n\r\n<p>* Hook closure for adjustable maximum fit and compression</p>\r\n\r\n<p>* Flexible stays help eliminate rolling and provide additional support</p>\r\n\r\n<p>* Universal, one size fits most</p>\r\n\r\n<p>* 24&quot;- 46&quot;</p>\r\n', 'This brace is Universal fit. One size fits most', 32, 25, 0, 'instock', '', 98, '', '', 0, 'blue-jay-back-support-with-supporting-stays-universal-blk', '', 'Complete Medical', '', '', '9c0c058862cc0c2c88f9534ff58806b4.jpg', '', '2019-02-25 10:46:54', '1', 'BJ215300UN', '', '', '', '0', '', '1', '', 'Black', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(38, 'Blue Jay Industrial Back Support w/Suspenders, Black ', 139, 'LIFELINE MEDICAL SUPPLY', 66, 'HCPCS', 'ICD10', 0, '<p>Color: black</p>\r\n\r\n<p>* Wide duo-tension straps provide excellent abdominal and lower back support</p>\r\n\r\n<p>* Flexible stays help eliminate rolling</p>\r\n\r\n<p>* Wide duo-tension straps encourage proper lifting technique</p>\r\n\r\n<p>* Non-removable suspenders provide extra support and comfort</p>\r\n', 'Covered by Medicare, Medicaid and Most HMO\'s', 46, 34, 0, 'instock', '', 100, '', '', 0, 'blue-jay-industrial-back-support-w-suspenders-black-1', '', 'Complete Medical', '', '', '26fff37d216f50d33f5be11bc46240c3.jpg', '', '2019-02-25 10:50:47', '1', '', '', '', '', '0', '', '1', '', 'Black', '', '', '', '0', '00', 1, '0', '0', '', '', 0, 1),
