(40, 'Lumbar Support Male Sportaid', 139, 'LIFELINE MEDICAL SUPPLY', 10, 'HCPCS', 'ICD10', 0, '<p>Heavy-duty support</p>\r\n\r\n<p>* fabric covered polyester felt back panel and elastic front panels</p>\r\n\r\n<p>* four pre-shaped removeable back stays</p>\r\n\r\n<p>* wide cotton web straps provide extra compression and are adjustable with hook and loop closure</p>\r\n\r\n<p>* Shipping Carton Size: 16&quot;L x 12&quot;W x 4&quot;H</p>\r\n', 'This is a heavy-duty support brace', 65, 55, 0, 'instock', '', 100, '', '', 0, 'lumbar-support-male-sportaid', '', 'Complete Medical', '', '', '980b1e1e8f097c5d19190adbc9c510d1.jpg', '', '2019-02-25 10:57:58', '1', 'SA1127MXL', '', '', '', '0', '', '1', '', 'white', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(41, 'Lumbo Support 14', 139, 'LIFELINE MEDICAL SUPPLY', 10, '', '', 0, '<p>Elastic front panels close with hook and loop</p>\r\n\r\n<p>* Four removable rigid steel or aluminum stays</p>\r\n\r\n<p>* Straps provide support to both abdomen and lumbosacral area</p>\r\n\r\n<p>* Specify size (hip circumference): SM 24&quot;-30&quot;; MD 30&quot;-36&quot;; LG 36&quot;-42&quot;; XL 42&quot;-48&quot; * Large 36&quot;-42</p>\r\n', 'This brace strap provide support to both abdomen and lumbosacral area', 80, 65, 0, 'instock', '', 100, '', '', 0, 'lumbo-support-14-1', '', 'Complete Medical', '', '', 'ac4543305b19672fe9d4338a2de30c43.jpg', '', '2019-02-25 11:03:31', '1', '001', '', '', '', '0', '', '0', '', 'white', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(42, 'Swede-O Ankle Lok W/ Stabilizers', 139, 'LIFELINE MEDICAL SUPPLY', 11, 'HCPCS', 'ICD10', 0, '<p>&nbsp;MEN 3-5.5 WOMEN 4-6.5</p>\r\n\r\n<p>* Exclusive patented offset panel - traps the laces between the inner and outer flap to hold the laces tighter longer than any other brace</p>\r\n\r\n<p>* Patented, close-spaced eyelets</p>\r\n\r\n<p>* Knitted tongue reduces bulk</p>\r\n\r\n<p>* Full elastic back - ensures complete unrestricted blood flow to the Achilles tendon and virtually eliminates the chance of blistering</p>\r\n\r\n<p>* Internal U-shaped spiral stays</p>\r\n\r\n<p>* Side stabilizer inserts provides additional medial and lateral support</p>\r\n\r\n<p>* Short, curved, heat sealed arch</p>\r\n\r\n<p>* Triple layer vinyl laminate</p>\r\n\r\n<p>* 1 year warranty&nbsp;</p>\r\n', 'This brace is with a full elastic back - It ensures complete unrestricted blood flow to the Achilles tendon and virtually eliminates the chance of blistering', 40, 35, 0, 'instock', '', 100, '', '', 0, 'swede-o-ankle-lok-w-stabilizers-1', '', 'Complete Medical', '', '', 'e017c4c645bdafcf6f6ba15870453229.jpg', '', '2019-02-25 11:14:54', '1', '01211R', '', '', '', '0', '', '1', '', 'white', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(43, 'Easy Lok Ankle Brace. White Woven Tongue w/ Stabilizers', 139, 'LIFELINE MEDICAL SUPPLY', 11, '', '', 0, '<p>Swede-O</p>\r\n\r\n<p>* Fits men&#39;s 6-7? and women&#39;s 7-9?</p>\r\n\r\n<p>* Ideal for arthritic patients and others who have difficulty applying a lace-up style brace</p>\r\n\r\n<p>* Exclusive ANKLE LOK offset panel provides greater leverage so the hook and loop closure straps can be pulled tighter and will stay tighter longer</p>\r\n\r\n<p>* Heavy-duty triple vinyl laminate construction provides superior ankle support and durability</p>\r\n\r\n<p>* Includes semi-rigid side stabilizer inserts for additional ankle support</p>\r\n\r\n<p>* Foam padded interior for greater comfort</p>\r\n\r\n<p>* Breathable tongue wicks away moisture to keep the ankle cool and dry</p>\r\n\r\n<p>* Made in the USA with uncompromising quality standards</p>\r\n', 'This brace is deal for arthritic patients and others who have difficulty applying a lace-up style brace', 44, 38, 0, 'instock', '', 100, '', '', 0, 'easy-lok-ankle-brace-white-woven-tongue-w-stabilizers', '', 'Complete Medical', '', '', '7eb8aa55554405986af0d08552c17291.jpg', '', '2019-02-25 15:08:11', '1', '01412', '', '', '', '0', '', '0', '', 'white', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(44, 'Aircast Air-Stirrup Brace', 139, 'LIFELINE MEDICAL SUPPLY', 11, '', '', 0, '<p>&nbsp;Air-Stirrup ankle brace for use with sprains, fractures and chronic instability</p>\r\n\r\n<p>* Resists inversion without affecting flexion</p>\r\n\r\n<p>* Anatomically contoured to conform to the ankle with minimum bulk</p>\r\n\r\n<p>* Comfort and security encourage early reform to function&nbsp;</p>\r\n', 'Stabilize weak ankle', 60, 45, 0, 'instock', '', 100, '', '', 0, 'aircast-air-stirrup-brace', '', 'Complete Medical', '', '', '067a23d296a025bf208e773cd9963061.jpg', 'ed06084ad1a830934b119d32e774ca91.jpg', '2019-02-25 15:13:14', '1', '02AL', '', '', '', '0', '', '0', '', 'white', '', '', '', '2861.mp4', '0', 1, '0', '0', '', '', 0, 1),
(45, 'Air Stirrup, Universal', 139, 'LIFELINE MEDICAL SUPPLY', 11, '', '', 0, '<p>Patented Duplex aircell system to enhance circulation and reduce swelling</p>\r\n\r\n<p>* Universal semi-rigid shells prevent further injury while allowing normal ambulation</p>\r\n\r\n<p>* Pre-Inflated aircell and adjustable heel pad for easy fit</p>\r\n\r\n<p>* Indications: Ankle sprain &amp; chronic ankle instability *</p>\r\n', 'Covered By Medicare, Medicaid And Most HMO\'s', 52, 38, 0, 'instock', '', 100, '', '', 0, 'air-stirrup-universal', '', 'Complete Medical', '', '', 'e6f105702b3499907ddb9c111e153557.jpg', '', '2019-02-25 15:18:57', '1', '02E', '', '', '', '0', '', '0', '', 'Black, white', '', '', '', '2523.mp4', '0', 1, '0', '0', '', '', 0, 1),
(46, 'AirSport Ankle Brace', 139, 'LIFELINE MEDICAL SUPPLY', 11, 'HCPCS', 'ICD10', 0, '<p>Clinically proven semi-rigid shell and aircells to provide comfort and support</p>\r\n\r\n<p>* Additional compression and stabilization is provided by anterior talofibular cross strap and intergral forefoot and shin wraps</p>\r\n\r\n<p>* The unique &quot;step-in&quot; design (toes first inserted into the back of the brace) and automatic heel adjustment make the AirSport extremely fast and easy to put on</p>\r\n\r\n<p>* Indication: Ankle sprain; Chronic instability; Prophylaxis</p>\r\n', 'It provides comfort for strain ankle', 65, 48, 0, 'instock', '', 100, '', '', 0, 'airsport-ankle-brace', '', 'Complete Medical', '', '', '8fb2d94a65b1a79e7164a79558fbad48.jpg', '', '2019-02-25 15:25:06', '1', '02MLL', '', '', '', '0', '', '0', '', 'Black', '', '', '', '0', '00', 1, '0', '0', '', '', 0, 1),
(47, 'A60 Ankle Support', 139, 'LIFELINE MEDICAL SUPPLY', 11, '', '', 0, '<p>Provides prophylactic support, protection, and comfort with simplified application</p>\r\n\r\n<p>* The design incorporates a stabilizer molded at a 60 degree angle to help guard against ankle sprains and prevent rollover</p>\r\n\r\n<p>* 60 degrees stabilizer helps prevent inversion and eversion</p>\r\n\r\n<p>* Breathable fabric provides cool and dry comfort</p>\r\n\r\n<p>* Sleek, anatomical design minimizes bulk in shoe</p>\r\n\r\n<p>* No-lace, single strap application simplifies adjustment</p>\r\n', 'This ankle brace is designed with the athlete in mind. Aircast A60 provides effective ankle support and protection, comfort, and it is simple to use. ', 65, 48, 0, 'instock', '', 100, '', '', 0, 'a60-ankle-support', '', 'Complete Medical', '', '', '53d49073176fbba35b67d24d084f77a6.jpg', '', '2019-02-25 15:29:20', '1', '02TLL', '', '', '', '0', '', '0', '', 'Black', '', '', '', '6794.mp4', '0', 1, '0', '0', '', '', 0, 1);
INSERT INTO `product` (`id`, `product_name`, `seller_id`, `seller_name`, `category`, `item_code`, `diagnosis_code`, `subcategory`, `description`, `short_description`, `price`, `sale_price`, `delivery_charge`, `stock_status`, `strip`, `stock`, `user_like`, `rating`, `sale`, `slug`, `product_code`, `product_brand`, `measurement`, `measure_unit`, `product_image`, `image_gallery`, `created_date`, `status`, `tags`, `transaction_cost`, `reviews`, `flag`, `tax`, `store_type`, `insurance`, `insurance_name`, `color`, `csv`, `size`, `weight`, `product_video`, `storeprice`, `prescription`, `rating_point`, `rating_users`, `description_space`, `link`, `isDelete`, `isActive`) VALUES
(48, 'Bell-Horn Active Ankle Brace', 139, 'LIFELINE MEDICAL SUPPLY', 11, 'L1906', 'ICD10', 0, '<p>Neoprene padding system</p>\r\n\r\n<p>* Two straps and a bilateral hinge provide unequaled ankle protection for chronic instability, or preventative use when increased activity levels are presented in rehabilitation</p>\r\n\r\n<p>* &quot;Ranked among the highest in terms of stability, comfort and ease of application&quot; - According to the Journal of the American Podiatric Medical association</p>\r\n\r\n<p>* Provides maximum ankle protection during activity</p>\r\n\r\n<p>* Low profile design allows brace to be worn inside an athletic shoe</p>\r\n\r\n<p>* Extremely lightweight and comfortable</p>\r\n\r\n<p>* Recommended for chronic ankle instability but allows the freedom of motion in plantarflexion / dorsiflexion</p>\r\n\r\n<p>* Fits Womens shoe sizes 5 - 6&nbsp;</p>\r\n', 'This brace provides maximum ankle protection during activity', 55, 40, 0, 'instock', '', 100, '', '', 0, 'bell-horn-active-ankle-brace', '', 'Complete Medical', '', '', '2510ce106da2f988e5f87f194266145d.jpg', '', '2019-02-25 15:36:13', '1', '', '', '', '', '0', '', '1', '', 'white', '', '', '', '0', '0', 1, '0', '0', '', '', 0, 1),
(49, 'Tuli\'s Cheetah Ankle Support w/Heel Cup', 139, 'LIFELINE MEDICAL SUPPLY', 11, '', '', 0, '<p>Fitted X-Small - Instep Circumference up to 7.5 inches</p>\r\n\r\n<p>* Sold as an individual unit, not as a pair</p>\r\n\r\n<p>* A dynamic combination of Tulis Heel Cups&nbsp;shock absorbing technology and the comfort and support of a lightweight neoprene ankle support</p>\r\n\r\n<p>* Barefoot feeling protection and comfort, ideal for many athletes including gymnasts and dancers, Tulis Cheetahs provide support for shin splints and tired and swollen ankles</p>\r\n\r\n<p>* Available in both a Fitted slip-on version or One Size Fits All with adjustable velcro straps</p>\r\n', 'This product is ideal for barefoot support dancers and gymnasts ankle support, shin splints, weak ankles, ankle rehab, additional heel shock and impact relief and  sever’s disease\r\n\r\n·        Tired or Swollen Ankles', 28, 20, 0, 'instock', '', 100, '', '', 0, 'tuli-s-cheetah-ankle-support-w-heel-cup', '', 'Complete Medical', '', '', '474c751054057424a0148b4c2b97bd81.jpg', '', '2019-02-25 15:40:04', '1', '1483A', '', '', '', '0', '', '0', '', 'empty', '', '', '', '6807.mp4', '0', 1, '0', '0', '', '', 0, 1),
(50, 'MalleoTrain Ankle Brace', 139, 'LIFELINE MEDICAL SUPPLY', 11, '', '', 0, '<p>The MalleoTrain ankle support reinforces the stability and strength of your ankle joint</p>\r\n\r\n<p>*With a special knit fabric that fits the natural shape of your ankle, the MalleoTrain brace delivers medical grade compression without hurting pressure points</p>\r\n\r\n<p>*It stabilizes the ankle and ligaments and improves circulation</p>\r\n\r\n<p>*Comfortable support:</p>\r\n\r\n<p>*With every movement you make, two soft pads become active, massaging the ankle joint</p>\r\n\r\n<p>*Cushioned pads support the inner and outer ankle bones to reduce swelling and provide even more stability</p>\r\n\r\n<p>*MalleoTrain supports are easy to put on, do not slip, and sit firmly and comfortably in position</p>\r\n\r\n<p>*Get back on your feet faster The MalleoTrain support helps you every step of the way, quickly allowing you to walk again without ankle pain</p>\r\n\r\n<p>*Components: Graduated compression - Compression gradually gets lighter towards the ends *Improves circulation and relieves muscle and joint soreness</p>\r\n\r\n<p>*Three-dimensional knit - Constructed to conform to the natural shape of the ankle so it fits snugly yet comfortably against your body and stimulates circulation</p>\r\n\r\n<p>*Contoured viscoelastic cushion - Soft pads behind each ankle bone helps to reduce pain and swelling</p>\r\n\r\n<p>*No rigid parts - Comfortable to wear and allows full range of motion</p>\r\n\r\n<p>*Breathable Train active knit - gentle on the skin and extremely comfortable to wear</p>\r\n\r\n<p>*Graduated compression - Compression gradually gets lighter towards the ends</p>\r\n\r\n<p>*Improves circulation and relieves muscle and joint soreness</p>\r\n\r\n<p>*Treatment of: Mild ankle sprains, Mild instabilities, Ankle arthritis, Ankle pain, Ankle swelling.</p>\r\n', 'This brace stabilizes the ankle muscles and joints for injury healing and pain relief', 110, 85, 0, 'instock', '', 100, '', '', 0, 'malleotrain-ankle-brace', '', 'Complete Medical', '', '', '189f99d3df7ca90e41ac21f5428d70c3.jpg', '', '2019-02-25 15:45:54', '1', '1580BR', '', '', '', '0', '', '0', '', '', '', '', '', '2165.mp4', '0', 1, '0', '0', '', '', 0, 1),
(51, 'MalleoTrain Ankle', 1, 'Super Admin', 11, '', '', 0, '<p>The MalleoTrain ankle support reinforces the stability and strength of your ankle joint *With a special knit fabric that fits the natural shape of your ankle, the MalleoTrain brace delivers medical grade compression without hurting pressure points *It stabilizes the ankle and ligaments and improves circulation *Comfortable support: *With every movement you make, two soft pads become active, massaging the ankle joint *Cushioned pads support the inner and outer ankle bones to reduce swelling and provide even more stability *MalleoTrain supports are easy to put on, do not slip, and sit firmly and comfortably in position *Get back on your feet faster *The MalleoTrain support helps you every step of the way, quickly allowing you to walk again without ankle pain *Components: *Graduated compression - Compression gradually gets lighter towards the ends *Improves circulation and relieves muscle and joint soreness *Three-dimensional knit - Constructed to conform to the natural shape of the ankle so it fits snugly yet comfortably against your body and stimulates circulation *Contoured viscoelastic cushion - Soft pads behind each ankle bone helps to reduce pain and swelling *No rigid parts - Comfortable to wear and allows full range of motion *Breathable Train active knit - gentle on the skin and extremely comfortable to wear *Graduated compression - Compression gradually gets lighter towards the ends *Improves circulation and relieves muscle and joint soreness *Treatment of: *Mild ankle sprains *Mild instabilities *Ankle arthritis *Ankle pain *Ankle swelling</p>\r\n', 'Recommended for Ankle discomfort', 110, 85, 0, 'instock', '', 100, '', '', 0, 'malleotrain-ankle-1', '', 'Complete Medical', '', '', '06ae29afe8d75f9c25ab99d541cd8d85.jpg', '', '2019-02-25 15:49:44', '1', '1580CL', '', '', '', '0', '', '0', '', '', '', '', '', '1973.mp4', '0', 1, '0', '0', '', '', 0, 1),
(52, 'Exoform Ankle Speed Brace', 1, 'Super Admin', 11, '', '', 0, '<p>Exoform?s advanced design provides the compression and comfort of a soft ankle brace with 35% more protection than traditional stirrups * Figure-8 heel lock strapping performs consistently, unlike taping that stretches over time * Allows for normal plantar &amp; dorsi flexion * Constructed of highly breathable, quick drying fabric * Measure ankle diagonally over the base of the heel and across the ankle bone *</p>\r\n', 'Exoform is a hybrid between a stirrup and a soft ankle brace', 40, 30, 0, 'instock', '', 100, '', '', 0, 'exoform-ankle-speed-brace', '', 'Complete Medical', '', '', '70e3b852d608fea54e647376b4c919f3.jpg', '', '2019-02-25 15:54:54', '1', '20615', '', '', '', '0', '', '0', '', 'Black', '', '', '', '0', '0', 1, '0', '0', '', '', 0, 1),
(53, 'Swede-O Ankle Lok w/ Stabilizers Black', 139, 'LIFELINE MEDICAL SUPPLY', 11, '', '', 0, '<p>*Exclusive ANKLE LOK&nbsp;offset panel traps the laces between the inner and outer flap to hold the laces tighter longer than any other brace.</p>\r\n\r\n<p>*Exclusive close spaced eyelets concentrate the holding power where it&#39;s needed most creating the most effective heel lock.</p>\r\n\r\n<p>*Full elastic back ensures complete unrestricted blood flow to the Achilles&#39; tendon and virtually eliminates the chance for blistering.</p>\r\n\r\n<p>*Internal U-shaped spiral stays provide extra support and further minimize the chance for ankle injury.</p>\r\n\r\n<p>Arch fits the contour of the foot and is seamless so it virtually eliminates irritation to the bottom of the foot.</p>\r\n\r\n<p>*Triple layer vinyl laminate provides durability and comfort.</p>\r\n\r\n<p>*Exclusive padded tongue option makes it easier to slip brace on and off.</p>\r\n\r\n<p>*Easier application and comfort for fresh sprains.</p>\r\n\r\n<p>*Optional side stabilizer inserts provide additional medial and lateral support for injured ankles</p>\r\n', 'This brace exclusive lacing system keeps the brace tighter longer than any other brace for long-lasting support', 45, 32, 0, 'instock', '', 100, '', '', 0, 'swede-o-ankle-lok-w-stabilizers-black', '', 'Complete Medical', '', '', 'f4847a281d732a42ce9a771a5724d4d8.jpg', '', '2019-02-25 15:59:06', '1', '21211R', '', '', '', '0', '', '0', '', 'Black', '', '', '', '0', '0', 1, '0', '0', '', '', 0, 1),
(54, 'MalleoTrain Ankle Support', 139, 'LIFELINE MEDICAL SUPPLY', 11, '', '', 0, '<p>Comfortable, lightweight, knitted support ideal for chronic ankle swelling and soreness, ankle sprains, ligamental weakness and slight tears</p>\r\n\r\n<p>* Incorporate silicone inserts</p>\r\n\r\n<p>* Promotes proprioception, thus heightening sensory awareness in the ankle for increased joint stabilization * Anatomical knit with graduated compression at the edges</p>\r\n\r\n<p>* Will not retain heat * Machine washable</p>\r\n', 'This brace is comfortable, lightweight, knitted support. It is ideal for chronic ankle swelling and soreness, ankle sprains, ligamental weakness and slight tears', 110, 85.49, 0, 'instock', '', 100, '', '', 0, 'malleotrain-ankle-support', '', 'Complete Medical', '', '', '845c222ea5603b971ab992633b5af7ee.jpg', '', '2019-02-25 16:04:37', '1', '2439AL', '', '', '', '0', '', '0', '', '', '', '', '', '4194.mp4', '0', 1, '0', '0', '', '', 0, 1),
(55, 'AnkleGard Universal Blue', 139, 'LIFELINE MEDICAL SUPPLY', 11, '', '', 0, '<p>Recommended for ankle sprains, can help prevent ankle injuries</p>\r\n\r\n<p>* Durable, supportive design, made of NuStimWrap, resists migration and delivers maximum adjustable compression</p>\r\n\r\n<p>* Fits securely on either ankle with attached Velcro</p>\r\n\r\n<p>* Wrap, when applied directly to the skin, will not cause blistering or irritation</p>\r\n\r\n<p>* Slim design promotes comfortable wear in most footwear</p>\r\n', 'Recommended for ankle sprains. It  can also help prevent ankle injuries', 25, 20, 0, 'instock', '', 100, '', '', 0, 'anklegard-universal-blue', '', 'Complete Medical', '', '', '19f77a75cafdc0ee2332ee0b8127023a.jpg', '', '2019-02-25 16:08:36', '1', '40001B', '', '', '', '0', '', '0', '', 'Blue', '', '', '', '0', '0', 1, '0', '0', '', '', 0, 1),
(56, '	Thermoskin Ankle Wrap', 139, 'LIFELINE MEDICAL SUPPLY', 11, 'HCPCS', 'ICD10', 0, '<p>It Is designed to assist in the rehabilitation of sprains and ligament damage to the ankle</p>\r\n\r\n<p>* Captures body heat &amp; increases blood flow</p>\r\n\r\n<p>* Allows skin to ventilate &amp; release moisture</p>\r\n\r\n<p>* Can be used for left or right foot</p>\r\n\r\n<p>* It has the additional benefit of an ankle closure strap for ease of application and increased compression where required</p>\r\n', 'This brace Is designed to assist in the rehabilitation of sprains and ligament damage to the ankle', 45, 32, 0, 'instock', '', 100, '', '', 0, '-thermoskin-ankle-wrap', '', 'Complete Medical', '', '', '11f7a4a75529227dbcb559dfac17110c.jpg', '', '2019-02-25 16:12:07', '1', '83203', '', '', '', '0', '', '1', '', '', '', '', '', '0', '0', 1, '0', '0', '', '', 0, 1),
(57, '	Ankle Brace, Canvas Lightweight', 139, 'LIFELINE MEDICAL SUPPLY', 11, 'HCPCS,L1902', 'ICD10', 0, '<p>Flexible and soft, this canvas ankle brace provides medial/lateral support to injured or weak ankles but is light enough to wear during athletic activity</p>\r\n\r\n<p>* Extra stabilization is achieved with the removable medial/lateral inserts</p>\r\n\r\n<p>* Lace-up design allows for a more precise fitting support</p>\r\n\r\n<p>* Soft canvas that contours and cradles the ankle</p>\r\n\r\n<p>* Breathable and comfortable ankle brace</p>\r\n\r\n<p>* Indications: Recommended for stabilizing the ankle joint following cast removal or when severe sprains occur</p>\r\n', 'This canvas ankle brace provides medial/lateral support to injured or weak ankles but is light enough to wear during athletic activity', 35, 28, 0, 'instock', '', 100, '', '', 0, '-ankle-brace-canvas-lightweight', '', 'Complete Medical', '', '', '8f3e77f415eed553884ef24b4ca23aa2.jpg', '', '2019-02-25 16:15:43', '1', 'BH165L', '', '', '', '0', '', '1', '', 'white', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(58, 'Elastic Ankle Support', 139, 'LIFELINE MEDICAL SUPPLY', 11, 'HCPCS,A4466', 'ICD10', 0, '<p>Elastic supports help improve stability by limiting abduction and adduction</p>\r\n\r\n<p>* With an open heel and toe, this ankle support is light enough to be worn inside of the shoe but durable enough to provide the proper compression</p>\r\n\r\n<p>* Support for weak or injured ankles</p>\r\n\r\n<p>* Comfortable elastic, durable protection</p>\r\n\r\n<p>* Fits left or right ankle</p>\r\n\r\n<p>* Recommended for mild ankle sprain, contusions, tendonitis, and ankle strain</p>\r\n', 'This ankle brace elastic supports help improve stability by limiting abduction and adduction', 15, 10, 0, 'instock', '', 100, '', '', 0, 'elastic-ankle-support', '', 'Complete Medical', '', '', 'be2e1c5d21de0672b4df0dba014ba11f.jpg', '', '2019-02-25 16:19:55', '1', 'BH189L', '', '', '', '0', '', '1', '', 'white', '', '', '', '7465.htm', '', 1, '0', '0', '', '', 0, 1),
(59, 'Stabilized Ankle Brace', 139, 'LIFELINE MEDICAL SUPPLY', 11, 'HCPCS,L1902', 'ICD10', 0, '<p>Cool and durable flannel and mesh design provides comfort</p>\r\n\r\n<p>* Non-stretch &quot;Figure 8&quot; nylon straps add support, while the heel lock helps to prevent inversion/eversion</p>\r\n\r\n<p>* Figure 8 strap offers increased stability mimicking trainer&#39;s tape</p>\r\n\r\n<p>* Low profile design allows brace to be worn inside an athletic shoe</p>\r\n\r\n<p>* Strong durable breathable material</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'Recommended for stabilizing the ankle joint following cast removal or for mild to moderate sprain', 36, 28, 0, 'instock', '', 100, '', '', 0, 'stabilized-ankle-brace', '', 'Complete Medical', '', '', '537e4151056d0e8ebe4506e7ef6b5815.jpg', '', '2019-02-25 16:23:41', '1', 'BH228L', '', '', '', '0', '', '1', '', 'Black', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(60, '	Compressive Ankle Support', 139, 'LIFELINE MEDICAL SUPPLY', 11, 'HCPCS,A4466', 'ICD10 ', 0, '<p>It is the basic elastic ankle sleeve with a twist; we have placed inside a L-shaped visco elastic insert which, when the joint is moved, provides a massaging effect and helps to improve circulation around the ankle</p>\r\n\r\n<p>* Elastic contours for a better fit</p>\r\n\r\n<p>* Helps improve circulation</p>\r\n\r\n<p>* Viscoelastic insert provides consistent compression and gently massages the ankle</p>\r\n\r\n<p>* Indicated for swollen or tender ankles</p>\r\n', 'Perfect support for injuries resulting from sports as well as sprains, strains, or for post-operative rehabilitation', 25, 18, 0, 'instock', '', 100, '', '', 0, '-compressive-ankle-support', '', 'Complete Medical', '', '', '5271016a020ed388f85e891ce204a41e.jpg', '', '2019-02-25 16:31:02', '1', 'BH229L', '', '', '', '0', '', '1', '', 'white', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(61, 'Drop Foot Brace,', 139, 'LIFELINE MEDICAL SUPPLY', 11, 'HCPCS', 'ICD10', 0, '<p>* Anatomical design compensates for atrophy and avoids calcaneus irritation</p>\r\n\r\n<p>* Designed to fit into patient&#39;s standard shoes&nbsp;</p>\r\n', 'This brace is fabricated in a predorsiflexed position to provide superior dorsiflexion assist', 40, 28, 0, 'instock', '', 100, '', '', 0, 'drop-foot-brace', '', 'Complete Medical', '', '', '521b22dfcd3ae375aa45f4f281e2cac2.jpg', '', '2019-02-25 16:38:05', '1', 'BJ180100', '', '', '', '0', '', '1', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(62, 'Blue Jay Universal Gel Ankle Support w/ Hard Exterior Shell', 139, 'LIFELINE MEDICAL SUPPLY', 11, 'HCPCS', 'ICD10', 0, '<p>&nbsp;</p>\r\n\r\n<p>* Upper air and lower gel pads provide a comfortable, contoured fit around the ankle</p>\r\n\r\n<p>* High impact shell minimizes rolling of the ankle without limiting plantar and dorsi flexion</p>\r\n\r\n<p>* Molded plastic shell is tapered for a comfortable fit in most shoes</p>\r\n\r\n<p>* Fully adjustable, movable straps can be positioned and trimmed for customized fit</p>\r\n\r\n<p>* Fits left or right ankle</p>\r\n', 'Interior gel pad provides a comfortable, contoured fit while the exterior hard shell minimizes rolling', 40, 32, 0, 'instock', '', 100, '', '', 0, 'blue-jay-universal-gel-ankle-support-w-hard-exterior-shell', '', 'Complete Medical', '', '', '570e125887563bd8d31f292866a83364.jpg', '', '2019-02-25 16:42:19', '1', 'BJ215100UN', '', '', '', '0', '', '1', '', 'Black', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(63, 'Velocity Ankle Brace', 139, 'LIFELINE MEDICAL SUPPLY', 11, '', '', 0, '<p>Provides moderate support for ankle injury prevention and treatment</p>\r\n\r\n<p>* Anatomical contour for proper fit</p>\r\n\r\n<p>* Sturdy rigid uprights with circumferential strapping to help prevent and treat high ankle sprains and inversion/eversion injuries</p>\r\n\r\n<p>* Bilateral hinges for natural, unrestricted motion</p>\r\n\r\n<p>* Heat moldable and trimable foot plate to match shoe insoles or orthotics</p>\r\n\r\n<p>* Available in left or right version *</p>\r\n', 'Recommended to help prevent high ankle sprains, abnormal inversion/eversion and protection of ankles during impact sports', 195, 150, 0, 'instock', '', 100, '', '', 0, 'velocity-ankle-brace', '', 'Complete Medical', '', '', 'd31a49f159a713a5316260070dd36dff.jpg', '', '2019-02-25 16:46:12', '1', 'DJ14902', '', '', '', '0', '', '0', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(64, 'Single Strap Ankle Support', 139, 'LIFELINE MEDICAL SUPPLY', 11, 'HCPCS', 'ICD10', 0, '<p>* Four Way Stretch Spandex</p>\r\n\r\n<p>* Slip on style with opem heel</p>\r\n\r\n<p>* &nbsp;Closes with hook and loop for proper tension adjustment</p>\r\n\r\n<p>* Wear over sock</p>\r\n', 'This is a single strap ankle support', 20, 15, 0, 'instock', '', 100, '', '', 0, 'single-strap-ankle-support', '', 'Complete Medical', '', '', '9e4c747383837ab17409424b30688702.jpg', '', '2019-02-25 16:50:02', '1', 'SA0313ML', '', '', '', '0', '', '1', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(65, 'Double Strap Ankle Support', 139, 'LIFELINE MEDICAL SUPPLY', 11, 'HCPCS', 'ICD10', 0, '<p>* 3&quot; wide segmented straps wrap in figure eight</p>\r\n\r\n<p>* Wear over sock</p>\r\n\r\n<p>* Measurement is around ankle joint * Latex Free *</p>\r\n', 'This is a double strap style ankle support that offers compression to medial and lateral side of ankle', 28, 20, 0, 'instock', '', 100, '', '', 0, 'double-strap-ankle-support', '', 'Complete Medical', '', '', '7be3dd63b6ad217bc1dc0b7d75956fa3.jpg', '', '2019-02-25 16:53:42', '1', 'SA0325XL', '', '', '', '0', '', '1', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(66, 'Universal Gel Air Ankle Stirrup Short Sportaid', 139, 'LIFELINE MEDICAL SUPPLY', 11, 'HCPCS', 'ICD10', 0, '<p>Trainer 9&quot;</p>\r\n\r\n<p>* Allows range of motion with support</p>\r\n\r\n<p>* Great retail packaging</p>\r\n\r\n<p>* Fits left or right</p>\r\n\r\n<p>* Fully adjustable, movable straps</p>\r\n\r\n<p>* Worn comfortably inside lace up shoe</p>\r\n\r\n<p>* Cleans easily with soap and water</p>\r\n\r\n<p>* White high impact, high density shell</p>\r\n\r\n<p>* Maintains fit during high level of activity</p>\r\n\r\n<p>* Latex Free&nbsp;</p>\r\n', 'This gel air provides padded comfort plus hot or cold therapy', 55, 40, 0, 'instock', '', 100, '', '', 0, 'universal-gel-air-ankle-stirrup-short-sportaid', '', 'Complete Medical', '', '', '247d0e3b523df06d778d3f5d659111cc.jpg', '', '2019-02-25 16:57:40', '1', 'SA7400SHORT', '', '', '', '0', '', '1', '', 'white', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(67, 'Neoprene Slip-On Ankle Support', 139, 'LIFELINE MEDICAL SUPPLY', 11, 'HCPCS', 'ICD10', 0, '<p>* Fits either foot and easily into shoe</p>\r\n\r\n<p>* Offers warmth, flexibility and support&nbsp;</p>\r\n', 'This ankle support offers warmth and flexibility', 20, 15, 0, 'instock', '', 100, '', '', 0, 'neoprene-slip-on-ankle-support', '', 'Complete Medical', '', '', '582410c2db89153fd039dc8de7d3ebee.jpg', '', '2019-02-25 17:01:52', '1', 'SA9090MD', '', '', '', '0', '', '1', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(68, '	Ankle Brace, Quick-Tie', 139, 'LIFELINE MEDICAL SUPPLY', 11, 'HCPCS', 'ICD10', 0, '<p>* Once the fit is set, the speed lacing tabs provide fast donning and doffing</p>\r\n\r\n<p>* Seamless bottom for extra comfort</p>\r\n\r\n<p>* Unique center wedge provides flexion and extension, while maintaining proper support&nbsp;</p>\r\n', 'Two sets of adjustable lacing not only ensure upper and lower ankle support, but also allow for the ultimate in personalized fit for every size foot', 55, 40, 0, 'instock', '', 100, '', '', 0, '-ankle-brace-quick-tie', '', 'Complete Medical', '', '', 'ace5cf95413878590f6ac9eaa54bc55a.jpg', '', '2019-02-25 17:05:06', '1', 'SCT0540', '', '', '', '0', '', '1', '', 'Black', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(69, 'Aircast Infrapatellar Knee Band', 139, 'LIFELINE MEDICAL SUPPLY', 63, 'HCPCS', 'ICD10', 0, '<p>* Focusing the pressure helps decrease stress at the tibial tubercle</p>\r\n\r\n<p>* Foam padding for added comfor</p>\r\n', 'The unique aircell focuses compression on the patellar tendon helping to relieve symptoms of Osgood Schlatter and patella tendonitis', 35, 25, 0, 'instock', '', 100, '', '', 0, 'aircast-infrapatellar-knee-band', '', 'Complete Medical Supply', '', '', '6d8b409d7e088e5e7a6ca0ea70af4b6f.jpg', '', '2019-02-26 10:22:08', '1', '08A-B', '', '', '', '0', '', '1', '', 'Black', '', '', '', '0', '', 1, '4', '1', '', '', 0, 1),
(70, '	Knee Immobilizer', 1, 'Super Admin', 63, 'HCPCS,L1830', 'ICD10', 0, '<p>12&quot; Long, Large</p>\r\n\r\n<p>* Measurement 6&quot; below knee: 15.25&quot; - 18.25&quot;</p>\r\n\r\n<p>* Measurement 6&quot; above knee: 20.5&quot; - 23.5&quot;</p>\r\n\r\n<p>* White cotton sateen laminated to 3/8&quot; thick beige foam with alternating hook and loop closures</p>\r\n\r\n<p>* One each medial and lateral stay and three contoured posterior stays are all removable</p>\r\n', 'Needed to immobolize knee', 40, 30, 0, 'instock', '', 100, '', '', 0, '-knee-immobilizer', '', 'Complete Medical', '', '', '2fd07c967ad8d3bca5a1fac5ded8403c.jpg', '', '2019-02-26 10:27:04', '1', '3112LG', '', '', '', '0', '', '1', '', 'white', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(71, '	Knee Immobilizer Deluxe', 139, 'LIFELINE MEDICAL SUPPLY', 63, 'HCPCS,L1830', 'ICD10', 0, '<p>&nbsp;White cotton sateen on 3/8&quot; thick foam, nylon tricot lined</p>\r\n\r\n<p>* One each medial and lateral stays and two contoured posterior stays are removable</p>\r\n\r\n<p>* Alternating loop-lock straps close with hook and loop</p>\r\n\r\n<p>* Two adhesive foam strips and popliteal pad included&nbsp;</p>\r\n', 'Knee immobilizer', 55, 42, 0, 'instock', '', 99, '', '', 0, '-knee-immobilizer-deluxe', '', 'Complete Medical', '', '', '156491d6bdf0e2e72e852aa3b2828d5b.jpg', '', '2019-02-26 10:32:28', '1', '3212LG', '', '', '', '0', '', '1', '', 'white', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(72, 'Universal 3-Panel Knee Immobilizer', 139, 'lifeline', 12, 'HCPCS,L1830', 'ICD10', 0, '<p>* 16&quot; Long</p>\r\n\r\n<p>* Beige unifoam on 3/8&quot; thick foam, loop-lock straps with hook and loop closure</p>\r\n\r\n<p>* Features two side panels for easy size adjustment and access to injury site</p>\r\n\r\n<p>* Measure circumference 6&quot; above and 6&quot; below the knee</p>\r\n\r\n<p>* Fits circumference: (6&quot; Above Knee): 15&quot; - 25&quot;, (6&quot; Below Knee): 12&quot; - 20&quot;</p>\r\n\r\n<p>* Three contoured posterior and one each medial and lateral stays are removable</p>\r\n', 'Covered by Medicare, Medicaid and most HMO\'s', 65, 50, 0, 'instock', '', 100, '', '', 0, 'universal-3-panel-knee-immobilizer', '', 'Complete Medical', '', '', '1f66a9566ea58fdade5a97475f27143c.jpg', '', '2019-02-26 10:36:48', '1', '3316UN', '', '', '', '0', '', '1', '', 'Beige', '', '', '', '0', '00', 1, '0', '0', '', '', 0, 1),
(73, '	Knee Immobilizer Snoopy Pediatric', 139, 'LIFELINE MEDICAL SUPPLY', 12, 'HCPCS,L1830', 'ICD10', 0, '<p>Poly cotton bound foam and lined with nylon tricot</p>\r\n\r\n<p>* One each medial and lateral stay and three contoured posterior stays are all removable</p>\r\n\r\n<p>* Hook/Loop closure</p>\r\n\r\n<p>* Fits sizes:-10&quot; to 14&quot; (Circumference 3&quot; Above Knee)-6.5&quot; to 10&quot;</p>\r\n\r\n<p>* (Circumference 3&quot; Below Knee).</p>\r\n', 'Pediatric Knee immobilizer', 60, 45, 0, 'instock', '', 100, '', '', 0, '-knee-immobilizer-snoopy-pediatric', '', 'Complete Medical', '', '', '02dbe96662d51ab993ec140cd371df0a.jpg', '', '2019-02-26 11:29:58', '1', '4702', '', '', '', '0', '', '1', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(74, 'Palumbo Patella Tracker', 139, 'LIFELINE MEDICAL SUPPLY', 12, 'HCPCS', 'ICD10', 0, '<p>* Lateral elastic insert in patella strap repositions pad according to knee&#39;s ROM.</p>\r\n\r\n<p>* Viscoelastic insert conforms and adjusts.</p>\r\n\r\n<p>* Fits left or right.</p>\r\n\r\n<p>* 18&quot;- thick neoprene.</p>\r\n\r\n<p>* Blue.</p>\r\n\r\n<p>* Circ. 3&quot; above Mid-Patella: 13-1/2&quot; to 15&quot; Circ. 3&quot; below Mid-Patella: 11-1/2&quot; to 13&quot;</p>\r\n', 'Floating lateral bracing pad maintains patellar position during flexion.', 125, 95, 0, 'instock', '', 100, '', '', 0, 'palumbo-patella-tracker', '', 'Complete Medical', '', '', '6d847d997dcf3e33ced0e84bf14dfb2a.jpg', '', '2019-02-26 12:24:20', '1', '66365', '', '', '', '0', '', '1', '', 'Blue', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(75, 'Hinged Knee Wrap Dual Pivot Brace', 139, 'LIFELINE MEDICAL SUPPLY', 63, 'HCPCS,L1810', 'ICD10', 0, '<p>&nbsp;Open wrap knee brace design offers flexible application with the option of three high quality removable hinges</p>\r\n\r\n<p>* Measure slightly bent, underneath knee cap</p>\r\n\r\n<p>&nbsp;</p>\r\n', ' Permits functional mobility while ensuring stability and support following postoperative ligament and meniscus surgery', 144, 106, 0, 'instock', '', 100, '', '', 0, 'hinged-knee-wrap-dual-pivot-brace', '', 'Complete Medical', '', '', 'd6ff392f287b2871ddb1d7ef26874c05.jpg', '', '2019-02-26 12:32:02', '1', '80277', '', '', '', '0', '', '1', '', 'Beige', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(76, 'Open Knee Wrap Stabilizer', 139, 'LIFELINE MEDICAL SUPPLY', 63, 'HCPCS', 'ICD10', 0, '<p>* Has full-length anterior opening, popliteal cut out and unrestricted knee flexion</p>\r\n\r\n<p>* Side spirals give additional support</p>\r\n\r\n<p>* Captures body heat &amp; increases blood flow</p>\r\n\r\n<p>* Allows skin to ventilate &amp; release moisture</p>\r\n\r\n<p>* Measure slightly bent underneath knee cap</p>\r\n', ' Wrap design with velcro closure and open patella means comfort for tenderness or bruising on the kneecaps', 69, 52, 0, 'instock', '', 100, '', '', 0, 'open-knee-wrap-stabilizer', '', 'Complete Medical', '', '', '2b36a6c9a367d90594e7d58d8d71027b.jpg', '', '2019-02-26 12:38:06', '1', '80284', '', '', '', '0', '', '1', '', 'Beige', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(77, 'Knee Support, Standard', 139, 'LIFELINE MEDICAL SUPPLY', 12, 'HCPCS', 'ICD10', 0, '<p>* Provides protection and support against general wear and tear including sprains, strains and twisted knees</p>\r\n\r\n<p>* Anatomically shaped in 3 pieces for more comfort and a better fit</p>\r\n\r\n<p>* Thermoskin increases elasticity of muscles, tendons and ligaments to reduce the risk of injury when under stress and strain</p>\r\n\r\n<p>* Clinically proven to increase surface skin and subcutaneous temperature between 2-3 degrees F, the optimal level to make tendons and muscles more pliable and elastic to provide optimal muscle function</p>\r\n', 'Thermal support for prevention, treatment & rehabilitation of the knee', 35, 25, 0, 'instock', '', 100, '', '', 0, 'knee-support-standard', '', 'Complete Medical', '', '', '9380d0e0d7a6444ba2bddbd622956b5f.jpg', '', '2019-02-26 12:42:24', '1', '82208', '', '', '', '0', '', '1', '', 'Beige', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(78, 'Elastic Knee Stabilizer', 139, 'LIFELINE MEDICAL SUPPLY', 12, 'HCPCS', 'ICD10', 0, '<p>* Thermoskin elastics can expand, contract and stretch and are made of a high-grade durable material that permits a full range of movement and are comfortable to wear during a range of activities</p>\r\n\r\n<p>* Anatomically designed, the elastic support will comfortably contour to the shape of your knee</p>\r\n\r\n<p>* It provides even compression and support to weakened and injured knees</p>\r\n\r\n<p>* It has side stabilizers to provide increased medial and laterial support</p>\r\n', 'Elastic Support for Prevention, Treatment & Rehabilitation of the knee', 20, 16, 0, 'instock', '', 100, '', '', 0, 'elastic-knee-stabilizer', '', 'Complete Medical', '', '', '6a1eeca48909ddf521686a67b87f9901.jpg', '', '2019-02-26 12:46:47', '1', '83646', '', '', '', '0', '', '1', '', 'Beige', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(79, 'Thermoskin Arthritic Hinged Knee Wrap', 139, 'LIFELINE MEDICAL SUPPLY', 63, 'HCPCS', 'ICD10', 0, '<p>* Hinges also help prevent hyperextension.</p>\r\n\r\n<p>* The Knee Wrap is easy to apply and adjust with two adjustable closure straps.</p>\r\n\r\n<p>* Open knee patella area is helpful if knee cap is bruised or tender.</p>\r\n\r\n<p>* Thermoskin&#39;s exclusive Trioxon lining is soft and comfortable against the skin while providing increased circulation and heat therapy.</p>\r\n\r\n<p>* Universal design means you can wear on either knee</p>\r\n', 'Thermoskin Arthritic Hinged Knee Wrap contains lightweight, high quality hinges for extra stability.', 80, 59, 0, 'instock', '', 100, '', '', 0, 'thermoskin-arthritic-hinged-knee-wrap', '', 'Complete Medical', '', '', '4cddffabb5096c192f0bc958a2fc675f.jpg', '', '2019-02-26 12:50:43', '1', '84184', '', '', '', '0', '', '1', '', 'Black', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(80, 'GenuTrain P3 Knee Support', 139, 'LIFELINE MEDICAL SUPPLY', 63, 'HCPCS', 'ICD10', 0, '<p>* Two integral pressure cushions (pads) and a corrective guide, stabilize the position of the kneecap and activate the musculature, thereby accelerating the healing process</p>\r\n\r\n<p>* Breathable knit for high wearing comfort * Together with a corrective guide, the integral, ring-shaped pad prevents any drifting, while a second, wedge-shaped pad also acts to relieve both pressure and pain</p>\r\n\r\n<p>* GenuTrain P3 exerts intermittent compression, thereby accelerating the reabsorption of edema and effusions</p>\r\n\r\n<p>* The sense of security during load-bearing is improved and muscular stabilization is achieved for the joint in addition to increased proprioception</p>\r\n\r\n<p>* Ideal for use in sports. It shortens the regeneration period and enables training to be resumed more quickly</p>\r\n\r\n<p>* Extra stretchy knit with a softer zone behind the knee, reduced pressure at the edges, breathable materials and an anatomically contoured shape</p>\r\n\r\n<p>* The skin is kept pleasantly cool and nothing digs in</p>\r\n\r\n<p>* Indications: Femoropatellar pain syndrome (chondropathy, chondromalacia), Patellar lateralization (dislocation tendency), After lateral release surgery: Osteoarthritis of the knee</p>\r\n', 'This Knee support relieves pain and swelling caused by misalignment of the kneecap (patellar lateralization), femoropatellar pain syndrome (anterior knee pain) or pain associated with patellar tip syndrome', 190, 145, 0, 'instock', '', 100, '', '', 0, 'genutrain-p3-knee-support', '', 'Complete Medical', '', '', '2f5557792a80273b2cfbba271452ab88.jpg', '', '2019-02-26 13:51:15', '1', '8515A', '', '', '', '0', '', '1', '', 'Black, Gray', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(81, 'ProStyle Knee Wrap Universal', 139, 'LIFELINE MEDICAL SUPPLY', 12, 'HCPCS,A4466', 'ICD10', 0, '<p>* Generates heat, which provides increased warmth to the knee thereby increasing circulation and decreasing pain</p>\r\n\r\n<p>* For treatment of arthritis, quad weakness, knee contusions, joint effusion, knee sprains and strains as well as meniscal tears</p>\r\n\r\n<p>* ProStyle? material adds the soothing warmth of neoprene with a soft terry-cloth lining</p>\r\n\r\n<p>* Maintains cool comfort while keeping the muscles of the knee warm and loose</p>\r\n\r\n<p>* Wrap style offers a more secure fit than sleeves</p>\r\n\r\n<p>* Knee support for the active person</p>\r\n\r\n<p>* Recommended for treatment of: arthritis, quad weakness, knee contusions, joint effusions, knee sorains and strains as well as meniscal tears</p>\r\n', 'Recommended to limit swelling and protect injured knee', 35, 25, 0, 'instock', '', 100, '', '', 0, 'prostyle-knee-wrap-universal', '', 'Complete Medical', '', '', '3c84eb300c9202a97994076df793f2ea.jpg', '', '2019-02-26 13:59:47', '1', 'BH162', '', '', '', '0', '', '1', '', 'Black', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(82, 'Elastic Knee Support', 139, 'LIFELINE MEDICAL SUPPLY', 12, 'HCPCS,L3908', 'ICD10', 0, '<p>* Made of one-way stretch elastic, this elastic knee support can also be used as a preventative support for athletes</p>\r\n\r\n<p>* Support for weak or injured knees</p>\r\n\r\n<p>* Comfortable elastic, durable protection</p>\r\n\r\n<p>* Easily applied</p>\r\n\r\n<p>* Provides support while maintaining flexibility</p>\r\n', 'Recommended for stabilization of the knee joint when ligaments or muscles have been damaged or weakened', 15, 10, 0, 'instock', '', 100, '', '', 0, 'elastic-knee-support', '', 'Complete Medical', '', '', '6614131c2c01707e562656be7b2664dc.jpg', '', '2019-02-26 14:04:03', '1', 'BH193M', '', '', '', '0', '', '1', '', 'white, Beige', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(83, 'ProStyle Knee Sleeve Closed Patella', 139, 'LIFELINE MEDICAL SUPPLY', 12, 'HCPCS', 'ICD10,A4466', 0, '<p>* Closed patella</p>\r\n\r\n<p>* Indications: Recommended for treatment of: arthritis, quad weakness, knee contusions, joint effusions, knee sprains and strains as well as meniscal tears&nbsp;</p>\r\n', 'This ProStyle Knee Sleeve provides a warming support for arthritis', 28, 17, 0, 'instock', '', 100, '', '', 0, 'prostyle-knee-sleeve-closed-patella', '', 'Complete Medical', '', '', '2d8cae9c9b61083289b16a0a3bd9dc9c.jpg', '', '2019-02-26 14:09:38', '1', 'BH203L', '', '', '', '0', '', '1', '', 'Black', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(84, '	Knee Sleeve, ProStyle Open Patella', 139, 'LIFELINE MEDICAL SUPPLY', 63, 'HCPCS,A4466', 'ICD10', 0, '<p>* Bell-Horn&#39;s exclusive ProStyle Knee Supports are designed to give you the comfort of an elastic support with the therapeutic properties of heat, without the perspiration associated with neoprene</p>\r\n\r\n<p>* Provides a warming support for arthritis</p>\r\n', 'Recommended for treatment of: arthritis, quad weakness, knee contusions, joint effusions, knee sprains and strains as well as meniscal tear', 28, 18, 0, 'instock', '', 100, '', '', 0, '-knee-sleeve-prostyle-open-patella', '', 'Complete Medical', '', '', 'd25899d53048050c45ec3b0ec24ac1f4.jpg', '', '2019-02-26 14:13:40', '1', 'BH204L', '', '', '', '0', '', '1', '', 'Black', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(85, 'Compressive Knee Support', 139, 'LIFELINE MEDICAL SUPPLY', 63, 'HCPCS , A4466', 'ICD10', 0, '<p>It is the basic elastic knee sleeve with a twist; we have placed inside a visco elastic insert which, when the joint is moved, provides a massaging effect and helps to improve circulation around the joint</p>\r\n\r\n<p>* Elastic contours for a better fit</p>\r\n\r\n<p>* Helps improve circulation</p>\r\n\r\n<p>* Viscoelastic insert provides consistent compression and gently massages the knee</p>\r\n\r\n<p>* Indicated for swollen or tender knees</p>\r\n\r\n<p>&nbsp;</p>\r\n', ' Perfect brace for injuries resulting from sports as well as sprains, strains, or for post-operative rehabilitation', 26, 15, 0, 'instock', '', 100, '', '', 0, 'compressive-knee-support', '', 'Complete Medical', '', '', 'aa6d68d38c2dd686a358f9334171d464.jpg', '', '2019-02-26 14:18:04', '1', 'BH230L', '', '', '', '0', '', '1', '', 'white', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(86, 'Hinged Patella Knee Wrap', 139, 'LIFELINE MEDICAL SUPPLY', 12, 'HCPCS', 'ICD10', 0, '<p>Designed to give you the comfort of an elastic support with the therapeutic properties of heat, without the perspiration associated with neoprene</p>\r\n\r\n<p>* Ideal for knee sprain or strain</p>\r\n\r\n<p>* Wrap design allows for an easy fit</p>\r\n\r\n<p>* ProStyle retains heat to help keep muscle loose</p>\r\n\r\n<p>* Offers treatment for ACL, LCL, MCL, PCL sprains</p>\r\n\r\n<p>* Offers treatment for Osgood-Schlatter Disease as well as patellar instability * 19&quot; - 23&quot;</p>\r\n', ' Recommended for swollen or tender knees resulting from: sprains, strains, sports injuries or post-operative rehabs', 45, 35, 0, 'instock', '', 100, '', '', 0, 'hinged-patella-knee-wrap', '', 'Complete Medical', '', '', '8a9c030ffe16f41bd77e9c3c52a1ff71.jpg', '', '2019-02-26 14:22:33', '1', 'BH2372X3X', '', '', '', '0', '', '1', '', 'Black', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(87, 'Hinged Knee Wrap, ProStyle EZ Fit', 139, 'LIFELINE MEDICAL SUPPLY', 63, 'HCPCS,L1810', 'ICD10', 0, '<p>Bell Horn&#39;s exclusive ProStyle Knee Wraps are designed to give you the comfort of an elastic support with the therapeutic properties of heat, without the perspiration associated with neoprene</p>\r\n\r\n<p>* These supports are ideal for knee sprain or strain</p>\r\n\r\n<p>* Wrap design allows for an easy fit</p>\r\n\r\n<p>* ProStyle retains heat to help keep muscle loose</p>\r\n\r\n<p>* Offers treatment for ACL, LCL, MCL, PCL sprains</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'Recommended for swollen or tender knees resulting from: sprains, strains, sports injuries or post-operative rehab. Offers treatment for Osgood-Schlatter Disease as well as patellar instability', 50, 38, 0, 'instock', '', 100, '', '', 0, 'hinged-knee-wrap-prostyle-ez-fit', '', 'Complete Medical', '', '', 'f00bf42e53cd68b321e897a1258916eb.jpg', '', '2019-02-26 14:26:08', '1', 'BH352S', '', '', '', '0', '', '1', '', 'Black', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(88, 'Elastic Knee Support For Stability', 139, 'LIFELINE MEDICAL SUPPLY', 63, 'HCPCS, L1825', 'ICD10', 0, '<p>* Improve knee stability, pain and swelling</p>\r\n\r\n<p>* Use when pain and/or swelling of the knee is present</p>\r\n', 'This one way stretch elastic knee support is designed to offer basic stabilization of the knee joint and support weakened muscles', 15, 10, 0, 'instock', '', 100, '', '', 0, 'elastic-knee-support-for-stability', '', 'Complete Medical', '', '', '8edd15fa9af8c13aaf3a2d82a7395c11.jpg', '', '2019-02-26 14:29:22', '1', 'BH99300M', '', '', '', '0', '', '1', '', 'Black', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(89, 'Knee Wrap Black Universal Open Patella', 139, 'LIFELINE MEDICAL SUPPLY', 63, 'HCPCS,L1825', 'ICD10', 0, '<p>* Designed to provide the maximum support in a wrap of this style, we have incorporated a three-strap closure to this Knee Wrap to ensure the popliteal is as equally supported as the patella</p>\r\n\r\n<p>* A great solution for additonal support for injured and weak knee</p>\r\n', 'Can be used to help Arthritis, quad weakness, knee contusions, joint effusion, knee sprains and strains as well as meniscal tears', 22, 15, 0, 'instock', '', 100, '', '', 0, 'knee-wrap-black-universal-open-patella', '', 'Complete Medical', '', '', '2f288936ed874b054c6a11206e43397e.jpg', '', '2019-02-26 14:32:20', '1', 'BH99320', '', '', '', '0', '', '1', '', 'Black', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(90, '	Extension Stop Hinged Knee Brace ', 139, 'LIFELINE MEDICAL SUPPLY', 63, 'HCPCS', 'ICD10', 0, '<p>* Geared precision hinge</p>\r\n\r\n<p>* A&nbsp;quick and easy scrrew adjustment allows the user to set the extension stop at 0,15, 0r 30 degrees</p>\r\n\r\n<p>* Patella stabilization is controled by hook and loop fasteners which can be repositioned for comfort</p>\r\n\r\n<p>* Elastic straps allow for customization</p>\r\n\r\n<p>* Measurement circumference around center of knee joint with leg extended and relaxed</p>\r\n', 'Recommended for Patella stabilization', 55, 45, 0, 'instock', '', 100, '', '', 0, '-extension-stop-hinged-knee-brace', '', 'Complete Medical', '', '', '67175f44745d596e3dcff17ff65dde57.jpg', '', '2019-02-26 14:36:23', '1', 'JJ47033', '', '', '', '0', '', '1', '', 'Black', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(91, 'Knee Support with Viscoelastic', 139, 'LIFELINE MEDICAL SUPPLY', 63, 'HCPCS', 'ICD10', 0, '<p>* Two-way stretch Spandex&nbsp;</p>\r\n\r\n<p>* Features lateral and medial spiral stays</p>\r\n\r\n<p>* Measurement is around knee cap&nbsp;</p>\r\n', 'This a lightweight compressive support', 40, 30, 0, 'instock', '', 100, '', '', 0, 'knee-support-with-viscoelastic', '', 'Complete Medical', '', '', 'b81683d330900dbdd483e9184514b69f.jpg', '', '2019-02-26 14:40:12', '1', 'SA3627SM', '', '', '', '0', '', '1', '', 'Beige', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(92, '	Knee Sleeve Neoprene Open Patella', 139, 'LIFELINE MEDICAL SUPPLY', 12, 'HCPCS', 'ICD10', 0, '<p>&nbsp;* Two-way stretch Spandex&nbsp;</p>\r\n\r\n<p>* Features lateral and medial spiral stays</p>\r\n\r\n<p>* Measurement is around knee cap&nbsp;</p>\r\n', 'This is a  lightweight compressive support', 24, 16, 0, 'instock', '', 100, '', '', 0, '-knee-sleeve-neoprene-open-patella', '', 'Complete Medical', '', '', 'e978421ee27ce37f6ae18d35e87bf753.jpg', '', '2019-02-26 14:44:07', '1', 'SA9050LG', '', '', '', '0', '', '1', '', 'Blue', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(93, 'Neoprene Open Patella Hinged Knee Brace', 139, 'lifeline', 12, 'HCPCS', 'ICD10', 0, '<p>Excellent Retail Packaging!</p>\r\n\r\n<p>* Two each medial and lateral spiral stays</p>\r\n\r\n<p>* Opposing loop-lock stabilizing straps</p>\r\n\r\n<p>* Reinforced patella with adjustable buttress pad</p>\r\n\r\n<p>* Measurement is aorund kneecap</p>\r\n\r\n<p>* Latex Free</p>\r\n', 'Covered by Medicare, Medicaid and most HMO\'s', 76, 55, 0, 'instock', '', 100, '', '', 0, 'neoprene-open-patella-hinged-knee-brace', '', 'Complete Medical', '', '', 'd7ad080b9976d5d24ed244feb01d87e1.jpg', '', '2019-02-26 14:47:19', '1', 'SA9063LG', '', '', '', '0', '', '1', '', 'Blue', '', '', '', '0', '00', 1, '0', '0', '', '', 0, 1),
(94, 'Knee Wrap Black Neoprene Sportaid', 139, 'LIFELINE MEDICAL SUPPLY', 12, 'HCPCS', 'ICD10', 0, '<p>* Easy application</p>\r\n\r\n<p>* Excellent adjustability</p>\r\n\r\n<p>* Measurement is around kneecap</p>\r\n\r\n<p>* Latex Free</p>\r\n\r\n<p>* Comes with 1 adjustable velcro strap on top portion (above kneecap)&nbsp;</p>\r\n', 'This black neoprene provides warmth, flexibility and support', 28, 20, 0, 'instock', '', 100, '', '', 0, 'knee-wrap-black-neoprene-sportaid-1', '', 'Complete Medical', '', '', '95bc83516c75da37ff0c455ca582101a.jpg', '', '2019-02-26 14:50:58', '1', 'SA9086LG', '', '', '', '0', '', '1', '', 'Black', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(95, 'Universal Knee Wrap Sportaid', 139, 'LIFELINE MEDICAL SUPPLY', 63, 'HCPCS ', 'ICD10', 0, '<p>UNIVERSAL</p>\r\n\r\n<p>* Excellent Retail Packaging!</p>\r\n\r\n<p>* Wrap around knee with reinforced patella for additional support</p>\r\n\r\n<p>* Hook receptive pile</p>\r\n\r\n<p>* Fits either knee</p>\r\n\r\n<p>* Measurement is universal</p>\r\n\r\n<p>* Latex Free</p>\r\n\r\n<p>* Comes with 2 adjustable velcro straps</p>\r\n\r\n<p>* Maximum thigh circumference: 24&quot;&nbsp;</p>\r\n', 'This  black neoprene provide warmth, comfort, and support', 60, 45, 0, 'instock', '', 100, '', '', 0, 'universal-knee-wrap-sportaid', '', 'Complete Medical', '', '', '8e433decf521d1e4715f4f2916f6e4c9.jpg', '', '2019-02-26 14:53:47', '1', 'SA9177UN', '', '', '', '0', '', '1', '', 'Green', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(96, 'J-Brace Patellar Stabilizer ', 139, 'LIFELINE MEDICAL SUPPLY', 12, '', '', 0, '<p>The J-Brace Patellar Stabilizer is a 1/8th&quot; thick, 13&quot; long sleeve with two lateral and two medial spiral steel stays</p>\r\n\r\n<p>* It also has a tubular rubber buttress to align the patella</p>\r\n\r\n<p>* Laterally attached straps pull medially to displace force to the patella</p>\r\n\r\n<p>* The J-Brace allows compete range of motion while providing stability</p>\r\n\r\n<p>* 15&quot; - 16&quot; * Manufactured from DermaDry which combines the breathability and water-vapor transmission capabilities of open-cell sponge rubber with the durability, stretch and compression of neoprene</p>\r\n\r\n<p>* This process allows perspiration to evaporate and is further enhanced by the KwikWick treatment of the soft polyester that coats the inside and outside of the braces</p>\r\n\r\n<p>* A flame lamination process is used to secure the KwikWick treated polyester to the rubber, eliminating the need for industrial adhesives, a known cause of contact dermatitis</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'This product is  excellent treatment for patellar instabilities, subluxations and dislocations', 60, 45, 0, 'instock', '', 100, '', '', 0, 'j-brace-patellar-stabilizer-1', '', 'Complete Medical', '', '', '9a6b8f6761a7628dee7b7451809d4733.jpg', '', '2019-02-26 14:57:42', '1', 'SCT0417LL', '', '', '', '0', '', '0', '', 'Black', '', '', '', '5465.mp4', '', 1, '0', '0', '', '', 0, 1),
(97, 'Aircast Armband', 139, 'lifeline', 13, '', '', 0, '<p>BEIGE * 8&quot;-14&quot; * For tennis elbow from racquet sports, golf and repetitive industrial activity</p>\r\n\r\n<p>* A comfortable foam-filled, inelastic band focuses compression on the extensor muscle/tendon complex</p>\r\n\r\n<p>* Significantly reduces EMG compared with conventional armbands</p>\r\n\r\n<p>* Effective with 86% of patients - according to a clinical study</p>\r\n\r\n<p>* One size fits most adults *</p>\r\n', 'Golf-Tennis Players Elbow Support', 25, 15, 0, 'instock', '', 100, '', '', 0, 'aircast-armband', '', 'Complete Medical', '', '', '4bf644840f4e056f9994aa7c49924467.jpg', '', '2019-02-26 15:04:59', '1', '005', '', '', '', '0', '', '0', '', 'Black, Beige', '', '', '', '0', '00', 1, '0', '0', '', '', 0, 1),
(98, '	EpiTrain Elbow Support', 139, 'LIFELINE MEDICAL SUPPLY', 13, 'NA', 'NA', 0, '<p>Comfortable, lightweight, breathable knitted elbow support incorporating two anatomically contoured silicone inserts surrounding the epicondyles and lying over the flexor and extensor muscles</p>\r\n\r\n<p>* Graduated compression at the edges prevents constriction of circulation and rolling</p>\r\n\r\n<p>* Does not retain heat - machine washable</p>\r\n\r\n<p>* Sizing: With arm slightly bent, loosely measure the circumference of the arm 4.75&quot; below the lateral epicondyle</p>\r\n', 'Ideal for epicondylitis, elbow strains or sprains, overuse syndromes, and pre- and post-operative conditions, chronic edema', 110, 85, 0, 'instock', '', 100, '', '', 0, '-epitrain-elbow-support', '', 'Complete Medical', '', '', 'a1bd20e4c3d69e460cd9b1f834b92ce1.jpg', '', '2019-02-26 15:10:08', '1', '3652100', '', '', '', '0', '', '1', '', 'Black, Gray', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(99, 'Thermoskin Hinged Elbow Support', 139, 'LIFELINE MEDICAL SUPPLY', 13, 'NA', 'NA', 0, '<p>* X-cross hook &amp; loop locking straps help restrict range of motion</p>\r\n\r\n<p>* Medial and lateral hinges provide a hyperextension stop at 0&nbsp;</p>\r\n\r\n<p>* Measure around elbow joint with arm extended</p>\r\n\r\n<p>* Small 9-10</p>\r\n', 'Hinged Elbow is designed to prevent hyperextension of the elbow', 95, 70, 0, 'instock', '', 100, '', '', 0, 'thermoskin-hinged-elbow-support', '', 'Complete Medical', '', '', '2f0dadd81ff7dd24a27267c70aebe516.jpg', '', '2019-02-26 15:16:48', '1', '83137', '', '', '', '0', '', '1', '', 'Black, Beige', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(100, 'Elastic Elbow Support', 1, 'Super Admin', 13, 'HCPCS,A4466', 'ICD10', 0, '<p>This elbow support is elastic and effective</p>\r\n', 'Elastic elbow support', 15, 10, 0, 'instock', '', 100, '', '', 0, 'elastic-elbow-support', '', 'Complete Medical', '', '', 'c9aeabe741ec104ba3d82ac7383f4cb2.jpg', '', '2019-02-26 15:20:36', '1', 'BH195M', '', '', '', '0', '', '1', '', 'Beige', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1);
