(101, 'Tennis Elbow Sleeve, ProStyle ', 1, 'Super Admin', 13, 'HCPCS,A4466', 'ICD10', 0, '<p>&nbsp;* A tapered fit and loop lock compression strap assures that the correct amount of compression is applied to the elbow</p>\r\n\r\n<p>* Helps improve circulation</p>\r\n\r\n<p>* Provides support and relief to elbow joints, muscles and tendons</p>\r\n\r\n<p>* ProStyle support offers a terry-lined &quot;all weather&quot; neoprene for maximum comfort</p>\r\n\r\n<p>* Elbow sleeve with strap helps provide temporary relief of pain due to tendonitis or tennis elbow</p>\r\n', 'Elbow Sleeve offers compressive support for joints, muscles, and ligaments', 25, 17, 0, 'instock', '', 100, '', '', 0, 'tennis-elbow-sleeve-prostyle', '', 'Complete Medical', '', '', '56a63060f51ab4f19f91ff49fc2bfc25.jpg', '', '2019-02-26 15:23:49', '1', 'BH305S', '', '', '', '0', '', '1', '', 'Black', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(102, 'Protection Elbow Pad', 139, 'LIFELINE MEDICAL SUPPLY', 13, '', '', 0, '<p>* ProStyle PROtection Elbow Sleeve with pad offers compressive support for joints, muscles, and ligaments</p>\r\n\r\n<p>* Features Include: Impact resistant foam pad, Contoured, streamlined for a better fit, Lightweight protection</p>\r\n\r\n<p>* Indications: Recommended treatment of mild sprains and strains</p>\r\n\r\n<p>* Protection of sudden impact related with sports activities</p>\r\n', 'Helps reduce pressure on injured or sensitive elbows', 22, 16, 0, 'instock', '', 100, '', '', 0, 'protection-elbow-pad', '', 'Complete Medical', '', '', '0ce34589a51e2e90efc412a2f690ea16.jpg', '', '2019-02-26 15:26:56', '1', 'BH330L', '', '', '', '0', '', '0', '', 'Black', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(103, 'Elbow Support Large Slip-On Sportaid', 139, 'LIFELINE MEDICAL SUPPLY', 13, '', '', 0, '<p>* Knitted elastic support *</p>\r\n\r\n<p>* Elastic with varying tensions for proper fit</p>\r\n\r\n<p>* Latex Free&nbsp;</p>\r\n', 'Golf-Tennis Elbow Support Provides intermediate compression', 15, 11, 0, 'instock', '', 100, '', '', 0, 'elbow-support-large-slip-on-sportaid', '', 'Complete Medical', '', '', '8a6fc33fabc637d8221abb51fd135561.jpg', '', '2019-02-26 15:29:54', '1', 'SA1953LG', '', '', '', '0', '', '0', '', 'Beige', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(104, 'Shoulder Immobilizer', 139, 'LIFELINE MEDICAL SUPPLY', 14, 'HCPCS,A4565', 'ICD10', 0, '<p>&nbsp;* It has a wide elastic chest band with web straps</p>\r\n\r\n<p>* One humorous cuff, one forearm cuff with hook and loop closure</p>\r\n\r\n<p>* Female support is contoured in front for proper anatomical fit</p>\r\n\r\n<p>* Fits left or right arm</p>\r\n', 'Recommended for immobilizing shoulder', 28, 20, 0, 'instock', '', 100, '', '', 0, 'shoulder-immobilizer-1', '', 'Complete Medical', '', '', '90ca8ada17caebff67a2dc6b935edfcf.jpg', '', '2019-02-26 15:36:44', '1', '2500FLG', '', '', '', '0', '', '1', '', 'white', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(105, 'Thermoskin Sports Shoulder Univ. Fit', 139, 'LIFELINE MEDICAL SUPPLY', 14, '', '', 0, '<p>* Not to be used for dislocations or bracing</p>\r\n\r\n<p>* Universal design fits either or right or left shoulder&nbsp;</p>\r\n', 'Provides protection, heat and support for the shoulder and keeps it warm and loose while playing sports', 110, 80, 0, 'instock', '', 100, '', '', 0, 'thermoskin-sports-shoulder-univ-fit', '', 'Complete Medical', '', '', '64a68823de46400edbf972813a7eead9.jpg', '', '2019-02-26 15:40:04', '1', '83230', '', '', '', '0', '', '0', '', 'Beige', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(106, 'OmoTrain Shoulder Support', 139, 'LIFELINE MEDICAL SUPPLY', 14, '', '', 0, '<p>* Adjustable, anatomically contoured silicone insert lies on the shoulder provides intermittent compression of the soft tissue, leading to increased circulation and decreased pain, swelling and subluxation</p>\r\n\r\n<p>* Anatomical knit with graduated compression at the edges prevents constriction of circulation</p>\r\n\r\n<p>* Lightweight, breathable knit will not retain heat and sweat * Ideal for shoulder pain, rotator cuff rehab, shoulder subluxation, post surgery, osteoarthritis, and hemiparesis</p>\r\n\r\n<p>* Universal - Can be used on either the Right or Left Shoulder</p>\r\n\r\n<p>* Machine washable</p>\r\n\r\n<p>* Size is determined by loose circumference of the biceps, while arm is hanging loose</p>\r\n', 'Uniquely designed, knitted shoulder support guides and centers the glenohumeral joint promoting mobility but inhibiting rotation for proper therapy helping to keep the arm in the socket', 190, 155, 0, 'instock', '', 100, '', '', 0, 'omotrain-shoulder-support', '', 'Complete Medical', '', '', '7500cd5a9d19201f6732722c461ec34b.jpg', '', '2019-02-26 15:44:10', '1', '8511A', '', '', '', '0', '', '0', '', 'white', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(107, 'Blue Jay Universal Arm Sling with Shoulder Comfort Pad-Blue', 139, 'LIFELINE MEDICAL SUPPLY', 14, '', '', 0, '<p>* Durable cotton blend for lasting wear</p>\r\n\r\n<p>* Slide buckle for adjustable strap length</p>\r\n\r\n<p>* Neoprene shoulder pad for comfort</p>\r\n\r\n<p>* Size: 18&quot; x 9&quot; pouch fits most</p>\r\n', 'It provides comfort and support', 15, 8, 0, 'instock', '', 100, '', '', 0, 'blue-jay-universal-arm-sling-with-shoulder-comfort-pad-blue', '', 'Complete Medical', '', '', '33843a3de4708b53710da4b69215a7cd.jpg', '', '2019-02-26 15:46:32', '1', 'BJ215400UN', '', '', '', '0', '', '0', '', 'white, Blue', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(108, 'Form Fit Shoulder Brace with Abduction', 139, 'LIFELINE MEDICAL SUPPLY', 14, '', '', 0, '<p>* With its streamlined fit, sporty look and breathability it offers excellent comfort and ease of use</p>\r\n\r\n<p>* Same as its predecessor, the SmartSling, the Form Fit Shoulder Brace also provides abduction of the shoulder (when the abduction pillow is attached), or external rotation of the shoulder (when the external rotation pillow is attached)</p>\r\n\r\n<p>* Optional axilla pillow (#SSAXP) helps distribute weight over a larger surface area and decreases pressure on the ulnar nerve</p>\r\n', 'The Form Fit Shoulder Brace is designed to provide immobilization following shoulder injury/surgery', 160, 110, 0, 'instock', '', 100, '', '', 0, 'form-fit-shoulder-brace-with-abduction', '', 'Complete Medical', '', '', 'd849564bd4dc698589124492d8e188da.jpg', '', '2019-02-27 08:22:16', '1', 'SSL', '', '', '', '0', '', '0', '', 'Black', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(109, 'Thermoskin Thigh/Hamstring', 139, 'LIFELINE MEDICAL SUPPLY', 15, '', '', 0, '<p>* Useful in treating quadricep and hamstring muscle strain</p>\r\n\r\n<p>* Captures body heat &amp; increases blood flow</p>\r\n\r\n<p>* Allows skin to ventilate &amp; release moisture</p>\r\n', 'Provides protection and support for the thigh', 45, 32, 0, 'instock', '', 100, '', '', 0, 'thermoskin-thigh-hamstring', '', 'Complete Medical', '', '', 'ebf5ced391278615183a477fdedb015a.jpg', '', '2019-02-27 08:31:11', '1', '82111', '', '', '', '0', '', '0', '', 'Black, Beige', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(110, 'Blue Jay Adj Thumb Support w/Stabilizing Stay', 139, 'LIFELINE MEDICAL SUPPLY', 16, '', '', 0, '<p>* Low profile, lined neoprene provides warmth and comfort</p>\r\n\r\n<p>* Wrist strap provides additional support, yet allows for a good grip</p>\r\n\r\n<p>* Fits left or right hand</p>\r\n', ' Stabilizing stay keeps the thumb in a neutral position', 300, 300, 0, 'instock', '', 100, '', '', 0, 'blue-jay-adj-thumb-support-w-stabilizing-stay', '', 'Complete Medical', '', '', 'e009e3ea8d1b2ef37d6f7162d3b33bd8.jpg', '', '2019-02-27 08:36:27', '1', 'BJ215481LGXL', '', '', '', '0', '', '0', '', 'Beige', '', '', '', '0', '250', 1, '0', '0', '', '', 0, 1),
(111, 'Jobst Maternity P/H Ultrasheer 8-15 mmHg', 139, 'LIFELINE MEDICAL SUPPLY', 17, '', '', 0, '<p>*Maternity Pantyhose; combining style with mild support</p>\r\n\r\n<p>*Lightweight fashionable appearance</p>\r\n\r\n<p>*Reinforced toe and sheer heel</p>\r\n\r\n<p>*Floral lace brief panty</p>\r\n\r\n<p>*Expandable tummy panel for comfort</p>\r\n\r\n<p>*Machine wash in a mesh laundry bag or hand wash with warm water using a mild soap or detergent designed for compression stockings</p>\r\n\r\n<p>*Machine dry on low heat *Latex-free, 81% nylon, 19% spandex *Small *Silky Beige *8-15 mmHg Mild Gradient Compression Indication Guide:</p>\r\n\r\n<p>*Discomfort from spider veins</p>\r\n\r\n<p>*Relief from minor leg swelling</p>\r\n\r\n<p>*Relief of tired aching legs</p>\r\n\r\n<p>*Relief of leg discomfort during pregnancy</p>\r\n\r\n<p>*Minor varicose veins</p>\r\n\r\n<p>*For wear following sclerotherapy</p>\r\n', 'Jobst Ultrasheer Supportwear 8-15 mmHg Mild Compression', 38, 28, 0, 'instock', '', 100, '', '', 0, 'jobst-maternity-p-h-ultrasheer-8-15-mmhg', '', 'Complete Medical', '', '', '5d9d837359e5ac2ef72301c734ecf921.jpg', '', '2019-02-27 09:53:09', '1', '117253', '', '', '', '0', '', '0', '', 'Beige', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(112, 'Universal Maternity Support', 139, 'LIFELINE MEDICAL SUPPLY', 17, '', '', 0, '<p>* Medical foam body applies over abdomen for optimum comfort</p>\r\n\r\n<p>* Plush elastic side panels for comfortable compression</p>\r\n\r\n<p>* Universal Sizing</p>\r\n\r\n<p>* Latex Free&nbsp;</p>\r\n', 'Adjustable to accommodate abdominal growth throughout pregnancy', 30, 21, 0, 'instock', '', 100, '', '', 0, 'universal-maternity-support', '', 'Complete Medical', '', '', '4c4165d95e3fc458bbd1c8dc7ac3a37a.jpg', '', '2019-03-01 10:33:17', '1', '2348', '', '', '', '11', '', '0', '', 'white', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(113, 'Maternity Support ', 139, 'LIFELINE MEDICAL SUPPLY', 17, '', '', 0, '<p>* Size based on pre-pregnancy dress size</p>\r\n\r\n<p>* It adds to your natural support, reducing the strain on your tissues and providing immediate relief</p>\r\n\r\n<p>* Support based on a design used by doctors and therapists for years</p>\r\n\r\n<p>* Relieves pain in the back, legs and abdomen</p>\r\n\r\n<p>* Provides gentle suppor</p>\r\n', ' Bell-Horn\'s Maternity Support lifts and supports your abdomen and transfers the weight evenly and comfortably to your spine', 50, 35, 0, 'instock', '', 100, '', '', 0, 'maternity-support-1', '', 'Complete Medical', '', '', '21ebe6169806bfe16d9dee90101b49f1.jpg', '', '2019-03-01 10:38:07', '1', 'BH319L', '', '', '', '0', '', '0', '', 'white', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(114, 'Loving Comfort Maternity Support', 139, 'LIFELINE MEDICAL SUPPLY', 17, '', '', 0, '<p>* Loving Comfort Maternity Support is made of lightweight ventilated elastic that is cool and soft to the skin</p>\r\n\r\n<p>* Fastens quickly with simple VELCRO&nbsp;brand closures</p>\r\n\r\n<p>* The Loving Comfort Maternity Support is sized according to pre-pregnancy dress size&nbsp;</p>\r\n', ' Designed to grow along with you so you can wear it right through to delivery', 45, 35, 0, 'instock', '', 100, '', '', 0, 'loving-comfort-maternity-support', '', 'Complete Medical', '', '', 'e91e96546019ef5352398edcac57f6ef.jpg', '', '2019-03-01 10:41:50', '1', 'SCT0230LG', '', '', '', '0', '', '0', '', 'white', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(115, 'Back Maternity Support', 139, 'LIFELINE MEDICAL SUPPLY', 67, 'NA', 'NA', 0, '<p>&nbsp;* Size based on pre-pregnancy dress sizes</p>\r\n\r\n<p>* Offers relief from back discomfort during pregnancy</p>\r\n\r\n<p>* 8&quot; elastic pregnancy belt supports the lower abdomen, while the duo-adjustable elastic side tension offers additional support</p>\r\n\r\n<p>* Provides temporary stabilization of the pelvis * Measurement is dress size before pregnancy:</p>\r\n\r\n<p>* Latex Free&nbsp;</p>\r\n', 'Maternity Support', 70, 55, 0, 'instock', '', 100, '', '', 0, 'back-maternity-support', '', 'Complete Medical', '', '', '4b0861aca973a14238b1763684a47260.jpg', '', '2019-03-01 10:45:15', '1', 'SCT3090RTL', '', '', '', '0', '', '0', '', '', '', '', '', '0', '00', 1, '0', '0', '', '', 0, 1),
(116, 'Abdominal Support', 139, 'LIFELINE MEDICAL SUPPLY', 18, 'HCPCS , L0625', 'ICD10', 0, '<p>* Designed for inconspicuous wear under clothing</p>\r\n\r\n<p>* For both male and female</p>\r\n\r\n<p>* Easy application</p>\r\n\r\n<p>* Recommended for use with abdominal strains as well as post surgery applications</p>\r\n', 'The common use for abdominal supports are for support when loss of muscle tone is indicated,however, with the Bell-Horn three panel design, this can also be used for post-surgical dressings', 35, 26, 0, 'instock', '', 100, '', '', 0, 'abdominal-support', '', 'Complete Medical', '', '', 'd9d41c6d98e317edc9b02eaa48dedb6c.jpg', '', '2019-03-01 11:31:43', '1', 'BH167', '', '', '', '0', '', '1', '', 'white', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(119, 'Hernia Guard', 1, 'Super Admin', 19, 'HCPCS,L8300', 'ICD10', 0, '<p>Provides comfortable, yet constant pressure to the hernia</p>\r\n\r\n<p>* Two uniquely shaped foam pads provide gradual pressure and support</p>\r\n\r\n<p>* It is woven for more durability and comfort with hook and loop for the perineal straps and offers a plush elastic waistband for better adjustability and comfort</p>\r\n\r\n<p>* Made of an elastic wraparound waistband with flexible posterior stays and soft leg straps</p>\r\n\r\n<p>* Removable hernia pads</p>\r\n\r\n<p>* For reducible inguinal hernias</p>\r\n\r\n<p>* Bell-Horn advises to use only under the supervision of your physician</p>\r\n\r\n<p>* Specific fitting instructions should also be supplied by a physician</p>\r\n', 'Covered by Medicare, Medicaid and HMO\'S', 52, 38, 0, 'instock', '', 100, '', '', 0, 'hernia-guard', '', 'Complete Medical', '', '', 'f6ed31fd583124047bc408f3eb5edeb3.jpg', '', '2019-03-02 13:14:50', '1', 'BH85220L', '', '', '', '0', '', '1', '', 'white', '', '', '', '0', '00', 1, '0', '0', '', '', 0, 1),
(120, 'Hernia Belt', 1, 'Super Admin', 19, 'HCPCS', 'ICD10', 0, '<p>* Perineal straps provide comfortable compression</p>\r\n\r\n<p>* Removable foam compression pads for gentle, gradual compression</p>\r\n\r\n<p>* Treats right, left or double hernias</p>\r\n\r\n<p>* Comfortable, lightweight nylon material</p>\r\n\r\n<p>* Latex free *</p>\r\n', 'Provides adjustable, gradual compressive support to help reduce inguinal hernias', 51, 37, 0, 'instock', '', 100, '', '', 0, 'hernia-belt', '', 'Complete Medical', '', '', 'a5cd4d8826a14cdf8cbdbcf8fe379e10.jpg', '9ee3279d94d2ed90a3c4458fb8fd36cf.jpg', '2019-03-02 13:22:47', '1', 'DJ97903', '', '', '', '0', '', '1', '', 'white, Beige', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(121, 'Universal Cervical Collar', 1, 'Super Admin', 20, '', '', 0, '<p>* Excellent retail packaging</p>\r\n\r\n<p>* 1&quot; thick medium-firm foam</p>\r\n\r\n<p>* 2 1/2&quot; Wide at chin cut-out</p>\r\n\r\n<p>* Extra stockinette sleeve included</p>\r\n\r\n<p>* Hook / loop closure</p>\r\n\r\n<p>* Fits 12&quot; - 22&quot; neck</p>\r\n\r\n<p>* Latex Free</p>\r\n', 'Sportaid', 15, 10, 0, 'instock', '', 100, '', '', 0, 'universal-cervical-collar', '', 'Complete Medical', '', '', '1f8a981c7e75c1cf21a09639148ea1f4.jpg', '', '2019-03-02 13:32:18', '1', 'SA4518UN', '', '', '', '0', '', '0', '', 'Cream', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(122, 'Air Travel Pillow', 1, 'Super Admin', 28, 'NA', 'NA', 0, '<p>Ergonomically designed travel pillow inflates in seconds and deflates for compact storage in it&#39;s own pouch</p>\r\n\r\n<p>* Adjustable closure-fits most necks</p>\r\n\r\n<p>* Dimensions (inflated): 13-1/2&quot;W x 10&quot;D x 5-1/2&quot;H&nbsp;</p>\r\n', 'Back and Neck Therapy', 15, 10, 0, 'instock', '', 100, '', '', 0, 'air-travel-pillow', '', 'Complete Medical', '', '', '0ada488b477f270eaafd89153c3525d3.jpg', '5eccf80dfc422764313495a0159be521.jpg,c16ef4edb58659579c4df31a7e3f6659.jpg', '2019-03-02 13:41:49', '1', '2055', '', '', '', '0', '', '0', '', 'Blue', '', '', '', '0', '00', 1, '0', '0', '', '', 0, 1),
(123, '	Cervical Butterfly Pillow', 1, 'Super Admin', 28, '', '', 0, '<p>* Helps ease muscles and nerve tension, relieves stiff necks, pain across the back and shoulders, and morning headaches</p>\r\n\r\n<p>* Great for side or back sleepers</p>\r\n\r\n<p>* Filled with 100% soft polyester fibers</p>\r\n\r\n<p>* Machine washable white polycotton cover</p>\r\n', 'The specially designed shape of our Butterfly Pillow gives your head and neck the support necessary for a good night sleep', 38, 25, 0, 'instock', '', 100, '', '', 0, '-cervical-butterfly-pillow', '', 'Complete Medical', '', '', '3e6c2700ed28b1fdc6e280771df3fc78.jpg', '', '2019-03-02 13:46:23', '1', '2039', '', '', '', '0', '', '0', '', 'white', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(124, 'Contoured Foam Cervical Pillow Standard w/White Cove', 1, 'Super Admin', 28, '', '', 0, '<p>* This pillow is anatomically designed to follow the natural contours of your head and neck for total sleeping comfort</p>\r\n\r\n<p>* Ideal for back or side sleeping</p>\r\n\r\n<p>* Sized to fit any standard pillow case</p>\r\n\r\n<p>* Polyurethane foam with white washable cover</p>\r\n\r\n<p>* Size: 16&quot; W x 19&quot; L x 5&quot; H</p>\r\n', 'It supports and aligns your spine as nature intended, so tense, tired muscles can relax, rest, and revive themselves', 30, 22, 0, 'instock', '', 100, '', '', 0, 'contoured-foam-cervical-pillow-standard-w-white-cove', '', 'Complete Medical', '', '', '1d41cc954b6a49dcf3f1dff8e3b55379.jpg', '', '2019-03-02 13:48:58', '1', '2040A', '', '', '', '0', '', '0', '', 'white', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(125, 'Cervical Pillow- Convoluted', 1, 'Super Admin', 28, '', '', 0, '<p>* Special wedges inserted into each edge to provide cervical support regardless of which side you use</p>\r\n\r\n<p>* 22&quot; x 19&quot;</p>\r\n\r\n<p>* Poly/cotton blend cover included</p>\r\n\r\n<p>* This pillow does NOT compare to the Wal-Pil-O</p>\r\n\r\n<p>* The Wal-Pil-O is a 4-in-1 pillow that has been clinically proven to help reduce pain</p>\r\n', 'Specially designed sleeping pillow uses convoluted foam shaped to support the neck and promote airflow', 35, 25, 0, 'instock', '', 100, '', '', 0, 'cervical-pillow-convoluted', '', 'Complete Medical', '', '', '895774110330eee3af403b1ec952322e.jpg', '', '2019-03-02 13:52:22', '1', '2040C', '', '', '', '0', '', '0', '', 'Cream', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(126, 'Cervical Roll Pillow Fiber Filled Jackson Type', 1, 'Super Admin', 28, '', '', 0, '<p>* Pillow size Size: 18&quot; x 7&quot;</p>\r\n\r\n<p>* Covered in a non-removable white poly/cotton cover</p>\r\n', 'This plush filled hypo-allergenic, high-lofted polyester fiber filled pillow maintains proper neck posture and aligns the vertebrae restoring a stress-free, normal neck contour', 18, 14, 0, 'instock', '', 100, '', '', 0, 'cervical-roll-pillow-fiber-filled-jackson-type', '', 'Complete Medical', '', '', '665e77269f1e40c7dfebf5b1fa65f1a1.jpg', '', '2019-03-02 13:55:37', '1', '2044', '', '', '', '0', '', '0', '', 'white', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(127, 'Convalescent Recliner 3-Position', 1, 'Super Admin', 21, '', '', 0, '<p>* Seat has a self-adjusting, elastic webbing suspension system that wont flatten or bottom out</p>\r\n\r\n<p>* 3 positions; upright, legrest/footrest elevated and deep recline</p>\r\n\r\n<p>* Fully enclosed side panel</p>\r\n\r\n<p>* Blow-molded tray which can be stored on the side of the chair</p>\r\n\r\n<p>* 5&quot; casters (2 fixed - 2 swivel with total lock brake)</p>\r\n\r\n<p>* Neutral color, powder-coated steel frame</p>\r\n\r\n<p>* Moisture barrier on seat board helps prevent seepage</p>\r\n\r\n<p>* 3&quot; medium density polyurethane foam in back</p>\r\n\r\n<p>* Built-in headrest</p>\r\n\r\n<p>* Seat Width: 19&quot;, Overall Width: 26&quot;</p>\r\n\r\n<p>* Weight Capacity: 275 Lbs.</p>\r\n\r\n<p>* Unit reclines by pushing down on the armpads and leaning back</p>\r\n', 'Wide armrest slopes down to give forearm correct support in recline and semi-recline position, wrap-around scuff guards', 1200, 890, 0, 'instock', '', 100, '', '', 0, 'convalescent-recliner-3-position', '', 'Complete Medical', '', '', '7b57f83ff8a029a1b17e473a8f81a659.jpg', '', '2019-03-02 14:14:03', '1', '10544', '', '', '', '0', '', '0', '', 'Black, forestgreen, Blue, Red', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(128, 'Seat Lift Chair Table Left Side', 1, 'Super Admin', 21, '', '', 0, '<p>* Tabletop swivels to allow for easy access and departure.</p>\r\n\r\n<p>* Can be used for many activities such as eating, writing, crafts, working on the computer and reading.</p>\r\n\r\n<p>* Right or left positioning with 180&nbsp;rotation accommodates seating near any wall.</p>\r\n\r\n<p>* Tabletop pivots 360&nbsp;at the touch of a hand.</p>\r\n\r\n<p>* Teak wood grain laminate finish is attractive.</p>\r\n\r\n<p>* A built-in magazine rack provides added convenience.</p>\r\n', 'Designed for use with a lift chair, standard recliner or couch.', 355, 263, 0, 'instock', '', 100, '', '', 0, 'seat-lift-chair-table-left-side', '', 'Complete Medical', '', '', 'b2745ec124c5ed9c472850584664a8c8.jpg', '', '2019-03-02 14:18:39', '1', '13085LN', '', '', '', '0', '', '0', '', 'Brown', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(129, 'Drop-Arm Convalescent Recliner w/Tray', 1, 'Super Admin', 21, 'HCPCS,E1031', 'ICD10', 0, '<p>* Left and right arms drop to aid in transfers</p>\r\n\r\n<p>* Seat has a self-adjusting, elastic webbing suspension system that wont flatten</p>\r\n\r\n<p>* Blow-molded tray is stored on side</p>\r\n\r\n<p>* 5&quot; casters (2 fixed - 2 swivel with total lock)</p>\r\n\r\n<p>* Wide armrest slopes down to give forearm correct support</p>\r\n\r\n<p>* Moisture barrier on seat</p>\r\n\r\n<p>* 3&quot; medium density polyurethane foam back</p>\r\n\r\n<p>* Built-in headrest</p>\r\n\r\n<p>* Seat Width: 19&quot;, Overall Width: 26&quot;</p>\r\n\r\n<p>* Weight Capacity: 275 Lbs</p>\r\n', '3 positions; upright, legrest/footrest elevated and deep recline plus fully enclosed side panels', 1700, 1250, 0, 'instock', '', 100, '', '', 0, 'drop-arm-convalescent-recliner-w-tray', '', 'Complete Medical', '', '', 'd27f548c2306507feb387f23c4c3fc65.jpg', '', '2019-03-02 14:25:31', '1', '527', '', '', '', '0', '', '1', '', 'Black, Sky blue, Brown', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(130, '	Lumex Three Position Recliner Jade', 1, 'Super Admin', 21, '', '', 0, '<p>The standard of the industry and the recliner that started it all</p>\r\n\r\n<p>* This first recliner specifically designed to improve the comfort and mobility of residents in extended care facilities</p>\r\n\r\n<p>* The Lumex three position recliner easily adjusts into any one of three positions: sitting, TV or full recline</p>\r\n\r\n<p>* A position lock allows only the caregiver to secure the chair in any one of the three easily attained positions</p>\r\n\r\n<p>* Recliner encourages natural relaxation and improved blood circulation</p>\r\n\r\n<p>* Flex-o-Lator seat support system increases comfort by reducing the risk of &quot;bottoming out&quot;</p>\r\n\r\n<p>* Ergonomically designed seat and back with varied density foam construction provides correct support</p>\r\n\r\n<p>* Articulating headrest quickly adjusts to maximize individual comfort requirements</p>\r\n\r\n<p>* For safer, easier transport, the Lumex three position recliner features two, four inch swivel casters with wheel locks and four inch fixed front wheels</p>\r\n\r\n<p>* The molded activity table can be fixed in position or left unsecured for easy exit from the recliner</p>\r\n\r\n<p>* Durable welded steel epoxy coated frame is easy to clean and maintain</p>\r\n\r\n<p>* Weight bearing capacity: 250 pounds</p>\r\n\r\n<p>* Warranty on frame: Limited 2 Years; Warranty on upholstery: Limited 1 Year; Warranty on all other components: Limited 1 Year</p>\r\n', 'Recliners offer numerous therapeutic benefits including position changes that can aid in circulation and ease discomfort from respiratory, heart and other ailments', 850, 600, 0, 'instock', '', 100, '', '', 0, '-lumex-three-position-recliner-jade', '', 'Complete Medical', '', '', 'e2e0038789b3d22f9910e3126f4b0664.jpg', '', '2019-03-02 14:31:39', '1', '537C', '', '', '', '0', '', '0', '', 'Black, Sky blue', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(131, 'Designer Care Cliner', 1, 'Super Admin', 21, '', '', 0, '<p>Style, comfort, value, and great features make our Premier Care Cliner unlike any other</p>\r\n\r\n<p>* Contemporary style, modern form, and comfort for your patients</p>\r\n\r\n<p>* Durable and comfortably contoured urethane arms protect the upholstered finish while providing a sleek and modern style</p>\r\n\r\n<p>* Trendelenburg positioning on back with easy access handle</p>\r\n\r\n<p>* Fold-down side tables on both sides</p>\r\n\r\n<p>* 3&quot; nylon total-lock and directional-lock casters provide ease of maneuverability</p>\r\n\r\n<p>* Seat height 20.5&quot; * Seat width 22&quot;</p>\r\n\r\n<p>* Seat depth 19.5&quot;</p>\r\n\r\n<p>* Overall height 47&quot;</p>\r\n\r\n<p>* Overall width 32&quot;</p>\r\n\r\n<p>* Weight capacity 275 lbs</p>\r\n', 'The 6700 also features LiquiCell\'\" seating that makes it more comfortable, reduces fatigue, and relieves pressure over longer periods of sitting', 2500, 1750, 0, 'instock', '', 100, '', '', 0, 'designer-care-cliner', '', 'Complete Medical', '', '', 'ddbf75f2aa06ec0402089d999a78ae16.jpg', '', '2019-03-02 14:36:44', '1', '6700', '', '', '', '0', '', '0', '', 'Brown', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(132, 'Checker Car Nebulizer Pink', 1, 'Super Admin', 22, 'HCPCS', 'ICD10', 0, '<p>* Quiet Operation</p>\r\n\r\n<p>* Electrical requirements: 115VAC/ 60HZ * Operation pressure: 16 Psi * Partical size: Less than 5 Microns</p>\r\n\r\n<p>* Flow range: Less than 12 lpm</p>\r\n\r\n<p>* 3-Year Warranty</p>\r\n\r\n<p>* No case available</p>\r\n', 'This nebulizer is  designed to appeal to children', 72, 55, 0, 'instock', '', 100, '', '', 0, 'checker-car-nebulizer-pink', '', 'Complete Medical', '', '', '628450b0d098f4c4ada3530a1abd5ca4.jpg', '84187d6fac954527d66111d7a73e7b5a.jpg,3cf1b28e6710402b87edaab064d6fe1b.jpg', '2019-03-02 15:18:04', '1', '18040P', '', '', '', '0', '', '1', '', 'Pink, Yellow', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(133, 'Power Neb Ultra Nebulizer', 1, 'Super Admin', 22, 'HCPCS,E0570,A7003,A7013', 'ICD10', 0, '<p>* One of the smallest economy neb compressors available today at only 3.2 lbs * Built in neb kit holder for hands free use</p>\r\n\r\n<p>* Comes complete with disposable neb kit</p>\r\n\r\n<p>* 5 year limited warranty</p>\r\n\r\n<p>* Specifications: Method of Nebulization Piston Compressor</p>\r\n\r\n<p>* Particle Size 0.5 m to 5 m</p>\r\n\r\n<p>* Unit Dimensions 6.3&quot; (W) x 3.0&quot; (H) x 5.3&quot; (D)</p>\r\n\r\n<p>* Weight 3.2 lbs.</p>\r\n\r\n<p>* Maximum Pressure 30 psi</p>\r\n\r\n<p>* Operating Pressure = 10 psi</p>\r\n\r\n<p>* Liter Flow = 8 lpm</p>\r\n\r\n<p>* Electrical Requirement 115 VAC 60Hz&nbsp;</p>\r\n', 'This nebulizer delivers consistent particle size of less than 5 microns and fast treatment times', 35, 25, 0, 'instock', '', 100, '', '', 0, 'power-neb-ultra-nebulizer', '', 'Complete Medical', '', '', '21eba22a3790be617ac0393f67aa49e6.jpg', '1bc6c2a962b9507280a0e721eb368b63.jpg', '2019-03-02 15:24:52', '1', '18080', '', '', '', '0', '', '1', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(134, 'Nebulizer System, Pediatric Bunny, w/1 Disp & 1 Reuse Neb', 1, 'Super Admin', 22, 'HCPCS', 'ICD10', 0, '<p>Designed to reduce anxiety during treatments, the child-friendly Bunny Nebulizer provides effective treatments with a state-of-the-art piston compressor</p>\r\n\r\n<p>* Provides smooth, quiet treatments</p>\r\n\r\n<p>* Delivers 43 psi at maximum pressure and 16 psi operating pressure (liter flow range 5 - 8 LPM) and weighs only 3.4 pounds</p>\r\n\r\n<p>* Equipped with a built-in carrying handle and a convenient nebulizer parking post</p>\r\n\r\n<p>* Comes complete with compressor, nebulizer, child mask, tubing, angled mouthpiece, five extra filters, an instruction manual, and a five year warranty</p>\r\n\r\n<p>* Power: 120 VAC/60Hz</p>\r\n\r\n<p>* Power Consumption: 1.5 amps</p>\r\n\r\n<p>* Sound Level: less than 60dBA at 1 meter</p>\r\n\r\n<p>* Maximum Compressor Pressure: 25 to 42 psi</p>\r\n\r\n<p>* Typical Operating Pressure: 8 to 13 psi</p>\r\n\r\n<p>* Typical Operating Flow Rate: 5 ~ 8 LPM</p>\r\n\r\n<p>* Medication Capacity: 5 ml</p>\r\n\r\n<p>* Particle Size: Less than 5 microns</p>\r\n\r\n<p>* Operating Temperature: 50 degrees - 104 degrees F&nbsp;</p>\r\n', 'Covered by Medicare, Medicaid and HMO\'s', 55, 38, 0, 'instock', '', 100, '', '', 0, 'nebulizer-system-pediatric-bunny-w-1-disp-1-reuse-neb', '', 'Complete Medical', '', '', 'b5514a02e498b8318ae8eeb792c74980.jpg', 'a5360e547c2e9ac060276a5c711cdd84.jpg,568ab03d0d7a60cb0eea0a5d9bf7dd30.jpg', '2019-03-02 15:30:23', '1', '4400A', '', '', '', '0', '', '1', '', 'empty', '', '', '', '0', '00', 1, '0', '0', '', '', 0, 1),
(135, 'Nebulizer System, Pediatric Dinosaur, w/1Disp & 1Reuse Neb', 1, 'Super Admin', 22, 'HCPCS', 'ICD10', 0, '<p>Designed to reduce anxiety during treatments, the child-friendly Dinosaur Nebulizer provides effective treatments with a state-of-the-art piston compressor</p>\r\n\r\n<p>* Provides smooth, quiet treatments</p>\r\n\r\n<p>* Delivers 29 psi at maximum pressure and 10 psi operating pressure (liter flow range 5 - 8 LPM) and weighs only 3.4 pounds</p>\r\n\r\n<p>* Equipped with a convenient nebulizer parking post</p>\r\n\r\n<p>* Comes complete with compressor, nebulizer, child mask, tubing, angled mouthpiece, five extra filters, an instruction manual, and a five year warranty</p>\r\n\r\n<p>* Power: 120 VAC/60Hz</p>\r\n\r\n<p>* Power Consumption: 1.5 amps</p>\r\n\r\n<p>* Sound Level: less than 60dBA at 1 meter</p>\r\n\r\n<p>* Maximum Compressor Pressure: 25 to 42 psi</p>\r\n\r\n<p>* Typical Operating Pressure: 8 to 13 psi</p>\r\n\r\n<p>* Typical Operating Flow Rate: 5 ~ 8 LPM</p>\r\n\r\n<p>* Medication Capacity: 5 ml</p>\r\n\r\n<p>* Particle Size: 5 to 10 microns</p>\r\n\r\n<p>* Operating Temperature: 50 degrees - 104 degrees F&nbsp;</p>\r\n', 'Covered by Medicare, Medicaid and HMO\'s', 55, 38, 0, 'instock', '', 100, '', '', 0, 'nebulizer-system-pediatric-dinosaur-w-1disp-1reuse-neb', '', 'Complete Medical', '', '', '426ff0e106a3bd409fd24ad572b5b52d.jpg', '4b1e25900a47a822a3284284fcc9f726.jpg,e633485cfe8b85d00e24cbb326cc44d7.jpg', '2019-03-02 15:35:13', '1', '4400B', '', '', '', '0', '', '1', '', 'empty', '', '', '', '0', '00', 1, '0', '0', '', '', 0, 1),
(136, 'Nebulizer System, Pediatric Dog, w/ 1 Disp & 1 Reuse Neb', 1, 'Super Admin', 22, 'HCPCS', 'ICD10', 0, '<p>* Provides smooth, quiet treatments</p>\r\n\r\n<p>* Delivers 43 psi at maximum pressure and 16 psi operating pressure (liter flow range 5 - 8 LPM) and weighs only 3.4 pounds</p>\r\n\r\n<p>* Equipped with a built-in carrying handle and a convenient nebulizer parking post</p>\r\n\r\n<p>* Comes complete with compressor, nebulizer, child mask, tubing, angled mouthpiece, five extra filters, and a five year warranty</p>\r\n\r\n<p>* Power: 120 VAC/60Hz</p>\r\n\r\n<p>* Power Consumption: 1.5 amps</p>\r\n\r\n<p>* Sound Level: less than 60dBA at 1 meter</p>\r\n\r\n<p>* Maximum Compressor Pressure: 29 to 43 psi</p>\r\n\r\n<p>* Typical Operating Pressure: 10 to 16 psi</p>\r\n\r\n<p>* Typical Operating Flow Rate: 5 ~ 8 LPM</p>\r\n\r\n<p>* Medication Capacity: 5 ml</p>\r\n\r\n<p>* Particle Size: Less than 5 microns</p>\r\n\r\n<p>* Operating Temperature: 50 degrees - 104 degrees F&nbsp;</p>\r\n', 'Designed to reduce anxiety during treatments, the child-friendly Dog Nebulizer provides effective treatments with a state-of-the-art piston compressor', 55, 38, 0, 'instock', '', 100, '', '', 0, 'nebulizer-system-pediatric-dog-w-1-disp-1-reuse-neb', '', 'Complete Medical', '', '', '7fcea7f83e31970e7dfb5c0e9c732aae.jpg', '551c861d91b8bf7850f95e9593aeb58e.jpg,b658cc427d2e23fcec40f796610e8625.jpg', '2019-03-02 15:39:40', '1', '4400E', '', '', '', '0', '', '1', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
