(144, 'MEDNEB Compressor Nebulizer', 1, 'Super Admin', 22, 'HCPCS,E0570,A7003,A7013', 'ICD10', 0, '<p>* Includes Airial compressor, disposable nebulizer kit, 7&#39; kink resistant tubing, mouthpiece, and extra filters</p>\r\n\r\n<p>* Piston-Driven System</p>\r\n', 'This a compact, desk-top unit nebulizer', 45, 35, 0, 'instock', '', 100, '', '', 0, 'medneb-compressor-nebulizer', '', 'Complete Medical', '', '', '52b9eeef7f8f609793874ea6c24848a1.jpg', '', '2019-03-02 16:21:18', '1', 'MQ5600', '', '', '', '0', '', '1', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
