(146, 'Blue/White Teardrop Cool Mist Humidifier', 1, 'Super Admin', 23, '', '', 0, '<p>&nbsp;* Increases air moisture for easier breathing and a good night&nbsp;sleep</p>\r\n\r\n<p>* 0.9 gallon water tank runs whisper quiet up to 24 hours</p>\r\n\r\n<p>* Mists up to 2.3 gallons of moisture per day</p>\r\n\r\n<p>* Effectively humidifies rooms up to 250 square feet</p>\r\n\r\n<p>* 360&nbsp;mist nozzle and variable control settings</p>\r\n\r\n<p>* Auto shutoff safety sensor</p>\r\n\r\n<p>* Uses less energy than a standard household light bulb</p>\r\n\r\n<p>* Does not require a filter</p>\r\n', 'Relieves cough, cold, and flu symptoms, including nasal congestion, dry cough, sinus irritation, nose bleeds, dry skin', 95, 75, 0, 'instock', '', 100, '', '', 0, 'blue-white-teardrop-cool-mist-humidifier', '', 'Complete Medical', '', '', 'c7ab3385378b03b03f1a8986f2473490.jpg', '', '2019-03-02 16:32:49', '1', '4430', '', '', '', '0', '', '0', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(147, 'Electric Breast Pump Finesse Pump, Ameda', 1, 'Super Admin', 24, 'HCPCS', 'ICD10', 0, '<p>* Features Ameda HygienKit Milk Collection System</p>\r\n\r\n<p>* Operates on three power sources, including AC adapter, AA batteries or car adapter</p>\r\n\r\n<p>* Pump weighs only one pound</p>\r\n\r\n<p>* Eight adjustable suction levels and four cycle speeds</p>\r\n\r\n<p>* Warranty: 1yr on motor / 90 days on all else&nbsp;</p>\r\n', ' It provides numerous variations to mimic babys suckling', 290, 205, 0, 'instock', '', 100, '', '', 0, 'electric-breast-pump-finesse-pump-ameda', '', 'Complete Medical', '', '', '975e0b9c48c30f5c75fb1c0c64ef9fa0.jpg', '', '2019-03-02 16:39:05', '1', '17070', '', '', '', '0', '', '1', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(148, 'Zomee Breast Pump Double', 1, 'Super Admin', 24, 'HCPCS,E0603', 'ICD10', 0, '<p>* Unit includes Zomee Double/Single Breast Pump, 12 Volt AC Power Adapter, Detachable Power Cord Prongs, 2 Zomee Bottles, 2 Zomee Backflow Protectors, 2 Zomee Tubing, 4 Flanges (2-24mm &amp; 2-28mm)</p>\r\n\r\n<p>*Rechargeable Battery ; 1hr 30mins of charging will give 2hr 30mins of portable pumping life</p>\r\n\r\n<p>* USB port for convenient charging</p>\r\n\r\n<p>* Two Phases of Pumping; massage and express</p>\r\n\r\n<p>* Breast-Express phase has 1-9 adjustable levels of low frequency with strong suction to effectively collect breast milk</p>\r\n', 'Massage phase has 1-5 adjustable levelsof high frequency with weak suction to stimulate milk production', 110, 80, 0, 'instock', '', 100, '', '', 0, 'zomee-breast-pump-double', '', 'Complete Medical', '', '', '9c73e33017149f8428651486a49726d8.jpg', '87a98dfbc52a82cf702e915e5795cbde.jpg,e7733002a649656a0683110996e5113e.jpg,4301cdaa8fa6c0cb4c9a389c3e547ab2.jpg', '2019-03-02 16:44:10', '1', '2331', '', '', '', '0', '', '1', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(149, 'SimplyGo Manual Breast Pump by EvenFlo', 1, 'Super Admin', 24, 'HCPCS', 'ICD10', 0, '<p>* Small, handheld, portable, convenient, &amp; diaper bag ready</p>\r\n\r\n<p>* Silicone insert adds cushion comfort</p>\r\n\r\n<p>* Includes: Pump unit, 5-oz collection bottle, nipple, pump stand, hood, sealing disc, 2 breast pads w/coupon, additional overflow valve, &amp; carrying case</p>\r\n\r\n<p>* 90 day warranty for manufacturer&#39;s defects</p>\r\n', 'The pump has a state of the art valve that provides consistent suction for more comfortable and efficient milk expression', 45, 34, 0, 'instock', '', 100, '', '', 0, 'simplygo-manual-breast-pump-by-evenflo', '', 'Complete Medical', '', '', '9cab56360a059ce408c9a098d3e84845.jpg', '', '2019-03-02 16:48:04', '1', '', '', '', '', '0', '', '1', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
