(151, 'Perfect 3 Talking Glucometer (Blood Glucose Meter)', 1, 'Super Admin', 26, '', '', 0, '<p>* This machine is code free</p>\r\n\r\n<p>* It uses a tiny sample size .7 microliters of blood and works quickly in 7 seconds</p>\r\n\r\n<p>* It holds 1000 results in memory</p>\r\n\r\n<p>* Includes meter (with batteries), user guide, quick reference guide, log book, warranty information &amp; carrying case</p>\r\n\r\n<p>* Does not include strips or control solution</p>\r\n', 'This is a suitable visual and hearing Impaired aid meter', 40, 30, 0, 'instock', '', 100, '', '', 0, 'perfect-3-talking-glucometer-blood-glucose-meter', '', 'Complete Medical', '', '', '47d46e2390ab9531773838f25744e856.jpg', '', '2019-03-03 11:18:54', '1', '2653', '', '', '', '0', '', '0', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(152, 'VivaGuard Ino Blood Glucose Monitoring Meter', 1, 'Super Admin', 26, 'HCPCS', 'ICD10', 0, '<p>* Wide hematocrit range</p>\r\n\r\n<p>* 900-test memory</p>\r\n\r\n<p>* 0.8 L Blood required</p>\r\n\r\n<p>* 5 seconds</p>\r\n\r\n<p>* 8 electrodes</p>\r\n\r\n<p>* 900 meter mrmory with date and time, 7, 14, and 30 day averaging</p>\r\n\r\n<p>* 5 test reminders help make testing routine</p>\r\n\r\n<p>* Ketone warning and Hypo warning reduce risks caused by extreme glucose values</p>\r\n\r\n<p>* No coding technology reduces risk of miscoding (studies have found that 1 in 6 people with diabetes (16%) miscode when using manually coded meters) increasing testing confidence and user experience</p>\r\n\r\n<p>* See #2680B for Test Strips, 2680C for Lancing Devices and 2680D for Lancets</p>\r\n', 'Easy and accurate Glucometer ', 25, 18, 0, 'instock', '', 100, '', '', 0, 'vivaguard-ino-blood-glucose-monitoring-meter', '', 'Complete Medical', '', '', '443cf7e68919201977e32a03a52a66d0.jpg', '', '2019-03-03 11:23:14', '1', '2680A', '', '', '', '0', '', '1', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(153, 'Gentle Step Diabetic Shoe', 1, 'Super Admin', 26, 'HCPCS,A5500', 'ICD10', 0, '<p>* Conforms to Medicare Therapeutic Shoe Bill</p>\r\n\r\n<p>* Approved extra-depth shoe for certain patients with diabetes</p>\r\n\r\n<p>* Upper constructed of lycra to provide comfort in patients with forefoot deformities or lesions</p>\r\n\r\n<p>* Firm heel counter to provide stability and comfortable fit</p>\r\n\r\n<p>* Extra depth concealed in the molded outsole to provide a lower profile and enhanced style</p>\r\n\r\n<p>* Machine washable</p>\r\n\r\n<p>* Toe box made of lycra material to stretch over foot deformities such as hammer toes, bunions, etc.</p>\r\n\r\n<p>* One strap loop lock provides easy closure</p>\r\n\r\n<p>* Latex free</p>\r\n', 'Covered by Medicare, Medicaid and HMO\'s', 120, 85, 0, 'instock', '', 100, '', '', 0, 'gentle-step-diabetic-shoe', '', 'Complete medical', '', '', 'accb6987956fc103d787ccdfe3e6e4ba.jpg', '', '2019-03-03 13:42:33', '1', '1441A', '', '', '', '0', '', '1', '', 'Black', '', '', '', '0', '00', 1, '0', '0', '', '', 0, 1),
