(155, 'Diabetic Socks', 1, 'Super Admin', 26, '', '', 0, '<p>* Extra wide to keep swollen feet warm at night and to protect and cover foot cream</p>\r\n\r\n<p>* 100% cotton/ machine wash/tumble dry</p>\r\n', 'Ideal for those who need special foot care', 12, 8, 0, 'instock', '', 100, '', '', 0, '-diabetic-socks-1', '', 'Complete Medical', '', '', 'e28a400cc0f265ef904533e2c3b8ffc9.jpg', '', '2019-03-03 13:55:25', '1', '2667D', '', '', '', '0', '', '0', '', 'Black', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(156, 'MedCrew Diabetic Sock', 1, 'Super Admin', 26, '', '', 0, '<p>* Holofiber increases circulation and oxygenated blood flow</p>\r\n\r\n<p>* Moisture wicking yarn helps keep feet dry</p>\r\n\r\n<p>* Machine Washable</p>\r\n\r\n<p>* Features cutting edge nanotechnology</p>\r\n\r\n<p>* Made of 50% HoloFiber Yarn, 34% Comfortrel, 13% Nylon, &amp; 3% Spandex&nbsp;</p>\r\n', 'Diabetes Care', 30, 22, 0, 'instock', '', 100, '', '', 0, 'medcrew-diabetic-sock', '', 'Complete Medical', '', '', '118eccc6afdc8ada8931470e4ab926a0.jpg', '', '2019-03-03 13:59:02', '1', '', '', '', '', '0', '', '0', '', 'white', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(157, 'Hand Sewn White Diabetic Socks', 1, 'Super Admin', 26, '', '', 0, '<p>* Hand sewn non-irritating FLAT &amp; SOFT COMFORT TOE SEAM provides amazing comfort</p>\r\n\r\n<p>* Special non-binding top stays up and promotes circulation</p>\r\n\r\n<p>* Color: White</p>\r\n\r\n<p>* Materials - 95% Cotton, 5% Spandex</p>\r\n', 'Natural cotton stretches and is perfect for people who suffer from swollen feet or circulatory problems', 12, 8, 0, 'instock', '', 100, '', '', 0, 'hand-sewn-white-diabetic-socks', '', 'Complete Medical', '', '', '3be913bec4034a285f3117669c2c62d7.jpg', '', '2019-03-03 14:03:06', '1', 'BJ250100', '', '', '', '0', '', '0', '', 'white', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1);
