(158, 'Molded Wheelchair Cushion w/Lumbar Support 18', 1, 'Super Admin', 55, 'HCPCS,E2611', 'ICD10', 0, '<p>* Conforms to provide support to the lumbar region</p>\r\n\r\n<p>* Sealed liner protects foam core from moisture</p>\r\n\r\n<p>* The stabilization board secured on back of foam core prevents hammocking in sling-back wheelchairs</p>\r\n\r\n<p>* Has a non-slip vinyl back to prevent the cushion from sliding</p>\r\n\r\n<p>* Weight Capacity: 300 lbs</p>\r\n\r\n<p>* 18 Month Limited Warranty on cover and cushion</p>\r\n\r\n<p>* Notice to California Consumers: WARNING: This product contains chemicals known to the State of California to cause cancer and birth defects or other reproductive harm&nbsp;</p>\r\n', 'Improves seating posture while providing back support and comfort', 75, 55, 0, 'instock', '', 100, '', '', 0, 'molded-wheelchair-cushion-w-lumbar-support-18-1', '', 'Complete Medical', '', '', '79caa75e3e9f864bd231225d0f9d067a.jpg', '09c0fcadf52166181c4396b8d59b97ce.jpg,4092473fbb486744804041caa74b251e.jpg,e4e6feb2c653105695a6c2e426762db0.jpg', '2019-03-03 14:11:38', '1', '11984', '', '', '', '0', '', '1', '', 'Black', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(159, 'Lumbar Cushion w/Strap', 1, 'Super Admin', 29, '', '', 0, '<p>With Strap *</p>\r\n\r\n<p>* Gives vertical &amp; lateral support</p>\r\n\r\n<p>* Size: 14&quot; x 14&quot; x 4 1/2&quot; * Corrects posture</p>\r\n\r\n<p>* Cushion has elastic strap</p>\r\n\r\n<p>* The ultimate in soothing lumbar support</p>\r\n\r\n<p>* Molded foam provides support directly to the lumbar region heping you to relax and feel instant relief</p>\r\n\r\n<p>* Features poly/cotton cover&nbsp;</p>\r\n', 'Eases stress on back muscles', 26, 20, 0, 'instock', '', 100, '', '', 0, '-lumbar-cushion-w-strap', '', 'Complete Medical', '', '', '4427a5ff71d14cc20452676d93a964d3.jpg', '', '2019-03-03 14:16:05', '1', '8596', '', '', '', '0', '', '0', '', 'Blue', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(160, 'ObusForme CustomAIR Backrest w/Lumbar Support', 1, 'Super Admin', 84, '', '', 0, '<p>* Our award winning backrest support transforms ordinary chairs into ergonomically correct seating</p>\r\n\r\n<p>* Features &amp; Benefits: Engineered shape conforms to natural spinal curvature Integrated, adjustable lumbar support adjusts vertically to provide a full range of support from the thoracic to the lumbar regions of the spine</p>\r\n\r\n<p>* Hand-held pump and valve enable customizable inflation/deflation of the lumbar support to suit personal requirements</p>\r\n\r\n<p>* Accommodates regular changes of posture, which helps alleviate stress on the lumbar region Pump, deflation valve and hose store neatly in pocket when not in use Lightweight and portable, turns any chair into an ergonomic seating system</p>\r\n\r\n<p>* Use at home, work, or in a vehicle</p>\r\n', 'The \"S\" shape of the ObusForme Backrest Support molds your spine into a more anatomically correct position and helps to enhance overall posture by supporting proper spinal alignment', 150, 98, 0, 'instock', '', 99, '', '', 0, 'obusforme-customair-backrest-w-lumbar-support', '', 'Complete Medical', '', '', '5804bee8390efec2b84ffbb3931f7521.jpg', '51bf50a29136af0ea84934e7fb5ff3d5.jpg,04007b00e002d744b3b122aae776dbf3.jpg,e5f736cb177a9b377f4615000b72a00c.jpg', '2019-03-03 14:22:26', '1', 'CLPROF01', '', '', '', '0', '', '0', '', 'Black, Blue, Red', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(161, 'Bucketseat Sitback Rest Lumbar Support', 1, 'Super Admin', 61, '', '', 0, '<p>* Specifically designed with side wings to fit snugly inside your car&#39;s bucket style seat</p>\r\n\r\n<p>* Side support wings provide maximum comfort and support while driving</p>\r\n\r\n<p>* Fits most standard bucketseats</p>\r\n\r\n<p>* Positioning belt included</p>\r\n\r\n<p>* Durable cotton blend cover</p>\r\n\r\n<p>* 13&quot;x 14&quot; (33cm x 36cm)</p>\r\n', 'Contour cut foam and side-support wings contour to your body for medium to firm support, to keep you in the correct position.  Use at home, office or in your car', 60, 45, 0, 'instock', '', 100, '', '', 0, 'bucketseat-sitback-rest-lumbar-support', '', 'Complete Medical', '', '', '4dc48bbfb3430258ce2dfdab01348ba5.jpg', '', '2019-03-03 14:30:47', '1', 'CR405BLK', '', '', '', '0', '', '0', '', 'Black, Blue, Gray', '', '', '', '0', '', 1, '2', '1', '', '', 0, 1),
(162, 'ObusformeB Ultra Premium Backrest Support ', 1, 'Super Admin', 61, '', '', 0, '<p>* Construction for ultra comfort with advanced ergonomic support for your back</p>\r\n\r\n<p>* Designed to increase comfort by aligning your spine and supporting correct posture</p>\r\n\r\n<p>* Muscles relax, leaving you more comfortable and energized</p>\r\n\r\n<p>* Features molded, impact resistant, lightweight polycarbonate frame</p>\r\n\r\n<p>* Durable polyurethane foam protects frame and provides cushy comfort</p>\r\n\r\n<p>* Hypoallergenic cover can be removed and spot washed</p>\r\n\r\n<p>* Double straps with lock buckles to secure to your seat</p>\r\n\r\n<p>* Use together with any Obusforme seat</p>\r\n\r\n<p>* Beautiful impact retail packaging</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'Unlike traditional \"L\" shaped chairs, the \"S\" shaped frame of the Obusforme molds your spine into proper anatomical alignment', 105, 70, 0, 'instock', '', 100, '', '', 0, 'obusformeb-ultra-premium-backrest-support', '', 'Complete Medical', '', '', '6c64bf63e9b30eb423007c9985befc7e.jpg', '1477b0d9581be163d99c55042be300b3.jpg,86f29c1282278614e3923a647f385cb8.jpg', '2019-03-03 14:36:57', '1', 'OFUF-MD', '', '', '', '0', '', '0', '', 'Black', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(163, 'Deep Kneading Shiatsu Cushion w/Heat', 1, 'Super Admin', 29, '', '', 0, '<p>* Deep Kneading Shiatsu Cushion with Heat</p>\r\n\r\n<p>* Traveling massage mechanism moves up and down the back for a relaxing massage</p>\r\n\r\n<p>* Soothing heat enhances your massage experience</p>\r\n\r\n<p>* 3 Massage Programs -choose Full Back or isolate massage to Upper Back or Lower Back only</p>\r\n\r\n<p>* Corded remote control, lets you customize your massage</p>\r\n\r\n<p>* Easy to use, integrated strapping system fits most chairs</p>\r\n\r\n<p>* Notice to California Consumers: WARNING: This product contains chemicals known to the State of California to cause cancer and birth defects or other reproductive harm</p>\r\n', 'A complete and full massage experience', 160, 120, 0, 'instock', '', 100, '', '', 0, 'deep-kneading-shiatsu-cushion-w-heat', '', 'Complete Medical', '', '', '43ba9363ec854a77c839f6a646d16e5b.jpg', '6f3ab3ee5f3346e00c9bdd713de34b3d.jpg,5996eb97f472770c3dc8c891dbb37ec0.jpg,fbcfebee916f95fd9392356c8fe0ac08.jpg', '2019-03-03 14:41:55', '1', 'SMSMC05', '', '', '', '0', '', '0', '', 'Black', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(164, 'Back Posture Cushion w/Strap', 1, 'Super Admin', 63, '', '', 0, '<p>* Designed to cradle your back so your left and right side is evenly supported</p>\r\n\r\n<p>* Lower back support: The micro beads are strategically located on each side of the cushion to provide firm support for your lower back area</p>\r\n\r\n<p>* Pelvic area support: The cushion&#39;s base helps position your lower back to best support your pelvic area</p>\r\n\r\n<p>* Secure the cushion: The adjustable straps helps secure the cushion onto your chair&nbsp;</p>\r\n', 'It helps to even back support', 22, 16, 0, 'instock', '', 100, '', '', 0, 'back-posture-cushion-w-strap', '', 'Complete Medical', '', '', '1087f22e9a03037e1140c2e060a1fadf.jpg', '', '2019-03-03 14:45:07', '1', 'RET7929', '', '', '', '0', '', '0', '', 'Gray', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(165, 'Suction Catheters 10 French Bx/1', 1, 'Super Admin', 30, 'HCPCS', 'ICD10', 0, '<p>10 French Bx/10</p>\r\n\r\n<p>* Sterile, straight packed suction catheters with Safe-T-Vac Valve</p>\r\n\r\n<p>* Touch-trol reverse angle valve helps minimize the chance of contact with sputum</p>\r\n\r\n<p>* Plastic glide finsih minimizes friction and facilitates secretion removal</p>\r\n', 'According to the manufacturer, these will work with most suction units.', 13, 9, 0, 'instock', '', 100, '', '', 0, 'suction-catheters-10-french-bx-1', '', 'Complete Medical', '', '', 'ddc508488b39136045dbad7254542025.jpg', '', '2019-03-03 15:48:34', '1', '137A', '', '', '', '0', '', '1', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(166, 'Suction Catheter Kits 12 Fr Bx/10', 1, 'Super Admin', 30, 'HCPCS', 'ICD10', 0, '<p>* 12 French Bx/10</p>\r\n\r\n<p>* Each kit includes: Sterile coil suction catheter with SAFE-T-VAC Valve, (2) walleted Safeskin purple nitrile latex free gloves and a pop-up solution cup in a sterile inner wrap&nbsp;</p>\r\n', 'For convenient, affordable respiratory suctioning procedures', 20, 14, 0, 'instock', '', 100, '', '', 0, 'suction-catheter-kits-12-fr-bx-10', '', 'Complete Medical', '', '', '235cf8be8d044be276d98d7b93ec67c8.jpg', '', '2019-03-03 15:53:30', '1', '14008C', '', '', '', '0', '', '1', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(167, 'Bardex Lubricath Latex Foley Catheter 14 French, 5cc', 1, 'Super Admin', 30, 'HCPCS', 'ICD10', 0, '<p>* 14 French, 5cc -Each</p>\r\n\r\n<p>* Lubricious coating</p>\r\n\r\n<p>* Two opposing eyes</p>\r\n', 'This a short length, round tip Catheter', 16, 12, 0, 'instock', '', 100, '', '', 0, 'bardex-lubricath-latex-foley-catheter-14-french-5cc', '', 'Complete Medical', '', '', '8baa79155c1b80491c10578608f482f5.jpg', '', '2019-03-03 15:56:57', '1', '165L14', '', '', '', '0', '', '1', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(168, 'Touchless Unisex Catheter Kit 14fr Red Rubber W/1100cc Bag', 1, 'Super Admin', 30, 'HCPCS', 'ICD10', 0, '<p>* 14 French</p>\r\n\r\n<p>* Kit contains: 1100cc collection collection chamber with glove and alcohol wipe, dispenser pack, red rubber catheter, lubricant, povidone iodine swabs</p>\r\n\r\n<p>* Catheter 16&quot; long*</p>\r\n', 'This is a Unisex  Catheter', 10, 7, 0, 'instock', '', 100, '', '', 0, 'touchless-unisex-catheter-kit-14fr-red-rubber-w-1100cc-bag', '', 'Complete Medical', '', '', '428a9c1a2622b4d687030174bdb91639.jpg', '', '2019-03-03 15:59:15', '1', '', '', '', '', '0', '', '1', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(169, 'Bard Red Rubber All-Purpose Urethral Catheter 16 Fr. (Ea', 1, 'Super Admin', 30, 'HCPCS', 'ICD10', 0, '<p>* 16 French</p>\r\n\r\n<p>* Radiopaque red rubber catheter with a round hollow tip</p>\r\n\r\n<p>* Can be used as a Robinson or a Nelaton catheter</p>\r\n\r\n<p>* Two opposing drainage eyes</p>\r\n\r\n<p>* 1&quot; Long</p>\r\n\r\n<p>* Single-use, sterile</p>\r\n', ' All-purpose urethal Catheter', 4, 2, 0, 'instock', '', 100, '', '', 0, 'bard-red-rubber-all-purpose-urethral-catheter-16-fr-ea', '', 'Complete Medical', '', '', 'cb91ce7e13074dc4d25838416d2564b5.jpg', '', '2019-03-03 16:02:59', '1', '802416', '', '', '', '0', '', '1', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(170, 'Vinyl Catheters Female 6 1/2', 1, 'Super Admin', 30, 'HCPCS', 'ICD10', 0, '<p>* Robinson Vinyl, (PVC), Urethral Catheters 6 Fr/Ch-18 Fr/Ch</p>\r\n\r\n<p>*PVC</p>\r\n\r\n<p>* Staggered eyes</p>\r\n\r\n<p>* Latex Free</p>\r\n', 'This Catheter maximizes urine flow', 55, 45, 0, 'instock', '', 100, '', '', 0, 'vinyl-catheters-female-6-1-2-1', '', 'Complete Medical', '', '', '3dfaff083f67b3085563ca8efd06e60d.jpg', '', '2019-03-03 16:06:48', '1', '8887660903', '', '', '', '0', '', '1', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(171, 'Catheter,Foley,100% Silicone 22FR, 10ML, 10/case', 1, 'Super Admin', 30, 'HCPCS', 'ICD10', 0, '<p>* Completely inert for less tissue irritation and encrustation during extended periods of indwelling use.</p>\r\n\r\n<p>* Easy insertion and less buckling with the bullet-shaped tip.</p>\r\n\r\n<p>* Larger inner lumen for better drainage.</p>\r\n\r\n<p>* Clear for easy visualization of clots, mucous and urine flow.</p>\r\n\r\n<p>* Radiopaque strip for easy visualization during scans.</p>\r\n\r\n<p>* Symmetrical balloon shape for improved reliability.</p>\r\n\r\n<p>* Not made with natural rubber latex</p>\r\n', 'Maximize safety and comfort with our 100% silicone Foley Catheters', 90, 70, 0, 'instock', '', 100, '', '', 0, 'catheter-foley-100-silicone-22fr-10ml-10-case', '', 'Complete Medical', '', '', '65029be07f91d095fa842f06c5f556ce.jpg', '', '2019-03-03 16:12:32', '1', 'DYND11505', '', '', '', '0', '', '1', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(172, 'Self Cath Catheter 10fr 16', 1, 'Super Admin', 30, 'HCPCS', 'ICD10', 0, '<p>* 10 Fr 16&quot; Funnel End Bx/30</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'For intermittent Self-Catheterization', 55, 40, 0, 'instock', '', 100, '', '', 0, 'self-cath-catheter-10fr-16-1', '', 'Complete Medical', '', '', '5c7ab34ac021cec4abd064594d62ef37.jpg', '', '2019-03-03 16:19:53', '1', 'MEN110', '', '', '', '0', '', '1', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(173, 'Catheter Self 14fr 6', 1, 'Super Admin', 30, 'HCPCS', 'ICD10', 0, '<p>* Straight Tipped - Female 14 Fr6&quot; Funnel End Bx/30</p>\r\n', ' For intermittent self-catheterization ', 50, 38, 0, 'instock', '', 100, '', '', 0, 'catheter-self-14fr-6-1', '', 'Complete Medical', '', '', 'a4da7db8bd80df46509d8be8fa28d9a4.jpg', '', '2019-03-03 16:23:45', '1', 'MEN214', '', '', '', '0', '', '1', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(174, 'FitRight Extra Briefs 20 per Bag/4 Bags/cs', 1, 'Super Admin', 31, 'HCPCS', 'ICD10', 0, '<p>* 4D-Core with odor protection helps wick fluid away to promote dryness and help maintain skin integrity</p>\r\n\r\n<p>* Skin-safe closures provide secure, safe and repeated refastenability</p>\r\n\r\n<p>* Ultra-soft cloth-like backsheet provides a discreet, garment-like, natural feel</p>\r\n\r\n<p>* Breathable side panels increase airflow and maximize patient comfort</p>\r\n\r\n<p>* Moisture alert wetness indicator changes color when the garment has been soiled</p>\r\n\r\n<p>* Absorbency 6 - Heavy Latex Free - Yes Odor Control Product - Yes Outer Material - Clothlike Packaging - Retail Bags Disposable Tape Tab Hook and loop</p>\r\n', 'Fit Right Extra Briefs promote a better fit as well as comfort and dignity', 80, 60, 0, 'instock', '', 100, '', '', 0, 'fitright-extra-briefs-20-per-bag-4-bags-cs', '', 'Complete Medical', '', '', '3d5869bd95479a0e0c92012f11bacd79.jpg', '', '2019-03-03 16:32:46', '1', 'FITEXTRALG', '', '', '', '0', '', '1', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(175, 'Protect Extra Underwear (20 Bags/4 Case)', 1, 'Super Admin', 31, 'HCPCS', 'ICD10', 0, '<p>* Extra absorbency core for optimal dryness and protection</p>\r\n\r\n<p>* Body-contoured anatomical design for added comfort and fit with the feel of underwear</p>\r\n\r\n<p>* Acquisition and dryness layer helps keep moisture away from skin</p>\r\n\r\n<p>* Size printed on the back sheet to improve product identification and ease of care</p>\r\n\r\n<p>* Absorbency 4 - Moderate Anti-Leak Guard -- No Bag Appearance -- Retail Latex Free</p>\r\n', 'Breathable soft non-woven back sheet is comfortable against skin, minimizing the risk of skin irritation and heat build up', 60, 45, 0, 'instock', '', 100, '', '', 0, 'protect-extra-underwear-20-bags-4-case', '', 'Complete Medical', '', '', 'a7c68400e7825c7742c826e1b8570e03.jpg', '', '2019-03-03 16:37:02', '1', 'MSC13005A', '', '', '', '0', '', '1', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(176, 'Aloe Vesta 3-N-1 Protective Ointment 8 oz.', 1, 'Super Admin', 31, 'HCPCS', 'ICD10', 0, '<p>*ConvaTec Aloe Vesta 3-in-1 Skin Protection Ointment soothes red, sore or irritated skin from urine burns, diaper rash, feces, or wound drainage</p>\r\n\r\n<p>*The ointment provides protection as a moisture barrier</p>\r\n\r\n<p>*Aloe Vesta 3-in-1 Skin Protection Ointment conditions the skin while repelling moisture</p>\r\n\r\n<p>*ConvaTec Aloe Vesta 3-in-1 Skin Protection Ointment is hypoallergenic and free of irritating dyes and fragrances</p>\r\n\r\n<p>*The ointment provides protection as a moisture barrier. Aloe Vesta 3-in-1 Skin Protection Ointment conditions the skin while repelling moisture</p>\r\n\r\n<p>*ConvaTec Aloe Vesta 3-in-1 Skin Protection Ointment is hypoallergenic and free of irritating dyes and fragrances</p>\r\n', 'ConvaTec Aloe Vesta 3-in-1 Skin Protection Ointment soothes red, sore or irritated skin from urine burns, diaper rash, feces, or wound drainage', 30, 20, 0, 'instock', '', 100, '', '', 0, '-aloe-vesta-3-n-1-protective-ointment-8-oz', '', 'Complete Medical', '', '', '56e022bdb35d83c011cad7ad379e8643.jpg', '', '2019-03-03 16:40:33', '1', '324908', '', '', '', '0', '', '1', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(177, 'Nose Cutout only', 1, 'Super Admin', 33, '', '', 0, '<p>* Permits patients to lie face down without turning head. 9&quot; (22.86cm) long x 2&quot; (5.08cm) wide</p>\r\n\r\n<p>* Standard placement is in the head end of the table top.</p>\r\n', 'Treatment Table Accessories', 200, 150, 0, 'instock', '', 100, '', '', 0, 'nose-cutout-only', '', 'Complete Medical', '', '', '95c06289fb5cd1bbb773ae3a50ff9229.jpg', '', '2019-03-04 06:51:57', '1', '009', '', '', '', '0', '', '0', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(178, 'Table Paper Dispenser 18', 1, 'Super Admin', 33, '', '', 0, '<p>Accommodates paper rolls from 18&quot; (45.72cm) to 21&quot; (53.34cm) wide</p>\r\n', 'Table Paper & Accessories', 65, 48, 0, 'instock', '', 100, '', '', 0, 'table-paper-dispenser-18-1', '', 'Complete Medical', '', '', '092e025ecc1b310f8f640455743eef43.jpg', '', '2019-03-04 06:55:01', '1', '030', '', '', '', '0', '', '0', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(179, 'Vinyl Exam Gloves Powder-Free Box/100', 1, 'Super Admin', 33, '', '', 0, '<p>* The non-latex formula makes these gloves ideal for those who may be allergic to latex</p>\r\n\r\n<p>* Manufactured to ASTM and FDA standards as a medical device, these soft vinyl gloves are comfortable and have beaded cuff for extra strength and tear resistance</p>\r\n\r\n<p>* 100 gloves per dispenser box</p>\r\n', 'Powder-free vinyl exam gloves are ideal for any type of medical or general use', 8, 5, 0, 'instock', '', 100, '', '', 0, 'vinyl-exam-gloves-powder-free-box-100', '', 'Complete Medical', '', '', 'ff4851fe2fad34aa37ae3e90a1ce247e.jpg', '', '2019-03-04 07:00:25', '1', '1008A', '', '', '', '0', '', '0', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
