(186, 'Latex Exam Gloves Powder-Free Bx/100', 1, 'Super Admin', 33, '', '', 0, '<p>* Powder-free to help reduce the risk of skin irritation, these gloves feature tapered fingertips for greater comfort and advanced processing for easier donning</p>\r\n\r\n<p>* Powder-Free Latex Exam Gloves have beaded, tear-resistant cuffs for added performance</p>\r\n', 'Latex Gloves for Professionals who require greater sensitivity for administering medical care or instrument manipulation find these fully textured powder-free latex exam gloves a perfect fit', 10, 8, 0, 'instock', '', 100, '', '', 0, 'latex-exam-gloves-powder-free-bx-100', '', 'Complete Medical', '', '', '05ba3f08cc3c3e6cb96cac5f0dd2e2ff.jpg', '', '2019-03-04 07:36:17', '1', '1023A', '', '', '', '0', '', '0', '', 'white', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(187, 'Nitrile Latex-Free/Powder-Free Exam Gloves - Bx/100', 1, 'Super Admin', 33, '', '', 0, '<p>* This latex-free, powder-free, textured glove offers the very best in tactile sensitivity, chemical resistance, and blood-borne pathogen protection</p>\r\n\r\n<p>* Nitrile Powder-Free Virtual Skin exam glove reduces hand fatigue and has superior tensile strength</p>\r\n', 'Blue Nitrile Powder-Free Virtual Skin exam glove uses Soft Stretch Modulus Technology to provide a second-skin comfort level', 12, 9, 0, 'instock', '', 100, '', '', 0, 'nitrile-latex-free-powder-free-exam-gloves-bx-100', '', 'Complete Medical', '', '', '8ccfe70909316dffa393755d39ca48be.jpg', '', '2019-03-04 07:40:48', '1', '1024A', '', '', '', '0', '', '0', '', 'Blue', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(188, 'Blood Drawing Chair w/Drawer', 1, 'Super Admin', 33, '', '', 0, '<p>* Provides a comfortable, efficient means of collecting blood from ambulatory patients</p>\r\n\r\n<p>* 2 full length, height-adjustable armrests support the arm in the optimum position for vein puncture and prevent back-bending of the elbow and subsequent flattening of the vein</p>\r\n\r\n<p>* Armrests are interchangeable, left to right, with the drawer placed at either side of the chair and the moveable portion angled to either side</p>\r\n\r\n<p>* Neutral gray, powder coated steel frame and black, one piece polypropylene seat are designed for maintenance-free service</p>\r\n\r\n<p>* Seat height: 17 1/4&quot;</p>\r\n\r\n<p>* Seat width: 17&quot;</p>\r\n\r\n<p>* Weight capacity: 250 Lbs.&nbsp;</p>\r\n', 'Blood Drawing Chairs with drawer', 550, 450, 0, 'instock', '', 100, '', '', 0, 'blood-drawing-chair-w-drawer', '', 'Complete Medical', '', '', 'ad19364c5724d50a38d2d188f81bb304.jpg', '', '2019-03-04 07:55:14', '1', '11602', '', '', '', '0', '', '0', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
