(190, 'Universal V-Neck Scrub Top Reversible Ceil', 1, 'Super Admin', 35, '', '', 0, '<p>Made of AngelStat&nbsp;fabric, a cotton-rich, 55% cotton / 45% polyester blend that gets softer and softer the more it&#39;s washed</p>\r\n\r\n<p>* Reversible unisex V-neck scrub top has a color- coded neck bias</p>\r\n\r\n<p>* Generous cut allows for extra roominess across the back</p>\r\n\r\n<p>* Featuring a left breast pocket inside and out, and set-in sleeves</p>\r\n', 'Unisex Scrubs', 20, 15, 0, 'instock', '', 100, '', '', 0, 'universal-v-neck-scrub-top-reversible-ceil-1', '', 'Complete Medical', '', '', 'b2d173118a724b88eda3f446e00f7c86.jpg', '', '2019-03-04 08:10:12', '1', '2153A', '', '', '', '0', '', '0', '', 'Sky blue', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
