(212, 'Talking Body Fat Scale', 1, 'Super Admin', 33, '', '', 0, '<p>* Extra large, sturdy platform and speaks in clear unaccented American English</p>\r\n\r\n<p>* The Phoenix uses strain gauge technology to be incredibly accurate and precise</p>\r\n\r\n<p>* Talking feature can be turned on or off (for those times you may not want to hear it) * Perfect for anyone with poor eyesight</p>\r\n\r\n<p>* 10-User Memory personal data storage</p>\r\n\r\n<p>* Works in both weigh-only and body fat modes</p>\r\n\r\n<p>* Easy to use and program</p>\r\n\r\n<p>* Scuff-resistant Stainless Steel foot pads</p>\r\n\r\n<p>* 200kg x 0.1kg - 440lb x 0.2lb</p>\r\n\r\n<p>* Power: 4-AA batteries (included)</p>\r\n\r\n<p>* MODES: lb, kg</p>\r\n\r\n<p>* Scale Size 15.75&quot; x 12.75&quot; x 1.25&quot;</p>\r\n', 'World\'s first talking body fat scale', 160, 120, 0, 'instock', '', 100, '', '', 0, 'talking-body-fat-scale', '', 'Complete Medical', '', '', '3fc55271c661d2a5a92a220d947b3bc1.jpg', '', '2019-03-04 13:46:51', '1', '2629', '', '', '', '0', '', '0', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(213, 'ProPlus Wheelchair Ramp Digital Scale', 1, 'Super Admin', 84, '', '', 0, '<p>* Pounds &amp; Kilograms</p>\r\n\r\n<p>* Extremely durable, with state-of-the-art technology, this scale is a &quot;must-have&quot; for any long-term and acute facility</p>\r\n\r\n<p>* Large, oversized platform provides added support to unsteady patients and can be used with chairs, wheelchairs or as a stand-on scale</p>\r\n\r\n<p>* 180 degree swivel head for side read</p>\r\n\r\n<p>* Keypad entry with customizable 1&quot; backlit LCD display readout</p>\r\n\r\n<p>* USB and Serial Ports (2) for computer interface with a 270 patient memory and user-friendly menu screen</p>\r\n\r\n<p>* Motion-sensing weighing technology</p>\r\n\r\n<p>* 6 D size alkaline batteries &amp; 120 volt AC adapter</p>\r\n\r\n<p>* Weight capacity: 1000 Lbs x .2 Lb</p>\r\n\r\n<p>* 3 Year Limited Warranty&nbsp;</p>\r\n', ' This scale has exclusive technology to compensate for any movement - critical to weighing patients in wheelchairs', 4700, 3800, 0, 'instock', '', 100, '', '', 0, 'proplus-wheelchair-ramp-digital-scale', '', 'Complete Medical', '', '', '7208a79955ae591a9812e0cda4873563.jpg', '', '2019-03-04 13:50:40', '1', '2500KL', '', '', '', '0', '', '0', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(214, 'Physicians Digital Waist High Scale 600 Lb Capacity', 1, 'Super Admin', 33, '', '', 0, '<p>* Hold/Release, Zero, KG/LB, Clear, Enter functions</p>\r\n\r\n<p>* Auto-Zero, 5 minute auto-off (AC mode disabled), low battery indicator</p>\r\n\r\n<p>* Wheels and handle for maximum portability</p>\r\n\r\n<p>* Updatable firmware</p>\r\n\r\n<p>* RS232 Output Port</p>\r\n\r\n<p>* 6 C-cell batteries (not included) or 120V AC adapter (included)</p>\r\n\r\n<p>* Metallic Gray</p>\r\n\r\n<p>* Weight capacity: 600 lb / 272kg</p>\r\n\r\n<p>* 1 Year Warranty</p>\r\n\r\n<p>* Specifications Capacity: 600 lb / 272 kg Resolution: 0.2 lb / 0.1 kg Platform Size: 14 1/4&quot; (w) x 14 1/4&quot;(d) x 2 5/8&quot; (h)/362mm (w) x 362mm (d) x 67mm (h) Height Rod: Optional 499KLROD Display: 1&quot; LCD, 350&nbsp;Swivel Wheels: (2) Wheels for ease of movement Power Source: 110-240V adapter included, 6 C-cell batteries (not included) Connectivity: USB Warranty: 2 Year Limited Warranty</p>\r\n', 'BMI (easy scroll method)', 1200, 820, 0, 'instock', '', 100, '', '', 0, 'physicians-digital-waist-high-scale-600-lb-capacity', '', 'Complete Medical', '', '', '352f8e2e9b66b16ef242b4d99b62c5f5.jpg', '', '2019-03-04 13:55:24', '1', '599KL', '', '', '', '0', '', '0', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(215, 'Seca 755 Mechanical Scale w/BMI', 1, 'Super Admin', 33, '', '', 0, '<p>* When the patient mounts the scale, a &quot;BMI disc&quot; of contrasting color is set in motion below the very precise weight display in the large, clear dial</p>\r\n\r\n<p>* It is visible in a small window next to which a height scale is printed</p>\r\n\r\n<p>* Once the weight has been determined, it is easy to read the BMI range, with contrasting colors, is split up into underweight, normal and overweight as well as adiposity (abnormally overweight)</p>\r\n\r\n<p>* A flat tread area and practical transport castors are further advantages of the Seca 755</p>\r\n\r\n<p>* It can also be converted into a complete measuring and weighing station by fitting the optional measuring rod Seca 220</p>\r\n\r\n<p>* Weight Capacity: 350 lbs</p>\r\n\r\n<p>* Graduation: 1 lbs/500 g</p>\r\n\r\n<p>* Function: BMI</p>\r\n\r\n<p>* Alternative: kg/lbs version also available&nbsp;</p>\r\n', 'The Seca 755 is one of the first mechanical column scales which, in addtion to displaying the weight, also displays the respective nutritional condition of the patient with the BMI function', 1450, 980, 0, 'instock', '', 100, '', '', 0, 'seca-755-mechanical-scale-w-bmi', '', 'Complete Medical', '', '', '4bb87e4282f681d16fc8414467808681.jpg', '', '2019-03-04 13:58:33', '1', '6280', '', '', '', '0', '', '0', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(216, 'Chair Scale Detecto #475 (Lbs', 1, 'Super Admin', 32, '', '', 0, '<p>* Pounds Mfg.#475</p>\r\n\r\n<p>* Beam scale weight capacity: 350 Lbs x 4 Oz</p>\r\n\r\n<p>* Display: .7&quot; high contrast LCD</p>\r\n\r\n<p>* Lift away arms and footrests</p>\r\n\r\n<p>* Color: White with black seat &amp; armrests</p>\r\n\r\n<p>* Die cast beam (#475) readable from both sides</p>\r\n\r\n<p>* 1 Year Warranty&nbsp;</p>\r\n', 'This scale has oversized wheels for transportation', 1250, 905, 0, 'instock', '', 100, '', '', 0, 'chair-scale-detecto-475-lbs', '', 'Complete Medical', '', '', '6e4ce9a18d9c9ea83e15f56f1841607a.jpg', '', '2019-03-04 14:01:26', '1', '6293', '', '', '', '0', '', '0', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(217, 'Lens Paper Booklet (Each) (50 sheets)', 1, 'Super Admin', 33, '', '', 0, '<p>* Soft and thin paper</p>\r\n\r\n<p>* 50 sheets per book * 4&quot; x 6&quot;</p>\r\n', 'Diagnostic - Microscope & Accessories', 5, 3, 0, 'instock', '', 100, '', '', 0, 'lens-paper-booklet-each-50-sheets', '', 'Complete Medical', '', '', '47c11e2472193c4681f8ce24cbde4708.jpg', '', '2019-03-04 14:05:35', '1', '215', '', '', '', '0', '', '0', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(218, 'Microscope Slides- Plain Pk/72', 1, 'Super Admin', 33, '', '', 0, '<p>* Plain Bx/72</p>\r\n\r\n<p>* 3&quot; x 1&quot; x 1mm</p>\r\n\r\n<p>* Polished rounded corners&nbsp;</p>\r\n', 'Microscope accessories', 10, 8, 0, 'instock', '', 100, '', '', 0, 'microscope-slides-plain-pk-72', '', 'Complete Medical', '', '', 'e634b3bae1386bff602d201ee0e3bd7c.jpg', '', '2019-03-04 14:08:11', '1', '217', '', '', '', '0', '', '0', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(219, 'Diagnostic Set Deluxe In Fitted Case', 1, 'Super Admin', 33, '', '', 0, '<p>*Set includes: an ophthalmoscope, otoscope with 3 aural &amp; 1 nasal specula, laryngeal and 2 post-nasal mirrors, metal tongue depressor and a bent arm throat lamp in a plastic carry case</p>\r\n', 'Combined Otoscope & Opthal. Sets', 230, 175, 0, 'instock', '', 100, '', '', 0, 'diagnostic-set-deluxe-in-fitted-case', '', 'Complete Medical', '', '', '171511f8e140741ca619c6ec1e2fbca1.jpg', '', '2019-03-04 14:11:37', '1', '9740', '', '', '', '0', '', '0', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(220, 'Binocular Microscope w/Infinit Plan Achromat Obj.(#3000LED)', 1, 'Super Admin', 33, '', '', 0, '<p>* Binocular viewing head, inclined 30, rotatable 360&nbsp;</p>\r\n\r\n<p>* HWF Plan 10x/20mm focusing eyepieces (paired - one w/pointer), with eyeguards * Reversed quadruple nosepiece</p>\r\n\r\n<p>* Infinity Plan achromat 4x, 10x, 40xR and 100xR oil objectives</p>\r\n\r\n<p>* Mechanical stage, 140 X 132mm</p>\r\n\r\n<p>* Abbe condenser, N.A. 1.25 with iris diaphragm (with slot for sliders)</p>\r\n\r\n<p>* Coaxial coarse and fine focusing controls</p>\r\n\r\n<p>* 3 watt LED variable illuminator</p>\r\n\r\n<p>* Dust cover, power cord, immersion oil and instruction manual</p>\r\n\r\n<p>* AS3000 has a 5 year limited warranty (this does not include the bulbs and fuses</p>\r\n', 'Microscope accessories', 1700, 1250, 0, 'instock', '', 100, '', '', 0, 'binocular-microscope-w-infinit-plan-achromat-obj-3000led', '', 'Complete Medical', '', '', '6b231210f72151caf138de14ddb8cf00.jpg', '', '2019-03-04 14:15:12', '1', 'AS3000', '', '', '', '0', '', '0', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(221, 'Binocular Microscope w/Slider Phase Set 10x,40xR(3000LEDSPH)', 1, 'Super Admin', 33, '', '', 0, '<p>* Binocular Microscope with Slider Phase Set 10x and 40xR</p>\r\n\r\n<p>* Binocular viewing head, inclined 30, rotatable 360&nbsp;</p>\r\n\r\n<p>* HWF Plan 10x/20mm focusing eyepieces (paired - one w/pointer), with eyeguards</p>\r\n\r\n<p>* Plan phase contrast 10x and 40xR objectives</p>\r\n\r\n<p>* Mechanical stage, 140 X 132mm</p>\r\n\r\n<p>* Abbe condenser, N.A. 1.25 with (1) phase slider with 10x &amp; 40x annuli and Brightfield position, green filter and centering telescope</p>\r\n\r\n<p>* Coaxial coarse and fine focusing controls</p>\r\n\r\n<p>* 3 watt LED variable illuminator</p>\r\n\r\n<p>* Dust cover, power cord, immersion oil and instruction manual</p>\r\n', 'Reversed quadruple nosepiece Microscope  ', 1850, 1400, 0, 'instock', '', 100, '', '', 0, 'binocular-microscope-w-slider-phase-set-10x-40xr-3000ledsph', '', 'Complete Medical', '', '', 'f392e430f3a84374e3b998a5b92adadc.jpg', '', '2019-03-04 14:21:57', '1', 'AS3000PH', '', '', '', '0', '', '0', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(222, 'Trinocular Microscope With Slider Phase Set-10x and 40xR', 1, 'Super Admin', 33, 'NA', 'NA', 0, '<p>Trinocular Microscope with Silder Phase Set - 10x and 40xR</p>\r\n\r\n<p>* With trinocular viewing head (50/50 light split)</p>\r\n\r\n<p>* HWF Plan 10x/20mm focusing eyepieces (paired - one w/pointer), with eyeguards</p>\r\n\r\n<p>* Reversed quadruple nosepiece</p>\r\n\r\n<p>* Plan phase contrast 10x and 40xR objectives</p>\r\n\r\n<p>* Mechanical stage, 140 X 132mm</p>\r\n\r\n<p>* Abbe condenser, N.A. 1.25 with (1) phase slider with 10x &amp; 40x annuli and Brightfield position, green filter and centering telescope</p>\r\n\r\n<p>* Coaxial coarse and fine focusing controls 3 watt LED variable illuminator Dust cover, power cord, immersion oil and instruction manua</p>\r\n', 'Diagnostic - Microscope & Accessories', 2100, 1450, 0, 'instock', '', 100, '', '', 0, 'trinocular-microscope-with-slider-phase-set-10x-and-40xr', '', 'Complete Medical', '', '', 'cdef18614764f28e682ae46bb7a3e569.jpg', '', '2019-03-04 14:24:44', '1', 'AS3001PH', '', '', '', '0', '', '0', '', 'empty', '', '', '', '0', '00', 1, '0', '0', '', '', 0, 1),
(223, 'Cardiovit AT-1 ECG Machine With Interpretation-3 Channel', 1, 'Super Admin', 33, 'NA', 'NA', 0, '<p>3 channel representation of all 12 simultaneously acquired leads</p>\r\n\r\n<p>* Automatic and manual mode</p>\r\n\r\n<p>* Multiple report formats, copy function, various recording speeds</p>\r\n\r\n<p>* Integrated rechargeable battery and integrated power supply</p>\r\n\r\n<p>* One button operation</p>\r\n\r\n<p>* Built-in thermal printer</p>\r\n\r\n<p>* Lightweight (2.9 kg/6.7 lbs)</p>\r\n', 'Diagnostic - ECG- Electrocardiograph', 4200, 3200, 0, 'instock', '', 100, '', '', 0, 'cardiovit-at-1-ecg-machine-with-interpretation-3-channel', '', 'Complete Medical', '', '', 'f45005efc831c611b8988bedf5330b4e.jpg', '', '2019-03-04 14:28:08', '1', 'AT1', '', '', '', '0', '', '0', '', 'empty', '', '', '', '0', '00', 1, '0', '0', '', '', 0, 1),
(224, 'Welch Allyn Pan Optic Ophthalmoscope', 1, 'Super Admin', 33, '', '', 0, '<p>* The revolutionary PanOptic provides easy entry into the eye, together with a wider field of view to more easily observe conditions such as hypertension, diabetic retinopathy, and papilledema</p>\r\n\r\n<p>* Fast entry into undilated pupils</p>\r\n\r\n<p>* 5x larger view of the fundus vs. standard scopes in an undilated eye</p>\r\n\r\n<p>* 25 degree field of view vs. the standard 5o field of view</p>\r\n\r\n<p>* Greater working distance improves comfort for both practitioner and patient</p>\r\n\r\n<p>* Detect with cobalt blue fiber and magnifying lens corneal abrasions</p>\r\n\r\n<p>* Compatible with all existing Welch Allyn 3.5v power sources&nbsp;</p>\r\n', 'Opthalmoscopes Heads with Cobalt-Blue Filter And Add-On Corneal Magnifying Lens ', 1300, 860, 0, 'instock', '', 100, '', '', 0, 'welch-allyn-pan-optic-ophthalmoscope', '', 'Complete Medical', '', '', 'c5550a39721d64fd9afec0a38c0ab705.jpg', '', '2019-03-04 15:25:52', '1', 'WA11810', '', '', '', '0', '', '0', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(225, 'Coaxial Diagnostic Set w/Lithium Ion Handle', 1, 'Super Admin', 33, 'NA', 'NA', 0, '<p>Our Coaxial Ophthalmoscope uses a Halogen HPX lamp that provides 30% more light output for true tissue color and consistent, long-lasting illumination</p>\r\n\r\n<p>* 28 lenses from -25 to +40 diopters for better resolution</p>\r\n\r\n<p>* The coaxial optical system produces a shadow-free spot and easier entry into undilated pupils</p>\r\n\r\n<p>* The crossed-linear polarizing filter reduces corneal reflection</p>\r\n\r\n<p>* The red-free filter may be used with any aperture</p>\r\n\r\n<p>* It has 18 possible aperture combinations for greater versatility</p>\r\n\r\n<p>* Otoscope uses Halogen HPX lamp and fiber optics for cool light with no reflections, no obstruction</p>\r\n\r\n<p>* It comes with a wide-angle viewing lens for instrumentation under magnification</p>\r\n\r\n<p>* The Lithium-Ion Handle is just half the weight of current 3.5v handles</p>\r\n\r\n<p>* It averages 120 minutes of on-time between charging</p>\r\n\r\n<p>* It has the smallest diameter of any 3.5v power handle on the market</p>\r\n\r\n<p>* The textured handle is made of sturdy CYCOLOY&nbsp;resin</p>\r\n\r\n<p>* It comes with a low-battery indicator and lithium-ion battery technology that has no &quot;memory&quot; effect</p>\r\n\r\n<p>* It has a soft grip rheostat intensity control, and AC charging module with retractable prongs that is easily removable from the handle</p>\r\n\r\n<p>* Key Components: 3.5v Coaxial Ophthalmoscope Head with Halogen Lamp (Model 11720), 3.5v MacroView Otoscope Head with Specula and Halogen Lamp (Model 23810), 3.5v Lithium-Ion Handle with Removable AC Adapter (Model 71900), Hard Case for 3.5v Set</p>\r\n\r\n<p>* Reusable Polypropylene Diagnostic Otoscope Specula, Set of Four (2, 3, 4, 5 mm)</p>\r\n\r\n<p>* The Welch Allyn Warranty: Welch Allyn will repair or replace, free of charge, any parts of its own manufacture proven to be defective through causes other than misuse, neglect, damage in shipment, or normal wear&nbsp;</p>\r\n', 'Diagnostic Sets', 1450, 1100, 0, 'instock', '', 100, '', '', 0, 'coaxial-diagnostic-set-w-lithium-ion-handle', '', 'Complete Medical', '', '', '1147cd40ce031369bc8809feace91683.jpg', '', '2019-03-04 15:32:11', '1', 'WA97250MS', '', '', '', '0', '', '0', '', '', '', '', '', '0', '00', 1, '0', '0', '', '', 0, 1),
(226, 'Bed Pan Stainless Steel', 1, 'Super Admin', 56, '', '', 0, '<p>* Resistant to stains &amp; cracks</p>\r\n\r\n<p>* 350# weight capacity</p>\r\n\r\n<p>* 14&quot; x 12&quot; x 4&quot;&nbsp;</p>\r\n', 'Stainless steel Bed Pans', 85, 65, 0, 'instock', '', 100, '', '', 0, 'bed-pan-stainless-steel', '', 'Complete Medical', '', '', 'a5f2c5cf649ed47eba5b9295abfdceb0.jpg', '', '2019-03-06 10:46:06', '1', '7089', '', '', '', '0', '', '0', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(227, 'Advair Diskus', 1, 'Super Admin', 1, '', '', 0, '<p>* Advair Diskus&nbsp;is specifically indicated for the treatment of asthma in patients aged 4 years and older and the maintenance treatment of airflow obstruction and reducing exacerbations in patients with chronic obstructive pulmonary disease. Advair HFA is specifically indicated&nbsp;for treatment of asthma in patients aged 12 years and older.</p>\r\n\r\n<p>* Advair Diskus is supplied as an inhalation powder for&nbsp;oral inhalation only. The recommended dose for the treatment of asthma in patients aged 12 years and older is 1 inhalation of Advair Diskus&nbsp;100/50, Advair Diskus&nbsp;250/50, or Advair Diskus&nbsp;500/50 twice daily. Starting dosage is based on asthma severity. The recommended dose for the treatment of asthma in patients aged 4 to 11 years is 1 inhalation of Advair Diskus&nbsp;100/50 twice daily. The recommended dose for the maintenance treatment of COPD is 1 inhalation of Advair Diskus&nbsp;250/50 twice daily.</p>\r\n\r\n<p>* <gwmw class=\"ginger-module-highlighter-mistake-type-1\" id=\"gwmw-15785643161973619845877\">Adviar</gwmw> HFA is supplied as a metered dose inhaler for&nbsp;oral inhalation only. The recommended dose for the treatment of asthma in patients aged 12 years and older is 2 inhalations of Advair HFA 45/21, 115/21, or 230/21 twice daily. The starting dosage is based on asthma severity.</p>\r\n', 'Advair is a combination of fluticasone propionate, a corticosteroid and salmeterol, a beta2-adrenergic bronchodilator. It is available as a metered-dose inhaler (HFA) or as an inhalation powder (Diskus)', 25, 20, 0, 'instock', '', 100, '', '', 0, 'advair-diskus', '', 'Advair', '', '', '198e7454b0ffa0df578b120722f212c0.jpg', '', '2019-03-08 13:51:48', '1', '', '', '', '', '11', '', '1', '', '', '', '', '', '0', 'NA', 1, '0', '0', '', '', 0, 1),
(228, 'Accolate', 1, 'Super Admin', 37, 'NA', 'NA', 0, '<p>For the use of Accolate 10 mg oral Tablets for the prophylaxis and chronic treatment of asthma in pediatric patients 7 - 11 years of age.</p>\r\n', 'Accolate 10 Mg Tablet', 25, 15, 0, 'instock', '', 100, '', '', 0, 'accolate', '', 'Bloomtown', '', '', '061a477fa13db822b6ce1c9118d4053f.jpg', '', '2019-03-08 13:58:31', '1', '', '', '', '', '0', '', '1', '', 'empty', '', '', '', '0', '35', 1, '0', '0', '', '', 0, 1),
(229, 'Swing-Away Elevating Legrests Only for Std. Wheelchairs', 1, 'Super Admin', 54, '', '', 0, '<p>*Compatable with the most Standard Wheelchairs</p>\r\n\r\n<p>* Notice to California Consumers: WARNING: This product contains chemicals known to the State of California to cause cancer and birth defects or other reproductive harm&nbsp;</p>\r\n', 'Swing- away Elevating Legrest', 98, 75, 0, 'instock', '', 100, '', '', 0, 'swing-away-elevating-legrests-only-for-std-wheelchairs', '', 'Complete', '', '', '62573b41e0c93ebf10d6e6aa758da75d.jpg', '', '2019-03-08 14:02:55', '1', '10953D', '', '', '', '0', '', '1', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(230, 'Pediasure Pack of 16', 1, 'Super Admin', 34, 'HCPCS', 'ICD10', 0, '<ul>\r\n	<li>A source of complete, balanced nutrition especially designed for children 2 to 13 years of age.</li>\r\n	<li>#1 Pediatrician recommended brand.</li>\r\n	<li>Meets or exceeds 100% of the DRIs for protein and 25 essential vitamins and minerals\r\n	<ul>\r\n		<li>in 1000 mL for children 2 to 8 years of age.</li>\r\n		<li>in 1500 mL for children 9 to 13 years of age.</li>\r\n	</ul>\r\n	</li>\r\n	<li>Antioxidants (vitamins C &amp; E and selenium) to support the immune system.</li>\r\n	<li>DHA Omega-3&dagger;&nbsp;for brain and eye health.6</li>\r\n	<li>Halal.</li>\r\n	<li>Kosher.</li>\r\n	<li>Gluten-free.</li>\r\n	<li>Come in&nbsp;different flavors</li>\r\n</ul>\r\n', 'Suitable for lactose intolerance.', 40, 30, 0, 'instock', '', 100, '', '', 0, 'pediasure-pack-of-16', '', 'Abbott', '', '', 'a6101c460c73763f44c72ce7bea82804.png', '', '2019-03-08 16:52:44', '1', '4', '', '', '', '0', '', '1', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
