(232, 'Wheelchair Transport Lightweight Red 19', 1, 'Super Admin', 55, 'HCPCS,E1038', 'ICD10', 0, '<p>19&quot; BlACK UPHOLSTERY</p>\r\n\r\n<p>* Red Frame</p>\r\n\r\n<p>* Composite 8&quot; wheels are lightweight and maintenance free</p>\r\n\r\n<p>* Both 17&quot; and 19&quot; come with swing-away footrests</p>\r\n\r\n<p>* Padded armrests provide additional comfort</p>\r\n\r\n<p>* Nylon upholstery is comfortable, lightweight and easy to clean.</p>\r\n\r\n<p>* Aluminum casted back release hinge allows back to fold down for easy storage and transport</p>\r\n\r\n<p>* Standard rear wheel locks</p>\r\n\r\n<p>* Overall width w/ 17&quot; seat: 20&quot; (open), 9&quot; (closed)</p>\r\n\r\n<p>* Overall width w/ 19&quot; seat: 22&quot; (open), 9&quot; (closed)</p>\r\n\r\n<p>* Overall height: 39.5&quot;</p>\r\n\r\n<p>* Seat to floor height: 19&quot;</p>\r\n\r\n<p>* Back height: 18&quot;</p>\r\n\r\n<p>* Seat depth: 16&quot;</p>\r\n\r\n<p>* Overall length w/ riggings: 33&quot;</p>\r\n\r\n<p>* Weighs only 19 lbs</p>\r\n\r\n<p>* Carton shipping weight: 24 lbs</p>\r\n\r\n<p>* Weight Capacity: 300 lbs</p>\r\n\r\n<p>* Limited Lifetime Warranty</p>\r\n', ' This Wheelchair has Aluminum frame that is lightweight and strong', 210, 166, 0, 'instock', '', 100, '', '', 0, 'wheelchair-transport-lightweight-red-19-1', '', 'Complete Medical', '', '', '8497f20bdcc2c7289767ce6bacd2f4af.jpg', 'c8d5e204672a307adcc6bbd88ea1515a.jpg,fb1a2d33807142634a911c48d90b34f4.jpg,1def3a656fd0dab2b2c7fba9cd5a79e4.jpg', '2019-03-10 11:00:00', '1', '10950J', '', '', '', '0', '', '1', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(233, 'Wheelchair Transport Lightweight Silver 17', 1, 'Super Admin', 55, 'HCPCS', 'ICD10', 0, '<p>17&quot; BlACK UPHOLSTERY</p>\r\n\r\n<p>* Silver Frame</p>\r\n\r\n<p>* Weighs only 19 lbs</p>\r\n\r\n<p>* Aluminum frame is lightweight and strong</p>\r\n\r\n<p>* Composite 8&nbsp;wheels are lightweight and maintenance free</p>\r\n\r\n<p>* Both 17&quot; and 19&quot; come with swing-away footrests with heel loops</p>\r\n\r\n<p>* Padded armrests provide additional comfort</p>\r\n\r\n<p>* Nylon upholstery is comfortable, lightweight and easy to clean</p>\r\n\r\n<p>* Aluminum casted back release hinge allows back to fold down for easy storage and transport</p>\r\n\r\n<p>* Standard rear wheel locks</p>\r\n\r\n<p>* Includes Seat Belt</p>\r\n\r\n<p>* Limited Lifetime Warranty</p>\r\n\r\n<p>* Weight Capacity: 275 Lbs.&nbsp;</p>\r\n', 'Most HMO\'s Accepted. Must Complete CMN for Insurance Payment Option.', 210, 152, 0, 'instock', '', 100, '', '', 0, 'wheelchair-transport-lightweight-silver-17-1', '', 'Complete Medical', '', '', 'ee94560a14674b1161deb6c43811dd9d.jpg', '99fad8eafe55f9ef02694577f30b8d75.jpg,f9d79d68a6d0589fd00f8d6272120e93.jpg,5ced5623a1a7cbe6e96ee984347682c1.jpg,23f616be55d77fbf23f0f862262f1ca7.jpg', '2019-03-10 11:12:23', '1', '10950S', '', '', '', '0', '', '1', '', '', '', '', '', '0', '00', 1, '0', '0', '', '', 0, 1),
