(235, 'Wheelchair, Sentra Heavy Duty Extra Wide, 30', 1, 'Super Admin', 55, 'HCPCS', 'ICD10', 0, '<p>* 700 lb. Weight Capacity</p>\r\n\r\n<p>* Carbon steel frame with TRIPLE coated chrome for an attractive, chip-proof, maintainable finish</p>\r\n\r\n<p>* Reinforced steel gussets at all weight bearing points provide additional strength</p>\r\n\r\n<p>* Durable reinforced nylon upholstery</p>\r\n\r\n<p>* Extra large, padded armrests provide comfort and support</p>\r\n\r\n<p>* Steel, spoke wheels are strong and maintenance free</p>\r\n\r\n<p>* Precision sealed wheel bearings in front and rear ensure long lasting performance and reliability</p>\r\n\r\n<p>* Heavy duty, flat free 8&quot; front casters are adjustable in 3 positions</p>\r\n\r\n<p>* Extra heavy duty front forks</p>\r\n\r\n<p>* Reinforced side frame, caster journals and dual cross bars</p>\r\n\r\n<p>* Comes with push to lock wheel locks</p>\r\n\r\n<p>* Limited Lifetime Warranty&nbsp;</p>\r\n', 'This Wheelchair is Extra large and heavy duty. Its aluminum footplates provide maximum support, are attractive and crack proof', 1300, 980, 0, 'instock', '', 100, '', '', 0, 'wheelchair-sentra-heavy-duty-extra-wide-30-1', '', 'Complete Medical', '', '', '9e4388b4fd504b573e76ae97fd28efb0.jpg', '', '2019-03-10 11:24:21', '1', '10956Q', '', '', '', '0', '', '1', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(236, 'Bariatric Wheelchair Rem Full Arms 22', 1, 'Super Admin', 55, 'HCPCS,K0007,K0195,E0990', 'ICD10', 0, '<p>REMOVABLE FULL ARMS</p>\r\n\r\n<p>* 22&quot;</p>\r\n\r\n<p>* Product weight 56 lbs</p>\r\n\r\n<p>* Weight Capcity 500 lbs</p>\r\n\r\n<p>* Carbon-steel frame with triple coated chrome for an attractive, chip-proof, maintainable finish</p>\r\n\r\n<p>* Durable, heavy-gauge naugahyde upholstery</p>\r\n\r\n<p>* Padded armrests add to patient comfort</p>\r\n\r\n<p>* Composite Mag-style wheels are lightweight and maintenance free</p>\r\n\r\n<p>* 8&quot; front casters and precision sealed wheel bearings in front and rear ensure long lasting performance and reliability</p>\r\n\r\n<p>* Aluminum footplates are attractive, crack-proof and lightweight</p>\r\n\r\n<p>* Standard dual axle provides easy transition of seat to hemi-level</p>\r\n\r\n<p>* Reinforced side frame, caster journals and dual cross bars</p>\r\n\r\n<p>* Black upholstery and chrome frame</p>\r\n\r\n<p>* Limited Lifetime Warranty</p>\r\n\r\n<p>* Weight Capacity: 500 Lbs.</p>\r\n', 'This Wheelchair comes with carry pocket in backrest. It has reinforced steel gussets at all weight bearing points, to provide additional strength', 700, 500, 0, 'instock', '', 100, '', '', 0, 'bariatric-wheelchair-rem-full-arms-22-1', '', 'Complete Medical', '', '', 'f547ffa9e3050e386d3a8c3a87bd27dc.jpg', '', '2019-03-10 11:31:16', '1', '10959M', '', '', '', '0', '', '1', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(237, 'Viper Plus GT 16', 1, 'Super Admin', 3, 'HCPCS', 'ICD10', 0, '<p>* Adjustable seat rail extension and upholstery with 2&quot; extension easily adjusts from 16&quot; to 18&quot; (patent pending)</p>\r\n\r\n<p>* Deluxe high strength, lightweight, all aluminum frame.</p>\r\n\r\n<p>* Dual axle allows for multiple seat to floor height positions</p>\r\n\r\n<p>* Adjustable height, flip back, removable, padded arms</p>\r\n\r\n<p>* Weighs under 32 lbs. (excluding front rigging)</p>\r\n\r\n<p>* Over center cross brace eliminates seat guides, works with seating and positioning accessories</p>\r\n\r\n<p>* Adjustable angle back easily adjusts from 5&nbsp;- 20&nbsp;</p>\r\n\r\n<p>* Adjustable height back adjusts from 17&quot; - 19&quot; in 1&quot; increments, easily adaptable for individual patient needs</p>\r\n\r\n<p>* Adjustable height arms extend from 10&quot; to 14&quot;</p>\r\n\r\n<p>* Durable, heavy gauge, flame retardant, nylon upholstery with Velcro modesty flaps resists mildew and bacteria</p>\r\n\r\n<p>* Quick release, 24&quot; composite Mag-style wheels are lightweight and maintenance free</p>\r\n\r\n<p>* Precision sealed wheel bearings in front and rear ensure long lasting performance and reliability</p>\r\n\r\n<p>* Adjustable angle caster forks have 3 height adjustments and angle adjustability</p>\r\n\r\n<p>* Tool free adjustable swing away footrests also feature easy to access release handles</p>\r\n\r\n<p>* Urethane rear tires and casters offer superior performance, smoother ride and are lightweight</p>\r\n\r\n<p>* Adjustable anti-tipper with flip-up wheels that never needs to be removed</p>\r\n\r\n<p>* Limited Lifetime warranty</p>\r\n\r\n<p>* Weight capacity: 300 lbs</p>\r\n', 'This Wheelchair comes with push to lock wheel locks', 800, 650, 0, 'instock', '', 100, '', '', 0, 'viper-plus-gt-16-1', '', 'Complete Medical', '', '', '9cf8cc735a9787aa9187c2bd462c03fd.jpg', '', '2019-03-10 11:37:01', '1', '10960J', '', '', '', '0', '', '1', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(238, 'Wheelchair Full Reclining 22', 1, 'Super Admin', 55, 'HCPCS', 'ICD10', 0, '<p>DESK ARMS</p>\r\n\r\n<p>* 22&quot;</p>\r\n\r\n<p>* Weight 55 lbs</p>\r\n\r\n<p>* Weight Capcity 450 lbs</p>\r\n\r\n<p>*Padded armrests provide added patient comfort</p>\r\n\r\n<p>* Comes standard with swing-away elevating legrests</p>\r\n\r\n<p>* Wheels set back on frame prevents tipping</p>\r\n\r\n<p>* Precision sealed wheel bearings in front and rear ensure long lasting performance and reliability</p>\r\n\r\n<p>* Standard dual axle provides easy transition of seat to hemi-level</p>\r\n\r\n<p>* Aluminum footplates are atractive, crack-proof and lightweight</p>\r\n\r\n<p>* Front caster forks are adjustable in 3 positions</p>\r\n\r\n<p>* Rear anti-tippers standard</p>\r\n\r\n<p>* Weight Limit: 4500 Lbs.&nbsp;</p>\r\n', 'This Wheelchair  new state-of-the-art hydraulic reclining mechanism allows for infinite adjustments up to 180 degrees', 1400, 990, 30, 'instock', '', 99, '', '', 0, 'wheelchair-full-reclining-22-1', '', 'Complete Medical', '', '', '129f27546283a273e673f13812883e42.jpg', '', '2019-03-10 11:43:04', '1', '10966P', '', '', '', '0', '', '1', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(239, 'Desk Arms 12', 1, 'Super Admin', 3, 'HCPCS', 'ICD10', 0, '<p>*The Viper comes standard with adjustable padded arms, multiple seat to floor height positions, anti-tippers with flip-up wheels which never have to be removed and push to lock wheel locks</p>\r\n\r\n<p>*The back is height adjustable to provide added patient comfort</p>\r\n\r\n<p>*The carbon steel frame is high strength while remaining lightweight</p>\r\n\r\n<p>*The wheelchair upholstery is made of durable nylon which is flame retardant and resists mildew and bacteria for long lasting comfort and cleanliness</p>\r\n\r\n<p>*These comfort options make the Viper from Drive Medical an ideal wheelchair for anybody that needs to be in a wheelchair for extended periods of time</p>\r\n\r\n<p>*This wheelchair is available with various arm styles, seat widths, and swing away footrests or elevating legrests</p>\r\n\r\n<p>*Features: *8&quot; front casters have 3 height adjustments</p>\r\n\r\n<p>*Back height adjustable from 18&quot; - 20&quot;</p>\r\n\r\n<p>*Carbon steel black powder coated frame double coated for an attractive, chip-proof, maintainable finish</p>\r\n\r\n<p>*Comes standard with flip up anti tippers *Comes with push to lock wheel locks</p>\r\n\r\n<p>*Comes with swing-away footrests or elevating legrests with tool-free adjustable length riggings</p>\r\n\r\n<p>*Composite footplates with heel loops are durable and lightweight *Composite mag-style wheels with aluminum hand rims are lightweight and maintenance free</p>\r\n\r\n<p>*Composite steel lined front receiver is angled so the arm will lock into place every time</p>\r\n\r\n<p>*Dual axle provides easy transition of seat height to hemi level</p>\r\n\r\n<p>*Durable, flame retardant nylon upholstery resists mildew and bacteria</p>\r\n\r\n<p>*Easier to propel and transport</p>\r\n\r\n<p>*Flip-back arms, allow for easy transfer</p>\r\n\r\n<p>*Frame style eliminates seat guides and allows for custom backs and accessories</p>\r\n\r\n<p>*Nylon padded armrests provide added patient comfort</p>\r\n\r\n<p>*Precision sealed wheel bearings in front and rear ensure long lasting performance and reliability</p>\r\n\r\n<p>*The front mounted release lever can be flipped up or down depending on the patients needs</p>\r\n\r\n<p>*Urethane rear tires and casters offer superior performance, smoother ride and are lightweight</p>\r\n\r\n<p>* Viper weighs 32 lbs (Excluding front rigging)</p>\r\n', 'The Drive Medical Viper is a versatile wheelchair right out of the box and it is easier to propel and transport than an average weight wheelchair', 730, 595, 0, 'instock', '', 100, '', '', 0, 'desk-arms-12-1', '', 'Complete Medical', '', '', '108085ab0df5b468eb2edff11cd67ddc.jpg', '', '2019-03-10 11:53:39', '1', '10967A-ELR', '', '', '', '0', '', '1', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(240, 'Combination Rollator & Transport Wheelchair', 1, 'Super Admin', 54, 'HCPCS', 'ICD10', 0, '<p>* An individual can ambulate independently or be pushed safely by a caregiver</p>\r\n\r\n<p>* The footrests flip-down and the padded backrest is reversible depending on whether you are using it as a rollator or transport chair</p>\r\n\r\n<p>* Equipped large non-marring 8&quot; black casters with soft grip tires, ideal for both indoor and outdoor use</p>\r\n\r\n<p>* Easy-to-operate ergonomic hand brakes</p>\r\n\r\n<p>* Water-resistant nylon pouch attaches under seat for added privacy and security of personal items</p>\r\n\r\n<p>* Fold-strap for easy storage and transport</p>\r\n\r\n<p>* Designed to meet all your patients&nbsp;fundamental needs</p>\r\n\r\n<p>* Height adjustable for a custom fit</p>\r\n\r\n<p>* Supports patient weights up to 250 pounds</p>\r\n\r\n<p>* Lightweight aluminum frame</p>\r\n\r\n<p>* Reversible padded backrest for easy conversion from rollator to transport mode</p>\r\n\r\n<p>* Comfortable, flip-up padded seat</p>\r\n\r\n<p>* Overall Width: 24&quot;</p>\r\n\r\n<p>* Width between Hand Grips: 19&quot;</p>\r\n\r\n<p>* Seat Dimensions: 14.25&quot; (W) x 13.25&quot; (D)</p>\r\n\r\n<p>* Seat-to-Floor Height: 21.75&quot;</p>\r\n\r\n<p>* Weight Capacity: 250 lb</p>\r\n\r\n<p>* Wheel Size: 8&quot; * Product Weight: 22 lb</p>\r\n\r\n<p>* Carton Dimensions: 25&quot; x 10.2&quot; x 34.25&quot;</p>\r\n\r\n<p>* Shipping Weight: 25 lb</p>\r\n\r\n<p>* Warranty: Limited lifetime on frame, One year on all parts&nbsp;</p>\r\n', 'This Rollator combines the features of a rollator with a transport chair all in one unit', 220, 130, 0, 'instock', '', 98, '', '', 0, '-combination-rollator-transport-wheelchair', '', 'Complete Medical', '', '', '9819d8bec5b690f85c3d7fe301957737.jpg', '', '2019-03-10 12:00:15', '1', '11040A', '', '', '', '11', '', '1', '', 'Blue, Burgundy', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(241, 'Knee Walker Adult', 1, 'Super Admin', 54, 'HCPCS', 'ICD10', 0, '<p>* Adult knee walker</p>\r\n\r\n<p>* Conveniently folds for storage and transport</p>\r\n\r\n<p>* Brake can be adjusted for either right or left handed use</p>\r\n\r\n<p>* Leg height and handles adjusts to fit the height of the user</p>\r\n\r\n<p>* Ideal for individuals recovering from foot surgery, breaks, sprains, amputation and ulcers of the foot</p>\r\n\r\n<p>* Deluxe lever brake ensures safety</p>\r\n\r\n<p>* Tool free height adjustment</p>\r\n\r\n<p>* Tool free left to right/right to left leg adjustment</p>\r\n\r\n<p>* 8&quot; casters ideal for indoor/outdoor use</p>\r\n\r\n<p>* Limited Lifetime Warranty</p>\r\n\r\n<p>* Weight capacity: 300 Lbs</p>\r\n', 'Quick and easy adjustments for right or left leg support', 410, 305, 0, 'instock', ' 1bottle', 100, '', '', 0, 'knee-walker-adult', '', 'Complete Medical', '', '', 'cd74653ed4a2b9832cb4be2ede7d49af.jpg', '7a20e68e6cf39feea513dd02bcbfe00e.jpg,9c0fbe2bde2b724e0104b92393574dfa.jpg,d50ce65c1073961197b8bb974f19c4fb.jpg', '2019-03-10 12:27:05', '1', '1089', '', '', '', '1', '', '1', '', '', '', '', '', '0', '', 1, '0', '0', '<p>* Adult knee walker</p>\r\n\r\n<p>* Conveniently folds for storage and transport</p>\r\n\r\n<p>* Brake can be adjusted for either right or left handed use</p>\r\n\r\n<p>* Leg height and handles <gwmw class=\"ginger-module-highlighter-mistake-type-3\" id=\"gwmw-15796744143786813903319\">adjusts</gwmw> to fit the height of the user</p>\r\n\r\n<p>* Ideal for individuals recovering from foot surgery, breaks, sprains, amputation and ulcers of the foot</p>\r\n\r\n<p>* Deluxe lever brake ensures safety</p>\r\n\r\n<p>* Tool free height adjustment</p>\r\n\r\n<p>* Tool free left to right/right to left leg adjustment</p>\r\n\r\n<p>* 8&quot; casters ideal for indoor/outdoor use</p>\r\n\r\n<p>* Limited Lifetime Warranty</p>\r\n\r\n<p>* Weight capacity: 300 Lbs</p>\r\n', '', 0, 1),
(242, 'Steerable Knee Walker', 1, 'Super Admin', 54, 'HCPCS', 'ICD10', 0, '<p>* Knee walker can be steered for increased maneuverability</p>\r\n\r\n<p>* New, two-piece padded leg pad provides comfort Deluxe braking system</p>\r\n\r\n<p>* Removable front basket Durable, steel frame with silver vein finish</p>\r\n\r\n<p>* Tool free height adjustment</p>\r\n\r\n<p>* 7&quot; casters are ideal for indoor/outdoor use</p>\r\n', 'Ideal for individuals recovering from foot surgery, breaks, sprains, amputation and ulcers of the foot', 375, 295, 0, 'instock', '', 98, '', '', 0, 'steerable-knee-walker', '', 'Complete Medical', '', '', '119b66e9fca848c857a536ce633be223.jpg', '', '2019-03-10 12:32:11', '1', '1089D', '', '', '', '0', '', '1', '', '', '', '', '', '8544.mp4', '', 1, '0', '0', '', '', 0, 1),
(243, 'Knee Walker, Adult, Steerable', 178, 'Amar', 54, 'HCPCS', 'ICD10', 0, '<p>* New foldable steering column allows for easy storage</p>\r\n\r\n<p>* Knee walker can be steered for increased maneuverability</p>\r\n\r\n<p>* Deluxe lever brake ensures safety</p>\r\n\r\n<p>* Tool free height adjustment</p>\r\n\r\n<p>* Foldable</p>\r\n\r\n<p>* 8&quot; casters are ideal for indoor/outdoor use</p>\r\n\r\n<p>* Limited Lifetime Warranty</p>\r\n\r\n<p>*1 year Warranty on brake cable</p>\r\n\r\n<p>* Weight Capacity 300 lbs</p>\r\n\r\n<p>* Handle Height 33&quot; - 37.5&quot;</p>\r\n\r\n<p>* Unit Dimensions 17&quot; (W) x 32&quot; (D)</p>\r\n\r\n<p>* Knee Pad Height 17.5&quot; - 21.5&quot;</p>\r\n\r\n<p>* Pad Dimensions 7.25&quot; (W) x 14.25&quot; (D)</p>\r\n\r\n<p>* Weight 19 lbs.</p>\r\n\r\n<p>* Shipping weight 26 lb</p>\r\n', 'Ideal for individuals recovering from foot surgery, breaks, sprains, amputation and ulcers of the foot', 400, 275, 0, 'instock', '', 87, '', '', 0, 'knee-walker-adult-steerable', '', 'Complete Medical', '', '', '1f4711e6a87f65c5ab98ed35ad8da0ff.jpg', 'ba6fe604dc27f8c8d77dbf1ba035bbe6.jpg,d33372f3b1b0f07b40157adb6ac3d6b0.jpg', '2019-03-10 12:41:54', '1', '1089S', '', '', '', '2', '', '1', '', '', '', '', '', '0', '', 1, '4', '8', '', '', 0, 1),
(244, 'Povidone Iodine Solution- Gallon', 1, 'Super Admin', 33, 'NA', 'NA', 0, '<p>* Gallon, Prep Solution</p>\r\n\r\n<p>* 10% povidone iodine, U.S.P. equivalent to 1% available iodine</p>\r\n\r\n<p>* Surgical site preparation</p>\r\n\r\n<p>* Veinpuncture</p>\r\n\r\n<p>* Care of abrasions, lacerations and minor burns&nbsp;</p>\r\n', 'For antiseptic treatment of skin and mucosa', 45, 35, 0, 'instock', '', 100, '', '', 0, 'povidone-iodine-solution-gallon', '', 'Complete Medical', '', '', '469f1dbccb6f2477d660e1d67228dc33.jpg', '', '2019-03-10 14:20:20', '1', '233', '', '', '', '0', '', '0', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(245, 'Bariatric Adult Folding Walker w/Wheels, Double Button', 1, 'Super Admin', 58, 'HCPCS,E0148', 'ICD10', 0, '<p>* Wider and deeper frame design accommodates individuals up to 500 lbs</p>\r\n\r\n<p>* Vinyl contoured hand grip</p>\r\n\r\n<p>* Precision design provides additional strength while adding minimal weight</p>\r\n\r\n<p>* Includes rear glide caps, (item #1085B) allowing use on all surfaces.</p>\r\n\r\n<p>* Limited Lifetime Warranty</p>\r\n\r\n<p>* Width (Inside Hand Grips) 20&quot;</p>\r\n\r\n<p>* Overall width 27&quot;</p>\r\n\r\n<p>* Depth 24&quot;</p>\r\n\r\n<p>* Height 32&quot; - 39</p>\r\n', 'This Walker with wheels is for adult Bariatric use', 160, 120, 0, 'instock', '', 100, '', '', 0, 'bariatric-adult-folding-walker-w-wheels-double-button', '', 'Complete Medical', '', '', 'ea2447bcb36297bece337534cc5918ee.jpg', '', '2019-03-10 14:25:11', '0', '1056C', '', '', '', '0', '', '1', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(246, 'Walker, Folding, Adult, Trigger Release', 1, 'Super Admin', 58, 'HCPCS', 'ICD10', 0, '<p>* Trigger release can be reached with hands of all sizes</p>\r\n\r\n<p>* Durable, composite trigger release resists cracking and breaking</p>\r\n\r\n<p>* Sturdy 1&quot; diameter anodized, extruded aluminum construction ensures maximum strength while remaining lightweight</p>\r\n\r\n<p>* Replacement wheels 5&quot; &nbsp;</p>\r\n\r\n<p>* Includes rear glide caps, and glide covers&nbsp;</p>\r\n\r\n<p>allowing use on all surfaces</p>\r\n\r\n<p>* Patented</p>\r\n\r\n<p>* Limited Lifetime Warranty</p>\r\n\r\n<p>* 350 lb. weight capacity. *</p>\r\n', 'Trigger release feature allows the user to close the walker without removing their hands from the handle and is ideal for individuals with limited finger dexterity', 45, 35, 0, 'instock', '', 100, '', '', 0, 'walker-folding-adult-trigger-release', '', 'Complete Medical', '', '', 'a9da889cd4e3f324eaa2f2c17db0707a.jpg', '5ef6e52936e938065abbd6817f72828f.jpg', '2019-03-10 14:29:14', '0', '1073F', '', '', '', '0', '', '1', '', '', '', '', '', '0', '', 1, '2', '3', '', '', 0, 1),
(247, 'Deluxe Folding Travel Walker Red', 1, 'Super Admin', 58, 'HCPCS', 'ICD10', 0, '<p>* Comes with 5&quot; front wheels and rear glide skis that are ideal for most surfaces</p>\r\n\r\n<p>* Two side storage pouches with large pockets for personal items are held in place by Velcro tabs to both side frames</p>\r\n\r\n<p>* Sturdy 1&quot; diameter anodized, extruded aluminum construction ensures maximum strength while remaining lightweight</p>\r\n\r\n<p>* Limited Lifetime Warranty *</p>\r\n', 'Easily folds tool free to 1/4 the size of a traditional walker', 150, 110, 0, 'instock', '', 100, '', '', 0, 'deluxe-folding-travel-walker-red', '', 'Complete Medical', '', '', 'b46c3626806a496d1fda2b8ee4139f0c.jpg', '123502f6662ce86d1ded9d2e1d8a1d09.jpg,ac8d692d978b103a822bfe025da9b156.jpg,844703059c3f5647c020259b4c532126.jpg', '2019-03-10 14:34:22', '0', '1075M', '', '', '', '0', '', '1', '', 'Red', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(248, 'Knee Scooter Deluxe', 1, 'Super Admin', 2, '', '', 0, '<p>* Perfect solution for those who are unable to put weight on their foot or ankle due to an injury or surgery</p>\r\n\r\n<p>* With its four large wheels and padded knee platform, the knee scooter is perfect for indoor and outdoor use</p>\r\n\r\n<p>* The offset post on the padded knee platform allows for right-to-left adjustment in seconds -- no tools required</p>\r\n\r\n<p>* Equipped with an easy folding mechanism that collapses using a thumb release lever and fits beneath the raised knee platform for ease of storage and transportation</p>\r\n\r\n<p>* Generous turning radius for increased maneuverability</p>\r\n\r\n<p>* Large 8-inch clear PU wheels with sealed bearings</p>\r\n\r\n<p>* Adjustable hand brake ensures safety</p>\r\n\r\n<p>* Height adjustable to meet a variety of patient profiles</p>\r\n\r\n<p>* Padded knee platform with easy-<gwmw class=\"ginger-module-highlighter-mistake-type-3\" id=\"gwmw-15780486577104002476972\">adjustment</gwmw> mechanism</p>\r\n\r\n<p>* 350 lb weight capacity</p>\r\n\r\n<p>* Limited lifetime warranty on frame; 90 days on all other parts</p>\r\n\r\n<p>* Patient height range: 4.11&quot; - 6.6&quot;</p>\r\n\r\n<p>* Knee platform dimensions: 7&quot; (W) x 14&quot; (L)</p>\r\n\r\n<p>* Adjustable Handle Height: 31&quot; - 41&quot;</p>\r\n\r\n<p>* Knee platform height: 17.5&quot; - 22&quot;</p>\r\n\r\n<p>* Product weight: 22.8 lbs&nbsp;</p>\r\n', ' A great alternative to crutches or folding walkers that can have adverse effects such as back or under arm pain from extended use', 310, 220, 0, 'instock', '', 100, '', '', 0, 'knee-scooter-deluxe', '', 'Complete Medical', '', '', '5c92e2f65672ef10ae7abdcf9a6d97db.jpg', '', '2019-03-10 14:41:47', '1', '1085DLX', '', '', '', '1', '', '1', '', '', '', '', '', '0', '', 1, '0', '0', '<p>* Perfect solution for those who are unable to put weight on their foot or ankle due to an injury or surgery</p>\r\n\r\n<p>* With its four large wheels and padded knee platform, the knee scooter is perfect for indoor and outdoor use</p>\r\n\r\n<p>* The offset post on the padded knee platform allows for right-to-left adjustment in seconds -- no tools required</p>\r\n\r\n<p>* Equipped with an easy folding mechanism that collapses using a thumb release lever and fits beneath the raised knee platform for ease of storage and transportation</p>\r\n\r\n<p>* Generous turning radius for increased maneuverability</p>\r\n\r\n<p>* Large 8-inch clear PU wheels with sealed bearings</p>\r\n\r\n<p>* Adjustable hand brake ensures safety</p>\r\n\r\n<p>* Height adjustable to meet a variety of patient profiles</p>\r\n\r\n<p>* Padded knee platform with easy-<gwmw class=\"ginger-module-highlighter-mistake-type-3\" id=\"gwmw-15796731487100445643462\">adjustment</gwmw> mechanism</p>\r\n\r\n<p>* 350 lb weight capacity</p>\r\n\r\n<p>* Limited lifetime warranty on frame; 90 days on all other parts</p>\r\n\r\n<p>* Patient height range: 4.11&quot; - 6.6&quot;</p>\r\n\r\n<p>* Knee platform dimensions: 7&quot; (W) x 14&quot; (L)</p>\r\n\r\n<p>* Adjustable Handle Height: 31&quot; - 41&quot;</p>\r\n\r\n<p>* Knee platform height: 17.5&quot; - 22&quot;</p>\r\n\r\n<p>* Product weight: 22.8 lbs&nbsp;</p>\r\n', '', 0, 1),
(249, 'Static Air Mattress', 1, 'Super Admin', 27, 'HCPCS,E0198', 'ICD10', 0, '<p>* 32&quot;W x 72&quot;L</p>\r\n\r\n<p>* Features 55 air holes that allow air circulation, reducing heat build-up while providing a dry sleeping surface * Pumps can be purchased to ease inflation&nbsp;</p>\r\n\r\n<p>* Notice to California Consumers: WARNING: This product contains chemicals known to the State of California to cause cancer and birth defects or other reproductive harm *</p>\r\n', 'This mattress reduces interface pressure for the patient', 60, 45, 0, 'instock', '', 100, '', '', 0, 'static-air-mattress', '', 'Complete Medical', '', '', '50256aca9de562b94235f10412f82770.jpg', '88040a4c9bbdabb6b873476542374bb9.jpg,38134d2cfac080f5e047fda8f8e713f6.jpg', '2019-03-14 08:54:20', '1', '10760', '', '', '', '0', '', '1', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1);
INSERT INTO `product` (`id`, `product_name`, `seller_id`, `seller_name`, `category`, `item_code`, `diagnosis_code`, `subcategory`, `description`, `short_description`, `price`, `sale_price`, `delivery_charge`, `stock_status`, `strip`, `stock`, `user_like`, `rating`, `sale`, `slug`, `product_code`, `product_brand`, `measurement`, `measure_unit`, `product_image`, `image_gallery`, `created_date`, `status`, `tags`, `transaction_cost`, `reviews`, `flag`, `tax`, `store_type`, `insurance`, `insurance_name`, `color`, `csv`, `size`, `weight`, `product_video`, `storeprice`, `prescription`, `rating_point`, `rating_users`, `description_space`, `link`, `isDelete`, `isActive`) VALUES
(250, 'PressureGuard Easy Air Mattress', 1, 'Super Admin', 27, 'HCPCS,E0277', 'ICD10', 0, '<p>Low-air-loss Therapy with Alternating Pressure</p>\r\n\r\n<p>* The new PressureGuard Easy Air is independently documented to outperform every leading low air loss system in this key performance area</p>\r\n\r\n<p>* Remarkably, it does so with none of the compromises low air loss users have come to accept, thanks to its exclusive Air Diffusion Matrix technology and PressureGuard air/foam design</p>\r\n\r\n<p>* Easy Air won&#39;t lose inflation in a power outage</p>\r\n\r\n<p>* Its stable surface won&#39;t &quot;swallow up&quot; the user</p>\r\n\r\n<p>* And its Safety Edge won&#39;t collapse like air-only mattresses can, making transfers safer</p>\r\n\r\n<p>* It won&#39;t make the user too hot or cold</p>\r\n\r\n<p>* Ultra-simple to set up, clean and use</p>\r\n\r\n<p>* Dial sets the comfort level &quot;On/off&quot; buttons control air flow and alternating pressure feature</p>\r\n\r\n<p>* Weight limit: 500 lbs. on standard model</p>\r\n\r\n<p>* Mattress weight: 22 lbs</p>\r\n\r\n<p>* Warranty: 2-years, non-prorated</p>\r\n\r\n<p>* UL listed * The PressureGuard&nbsp;</p>\r\n\r\n<p>* Notice to California Consumers: WARNING: This product contains chemicals known to the State of California to cause cancer and birth defects or other reproductive harm&nbsp;</p>\r\n', 'Clinicians choose low air loss systems to address maceration, the weakening of the skin due to excess moisture', 9000, 6500, 0, 'instock', '', 100, '', '', 0, 'pressureguard-easy-air-mattress', '', 'Complete Medical', '', '', '4d864c34143934ab6210c7c1a3354fc4.jpg', '', '2019-03-14 09:02:11', '1', '1839A', '', '', '', '0', '', '1', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(251, 'Patriot Semi Electric Bed Bed Only', 177, 'Prishu', 56, 'HCPCS', 'ICD10', 0, '<p>* Bed Only</p>\r\n\r\n<p>* Introducing the new Patriot Semi-Electric Homecare Bed with a grid sleep surface</p>\r\n\r\n<p>*Sleep surface and motors are MADE IN THE USA</p>\r\n\r\n<p>*The motor unit and bed design provide the ultimate in quiet, smooth operation</p>\r\n\r\n<p>*Complete welded steel frame construction</p>\r\n\r\n<p>*The head and foot sections can be raised or lowered simultaneously or independently with one hand control</p>\r\n\r\n<p>*During a power failure the motor unit can lower both the head and foot section with just a single standard 9 volt battery</p>\r\n\r\n<p>*Assembles easily with just 5 components</p>\r\n\r\n<p>*Meets the requirements of HCPCS codes</p>\r\n\r\n<p>*Maximum patient weight 350 lbs</p>\r\n\r\n<p>*450 lbs evenly distributed total weight capacity including patient, mattress, rails, and accessories</p>\r\n\r\n<p>*Bed Height: Min. 15&quot;, Max. 24&quot; (at deck level)</p>\r\n\r\n<p>*Lift Range: Head - 60, Knee - 30&nbsp;</p>\r\n\r\n<p>*Overall Bed Size: 87&quot; L x 36&quot; W</p>\r\n\r\n<p>*No external pinch points</p>\r\n\r\n<p>*Slots in frame to ensure proper rail placement</p>\r\n\r\n<p>*Locking pins secure bed ends to sleep deck</p>\r\n\r\n<p>*Attached lanyards prevent loss while moving or storing</p>\r\n\r\n<p>*Grid Deck offers the following advantages: Much stronger frame, better mattress support, no spring sag or bottoming out with heavier patients, easier to clean, and no connecting links or springs to lose</p>\r\n\r\n<p>*2 year warranty for defects in workmanship and materials of technical components, frame, and electronics</p>\r\n\r\n<p>*During the warranty period, defective items will be repaired or replaced at manufacturers option</p>\r\n\r\n<p>*The warranty does not include any labor charges incurred in replacement part(s) installation or any associated freight or shipping charges to the manufacture</p>\r\n', 'The only homecare bed to offer optional corner mattress retainers', 1000, 702, 0, 'instock', '', 97, '', '', 0, 'patriot-semi-electric-bed-bed-only', '', 'Complete Medical', '', '', '9a6ea9a75210cd60904569ce345cd535.jpg', '', '2019-03-14 09:19:57', '1', '1801A', '', '', '', '11', '', '1', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(252, 'Combination TENS/EMS Digital Unit w/Time', 1, 'Super Admin', 25, 'HCPCS,E0745,E0720', 'ICD10', 0, '<p>* Includes: Device, batteries, lead wires, electrodes (1 pack of 4), carrying case and users manual.Ultima combo (Tens/EMS with body part diagram)</p>\r\n\r\n<p>* Timer: 5~60mins or continuous</p>\r\n\r\n<p>* 3 Years Manufacturer &#39;s warranty</p>\r\n\r\n<p>* 2 &quot;AA&quot; batteries are included with the unit</p>\r\n', 'Offers the user the choice of 5 modes of TENS and 2 Modes of EMS', 95, 70, 0, 'instock', '', 100, '', '', 0, 'combination-tens-ems-digital-unit-w-time', '', 'Complete Medical', '', '', '2868da286830884922ae37c84fee509e.jpg', '', '2019-03-15 08:19:28', '1', '3162', '', '', '', '0', '', '0', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(253, 'OTC TENS Unit Dual Channel', 1, 'Super Admin', 25, '', '', 0, '<p>* No prescription required</p>\r\n\r\n<p>* 8 automatic therapy modes</p>\r\n\r\n<p>* Small and lightweight</p>\r\n\r\n<p>* Includes: TENS unit, 2 wires, 4 electrodes and 2 &quot;AAA&quot; batteries</p>\r\n\r\n<p>* Retail packaged</p>\r\n', 'Electrotherapy', 45, 32, 0, 'instock', '', 100, '', '', 0, 'otc-tens-unit-dual-channel', '', 'Complete Medical', '', '', '18f1af7ae617c891e26c7a0eec9c476c.jpg', 'f62a31ecb93a5e02cd67cba53e16a5e2.jpg,ac65814ef6896597f449915d107ca7a7.jpg', '2019-03-15 08:29:20', '1', '3150', '', '', '', '0', '', '0', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(254, 'Tens Unit Dual Channel 3 Mode w/Time', 1, 'Super Admin', 25, 'HCPCS', 'ICD10', 0, '<p>* System includes device, lead wires, four self-adhesive reusable electrodes, 9V battery, hard plastic carrying case and instruction manual</p>\r\n\r\n<p>* Dual Channel</p>\r\n\r\n<p>* 30 and 60 minutes or continuous timer</p>\r\n\r\n<p>* Adjustable Pulse Width: 50-250 Microseconds</p>\r\n\r\n<p>* Pulse Rate: 2-150 Hz</p>\r\n\r\n<p>* Pulse Amplitude: 0-80 mA each channel</p>\r\n\r\n<p>* Waveform: Asymmetrical biphasic square pulse</p>\r\n\r\n<p>* One year warranty</p>\r\n\r\n<p>* FDA approved</p>\r\n', '3 Modes: Standard, Modulate and Burst', 52, 38, 0, 'instock', '', 100, '', '', 0, 'tens-unit-dual-channel-3-mode-w-time', '', 'Complete Medical', '', '', '800b0bb9fc1635947f2c740604f81f08.jpg', '', '2019-03-15 08:34:04', '1', '3166D', '', '', '', '0', '', '1', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(255, 'Microcurrent Tens Unit Micro II', 1, 'Super Admin', 25, 'HCPCS,E0745', 'ICD10', 0, '<p>* Kit contains one dual channel tens stimulator, carry case, set of lead wires, instruction manual, 9V battery and set of electrodes</p>\r\n\r\n<p>* Pulse amplitude: 12 V, Output Volt, No load</p>\r\n\r\n<p>* Pulse frequency: 0.5, 8, 80 Hz selected</p>\r\n\r\n<p>* Pulse width (microseconds): 6250 Fixed</p>\r\n\r\n<p>* Wave form: Asymmetrical bi-phasic square pulse</p>\r\n\r\n<p>* Timer: 10, 20 and 40 minutes</p>\r\n\r\n<p>* Mode selector: None</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'This Microcurrent Tens Unit is dual isolated between channels', 100, 56, 0, 'instock', '', 100, '', '', 0, 'microcurrent-tens-unit-micro-ii', '', 'Complete Medical', '', '', '4c694a62b820c6dacca18a2ed67b4717.jpg', '', '2019-03-15 08:38:12', '1', '3166K', '', '', '', '0', '', '1', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(256, 'UltraTens II Unit Ultrasound and TENS Combo', 1, 'Super Admin', 25, '', '', 0, '<p>* Deep heat from the therapeutic ultrasound and TENS therapy can be used simultaneously to help patients treat chronic and acute muscular pain</p>\r\n\r\n<p>* New innovative design features an increased duty cycle of 50% with three easy-to-use mode presets, plus 30 mA of TENS therapy</p>\r\n\r\n<p>* This versatile portable unit comes with carry case, AC adaptor and ultrasound gel for office or mobile use</p>\r\n\r\n<p>* 1 MHz with 3 power levels * Beam Non-uniformity Ration (BNR) 5:1 max</p>\r\n\r\n<p>* 3 Treatment times</p>\r\n\r\n<p>* Auto-off after10 min</p>\r\n\r\n<p>* Includes: device, 2&quot; x 4&quot; cloth, electrode, lead wire, AC adapter, gel, quick start guide, manual</p>\r\n', 'The UltraTENS II combines the two most proven modalities, ultrasound and TENS technology for pain relief into one compact sleek device', 260, 180, 0, 'instock', '', 100, '', '', 0, 'ultratens-ii-unit-ultrasound-and-tens-combo', '', 'Complete Medical', '', '', '8c0724cba0a6ef50aedee869c405e2b0.jpg', 'ababdfe485dc35eb62cb44c7b2d35a90.jpg,2033a94254bfb8838145bdddf591b6fa.jpg,132e37ce46d26a75652c55b6e2995502.jpg', '2019-03-15 08:44:36', '1', 'DU6012', '', '', '', '0', '', '0', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(257, 'Azulfidine', 1, 'Super Admin', 38, 'CPT', 'ICD10', 0, '<p>Common Uses:&nbsp;It is used to treat rheumatoid arthritis. It is used to treat ulcerative colitis. It is used to help keep ulcerative colitis flares from coming back. It may be given to you for other reasons. Talk with the doctor</p>\r\n\r\n<p>Ingredient Name: Sulfasalazine Delayed-Release Tablets&nbsp;</p>\r\n\r\n<p>Drug Manufacturer: PFIZER</p>\r\n\r\n<p>Generic Available: SULFASALAZINE EC 500MG DR TABLETS</p>\r\n', 'AZULFIDINE 500MG EN TABS.  PRICE PER TABLET\r\n\r\n', 3, 2, 0, 'instock', '', 100, '', '', 0, 'azulfidine', '', 'Bloomtown', '', '', 'b1378dae983e4f799342cbf500c3f806.jpg', '', '2019-03-15 11:33:49', '0', '32', '', '', '', '0', '', '1', '', 'empty', '', '', '', '0', '2', 1, '0', '0', '', '', 0, 1),
(258, 'Celebrex', 1, 'Super Admin', 38, 'CPT', 'ICD10', 0, '<p>Ingredient Name:&nbsp;Celecoxib</p>\r\n\r\n<p>Drug Manufacturer: PFIZER</p>\r\n\r\n<p>Generic Available: CELECOXIB 100MG CAPSULES</p>\r\n\r\n<p>Common Uses:&nbsp;It is used to ease pain and swelling. It is used to treat arthritis. It is used to ease painful period (menstrual) cycles. It is used to treat ankylosing spondylitis. It may be given to you for other reasons. Talk with the doctor.</p>\r\n', 'Available in 50,  100, 200, 300, 400 and 500 mg Capsules. Contact Provider for pricing', 0, 0, 0, 'instock', '', 100, '', '', 0, 'celebrex', '', 'Bloomtown', '', '', '6b9524487c10b46356c08edc7fa1144e.jpg', '', '2019-03-15 11:47:40', '0', '12', '', '', '', '0', '', '1', '', 'empty', '', '', '', '0', '0', 1, '0', '0', '', '', 0, 1),
(259, 'Diclofenac 1% Gel 100gm', 1, 'Super Admin', 38, 'CPT', 'ICD10', 0, '<p>Ingredient Name: Diclofenac Gel (1%) (dye KLOE fen ak)</p>\r\n\r\n<p>Drug Manufacturer:&nbsp;AMNEAL PHARMACEUTICALS</p>\r\n\r\n<p>Common Uses:&nbsp;This medication is used to relieve joint pain from arthritis.&nbsp;Diclofenac&nbsp;belongs to a class of drugs known as nonsteroidal anti-inflammatory drugs.</p>\r\n', 'Copay prices depends on insurance plan. ', 65, 50, 0, 'instock', '', 100, '', '', 0, 'diclofenac-1-gel-100gm', '', 'Bloomtown', '', '', '6f6b8f781563441581babad14b15aca2.jpg', '', '2019-03-15 12:00:55', '0', '34', '', '', '', '0', '', '1', '', 'empty', '', '', '', '0', '50', 1, '0', '0', '', '', 0, 1),
(260, 'Monoject Insulin Syringes 1/2cc 28g Bx/100', 1, 'Super Admin', 26, 'HCPCS', 'ICD10', 0, '<p>* 1/2cc 28 Gauge Bx/100</p>\r\n\r\n<p>* Individually wrapped for maximum protection</p>\r\n', 'Insulin Syringes', 35, 25, 0, 'instock', '', 100, '', '', 0, 'monoject-insulin-syringes-1-2cc-28g-bx-100', '', 'Complete Medical', '', '', '47438ed1c5e9e848c0d1b216136c3297.jpg', '', '2019-03-17 10:02:15', '1', '2451A', '', '', '', '0', '', '1', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(261, 'Monolet Style Lancets Bx/100 Twist Top 28G', 1, 'Super Admin', 26, 'HCPCS', 'ICD10', 0, '<p>* Consistent depth penetration</p>\r\n\r\n<p>* Unique design fits almost all lancing devices</p>\r\n\r\n<p>* 100 sterile lancets</p>\r\n', 'Fine gauge, tri-bevel tip for virtually painless sampling', 6, 4, 0, 'instock', '', 100, '', '', 0, 'monolet-style-lancets-bx-100-twist-top-28g', '', 'Complete Medical', '', '', '2a4f7279a19cd36d2215bf72aef25378.jpg', '', '2019-03-17 10:07:14', '1', '2697', '', '', '', '0', '', '1', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(262, 'Pressure Activated Lancets 26g 1.8mm Yellow (Bx/100)', 1, 'Super Admin', 26, 'HCPCS', 'ICD10', 0, '<p>26 gauge - 1.8 mm Depth, Pressure Activated</p>\r\n\r\n<p>* SensiLance Pressure Activated Lancets</p>\r\n\r\n<p>* For capillary blood samples</p>\r\n\r\n<p>* Ready to use - no loading needed</p>\r\n\r\n<p>* Needle automatically retracts</p>\r\n\r\n<p>* Latex Free</p>\r\n', 'Covered by Medicare Part B, Medicaid and HMO\'s', 24, 16, 0, 'instock', '', 100, '', '', 0, 'pressure-activated-lancets-26g-1-8mm-yellow-bx-100', '', 'Complete Medical', '', '', 'caf7a23422b54208b4dfc288e3495690.jpg', '', '2019-03-17 10:09:59', '1', '2700A', '', '', '', '0', '', '1', '', 'empty', '', '', '', '0', '00', 1, '0', '0', '', '', 0, 1),
(263, 'Prodigy Preferred Blood Glucose No Coding Strips,Bx/50', 1, 'Super Admin', 26, 'HCPCS', 'ICD10', 0, '<p>Do not use GDH-PQQ Technology</p>\r\n\r\n<p>* Offers Alternate Site Testing (AST) palm, forearm, upper arm, thigh or calf</p>\r\n\r\n<p>* Requires a tiny blood sample</p>\r\n\r\n<p>* Designed with capillary action that automatically draws in blood sample</p>\r\n', 'Covered by Medicare Part B, Medicaid and HMO\'s', 26, 18, 0, 'instock', '', 100, '', '', 0, 'prodigy-preferred-blood-glucose-no-coding-strips-bx-50', '', 'Complete Medical', '', '', '5d8e0e09c1c08250cccc1415381518e9.jpg', '', '2019-03-17 10:13:28', '1', '52800', '', '', '', '0', '', '1', '', 'empty', '', '', '', '0', '00', 1, '0', '0', '', '', 0, 1),
(264, 'Control Solution \'Low\' 4 ml. for Prodigy Glucometers', 1, 'Super Admin', 26, 'HCPCS', 'ICD10', 0, '<p>&nbsp; Used to check accuracy of the low sugar results of Prodigy glucometers</p>\r\n\r\n<p>* If your machine can read your results properly, then you can be assured your machine is working correctly</p>\r\n', 'Covered by Medicare Part B, Medicaid and HMO\'s', 8, 6, 0, 'instock', '', 100, '', '', 0, 'control-solution-low-4-ml-for-prodigy-glucometers', '', 'Complete Medical', '', '', '3685299f302ebe49a826a0a39a962bdb.jpg', '', '2019-03-17 10:16:18', '1', '53310', '', '', '', '0', '', '1', '', 'empty', '', '', '', '0', '00', 1, '0', '0', '', '', 0, 1),
(265, 'Care Touch Insulin Syringes 30G, 0.5cc, 1/2 in. Bx/100', 1, 'Super Admin', 26, 'HCPCS', 'ICD10', 0, '<p>Care Touch Insulin Syringes 30G,.5cc, 5/16&quot;, 8mm, Box 100</p>\r\n', 'Covered by Medicare, Medicaid and HMO\'S', 18, 12, 0, 'instock', '', 100, '', '', 0, 'care-touch-insulin-syringes-30g-0-5cc-1-2-in-bx-100', '', 'Complete Medical', '', '', '0da7f6147c73c8b5ebc255307b22e31b.jpg', '5799ecf2fe58d76d227b03b351591f47.jpg', '2019-03-17 10:19:26', '1', 'CT30101', '', '', '', '0', '', '1', '', 'empty', '', '', '', '0', '00', 1, '0', '0', '', '', 0, 1),
(266, 'Care Touch Syringe Only 1ml with Luer Slip Tip Bx/100', 1, 'Super Admin', 26, 'HCPCS', 'ICD10', 0, '<p>* 1ml Syringe Only with Luer Slip Tip - Box of 100 Syringes</p>\r\n\r\n<p>* Individually wrapped * High barrel clarity</p>\r\n\r\n<p>* Accurate and clear scale marking</p>\r\n\r\n<p>* Non-Toxic, Pryogen Free</p>\r\n\r\n<p>* Sterile</p>\r\n', 'This syringe is easy to read', 16, 12, 0, 'instock', '', 100, '', '', 0, 'care-touch-syringe-only-1ml-with-luer-slip-tip-bx-100', '', 'Complete Medical', '', '', 'f68ae5e3c39264dfbc1c833b34866340.jpg', 'cfbdf25f54e2030e8965cd6b5e46fe8d.jpg', '2019-03-17 10:22:31', '1', 'CT50101', '', '', '', '0', '', '1', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(267, 'Abilify 10mg Tablets', 1, 'Super Admin', 39, 'CPT', 'ICD10', 0, '<p>Ingredient Name: Aripiprazole Tablets</p>\r\n\r\n<p>Drug Manufacturer: BMS</p>\r\n\r\n<p>Generic Available: ARIPIPRAZOLE 10MG TABLETS</p>\r\n\r\n<p>Common Uses:&nbsp;It is used to treat schizophrenia. It is used to treat bipolar problems. It is used to treat low mood. It is used to treat certain behavior problems in patients with autism. It is used to treat Tourette&#39;s syndrome. It may be given to you for other reasons. Talk with the doctor</p>\r\n', 'Covered by Medicare, Medicaid and HMO\'o Plans', 0, 0, 0, 'instock', '', 100, '', '', 0, 'abilify-10mg-tablets', '', 'Bloomtown', '', '', '757d646ca5ceddbc604e4b9db538404a.jpg', '', '2019-03-17 11:01:33', '0', '23', '', '', '', '0', '', '1', '', 'empty', '', '', '', '0', '0', 1, '0', '0', '', '', 0, 1),
(268, 'Rollator Cushion w/Sherpa Top Black 13', 199, 'Nilesh', 2, '', '', 0, '<p>With Sherpa top</p>\r\n\r\n<p>* 13&quot;L x 14&quot; W x 2&quot;H&nbsp;</p>\r\n\r\n<p>* The Rollator cushion has the sherpa top on one side and the black poly-cotton on the other side</p>\r\n\r\n<p>* Comfort cushion for any firm rollator seat</p>\r\n\r\n<p>* Attaches easily with two hook and loop straps</p>\r\n\r\n<p>* Removable washable stretch cover</p>\r\n', 'Rollator Accessory', 50, 35, 0, 'instock', '', 100, '', '', 0, 'rollator-cushion-w-sherpa-top-black-13-1', '', 'Complete Medical', '', '', '770eaefc7e9d1d1c1ebece8ee115051d.jpg', '', '2019-03-17 11:41:07', '1', '11044C', '', '', '', '10', '', '0', '', '', '', '', '', '0', '', 0, '4', '1', '', '', 0, 1),
(269, 'Transport Chair, 22', 1, 'Super Admin', 3, 'HCPCS', 'ICD10', 0, '<p>* Lightweight - weighs only 33 lbs.</p>\r\n\r\n<p>* Supports individuals up to 450 lbs.</p>\r\n\r\n<p>* Attachable push bar with padded foam grip makes it easier to push</p>\r\n\r\n<p>* 12&quot; rear flat-free wheels</p>\r\n\r\n<p>* Adjustable leg support</p>\r\n\r\n<p>* Fixed, full length arms</p>\r\n\r\n<p>* Padded armrests provide additional comfort</p>\r\n\r\n<p>* Heavy duty, nylon reinforced upholstery with two carry handles</p>\r\n\r\n<p>* Limited lifetime warranty *</p>\r\n', ' Comes with lever and companion activated wheel locks and swing-away footrests', 700, 480, 0, 'instock', '', 100, '', '', 0, 'transport-chair-22-1', '', 'Complete Medical', '', '', '961f942d9ba96f67c0bcf821f1652c7f.jpg', '', '2019-03-17 11:51:28', '1', 'ATC22R', '', '', '', '0', '', '0', '', 'Red', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(270, 'Cirrus Plus Power Wheelchair Folding Lightweight 16', 1, 'Super Admin', 55, 'HCPCS, KO822', 'ICD10', 0, '<p>* 16&quot;</p>\r\n\r\n<p>* Elevating legrest available</p>\r\n\r\n<p>* Optional arm available</p>\r\n\r\n<p>* Intergrated, programmable PG controller</p>\r\n\r\n<p>* Adjustable height flip back arms and detachable arms</p>\r\n\r\n<p>* Attractive carbon steel frame with silver vein finish</p>\r\n\r\n<p>* Flat free, 12.5&quot; black drive wheels</p>\r\n\r\n<p>* Front 8&quot; flat free black casters</p>\r\n\r\n<p>* T-style adjustable arm optional</p>\r\n\r\n<p>* Anti tippers, standard</p>\r\n\r\n<p>* Elevating legrests optional</p>\r\n\r\n<p>* Adjustable tension back</p>\r\n\r\n<p>* Comes standard with seat belt, seat cushion with pouch, calf straps and heel loops</p>\r\n\r\n<p>* Folding battery tray * Back is height adjustable</p>\r\n\r\n<p>* Padded back upholstery and cushioned seat</p>\r\n\r\n<p>* Adjustable length joystick mount</p>\r\n\r\n<p>* Wheel locks</p>\r\n\r\n<p>* Comes with two U1, 34 AMP batteries</p>\r\n\r\n<p>* Has been tested and surpassed the ANSI RESNA testing requirement</p>\r\n\r\n<p>* Six months warranty on battery (from date of installation)</p>\r\n\r\n<p>* Limited Lifetime Warranty on power chair frame (from date of installation)</p>\r\n\r\n<p>* One Year Limited Warranty on electronics and drive train components</p>\r\n\r\n<p>* 300 lb. Weight Capacity&nbsp;</p>\r\n', 'This Wheelchair is foldable, lightweight with a frame that makes portability and transportation easy and convenient', 2800, 1950, 0, 'instock', '', 100, '', '', 0, 'cirrus-plus-power-wheelchair-folding-lightweight-16', '', 'Complete Medical', '', '', '9c6ae960228c92f045cfcf5cc3951bcb.jpg', '', '2019-03-17 12:01:25', '1', 'CPN16FBA', '', '', '', '0', '', '1', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(271, 'LiteRider PTC Power WC Red Rear Wheel Drive', 1, 'Super Admin', 55, '', '', 0, '<p>* Rear wheel drive</p>\r\n\r\n<p>* Comfortable, full size stadium seat and non-marking black tires on steel rims with shiny hubcabs</p>\r\n\r\n<p>* Weight capacity: 275 lbs</p>\r\n\r\n<p>* Maximum Speed: 3.5 mph</p>\r\n\r\n<p>* Operating Range: 9.5 miles</p>\r\n\r\n<p>* Ground Clearance: 2.5&quot;</p>\r\n\r\n<p>* Turning Radies: 26&quot; Type Batteries: 2-18 AH</p>\r\n\r\n<p>* Color: Red body with black seat</p>\r\n\r\n<p>* Freewheel Mode: Yes *Electronic Speed Control: Yes</p>\r\n\r\n<p>* Electro-Mechanical Brakes: Yes</p>\r\n\r\n<p>* Charger: Off-Board</p>\r\n\r\n<p>* Controller: PG VR-2, 50 Amp Remote</p>\r\n\r\n<p>*Length: 33&quot;</p>\r\n\r\n<p>* Width: 22.5&quot;</p>\r\n\r\n<p>* Height: 34.5&quot; - 36.5&quot;</p>\r\n\r\n<p>* Ground to Top of Seat: 20.9&quot;</p>\r\n\r\n<p>* Number of Seat Height Positions: 3</p>\r\n\r\n<p>* Size of increments: 1.0&quot;</p>\r\n\r\n<p>* Weight of Unit: 114 lbs</p>\r\n\r\n<p>* Tires: Flat Free</p>\r\n\r\n<p>* Rear tires: 9.5&quot;, Casters: 6&quot;</p>\r\n\r\n<p>* Standard Seat: 18&quot; x 15&quot;</p>\r\n\r\n<p>* Footrests are both height and angle adjustable</p>\r\n\r\n<p>* Five Year Warranty on Frame</p>\r\n\r\n<p>* Thirteen Month Warranty on Drive Train and Electronics</p>\r\n', 'The unique design of this Wheelchair incorporates a basket under the seat for valuables', 2200, 1550, 0, 'instock', '', 100, '', '', 0, 'literider-ptc-power-wc-red-rear-wheel-drive', '', 'Complete Medical', '', '', '66230451371f1b96f5026d0b40e135b1.jpg', '', '2019-03-17 12:08:55', '1', 'GP160', '', '', '', '50', '', '0', '', '', '', '', '', '0', '', 1, '3', '1', '<p>* Rear wheel drive</p>\r\n\r\n<p>* Comfortable, full size stadium seat and non-marking black tires on steel rims with shiny hubcabs</p>\r\n\r\n<p>* Weight capacity: 275 lbs</p>\r\n\r\n<p>* Maximum Speed: 3.5 mph</p>\r\n\r\n<p>* Operating Range: 9.5 miles</p>\r\n\r\n<p>* Ground Clearance: 2.5&quot;</p>\r\n\r\n<p>* Turning Radies: 26&quot; Type Batteries: 2-18 AH</p>\r\n\r\n<p>* Color: Red body with black seat</p>\r\n\r\n<p>* Freewheel Mode: Yes *Electronic Speed Control: Yes</p>\r\n\r\n<p>* Electro-Mechanical Brakes: Yes</p>\r\n\r\n<p>* Charger: Off-Board</p>\r\n\r\n<p>* Controller: PG VR-2, 50 Amp Remote</p>\r\n\r\n<p>*Length: 33&quot;</p>\r\n\r\n<p>* Width: 22.5&quot;</p>\r\n\r\n<p>* Height: 34.5&quot; - 36.5&quot;</p>\r\n\r\n<p>* Ground to Top of Seat: 20.9&quot;</p>\r\n\r\n<p>* Number of Seat Height Positions: 3</p>\r\n\r\n<p>* Size of increments: 1.0&quot;</p>\r\n\r\n<p>* Weight of Unit: 114 lbs</p>\r\n\r\n<p>* Tires: Flat Free</p>\r\n\r\n<p>* Rear tires: 9.5&quot;, Casters: 6&quot;</p>\r\n\r\n<p>* Standard Seat: 18&quot; x 15&quot;</p>\r\n\r\n<p>* Footrests are both height and angle adjustable</p>\r\n\r\n<p>* Five Year Warranty on Frame</p>\r\n\r\n<p>* Thirteen Month Warranty on Drive Train and Electronics</p>\r\n', '', 0, 1),
(272, 'Intrepid Mid Wheel Drive Power Wheelchair 20', 1, 'Super Admin', 55, 'HCPCS, K0823', 'ICD10', 0, '<p>* Equipped with 20&quot; Captains Seat, Blue</p>\r\n\r\n<p>* QuadraSpring suspension system for ultimate in smooth-riding stability</p>\r\n\r\n<p>* Standard comfortable and durable Captains Seats feature deep-contoured cushions and backs for maximum comfort and superior user positioning and lateral support</p>\r\n\r\n<p>* Captains Seats swivel and feature a fold-down backrest with 25 degrees of recline and an adjustable height headrest</p>\r\n\r\n<p>* Seats have four height adjustments, from 20&quot; to 23&quot;</p>\r\n\r\n<p>* Padded, flip-up armrests allow for easy transfers and user access</p>\r\n\r\n<p>* Armrests are also removable and height and width adjustable for positioning, support and width adjustable for positioning, support and adaptability to the size of the user</p>\r\n\r\n<p>* Adjustable length controller mount can be affixed to either the left or right armrest and can be fitted with an optional swingaway arm for additional flexibility</p>\r\n\r\n<p>* Standard non-slip footplate can be flipped up out of the users way and adjusted in both height and angle</p>\r\n\r\n<p>* Chair can be fitted with optional Elevating Leg Rests allowing the user to travel comfortably with raised legs; a necessity for those with some medical conditions, such as edema</p>\r\n\r\n<p>* Standard positioning belt for added user security</p>\r\n\r\n<p>* Mid-wheel drive allows for tight 18&quot; turning radius, making it ideal for indoor maneuverability</p>\r\n\r\n<p>* Programmable controller with common connectors is easy to service and setup and can be personalized for individuals with special requirements</p>\r\n\r\n<p>* Flat-free, non-marking tires offer worry-free travel</p>\r\n\r\n<p>* Motor assemblies offer easy freewheel operation, allowing the chair to be pushed, which can be helpful for transport</p>\r\n\r\n<p>* Weight Capacity 300 lbs</p>\r\n\r\n<p>* Batteries Two 12V x 35AH (U1)</p>\r\n\r\n<p>* Battery Charger 5 Amp, Offboard</p>\r\n', 'This Wheelchair has an extra strong steel frame for long-lasting durability', 2900, 2100, 0, 'instock', '', 100, '', '', 0, 'intrepid-mid-wheel-drive-power-wheelchair-20-1', '', 'Complete Medical', '', '', '336af8b7285f03c9b5eda444e1924392.jpg', '', '2019-03-18 09:10:54', '1', 'INB002', '', '', '', '11', '', '1', '', 'empty', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(273, 'K3 Lightweight Wheelchair 16', 1, 'Super Admin', 55, 'HCPCS,K0003', 'ICD10', 0, '<p>DETACHABLE DESK ARMS</p>\r\n\r\n<p>* 16&quot; With Elevating Leg Rests</p>\r\n\r\n<p>* Weighs under 36 lbs. (excluding riggings)</p>\r\n\r\n<p>* Removable flip back arms allow for easy transfer</p>\r\n\r\n<p>* Carbon steel frame with silver vein finish</p>\r\n\r\n<p>* New frame style eliminates seat guides and allows for custom back inserts and accessories</p>\r\n\r\n<p>* Tool free adjustable front riggings (footrests, legrests)</p>\r\n\r\n<p>* Composite, Mag-style wheels are lightweight and maintenance free</p>\r\n\r\n<p>* Precision sealed wheel bearings in front and rear ensure long lasting performance and reliability</p>\r\n\r\n<p>* Dual axle provides easy transition of seat height to hemi level</p>\r\n\r\n<p>* 8&quot; front casters are adjustable in 3 positions</p>\r\n\r\n<p>* Lightweight, Dual Axle&nbsp;</p>\r\n\r\n<p>* All the above come with Swing-Away Footrests or Elevated Leg Rests&nbsp;</p>\r\n', 'This Wheelchair comes with push to lock wheel locks', 270, 210, 0, 'instock', '', 100, '', '', 0, 'k3-lightweight-wheelchair-16-1', '', 'Complete Medical', '', '', 'efd3004a21c8f37d651c3ac44c34d4a8.jpg', '533a8b5928cae8133e28d74b9f7c7474.jpg,4ab37a9dd180b082e452a27c5a920f38.jpg,58e4727b8f482d5498c0225881eb0543.jpg', '2019-03-18 09:20:24', '1', 'K316DDA-ELR', '', '', '', '0', '', '1', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(274, 'Retroback Back Support System', 1, 'Super Admin', 55, 'HCPCS,E2611', 'ICD10', 0, '<p>* Simply clip Retroback onto the existing sling upholstery and lift it off every time a wheelchair needs to be folded or stored</p>\r\n\r\n<p>* No tools or hardware needed</p>\r\n\r\n<p>* This rugged back support system weighs only 3 pounds (1 kg), making it easy to attach and remove from a wheelchair</p>\r\n\r\n<p>* Includes: Cushioned back support pad with attachment clip, cover, and instruction manual</p>\r\n\r\n<p>* The removable, water-resistant cover is made of a flexible, durable, washable fabric</p>\r\n\r\n<p>* Clip on and clip off</p>\r\n\r\n<p>* Improves comfort</p>\r\n\r\n<p>* Supports posture</p>\r\n\r\n<p>* Weight Capacity: 300 lbs</p>\r\n\r\n<p>* 12-month Limited Warranty&nbsp;</p>\r\n', 'This is a Wheelchair with back Support \r\n', 360, 260, 0, 'instock', '', 100, '', '', 0, 'retroback-back-support-system', '', 'Complete Medical', '', '', 'a7b6291ab5718fd8a15329c78c661de3.jpg', '', '2019-03-18 09:27:50', '1', 'RETRO16C', '', '', '', '0', '', '1', '', '', '', '', '', '0', '', 1, '0', '0', '', '', 0, 1),
(275, 'Transport Chair, Super-Light Folding with Carry Bag', 1, 'Super Admin', 3, 'E1038', 'ICD10', 0, '<p>* Silver Frame and Blue Upholstery</p>\r\n\r\n<p>* Padded, flip back armrests</p>\r\n\r\n<p>* Weighs only 18 lbs</p>\r\n\r\n<p>* Aluminum frame is lightweight and strong</p>\r\n\r\n<p>* Composite wheels are lightweight and maintenance free</p>\r\n\r\n<p>* Folds like a conventional folding chair for added convenience</p>\r\n\r\n<p>* Comes with carry bag</p>\r\n\r\n<p>* Fold down footrests</p>\r\n\r\n<p>* Standard rear wheel locks</p>\r\n\r\n<p>* Attractive frame with durable, lightweight nylon upholstery</p>\r\n\r\n<p>* Weight capacity 300 lbs</p>\r\n\r\n<p>* Limited Lifetime Warranty&nbsp;</p>\r\n', 'This Wheelchair is easy to push or transport', 500, 350, 0, 'instock', '', 100, '', '', 0, 'transport-chair-super-light-folding-with-carry-bag', '', 'Complete Medical', '', '', '960d0c383d10a8689f7a362f360f5b9f.jpg', '', '2019-03-18 09:33:11', '1', 'SL18', '', '', '', '0', '', '1', '', '', '', '', '', '0', '', 1, '4', '2', '', '', 0, 1),
(276, 'Wheelchair - Transport With Commode ', 177, 'Prishu', 55, 'HCPCS,E0163', 'ICD10', 0, '<p>* Chrome plated steel tubing frame with welded construction</p>\r\n\r\n<p>* Drop arm allows for safe lateral patient transfers to and from commode</p>\r\n\r\n<p>* Swing away and detachable footrests (Sold separately)</p>\r\n\r\n<p>* Injection molded large plastic toilet seat, 7.5 quart bucket and cover come standard</p>\r\n\r\n<p>* Back can be easily removed without tools</p>\r\n\r\n<p>* Rust resistant, swivel casters (2 with locks)</p>\r\n\r\n<p>* Can be shipped UPS</p>\r\n\r\n<p>* Limited LifetimeWarranty</p>\r\n\r\n<p>* Weight capacity: 350 Lbs</p>\r\n\r\n<p>* Width between arms: 18&quot;</p>\r\n\r\n<p>* Outside width: 22&quot;</p>\r\n\r\n<p>* Seat width: 17&quot;</p>\r\n\r\n<p>* Seat depth: 17&quot;</p>\r\n\r\n<p>* Seat height: 20&quot;</p>\r\n\r\n<p>* Product weight: 35 lbs</p>\r\n\r\n<p>* Shipping weight: 42 lbs</p>\r\n\r\n<p>* Weight limit: 350 lbs&nbsp;</p>\r\n', 'This Wheelchair comes standard with padded seat', 300, 220, 0, 'instock', '', 99, '', '', 0, 'wheelchair-transport-with-commode', '', 'Complete ', '', '', 'bcf22b652387a097878b9f382301e33e.jpg', '', '2019-03-18 09:54:42', '1', '10960A', '', '', '', '11', '', '1', '', '', '', '', '', '0', '', 1, '1', '1', '', '', 0, 1),
(277, 'Image EC Mid Wheel Drive Blue 20', 1, 'Super Admin', 55, '', '', 0, '<p>Mfgr #2800ECBL-RCL-20</p>\r\n\r\n<p>* Mid Wheel drive allows for tighter turning radius</p>\r\n\r\n<p>* PG Controller with diagnostic fault codes</p>\r\n\r\n<p>* Off board charger</p>\r\n\r\n<p>* Joystick can be mounted on either side</p>\r\n\r\n<p>* Front swivel anti-tippers have true independent adjustable suspension</p>\r\n\r\n<p>* Helps prevent the drive wheels from losing contact with the ground</p>\r\n\r\n<p>* Drive mid wheels are flat free including coil spring tension suspension</p>\r\n\r\n<p>* Front and Rear semi-pneumatic swivel wheels</p>\r\n\r\n<p>* Foot plate is angle, height and depth adjustable</p>\r\n\r\n<p>* 18&quot; Deluxe height adjustable swivel captain&#39;s seat</p>\r\n\r\n<p>* Positioning belt standard</p>\r\n\r\n<p>* Arms are angle, height and depth adjustable</p>\r\n\r\n<p>* Standard headrest is height adjustable</p>\r\n\r\n<p>* Seat reclines for comfort and folds down for portability</p>\r\n\r\n<p>* Has been tested and surpassed the ANSI RESNA testing requirement</p>\r\n\r\n<p>* Batteries (Item # U1)</p>\r\n\r\n<p>* Batteries are accessible from the rear of the chair</p>\r\n\r\n<p>* 300 lb. Weight Capacity</p>\r\n', 'This Wheelchair has a uniquely designed Dynamic Drive suspension for greater climbing ability and comfort when traveling forward and in reverse', 3400, 2500, 0, 'instock', '', 92, '', '', 0, 'image-ec-mid-wheel-drive-blue-20', '', 'Complete Medical', '', '', 'c7c6db61265f4dfa75008ff614080ea2.jpg', '', '2019-03-18 10:03:16', '1', '2800BL', '', '', '', '2', '', '0', '', '', '', '', '', '0', '', 1, '4', '4', '', '', 0, 1),
