(285, 'Avalon LP Back Support', 192, 'Funso', 10, 'L0627/ L0642', 'ICD10', 0, '<ul style=\"list-style-type:disc\">\r\n	<li>Great economic solution to low back support.</li>\r\n	<li>Comprised from a durable elastic and featuring a 10&rdquo; posterior panel with &ldquo;classic&rdquo; elastic compression pulls</li>\r\n	<li>A&nbsp;great low-profile spine support designed to fit in any budget</li>\r\n	<li>Recommended for: Spinal Stenosis, Spondylolisthesis, Spondylolysis, Chronic Back Pain, Spinal Instability, Post-Op Disk Surgery, Facet Syndrome, Degenerative, Herniated/ Bulging Disc, or Post-Operative Lumber Fusion</li>\r\n</ul>\r\n', 'We process orders with Prescription only', 0, 0, 0, 'instock', '', 100, '', '', 0, 'avalon-lp-back-support', '', 'Comfortland', '', '', '80656177c3f0162a81371ee239cbbb5d.jpg', '', '2019-08-11 17:48:16', '0', 'OC056', '', '', '', '0', '', '1', '', 'Black', '', '', '', '0', '0', 1, '0', '0', '', '', 0, 1),
(286, 'T.L.S.O. Back Support', 192, 'Funso', 10, 'LO450', 'ICD10', 0, '<ul style=\"list-style-type:disc\">\r\n	<li>Moderate control of unwanted neck flexion /extension</li>\r\n	<li>Treat mid-neck strains and sprains</li>\r\n	<li>Recommended for posture correction, for people who suffer from Scoliosis or other spine problems, for those who spend long hours sitting without much movement</li>\r\n</ul>\r\n', 'We process orders with Prescription only', 0, 0, 0, 'instock', '', 100, '', '', 0, 't-l-s-o-back-support', '', 'Advanced Orthopaedics', '', '', '563f104601a44172e166a216828c03a7.jpg', '', '2019-08-11 17:56:05', '0', 'BB26', '', '', '', '0', '', '1', '', 'Cream', '', '', '', '0', '0', 1, '0', '0', '', '', 0, 1),
(287, 'Low Profile Air Walker (Low Top)', 192, 'Funso', 42, 'L4360, L4361', 'ICD10', 0, '<ul style=\"list-style-type:disc\">\r\n	<li>Inflatable bladder incorporated into liner for increased immobilization of the lower leg, ankle, and foot.</li>\r\n	<li>Designed for the treatment of stable fractures and ankle sprains.</li>\r\n	<li>Lightweight, low rocker profile design for greater patient comfort.</li>\r\n	<li>Cushioned heel for greater energy absorption.</li>\r\n	<li>Wider rocker bottom design promotes smooth energy conserving gait.</li>\r\n	<li>Fits either left or right.</li>\r\n	<li>Designed for the treatment of stable fractures and ankle sprains.</li>\r\n	<li>Recommended for: Soft tissue injuries, grade 2 and 3 sprains, stable fractures, post-operative stabilization, Helps to reduce pain, swelling, and edema of foot and ankle.</li>\r\n</ul>\r\n', 'We process orders with Prescription only', 0, 0, 0, 'instock', '', 100, '', '', 0, 'low-profile-air-walker-low-top', '', 'Advanced Ortho', '', '', '831304477b165733e3c04c51c223d605.jpg', '', '2019-08-11 19:08:05', '0', 'FCCAM004S', '', '', '', '0', '', '1', '', '', '', '', '', '0', '0', 1, '0', '0', '', '', 0, 1),
(288, 'Pediatric Cam Walker', 192, 'Funso', 42, 'L4386, L4387', 'ICD10', 0, '<ul style=\"list-style-type:disc\">\r\n	<li>Helps prevent sports injuries.</li>\r\n	<li>Designed for the treatment of stable fractures and ankle sprains</li>\r\n	<li>Lace &ndash; up closure allows for an intimate medial and lateral fit.</li>\r\n	<li>Figure 8 strapping configuration provides extra stability.</li>\r\n	<li>Fits either left or right foot.</li>\r\n	<li>Recommended for :&nbsp;Soft tissue injuries, Grade 2 and 3 sprains</li>\r\n</ul>\r\n', 'We process orders with Prescription only', 0, 0, 0, 'instock', '', 100, '', '', 0, 'pediatric-cam-walker', '', 'Advanced Ortho', '', '', 'a4b7d5ad1642c2e831ee4d572a822fbe.jpg', '', '2019-08-11 19:14:38', '0', 'FCCAM002', '', '', '', '0', '', '1', '', 'empty', '', '', '', '0', '0', 1, '0', '0', '', '', 0, 1),
(289, 'Universal Wrist/Forearm Brace', 1, 'Super Admin', 16, 'L3908', 'ICD10', 0, '<ul style=\"list-style-type:square\">\r\n	<li>Removable and adjustable palmar stay for maximum support.</li>\r\n	<li>Brace can be removed and put back on easily once properly fitted.</li>\r\n	<li>Velcro&trade; closure for easy adjustment.</li>\r\n	<li>11&quot; length.</li>\r\n</ul>\r\n', 'We process orders with Prescription only', 250, 250, 0, 'instock', '', 100, '', '', 0, 'universal-wrist-forearm-brace', '', 'Accord', '', '', '3367654db0ff4c025770cb7e3a7a67e8.jpg', '', '2019-08-11 21:38:57', '1', 'OC059', '', '', '', '0', '', '1', '', '', '', '', '', '0', '240', 1, '5', '2', '', '', 0, 1),
(290, 'ACL Knee Brace', 1, 'Super Admin', 12, 'L1845', 'ICD10', 0, '<ul style=\"list-style-type:disc\">\r\n	<li>Provides stability and support following injury or reconstruction of the ACL, PCL, MCL, LCL and menisci</li>\r\n	<li>Can be used prophylactically to prevent hyperextension injuries</li>\r\n	<li>Strong, lightweight composite frame</li>\r\n	<li>User-friendly ROM hinge for quick and easy adjustment</li>\r\n</ul>\r\n', 'We process orders with Prescription only', 50, 50, 0, 'instock', '', 100, '', '', 0, 'acl-knee-brace', '', 'Advanced Orthopaedics', '', '', '4aabf03261ee46ee3b4d5052345da6c3.jpg', 'c734af091320686d662645dfaebab4a5.jpg', '2019-08-11 21:43:33', '1', 'KB01', '', '', '', '25', '', '1', '', '', '', '', '', '0', '50', 1, '0', '0', '', '', 0, 1),
(291, 'Hinged Knee Support Sleeve', 177, 'Prishu', 10, 'L1832, L1833', 'ICD10', 0, '<ul style=\"list-style-type:disc\">\r\n	<li>The Drytex hinged knee suppoprt, is a Neoprene alternative constructed of a unique nylon core and polyester Lycrar fabric that allows for improved airflow</li>\r\n	<li>Provides compression and support, yet allows for breathability ideal in warm weather climates</li>\r\n	<li>Designed for mild to moderate medial lateral stability Measurements taken 6&quot; above mid-patella, knee joint line, and 6&quot; below mid-patella circumference</li>\r\n</ul>\r\n', 'We process orders with Prescription only', 250, 250, 0, 'instock', '', 100, '', '', 0, 'hinged-knee-support-sleeve', '', 'Complete Medical ', '', '', '092335af6a2c6136b3ba85552240dc6e.jpg', 'dc942d355744b813fa95bdf2925ef857.jpg,a09d637602d12eeadc180aeb8a1913bf.jpg,639193aaf171c76ca75b176e785a5e34.jpg', '2019-08-11 21:47:30', '0', 'KB37', '', '', '', '10', '', '0', '', 'Black', '', '', '', '0', '250', 1, '0', '0', '<ul style=\"list-style-type:disc\">\r\n	<li>The Drytex hinged knee suppoprt, is a Neoprene alternative constructed of a unique nylon core and polyester Lycrar fabric that allows for improved airflow</li>\r\n	<li>Provides compression and support, yet allows for breathability ideal in warm weather climates</li>\r\n	<li>Designed for mild to moderate medial lateral stability Measurements taken 6&quot; above mid-patella, knee joint line, and 6&quot; below mid-patella circumference</li>\r\n</ul>\r\n', '', 0, 1),
(292, 'NATROX Oxygen Wound Therapy', 1, 'Super Admin', 1, '', '', 0, '<p>1. The NATROX Oxygen Generator is a battery-operated device which delivers 98% pure humidified oxygen to the wound bed through water electrolysis. It is supplied with two rechargeable batteries and a charging kit, thus allowing the user complete freedom of movement.</p>\r\n\r\n<p>2. The NATROX Oxygen Delivery System is a sterile, single-use wound interface. Its &ldquo;web&rdquo; like design allows free passage of wound exudate into the secondary dressing whilst <gwmw class=\"ginger-module-highlighter-mistake-type-1\" id=\"gwmw-15787273141280743012297\">optimising</gwmw> the flow and diffusion of oxygen across the wound bed. It has a 1 m long <gwmw class=\"ginger-module-highlighter-mistake-type-3\" id=\"gwmw-15787273148821686433786\">thin flexible</gwmw> tube which connects directly to the NATROX Oxygen Generator. The NATROX Oxygen Delivery System should be changed at each dressing change in accordance with good clinical practice. However, it can remain in place for up to 7 days if clinically appropriate.</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'The NATROX Oxygen Wound Therapy System is a class II medical device licensed under Medical Device Directive 93/42/EEC. The system consists of two main elements; the NATROX Oxygen Generator and the NATROX Oxygen delivery system.', 3500, 3200, 0, 'instock', '', 100, '', '', 0, 'natrox-oxygen-wound-therapy-1', '', 'NATROX', '', '', '774d97354ad600722ca7d342e90c92d1.jpg', '', '2019-11-27 09:52:20', '0', '', '', '', '', '282', '', '1', '', '', '', '', '', '7243.mp4', '', 0, '0', '0', '', '', 0, 1),
(293, 'KosmoCare Dura Rexine Mag Wheel Regular Foldable Wheelchair with Safety Belt', 209, 'Shaka', 55, '', '', 0, '<ul>\r\n	<li>Folding wheelchair with fixed arm and footrest</li>\r\n	<li>Chrome plated steel frame</li>\r\n	<li>Superior quality wheels</li>\r\n	<li>Seat width: 18 inches; Max load bearing: 100 kgs</li>\r\n	<li>Net Weight of wheelchair: 18 kgs</li>\r\n	<li>Load carrying Capacity: 100 Kg/220 lb</li>\r\n</ul>\r\n', 'Folding wheelchair with fixed arm and footrest\r\nChrome plated steel frame\r\nSuperior quality wheels\r\nSeat width: 18 inches; Max load bearing: 100 kgs\r\nNet Weight of wheelchair: 18 kgs\r\nLoad carrying Capacity: 100 Kg/220 lb', 8000, 4990, 0, 'instock', '', 100, '', '', 0, 'kosmocare-dura-rexine-mag-wheel-regular-foldable-wheelchair-with-safety-belt', '', 'KosmoCare', '', '', '2e1d220af74d3441165b8e8ba232518c.jpg', '817ecb086cb86ab4a38d17bd75759c4a.jpg', '2020-01-14 04:59:02', '0', 'wheelchair', '', '', '', '10', '', '', '', '', '', '', '', '0', '', 0, '0', '0', '', '', 0, 1),
(299, 'Wheel Chair', 139, 'Lifeline Medical Supply', 55, '', '', 0, '<p>Description:</p>\r\n\r\n<p>Rollator 3 Wheeled with pouch and basket loop brake</p>\r\n\r\n<p>Description:</p>\r\n\r\n<p>Comes standard with basket, tray, and pouch</p>\r\n\r\n<p>8&quot; casters with soft-grip tires are ideal for indoor and outdoor use</p>\r\n\r\n<p>Special loop lock made of internal aluminum casting operates easily and ensures safety</p>\r\n\r\n<p>Handles are adjustable in height</p>\r\n\r\n<p>Adjustable brakes</p>\r\n\r\n<p>Easy, one hand folding</p>\r\n\r\n<p>Limited Lifetime Warranty</p>\r\n\r\n<p>Lifetime Warranty on brake cable</p>\r\n\r\n<p>Weight capacity: 350</p>\r\n', 'wheel chair with 2 wheels and handles', 252, 250, 10, 'instock', '', 123, '', '', 0, 'wheel-chair-1', '', 'Medical Supply Store', '', '', '7d4d6460cd5f08f823d8cab946fa3009.jpg', '1b6be91615fb9fc118487efb3a735324.jpg', '2020-02-29 09:59:26', '0', 'wheel-chair', '', '', '', '15', '', '0', '', 'Black', '', '', '', '0', '220', 0, '0', '0', '', '', 0, 1),
