(1, 'Manual wheelchair', 139, 'Funso', 1, 'A100,B100', 'AB123', 0, '<p>Manual wheelchair short <gwmw class=\"ginger-module-highlighter-mistake-type-1\" id=\"gwmw-15496941325118338821576\">descritpionManual</gwmw> wheelchair short <gwmw class=\"ginger-module-highlighter-mistake-type-1\" id=\"gwmw-15496941325119934246182\">descritpionManual</gwmw> wheelchair short <gwmw class=\"ginger-module-highlighter-mistake-type-1\" id=\"gwmw-15496941325113338151566\">descritpionManual</gwmw> wheelchair short <gwmw class=\"ginger-module-highlighter-mistake-type-1\" id=\"gwmw-15496941325119472315727\">descritpionManual</gwmw> wheelchair short <gwmw class=\"ginger-module-highlighter-mistake-type-1\" id=\"gwmw-15496941325110810119750\">descritpionManual</gwmw> wheelchair short <gwmw class=\"ginger-module-highlighter-mistake-type-1\" id=\"gwmw-15496941325115041642672\">descritpionManual</gwmw> wheelchair short <gwmw class=\"ginger-module-highlighter-mistake-type-1\" id=\"gwmw-15496941325110381695760\">descritpionManual</gwmw> wheelchair short <gwmw class=\"ginger-module-highlighter-mistake-type-1\" id=\"gwmw-15496941325110200019543\">descritpionManual</gwmw> wheelchair short <gwmw class=\"ginger-module-highlighter-mistake-type-1\" id=\"gwmw-15496941325111941609668\">descritpionManual</gwmw> wheelchair short <gwmw class=\"ginger-module-highlighter-mistake-type-1\" id=\"gwmw-15496941325114672922208\">descritpionManual</gwmw> wheelchair short <gwmw class=\"ginger-module-highlighter-mistake-type-1\" id=\"gwmw-15496941642885068190646\">descritpion</gwmw></p>\r\n', 'Manual wheelchair short descritpion', 50, '', '100', 0, '', '', 0, 'manual-wheelchair', '', 'RedBrand', '', '', '979ba28c6c6e8790e0bf9757d153e0e9.jpg', '2019-02-09 06:36:32', '1', 'manual,wheelchair', '', '', '', '3bb8f127fd853e0b28c66cc7213bb282.jpg,c056247eb138eebcfed0c67e1fa94489.jpg', 'instock', '100', '', '', '', '', '', '', '1', '', '0', '40', ''),
(2, '3-WHEELED W/POUCH & BASKET LOOP BRAKE ROLLATOR', 139, 'Funso', 2, 'R26.2', ' E0143', 0, '<p>Description:</p>\r\n\r\n<p>Rollator 3 Wheeled with pouch and basket loop brake</p>\r\n\r\n<p>Description:</p>\r\n\r\n<p>Comes standard with basket, tray, and pouch</p>\r\n\r\n<p>8&quot; casters with soft-grip tires are ideal for indoor and outdoor use</p>\r\n\r\n<p>Special loop lock made of internal aluminum casting operates easily and ensures safety</p>\r\n\r\n<p>Handles are adjustable in height</p>\r\n\r\n<p>Adjustable brakes</p>\r\n\r\n<p>Easy, one hand folding</p>\r\n\r\n<p>Limited Lifetime Warranty</p>\r\n\r\n<p>Lifetime Warranty on brake cable</p>\r\n\r\n<p>Weight capacity: 300 lbs.</p>\r\n\r\n<p>Diagnosis Code: R26.2,</p>\r\n\r\n<p>HCPCS: E0143</p>\r\n', 'Good for people with mobility issues\r\n', 111, '', '120.99', 0, '', '', 0, '3-wheeled-w-pouch-basket-loop-brake-rollator', '', 'Complete Medical', '', '', '985c2a48f971c04b84d222929d4c2cc9.jpg', '2019-02-10 08:37:10', '1', 'A100', '', '', '', 'b4b7c597e83ab026ea67b97bbf5fb156.jpg,763d9a6355fb8b9af1428faafffffe9e.jpg', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '165.00', ''),
(3, 'Zoom Rolling Walker', 139, 'lifeline', 2, 'R26.2', 'E0143 ,EO156', 0, '<p>&nbsp;</p>\r\n\r\n<p>This walker has adjustable height 18-24&#39;&#39;. Features include Seat pouch, padded seat, brakes, flip up back and height adjustment knob.&nbsp;</p>\r\n\r\n<ul>\r\n</ul>\r\n\r\n<p>Features</p>\r\n\r\n<ul>\r\n	<li>18&quot; Seat Height</li>\r\n	<li>Locking Hand Brakes</li>\r\n	<li>Large Padded Seat</li>\r\n	<li>Under Seat Pouch</li>\r\n	<li>Flip-up Back</li>\r\n	<li>Foldable</li>\r\n	<li>8&quot; Wheels</li>\r\n</ul>\r\n', 'Available in Store for Pick Up or Delivery. Recommended for people with mobility issues. Insurance C', 165, '', '125', 0, '', '', 0, 'zoom-rolling-walker', '', 'Nova Medical', '', '', '2c8d894c24645a4d249af1740931878f.jpg', '2019-02-10 09:20:33', '1', 'A002', '', '', '', 'dad9b2db2c89d92d46a63874c69bed06.jpg,bb0db3c3b62eebbfa87d1f2a816959d0.jpg,fa43b3e83c3eaf2a0f5d019c82806f1f.jpg,0db2fa8ae9eed93f3b4384d0b7ebcb48.jpg,eea7d479de97adcf01172c8feb356b42.jpg', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '165', ''),
(4, 'Adult Folding Walker', 139, 'lifeline', 2, 'R26.2', '', 0, '<p>&nbsp;</p>\r\n\r\n<p>Description</p>\r\n\r\n<p>The adult folding walker has a lightweight aluminum frame and different weight specification. Some of the features include:</p>\r\n\r\n<p>* 3 inch fixed wheels&nbsp;</p>\r\n\r\n<p>* Two-button release for great security.</p>\r\n\r\n<p>The walker folds to 4 inch in width for easy transport and storage.</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'Available in Store for Pick Up or Delivery. Recommended for people with mobility issues. Insurance C', 135, '', '105', 0, '', '', 0, 'adult-folding-walker', '', 'Nova Medical', '', '', 'de37cf15a3180f94ad0f4f259ba03d65.jpg', '2019-02-10 09:38:25', '1', 'A003', '', '', '', '5a4ac1201801e020210821e965fce7e7.jpg,aa99477d17aeb88d5c8892960139bbbf.jpg,f07b87e1f04cfacfe338481ec4e85c6d.jpg,e85dff1d7009997cbca14e1339499aa3.jpg,ce0cc655bbbad1e1b1b0c3cbd4e04a10.jpg', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '135', ''),
(5, 'Light Weight Folding Transport Wheelchair', 139, 'lifeline', 1, 'Z99.3', 'K0003', 0, '<p><strong>TO ORDER WITH INSURANCE</strong>.</p>\r\n\r\n<p>Ordering Physician Should Send a Prescription and Complete CMN, Face to Face and may be required to Upload additional documents.</p>\r\n\r\n<p>&nbsp;This lightweight dual axle transport wheelchair weighs less than 36 lbs. It has the following features:</p>\r\n\r\n<ul>\r\n	<li>Easy to Carry. Removable flip-back arms of this lightweight wheelchair allow for easy transfer and maneuverability</li>\r\n	<li>Convenient. Updated frame style of this manual wheelchair eliminates seat guides and allows for custom back inserts and accessories</li>\r\n	<li>safe. The wheelchair comes with push-to-lock wheel clasps. They save you braking time, provide extra safety and secure the wheelchair in place</li>\r\n	<li>Easy Assembling. The adjustable front legrests complete this lightweight wheelchair without the extra hassle of special tools</li>\r\n</ul>\r\n', 'Available in Store for Pick Up / Same Day Delivery.\r\nRecommended for people with mobility issues.\r\nInsurance Coverage: Medicare, Medicaid, and most HMO/s', 165, '', '180', 0, '', '', 0, 'light-weight-folding-transport-wheelchair', '', 'Healthline', '', '', '740200b0622c7e40837984988183fcc2.jpg', '2019-02-11 06:30:29', '1', 'A004', '', '', '', 'ae757fa08252c65fb696cfc63ff2239b.jpg,96d5b2e1c818ce29192fce1190d094fa.jpg', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '205', ''),
(6, 'Folding Power Wheelchair', 139, 'Super Admin', 4, '', 'K0821', 0, '<p><strong>TO ORDER WITH INSURANCE</strong>.</p>\r\n\r\n<p>Ordering Physician Should Send a Prescription, Complete CMN, Face to Face and May Be Required To Upload Additional Documents.</p>\r\n\r\n<p>This Folding Cirrus Plus EC 18&quot; Power Chair by Drive Medical is foldable and lightweight making it ideal for transporting. It comes in an attractive, lightweight, carbon steel frame with a silver vein finish which is easy to maintain. This Power Chair comes standard with the following features:</p>\r\n\r\n<p>* A seat belt, seat cushion with a pouch for easy storage,</p>\r\n\r\n<p>* Swing away footrests with calf straps and heel loops.</p>\r\n\r\n<p>* Wheel locks and adjustable tension, padded, back upholstery, adding to users convenience, safety, and comfort.</p>\r\n\r\n<p>* The integrated, programmable PG controller and adjustable length joystick mount accommodates most user sizes.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'Available in Store for Pick Up / Same Day Delivery. Recommended for people with mobility issues. Insurance Coverage: Most HMO/s', 1750, '', '1800', 0, '', '', 0, 'folding-power-wheelchair', '', 'Drive', '', '', 'dd1b35fc70a3903456850d2a83cfc8ea.jpg', '2019-02-11 07:24:33', '0', 'A006', '', '', '', '66e46b6340cbe4d467c7e848a0f0a399.jpg', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '2,050', ''),
(7, 'Pride Powered Wheelchair', 139, 'lifeline', 4, '', '', 0, '<p><strong>TO ORDER WITH INSURANCE</strong>.</p>\r\n\r\n<p>Ordering Physician Should Send a Prescription, Complete CMN, Face to Face and May Be Required To Upload Additional Documents</p>\r\n\r\n<p>This chair is rugged and dependable. It comes with the following features:</p>\r\n\r\n<ul>\r\n	<li>OMNI-Casters (nylon, spherical-shaped casters) on front and rear to prevent wheel hang-ups</li>\r\n	<li>Choice of 6 colors</li>\r\n	<li>18&Prime; x 17&Prime;, 5-point swivel seat with a latch release</li>\r\n	<li>Increased 300 lb. weight capacity</li>\r\n	<li>Faster speed &ndash; up to 3.7 mph</li>\r\n	<li>Larger, 18 amp batteries</li>\r\n	<li>Improved agility &ndash; longer wheel base; wider stance; compact turning radius 25.4&Prime;</li>\r\n	<li>Dual swing-away, under seat storage bins</li>\r\n	<li>Larger, height &amp; width adjustable armrests</li>\r\n	<li>Larger footplate</li>\r\n	<li>One hand feather-touch disassembly</li>\r\n	<li>60&Prime; lap belt</li>\r\n</ul>\r\n', 'Available in Store for Pick Up / Same Day Delivery. Recommended for people with mobility issues. Insurance Coverage: Most HMO/', 1680, '', '1750', 0, '', '', 0, 'pride-powered-wheelchair', '', 'Jazzy', '', '', '83a5a0bc7281b4b5aa32b13f764f6c1d.jpg', '2019-02-11 08:09:56', '1', 'B008', '', '', '', '8d98b598b1442b4dc9e7f62398f0114c.jpg,6b0ef83039910f6a8b6f41620ea379e2.png', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '1800', ''),
(8, 'Golden Mobility Scooter', 139, 'LIFELINE MEDICAL SUPPLY', 5, 'G82.20', 'K0800', 0, '<p><strong>TO ORDER WITH INSURANCE</strong>.</p>\r\n\r\n<p>Ordering Physician Should Send a Prescription, Complete CMN, Face to Face and May Be Required To Upload Additional Documents</p>\r\n\r\n<p>This Scooter is durable and very reliable. It comes with the following features:</p>\r\n\r\n<ul>\r\n	<li>Handsome, Heavy-Duty Scooter</li>\r\n	<li>Outdoor Ruggedness</li>\r\n	<li>Speeds Up to 7MPH</li>\r\n	<li>Full Lighting Package</li>\r\n	<li>Standard Front Basket</li>\r\n	<li>Extra Roomy Seat</li>\r\n	<li>Oversized Tires</li>\r\n	<li>Swivel Seat</li>\r\n	<li>Flip-Up Armrests for Easy Transfers</li>\r\n	<li>Adjustable Seat Height</li>\r\n	<li>Bumper Guard Protection</li>\r\n	<li>Arms Adjust in Width and Height</li>\r\n	<li>Weight Capacity: 500 lbs</li>\r\n</ul>\r\n', 'Available in Store for Pick Up / Same Day Delivery. Recommended for people with mobility issues. Insurance Coverage: Most HMO', 2570, '', '2700', 0, '', '', 0, 'golden-mobility-scooter', '', 'Golden ', '', '', 'c5023072cb478780a1c122956678e7a2.jpg', '2019-02-11 08:32:38', '1', 'B009', '', '', '', 'bd7c507b59c7331498984a3e7a8038a4.jpg,42e119b0f1920b0de33ef10a4362d253.jpg', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '2899', ''),
(9, 'Drive Medical Scout Compact Travel Power Scooter', 139, 'lifeline', 5, '', 'K0801', 0, '<p><strong>TO ORDER WITH INSURANCE</strong>.</p>\r\n\r\n<p>Ordering Physician Should Send a Prescription, Complete CMN, Face to Face and May Be Required To Upload Additional Documents</p>\r\n\r\n<p>This compact Scooter has the following features:</p>\r\n\r\n<ul>\r\n	<li>Interchangeable color panels hide scuffs and scratches; Quick and easy disassembly</li>\r\n	<li>Armrests are padded and adjustable; Height-adjustable swivel seat with fold-down backrest; Comes with large, plastic carry basket</li>\r\n	<li>Delta tiller is easily adjustable; Ergonomic throttle control with easy freewheel operation</li>\r\n	<li>Flat-free, non-marking tires and anti-tip wheels</li>\r\n	<li>Seat Width: 16.5&quot;; Max Speed: 4.25 mph; Climbing Angle: 6 degrees; Maximum Range: 15 miles; Motor: 24V x 270W x 4700rpm; Turning Radius: 45.5&quot;; Ground Clearance: 2.5&quot;; Weight Capacity: 300 lbs</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n', 'Available in Store for Pick Up / Same Day Delivery. Recommended for people with mobility issues. Insurance Coverage: Most HMO', 810, '', '920', 0, '', '', 0, 'drive-medical-scout-compact-travel-power-scooter', '', 'Drive', '', '', '899f8882a743e5d234bbce782c68aacf.jpg', '2019-02-11 09:02:49', '1', 'B009', '', '', '', 'c58bba5fd446373ae47959f0f7a73395.jpg,0f2f26c5f480028052464632aec03755.jpg', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '1100', ''),
(10, 'Oxygen Concentrator', 139, 'LIFELINE MEDICAL SUPPLY', 1, '', 'E1390', 0, '', 'Available in Store for Pick Up / Same Day Delivery. \r\nRecommended for people with respiratory Issues.', 2000, '', '2100', 0, '', '', 0, 'oxygen-concentrator', '', 'Invacre', '', '', 'f18cbb1bcf4d2076992942dba25f4578.jpg', '2019-02-11 11:38:41', '1', 'C02', '', '', '', 'cd16355473536fe11c8fd8348c8ec453.jpg', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '2520', ''),
(11, 'Invacare 820 DLX Hospital Bed ', 139, 'Super Admin', 6, '', 'E0256', 0, '<p><strong>TO ORDER WITH INSURANCE:&nbsp;</strong>Ordering Physician Should Send a Prescription, Complete CMN,&nbsp;and May Be Required To Upload Additional Documents</p>\r\n\r\n<p>The Invacare 820 DLX Hospital Bed comes with the following unique features</p>\r\n\r\n<ul>\r\n	<li>Quiet motor system</li>\r\n	<li>&nbsp;Waterproof enclosures.</li>\r\n	<li>Fast Cycle Time&nbsp;for the lowering of the bed.&nbsp;</li>\r\n	<li>Emergency crank&nbsp;provided allows all motors to be operated manually in the event of a power failure.</li>\r\n	<li>Locking Casters&nbsp;so bed stays in place</li>\r\n	<li>Rapid tool-free assembly&nbsp;minimizes delivery set-up time and makes maintenance easier</li>\r\n	<li>6-Function Hand Control Pendant&nbsp;The DLX&#39;s electric Hand Control features bright, universal symbols and allows residents and staff to easily operate the comfort controls of the bed. Hand pendant can be plugged in either side of the bed</li>\r\n</ul>\r\n', 'Available in Store for Pick Up / Same Day Delivery. \r\nInsurance Coverage by Medicare, Medicaid, and Most HMO', 1105, '', '1205', 0, '', '', 0, 'invacare-820-dlx-hospital-bed', '', 'Invacare', '', '', 'df5862c4e1ea7d62917b3f7817bc03d2.jpg', '2019-02-13 01:37:17', '1', 'C54', '', '', '', '853c849155835c95e23034ff9ff97da9.jpg,e5e1edc11e50db28eb2bbc0142679b36.jpg', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '1300', ''),
(12, 'Offset Handle Fashion Canes', 139, 'lifeline', 1, '', '', 0, '<p>Medline&#39;s cost-effective fashion canes act as mobility aids and fashion accessories. They are known for their:</p>\r\n\r\n<ul>\r\n	<li>Colorful designs and unique patterns provide users the right cane for different occasions</li>\r\n	<li>Nice alternative to the institutional look of chrome walking aids</li>\r\n	<li>Foam handles and convenient wrist straps</li>\r\n	<li>Height adjustment, 29&quot; to 38&quot; (74-96.5 cm); Cane weight, 0.8 lb. (0.4 kg</li>\r\n</ul>\r\n', 'Available in Store for Pick Up / Same Day Delivery.\r\n\r\n', 13, '', '11', 0, '', '', 0, 'offset-handle-fashion-canes', '', 'Medline', '', '', '20cbf343b1844d7f43ac964da68a51d3.jpg', '2019-02-13 01:54:12', '1', 'V002', '', '', '', 'ae4fa53d71d25cfa005671775a89b681.JPG', 'instock', '1', '', '', '', '', '', '', '0', '', '0', '14', ''),
(13, 'Offset Fashion Canes', 139, 'lifeline', 7, '', '', 0, '<p>Medline&#39;s cost-effective fashion canes act as reliable mobility aids and fashion accessories. They are known for the following features:</p>\r\n\r\n<ul>\r\n	<li>Colorful designs and unique patterns provide users the right cane for different occasions</li>\r\n	<li>Nice alternative to the institutional look of chrome walking aids</li>\r\n	<li>Foam handles and convenient wrist straps</li>\r\n	<li>Height adjustment, 29&quot; to 38&quot; (74-96.5 cm); Cane weight, 0.8 lb. (0.4 kg)</li>\r\n</ul>\r\n', 'Available in Store for Pick Up / Same Day Delivery', 12, '', '15', 0, '', '', 0, 'offset-fashion-canes', '', 'Medline', '', '', 'd086dab89a1138a4508f376e0762c370.jpg', '2019-02-13 02:21:07', '1', '', '', '', '', '628af367a437772964a0b891a6dc0cd0.JPG', 'instock', '1', '', '', '', '', '', '', '0', '', '0', '20', ''),
(14, 'Medline Aluminum Forearm Crutches', 139, 'lifeline', 8, '', '', 0, '<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Telescoping parts are manufactured with internal bushings and external lock nuts to provide totally silent usage</li>\r\n	<li>Vinyl-coated, tapered, contoured arm cuffs</li>\r\n	<li>Heavy-wall, high-strength aluminum tubing</li>\r\n	<li>Black components hide signs of wear and scratches;Height Range: 5 - 6&#39;2(Inches)</li>\r\n	<li>Tall Adult has a 250-lb. weight capacity, Patient height, 5&#39;10&quot;-6&#39;6&quot;; Adult has a 250-lb. weight capacity, Patient height, 5&#39;0&quot;-6&#39;2&quot;; Youth has a 250-lb. weight capacity, Patient height, 4&#39;2&quot;-5&#39;2&quot;</li>\r\n</ul>\r\n', 'Available in Store for Pick Up / Same Day Delivery', 35, '', '44', 0, '', '', 0, 'medline-aluminum-forearm-crutches', '', 'Medline', '', '', '5e3fd4510d5ad94ee36871bcebdeb58e.jpg', '2019-02-13 02:31:04', '1', '', '', '', '', 'e9823f0f5e057f2dfb3871b36d65c510.jpg', 'instock', '1', '', '', '', '', '', '', '0', '', '0', '45', ''),
(15, 'Drive Heavy Duty Shower Chair', 139, 'Super Admin', 9, '', '', 0, '<ul>\r\n	<li>The frame has width/depth cross braces attached with aircraft-type rivets</li>\r\n	<li>Large seat with 16 5&quot; depth</li>\r\n	<li>Seat height adjusts in 1&quot; increments</li>\r\n	<li>Durable, blow-molded plastic bench</li>\r\n	<li>Tool-free removable back</li>\r\n	<li>Aluminum frame is lightweight, durable and corrosion proof</li>\r\n	<li>Drainage holes reduce slipping</li>\r\n	<li>Weight Capacity 600 lbs</li>\r\n</ul>\r\n', 'Available in Store for Pick Up / Same Day Delivery. \r\nInsurance Coverage by Medicare, Medicaid, and Most HMO', 110, '', '120', 0, '', '', 0, 'drive-heavy-duty-shower-chair', '', 'Drive', '', '', '0c4cdaba25c52489d21306f516bcf0b7.jpg', '2019-02-13 02:42:56', '1', '', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '130', ''),
(16, 'Lumbar Sacral Back Braces', 139, 'Funso', 10, '', '', 0, '<ul>\r\n	<li>Constructed of beige or black elastic material.</li>\r\n	<li>Contoured shape for increased comfort in a seated position.</li>\r\n	<li>Two dynamic side pulls for optimal compression.</li>\r\n	<li>Neoprene posterior pocket accommodates moldable thermoplastic insert (sold separately).</li>\r\n	<li>9&ouml; posterior height.</li>\r\n</ul>\r\n', 'Available in Store for Pick Up / Same Day Delivery.\r\nInsurance Coverage by Medicare, Medicaid, and Most HMO\'s', 50, '', '55', 0, '', '', 0, 'lumbar-sacral-back-braces', '', 'Medline', '', '', 'bde0914c7a679dd5fae267c4e84ba042.JPG', '2019-02-13 03:01:37', '1', '', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '60', ''),
(17, 'Medline Standard Ankle Walkers', 139, 'LIFELINE MEDICAL SUPPLY', 11, '', '', 0, '<ul>\r\n	<li>Wide distance between the uprights accommodates extra dressings and swelling</li>\r\n	<li>One leg strap and two-foot straps are adjustable for desired size and compression</li>\r\n	<li>Nonskid rocker bottom sole for safety fits left or right leg</li>\r\n	<li>Fits right or left leg</li>\r\n	<li>Fits men&#39;s shoe size 8-11; women&#39;s shoe size 9-12</li>\r\n</ul>\r\n', 'Available in Store for Pick Up / Same Day Delivery. Insurance Coverage by Medicare, Medicaid, and Most HMO', 60, '', '65', 0, '', '', 0, 'medline-standard-ankle-walkers', '', 'Medline', '', '', 'e3485b988fbfe6062eabdf3bfd3fb24a.jpg', '2019-02-13 03:11:22', '1', '', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '70', ''),
(18, 'Medline U-Shaped Hinged Knee Support', 139, 'lifeline', 12, '', '', 0, '<ul>\r\n	<li>Removable U buttress can be positioned in the superior or inferior position</li>\r\n	<li>Medial and lateral heavy-duty hinges for a high level of stability</li>\r\n	<li>Unique soft-seam construction is smooth to reduce irritation caused by conventional methods of seaming</li>\r\n	<li>Two circumferential straps with loop lock closures help limit migration and control the patella</li>\r\n	<li>Four-way stretch, 1/8&quot; neoprene that gives uniform compression; Minimum circumference: 18&quot;; Maximum circumference: 20&quot;</li>\r\n</ul>\r\n', 'Available in Store for Pick Up / Same Day Delivery.\r\n Insurance Coverage by Medicare, Medicaid, and by most HMO\'s', 35, '', '40', 0, '', '', 0, 'medline-u-shaped-hinged-knee-support', '', 'Medline', '', '', 'd506c7f329588fd3dfef4c385d9955c4.jpg', '2019-02-13 03:21:29', '1', '', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '45', ''),
