(26, 'Drop Arm Commode Deluxe-KD Steel', 1, 'Super Admin', 9, 'ICD10', 'HCPCS', 0, '<p>300 pound weight capacity * Easy-to-release drop arms-either will drop down- mechanism allows for safe lateral patient transfers to and from commode * Ideal for those with limited dexterity * Legs are adjustable * 18&quot; width between arms * Easy-to-clean, chrome-plated, steel finish * Comes with commode pail w/carry handle * Limited Lifetime Warranty * Adjustable height</p>\r\n', 'This bedside commode is adjustable.', 16285, '', '121', 0, '', '', 0, 'drop-arm-commode-deluxe-kd-steel', '', 'Complete Medical', '', '', 'a40a2f9e2ae1c4e4b0f14fb649756d9c.jpg', '2019-02-24 06:47:15', '1', '1066', '', '', '', '2c9352b8ad43975f553a80f06744b002.jpg', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(27, 'Bariatric Drop-Arm Commode Deluxe Assembled', 1, 'Super Admin', 9, 'ICD10', 'HCPCS', 0, '<p>Assembled * Bariatric * Drop Arm for easy transfers * Accommodates individuals up to 1000 Lbs. * Durable 1&quot; steel tubing is sturdy and easy to maintain * Large, durable snap-on seat * Pail easily slides in from behind commode * Comes complete with seat, lid, bucket and cover * Limited Lifetime Warranty * Width between arms: 26&quot; * Height adjusts: 19 - 23&quot; * Commode opening: 8.5&quot;W x 12&quot;D Shipping Carton size: 29&quot;L x 21&quot;W x 21&quot;H</p>\r\n', 'This is a heavy duty Commode.', 267, '', '19050', 0, '', '', 0, 'bariatric-drop-arm-commode-deluxe-assembled', '', 'Complete Medical', '', '', '32125e59a204091464225849879804d9.jpg', '2019-02-24 06:56:35', '1', '1066A', '', '', '', 'be149e3d53fe774f906a04f93195d0a3.jpg', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '0000', ''),
(28, 'Bariatric Drop-Arm Commode Super Heavy Duty, Ex-Large', 1, 'Super Admin', 9, 'ICD10', 'HCPCS', 0, '<p>Assembled * Bariatric * Weight Capacity: 1000 Lbs. * Blow molded extra wide and deep toilet seat with extra large opening 8 1/2&quot; x 12&quot; * All steel construction * Easy-to-release drop arm mechanism * Plastic armrests provide comfort &amp; support * Comes complete with commode bucket and cover * Limited Lifetime Warranty * Width between arms: 36.5&quot;</p>\r\n', 'This is a Super Heavy Duty Commode', 799, '', '660', 0, '', '', 0, 'bariatric-drop-arm-commode-super-heavy-duty-ex-large', '', 'Complete Medical', '', '', 'b6ed6b5260afd4043418937056bf2f3d.jpg', '2019-02-24 07:05:24', '1', '1066C', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '0000', ''),
(29, 'Drop-Arm KD w/Padded Open-Front Seat', 1, 'Super Admin', 9, 'ICD10', 'HCPCS', 0, '<p>Easy to assemble frame * Padded, open front vinyl toilet seat * Easy-to-release drop arm mechanism allows for safe lateral patient transfers to and from commode * Ideal for those with limited dexterity * Legs are height adjustable * Easy to clean grey powder coated steel finish * Plastic armrest provide extra comfort and support * Comes with 12 qt. commode bucket with carrying handle and splash shield * Limited Lifetime Warranty * Weight capacity: 300 lbs * Tool-free assembly</p>\r\n', 'Tool-free easy to assemble Commode', 254, '', '192', 0, '', '', 0, 'drop-arm-kd-w-padded-open-front-seat', '', 'Complete Medical', '', '', '34aa0ef61b8d5865bd45c93960330092.jpg', '2019-02-24 07:11:35', '1', '1066KD', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '0000', ''),
(30, 'Solstice Oxygen Concentrator 5 Liter', 1, 'Super Admin', 1, 'ICD10', 'HCPCS', 0, '<p>5 Liter * Delivers oxygen at 93% purity at 5 LPM * Very lightweight and portable, weighs only 36 lbs. * Easy to transport * Quiet, only 45 dba * Easy access to all filters * Convenient patient controls and handles * Provides an amber light on the front panel that illuminates if the units oxygen purity falls below 85% * 5 Year Limited Warranty specifications * Delivery rate: 1-5 LPM * Maximum recommended low flow: 5 LPM * Outlet pressure: 8.5 psi * Oxygen purity: 1-5 LPM 93% -+3% * Operating voltage rating: 97-127 Volt, 60 Hz * Operating environment range: 10O C to 35O humidity range of 30% to 70% * Power consumption: 300 Watts average * Sound level: 45 dba * Unit dimension: 20� (H) x 14� (W) x 12� (D) * Operating system: Time cycle/pressure swing * Weight: 36 Lbs * 5 Year Limited Warranty</p>\r\n', 'This Oxygen Conserver/Concentrator is for respioratory care', 955, '', '723', 0, '', '', 0, 'solstice-oxygen-concentrator-5-liter', '', 'Complete Medical', '', '', '83672a3a0115587e2426ab68f958291a.jpg', '2019-02-24 08:38:05', '1', '18055', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(31, 'Mini-Oxygen Regulator 0-8 LPM (Drive # 18301GM', 1, 'Super Admin', 1, 'ICD10', 'HCPCS', 0, '<p>MINI D/E CYLINDERS (BARB OUTLET) * 0-8 LPM * High strength lightweight aluminum alloy body with all brass core * Green * CGA 870 yoke and CGA 540 nut &amp; nipple * 6 year warranty * Click style and easy to read flow rates * Laser etched: no labels to come off * Protected contents, gauge * Ribbed flow selector for better grip * Viton rubber yoke seal with brass ring</p>\r\n', 'This product is for Respiratory Care', 32, '', '25', 0, '', '', 0, 'mini-oxygen-regulator-0-8-lpm-drive-18301gm', '', 'Complete Medical', '', '', 'c449d785e2389e4ac37d3acdce26b638.jpg', '2019-02-24 08:45:57', '1', '18311', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(32, 'Liquid Oxygen (LOX) Carry Case', 1, 'Super Admin', 1, 'NA', 'NA', 0, '<p>Light weight reinforced nylon carry case fits most name brand units * Has enough room to carry name brand units with plenty of room for accessories i/e tubing, headgear and mask etc * Height: 9&quot; * Circumference: 16&quot;&nbsp;</p>\r\n', 'This is an accessory', 65, '', '52', 0, '', '', 0, 'liquid-oxygen-lox-carry-case', '', 'Complete Medical', '', '', '6b291c416900390cec1fbcd46099e942.jpg', '2019-02-24 08:52:07', '1', '11611', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '0', '', '0', '00', ''),
