(34, 'Oxygen \'D\' Tank- 425 Liter w/Toggle (19\"H)', 1, 'Super Admin', 1, 'ICD10', 'HCPCS', 0, '<p>With Toggle Post Valve (Easy to turn on/off manually) * &quot;D&quot; Tank, 425 Liters&nbsp;</p>\r\n', 'This product is for respiratory care', 98, '', '75', 0, '', '', 0, 'oxygen-d-tank-425-liter-w-toggle-19-h', '', 'Complete Medical', '', '', 'b09641c97d4c913dcd643f7806b802b6.jpg', '2019-02-24 09:10:52', '1', '8046', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(35, 'Ultra-Light,Semi-Electric Bed w/Half Rails', 1, 'Super Admin', 6, 'ICD10', 'HCPCS', 0, '<p>The Delta 1000 is truly universal because the bed frame can be used with Drive&#39;s and most other manufacturers? bed ends, old and new. * The transition box mounted on the foot section is key to interchangeability. * The transition box allows you to change the rotation of the high/low shaft. * Headboard is taller than footboard to better fit home decor. * The wood grain panels are break and scratch resistant. * Foot section weighs 50% less than conventional foot sections to make deliveries safe and easy. * Once installed, the high/low shaft will stay with the bed to eliminate loss or forgetting on future installations. * Labels and color-coded springs assure accurate installation of side rails for patient safety. * Unique motor is completely self-contained to reduce weight and noise. * The motor assembly can be installed and removed with patient in bed. * Bed, side rails and mattress safety-tested by SGS, a nationally recognized testing facility. * Satisfies all applicable FDA entrapment guidelines. * The motor is UL approved. * In the event of a power failure, a 9 volt battery, located in the motor, can lower the head and foot sections nine times. * No crank needed. * New and improved hand pendant has large, easy-to-use controls. * Bed ships in two cartons. * Channel frame construction provides superior strength and reduced weight. * Zinc-coated spring deck. * Patent Pending. * Weight Capacity 450 lbs</p>\r\n', 'This is an Ultra-Light, Semi-Electric Bed w/Half Rails', 1048, '', '800', 0, '', '', 0, 'ultra-light-semi-electric-bed-w-half-rails', '', 'Complete Medical', '', '', '43d41edba940a1e3cacb13e9dde53f31.jpg', '2019-02-24 09:20:02', '1', '15030BVHR', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(36, 'Belkis TLSO Back Brace Orthotics Small 19.5\" Tal', 1, 'Super Admin', 10, 'ICD10', 'HCPCS', 0, '<p>Small, 19.5&quot; tall * LG-PRO-BELKIS: Professional Belkis TLSO Custom fits with Flex-E-Core Technology * All Sizes fit up to 52 inch waist * Dual Non-Stretch Straps fit new code requirements * Professional Belkis Back Brace System allows user to easily make adjustment for comfort fit after first fitting * Unloads discs, vertebrae and other spinal structures by non-stretch, low pressure compression of the vertebral assembly * Helps immobilize spine thereby stabilizing weak or injured structures and deformities stabilizing the lumbo-sacral spine; facilitates healing of injuries or after surgical procedures; reduces pain * Belkis-PRO-TLSO: a BOC Orthtist design for TLSO 2 Mod symphis-xipho * Flex-E-Core combines Ferrous Alloys laminated within lightweight copolymer plastics forming composite panels (anterior and posterior) which are malleable with high tensile resistance * Flex-E-Core panels allow hands on custom fitting with near unlimited adjustment * Soft and comfortable with Easy Don-Doff Quick Release Access</p>\r\n', 'Covered by Medicare, Medicaid and Most HMO\'s', 202, '', '152', 0, '', '', 0, 'belkis-tlso-back-brace-orthotics-small-19-5-tal', '', 'Complete Medical', '', '', '8fbc592166fea32754f8fa216e34be5d.JPG', '2019-02-25 03:42:20', '1', '1861A', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(37, 'Blue Jay Back Support with Supporting Stays Universal Blk', 1, 'Super Admin', 10, 'ICD10', 'HCPCS', 0, '<p>Color: black * Criss-cross ventilated elastic creates firm compression and support on the back * Hook closure for adjustable maximum fit and compression * Flexible stays help eliminate rolling and provide additional support * Universal, one size fits most * 24&quot;- 46&quot;</p>\r\n', 'Covered By Medicare, Medicaid and Most HMO\'s', 32, '', '25', 0, '', '', 0, 'blue-jay-back-support-with-supporting-stays-universal-blk', '', 'Complete Medical', '', '', '9c0c058862cc0c2c88f9534ff58806b4.jpg', '2019-02-25 03:46:54', '1', 'BJ215300UN', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(38, 'Blue Jay Industrial Back Support w/Suspenders, Black X-Large', 1, 'Super Admin', 10, 'ICD10', 'HCPCS', 0, '<p>Color: black * Wide duo-tension straps provide excellent abdominal and lower back support * Flexible stays help eliminate rolling * Wide duo-tension straps encourage proper lifting technique * Non-removable suspenders provide extra support and comfort * Size: x-large (40&quot; - 55&quot;) * To size, measure hip circumference</p>\r\n', 'Covered by Medicare, Medicaid and Most HMO\'s', 46, '', '34', 0, '', '', 0, 'blue-jay-industrial-back-support-w-suspenders-black-x-large', '', 'Complete Medical', '', '', '26fff37d216f50d33f5be11bc46240c3.jpg', '2019-02-25 03:50:47', '1', '', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(39, 'Blue Jay Univ Back Support w/Lumbar Tension Straps-White', 1, 'Super Admin', 10, 'ICD10', 'HCPCS', 0, '<p>Color: white * Lumbar tension straps provide additional compression and support * Hook receptive elastic provides necessary abdominal and lumbosacral support with maximum adjustability * Lumbar tension straps extend from the back and adhere to side panels for additional compression * Flexible stays help eliminate rolling * Universal, one size fits most * 24&quot;- 46&quot;</p>\r\n', 'Covered by Medicare, Medicaid and Most HMO\'s', 34, '', '25', 0, '', '', 0, 'blue-jay-univ-back-support-w-lumbar-tension-straps-white', '', 'Complete Medical', '', '', 'da2ffbf6c42c91cbd4d211edd3453b7b.jpg', '2019-02-25 03:54:31', '1', 'BJ215320UN', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(40, 'Lumbar Support Male X-Large Sportaid', 1, 'Super Admin', 10, 'ICD10', 'HCPCS', 0, '<p>Heavy-duty support * fabric covered polyester felt back panel and elastic front panels * four pre-shaped removeable back stays * wide cotton web straps provide extra compression and are adjustable with hook and loop closure * Shipping Carton Size: 16&quot;L x 12&quot;W x 4&quot;H</p>\r\n', 'Covered by Medicare, Medicaid and Most HMO\'s', 65, '', '55', 0, '', '', 0, 'lumbar-support-male-x-large-sportaid', '', 'Complete Medical', '', '', '980b1e1e8f097c5d19190adbc9c510d1.jpg', '2019-02-25 03:57:58', '1', 'SA1127MXL', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(41, 'Lumbo Support 14\" Duo Strap Large 36\"-42\"', 1, 'Super Admin', 10, 'ICD10', 'HCPCS', 0, '<p>Elastic front panels close with hook and loop * Four removable rigid steel or aluminum stays * Straps provide support to both abdomen and lumbosacral area * Specify size (hip circumference): SM 24&quot;-30&quot;; MD 30&quot;-36&quot;; LG 36&quot;-42&quot;; XL 42&quot;-48&quot; * Large 36&quot;-42</p>\r\n', 'Covered By Medicare, Medicaid and Most HMO\'s', 80, '', '65', 0, '', '', 0, 'lumbo-support-14-duo-strap-large-36-42', '', 'Complete Medical', '', '', 'ac4543305b19672fe9d4338a2de30c43.jpg', '2019-02-25 04:03:31', '1', '', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(42, 'Swede-O Ankle Lok X-Small w/ Stabilizers White', 1, 'Super Admin', 11, 'ICD10', 'HCPCS', 0, '<p>SIZE X-Small * MEN 3-5.5 WOMEN 4-6.5 * Exclusive patented offset panel - traps the laces between the inner and outer flap to hold the laces tighter longer than any other brace * Patented, close-spaced eyelets * Knitted tongue reduces bulk * Full elastic back - ensures complete unrestricted blood flow to the Achilles tendon and virtually eliminates the chance of blistering * Internal U-shaped spiral stays * Side stabilizer inserts provides additional medial and lateral support * Short, curved, heat sealed arch * Triple layer vinyl laminate * 1 year warranty&nbsp;</p>\r\n', 'Covered by Medicare , Medicaid and Most HMO\'s', 40, '', '35', 0, '', '', 0, 'swede-o-ankle-lok-x-small-w-stabilizers-white', '', 'Complete Medical', '', '', 'e017c4c645bdafcf6f6ba15870453229.jpg', '2019-02-25 04:14:54', '1', '01211R', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(43, 'Easy Lok Ankle Brace Sm White Woven Tongue w/ Stabilizers', 1, 'Super Admin', 11, 'ICD10', 'HCPCS', 0, '<p>Swede-O * Fits men&#39;s 6-7� and women&#39;s 7-9� * Ideal for arthritic patients and others who have difficulty applying a lace-up style brace * Exclusive ANKLE LOK offset panel provides greater leverage so the hook and loop closure straps can be pulled tighter and will stay tighter longer * Heavy-duty triple vinyl laminate construction provides superior ankle support and durability * Includes semi-rigid side stabilizer inserts for additional ankle support * Foam padded interior for greater comfort * Breathable tongue wicks away moisture to keep the ankle cool and dry * Made in the USA with uncompromising quality standards</p>\r\n', 'Covered By Medicare, Medicaid And Most HMO\'s', 44, '', '38', 0, '', '', 0, 'easy-lok-ankle-brace-sm-white-woven-tongue-w-stabilizers', '', 'Complete Medical', '', '', '7eb8aa55554405986af0d08552c17291.jpg', '2019-02-25 08:08:11', '1', '01412', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(44, 'Aircast Air-Stirrup Brace', 1, 'Super Admin', 11, 'ICD10', 'HCPCS', 0, '<p>&nbsp;Air-Stirrup ankle brace for use with sprains, fractures and chronic instability * Resists inversion without affecting flexion * Anatomically contoured to conform to the ankle with minimum bulk * Comfort and security encourage early reform to function&nbsp;</p>\r\n', 'Covered By Medicare, Medicaid And Most HMO\'s', 60, '', '45', 0, '', '', 0, 'aircast-air-stirrup-brace', '', 'Complete Medical', '', '', '067a23d296a025bf208e773cd9963061.jpg', '2019-02-25 08:13:14', '1', '02AL', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(45, 'Air Stirrup, Universal', 1, 'Super Admin', 11, 'ICD10', 'HCPCS', 0, '<p>Patented Duplex aircell system to enhance circulation and reduce swelling * Universal semi-rigid shells prevent further injury while allowing normal ambulation * Pre-Inflated aircell and adjustable heel pad for easy fit * Indications: Ankle sprain &amp; chronic ankle instability *</p>\r\n', 'Covered By Medicare, Medicaid And Most HMO\'s', 52, '', '38', 0, '', '', 0, 'air-stirrup-universal', '', 'Complete Medical', '', '', 'e6f105702b3499907ddb9c111e153557.jpg', '2019-02-25 08:18:57', '1', '02E', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(46, 'AirSport Ankle Brace', 1, 'Super Admin', 11, 'ICD10', 'HCPCS', 0, '<p>Clinically proven semi-rigid shell and aircells to provide comfort and support * Additional compression and stabilization is provided by anterior talofibular cross strap and intergral forefoot and shin wraps * The unique &quot;step-in&quot; design (toes first inserted into the back of the brace) and automatic heel adjustment make the AirSport extremely fast and easy to put on * Indication: Ankle sprain; Chronic instability; Prophylaxis</p>\r\n', 'Covered By Medicare, Medicaid And Most HMO', 65, '', '48', 0, '', '', 0, 'airsport-ankle-brace', '', 'Complete Medical', '', '', '8fb2d94a65b1a79e7164a79558fbad48.jpg', '2019-02-25 08:25:06', '1', '02MLL', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(47, 'A60 Ankle Support', 1, 'Super Admin', 11, 'ICD10', 'HCPCS', 0, '<p>Provides prophylactic support, protection, and comfort with simplified application * The design incorporates a stabilizer molded at a 60 degree angle to help guard against ankle sprains and prevent rollover * 60 degrees stabilizer helps prevent inversion and eversion * Breathable fabric provides cool and dry comfort * Sleek, anatomical design minimizes bulk in shoe * No-lace, single strap application simplifies adjustment</p>\r\n', 'Covered By Medicare, Medicaid And Most HMO\'s', 65, '', '48', 0, '', '', 0, 'a60-ankle-support', '', 'Complete Medical', '', '', '53d49073176fbba35b67d24d084f77a6.jpg', '2019-02-25 08:29:20', '1', '02TLL', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(48, 'Bell-Horn Active Ankle Brace', 1, 'Super Admin', 11, 'ICD10,L1906', 'HCPCS', 0, '<p>Neoprene padding system * Two straps and a bilateral hinge provide unequaled ankle protection for chronic instability, or preventative use when increased activity levels are presented in rehabilitation * &quot;Ranked among the highest in terms of stability, comfort and ease of application&quot; - According to the Journal of the American Podiatric Medical association * Provides maximum ankle protection during activity * Low profile design allows brace to be worn inside an athletic shoe * Extremely lightweight and comfortable * Recommended for chronic ankle instability but allows the freedom of motion in plantarflexion / dorsiflexion * Fits Womens shoe sizes 5 - 6&nbsp;</p>\r\n', 'Covered By Medicare, Medicaid And Most HMO\'s', 55, '', '40', 0, '', '', 0, 'bell-horn-active-ankle-brace', '', 'Complete Medical', '', '', '2510ce106da2f988e5f87f194266145d.jpg', '2019-02-25 08:36:13', '0', '', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(49, 'Tuli\'s Cheetah Ankle Support w/Heel Cup', 1, 'Super Admin', 11, 'ICD10', 'HCPCS', 0, '<p>Fitted X-Small - Instep Circumference up to 7.5 inches * Sold as an individual unit, not as a pair * A dynamic combination of Tuli�s Heel Cups� shock absorbing technology and the comfort and support of a lightweight neoprene ankle support * Barefoot feeling protection and comfort, ideal for many athletes including gymnasts and dancers, Tuli�s Cheetahs provide support for shin splints and tired and swollen ankles * Available in both a Fitted slip-on version or One Size Fits All with adjustable velcro straps</p>\r\n', 'Covered By Medicare, Medicaid And Most HMO\'s', 28, '', '20', 0, '', '', 0, 'tuli-s-cheetah-ankle-support-w-heel-cup', '', 'Complete Medical', '', '', '474c751054057424a0148b4c2b97bd81.jpg', '2019-02-25 08:40:04', '1', '1483A', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(50, 'MalleoTrain Ankle Right Size 2 Natura', 1, 'Super Admin', 11, 'ICD10', 'HCPCS', 0, '<p>The MalleoTrain ankle support reinforces the stability and strength of your ankle joint *With a special knit fabric that fits the natural shape of your ankle, the MalleoTrain brace delivers medical grade compression without hurting pressure points *It stabilizes the ankle and ligaments and improves circulation *Comfortable support: *With every movement you make, two soft pads become active, massaging the ankle joint *Cushioned pads support the inner and outer ankle bones to reduce swelling and provide even more stability *MalleoTrain supports are easy to put on, do not slip, and sit firmly and comfortably in position *Get back on your feet faster The MalleoTrain support helps you every step of the way, quickly allowing you to walk again without ankle pain *Components: *Graduated compression - Compression gradually gets lighter towards the ends *Improves circulation and relieves muscle and joint soreness *Three-dimensional knit - Constructed to conform to the natural shape of the ankle so it fits snugly yet comfortably against your body and stimulates circulation *Contoured viscoelastic cushion - Soft pads behind each ankle bone helps to reduce pain and swelling *No rigid parts - Comfortable to wear and allows full range of motion *Breathable Train active knit - gentle on the skin and extremely comfortable to wear *Graduated compression - Compression gradually gets lighter towards the ends *Improves circulation and relieves muscle and joint soreness *Treatment of: *Mild ankle sprains *Mild instabilities *Ankle arthritis *Ankle pain *Ankle swelling *Right *Size 2</p>\r\n', 'Covered By Medicare, Medicaid And Most HMO\'s', 110, '', '85', 0, '', '', 0, 'malleotrain-ankle-right-size-2-natura', '', 'Complete Medical', '', '', '189f99d3df7ca90e41ac21f5428d70c3.jpg', '2019-02-25 08:45:54', '0', '1580BR', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(51, 'MalleoTrain Ankle', 1, 'Super Admin', 11, 'ICD10', 'HCPCS', 0, '<p>The MalleoTrain ankle support reinforces the stability and strength of your ankle joint *With a special knit fabric that fits the natural shape of your ankle, the MalleoTrain brace delivers medical grade compression without hurting pressure points *It stabilizes the ankle and ligaments and improves circulation *Comfortable support: *With every movement you make, two soft pads become active, massaging the ankle joint *Cushioned pads support the inner and outer ankle bones to reduce swelling and provide even more stability *MalleoTrain supports are easy to put on, do not slip, and sit firmly and comfortably in position *Get back on your feet faster *The MalleoTrain support helps you every step of the way, quickly allowing you to walk again without ankle pain *Components: *Graduated compression - Compression gradually gets lighter towards the ends *Improves circulation and relieves muscle and joint soreness *Three-dimensional knit - Constructed to conform to the natural shape of the ankle so it fits snugly yet comfortably against your body and stimulates circulation *Contoured viscoelastic cushion - Soft pads behind each ankle bone helps to reduce pain and swelling *No rigid parts - Comfortable to wear and allows full range of motion *Breathable Train active knit - gentle on the skin and extremely comfortable to wear *Graduated compression - Compression gradually gets lighter towards the ends *Improves circulation and relieves muscle and joint soreness *Treatment of: *Mild ankle sprains *Mild instabilities *Ankle arthritis *Ankle pain *Ankle swelling</p>\r\n', 'Covered By Medicare, Medicaid And Most HMO\'s', 110, '', '85', 0, '', '', 0, 'malleotrain-ankle-1', '', 'Complete Medical', '', '', '06ae29afe8d75f9c25ab99d541cd8d85.jpg', '2019-02-25 08:49:44', '1', '1580CL', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', '');
INSERT INTO `product_trans` (`id`, `product_name`, `seller_id`, `seller_name`, `category`, `diagnosis_code`, `item_code`, `subcategory`, `description`, `short_description`, `price`, `strip`, `sale_price`, `delivery_charge`, `user_like`, `rating`, `sale`, `slug`, `product_code`, `product_brand`, `measurement`, `measure_unit`, `product_image`, `created_date`, `status`, `tags`, `transaction_cost`, `shipping_cost`, `reviews`, `image_gallery`, `stock_status`, `stock`, `flag`, `tax`, `store_type`, `color`, `size`, `csv`, `insurance`, `insurance_name`, `product_video`, `storeprice`, `link`) VALUES
(52, 'Exoform Ankle Speed Brace', 1, 'Super Admin', 11, 'ICD10', 'HCPCS', 0, '<p>Exoform�s advanced design provides the compression and comfort of a soft ankle brace with 35% more protection than traditional stirrups * Figure-8 heel lock strapping performs consistently, unlike taping that stretches over time * Allows for normal plantar &amp; dorsi flexion * Constructed of highly breathable, quick drying fabric * Measure ankle diagonally over the base of the heel and across the ankle bone *</p>\r\n', 'Covered By Medicare, Medicaid And Most HMO\'s', 40, '', '30', 0, '', '', 0, 'exoform-ankle-speed-brace', '', 'Complete Medical', '', '', '70e3b852d608fea54e647376b4c919f3.jpg', '2019-02-25 08:54:54', '1', '20615', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(53, 'Swede-O Ankle Lok w/ Stabilizers Black', 1, 'Super Admin', 11, 'ICD10', 'HCPCS', 0, '<p>Exclusive ANKLE LOK� offset panel traps the laces between the inner and outer flap to hold the laces tighter longer than any other brace. Exclusive close spaced eyelets concentrate the holding power where it&#39;s needed most creating the most effective heel lock. Full elastic back ensures complete unrestricted blood flow to the Achilles&#39; tendon and virtually eliminates the chance for blistering. Internal U-shaped spiral stays provide extra support and further minimize the chance for ankle injury. Arch fits the contour of the foot and is seamless so it virtually eliminates irritation to the bottom of the foot. Triple layer vinyl laminate provides durability and comfort. Exclusive padded tongue option makes it easier to slip brace on and off. Easier application and comfort for fresh sprains. Optional side stabilizer inserts provide additional medial and lateral support for injured ankles</p>\r\n', 'Covered By Medicare, Medicaid And Most HMO\'s', 45, '', '32', 0, '', '', 0, 'swede-o-ankle-lok-w-stabilizers-black', '', 'Complete Medical', '', '', 'f4847a281d732a42ce9a771a5724d4d8.jpg', '2019-02-25 08:59:06', '1', '21211R', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(54, 'MalleoTrain Ankle Support', 1, 'Super Admin', 11, 'ICD10', 'HCPCS', 0, '<p>Comfortable, lightweight, knitted support ideal for chronic ankle swelling and soreness, ankle sprains, ligamental weakness and slight tears * Incorporate silicone inserts * Promotes proprioception, thus heightening sensory awareness in the ankle for increased joint stabilization * Anatomical knit with graduated compression at the edges * Will not retain heat * Machine washable</p>\r\n', 'Covered By Medicare, Medicaid And Most HMO\'s', 110, '', '85', 0, '', '', 0, 'malleotrain-ankle-support', '', 'Complete Medical', '', '', '845c222ea5603b971ab992633b5af7ee.jpg', '2019-02-25 09:04:37', '1', '2439AL', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(55, 'AnkleGard Universal Blue', 1, 'Super Admin', 11, 'ICD10', 'HCPCS', 0, '<p>Recommended for ankle sprains, can help prevent ankle injuries * Durable, supportive design, made of NuStimWrap, resists migration and delivers maximum adjustable compression * Fits securely on either ankle with attached Velcro * Wrap, when applied directly to the skin, will not cause blistering or irritation * Slim design promotes comfortable wear in most footwear</p>\r\n', 'Covered By Medicare, Medicaid And Most HMO\'s', 25, '', '20', 0, '', '', 0, 'anklegard-universal-blue', '', 'Complete Medical', '', '', '19f77a75cafdc0ee2332ee0b8127023a.jpg', '2019-02-25 09:08:36', '1', '40001B', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(56, '	Thermoskin Ankle Wrap', 1, 'Super Admin', 11, 'ICD10', 'HCPCS', 0, '<p>It Is designed to assist in the rehabilitation of sprains and ligament damage to the ankle * Captures body heat &amp; increases blood flow * Allows skin to ventilate &amp; release moisture * Can be used for left or right foot * It has the additional benefit of an ankle closure strap for ease of application and increased compression where required</p>\r\n', 'Covered By Medicare, Medicaid And Most HMO\'s', 45, '', '32', 0, '', '', 0, '-thermoskin-ankle-wrap', '', 'Complete Medical', '', '', '11f7a4a75529227dbcb559dfac17110c.jpg', '2019-02-25 09:12:07', '1', '83203', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(57, '	Ankle Brace, Canvas Lightweight', 1, 'Super Admin', 11, 'ICD10', 'HCPCS,L1902', 0, '<p>Flexible and soft, this canvas ankle brace provides medial/lateral support to injured or weak ankles but is light enough to wear during athletic activity * Extra stabilization is achieved with the removable medial/lateral inserts * Lace-up design allows for a more precise fitting support * Soft canvas that contours and cradles the ankle * Breathable and comfortable ankle brace * Indications: Recommended for stabilizing the ankle joint following cast removal or when severe sprains occur</p>\r\n', 'Covered By Medicare, Medicaid And Most HMO\'s', 35, '', '28', 0, '', '', 0, '-ankle-brace-canvas-lightweight', '', 'Complete Medical', '', '', '8f3e77f415eed553884ef24b4ca23aa2.jpg', '2019-02-25 09:15:43', '1', 'BH165L', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(58, 'Elastic Ankle Support', 1, 'Super Admin', 11, 'ICD10', 'HCPCS,A4466', 0, '<p>Elastic supports help improve stability by limiting abduction and adduction * With an open heel and toe, this ankle support is light enough to be worn inside of the shoe but durable enough to provide the proper compression * Support for weak or injured ankles * Comfortable elastic, durable protection * Fits left or right ankle * Recommended for mild ankle sprain, contusions, tendonitis, and ankle strain</p>\r\n', 'Covered By Medicare, Medicaid And Most HMO\'s', 15, '', '10', 0, '', '', 0, 'elastic-ankle-support', '', 'Complete Medical', '', '', 'be2e1c5d21de0672b4df0dba014ba11f.jpg', '2019-02-25 09:19:55', '1', 'BH189L', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(59, 'Stabilized Ankle Brace', 1, 'Super Admin', 11, 'ICD10', 'HCPCS,L1902', 0, '<p>Cool and durable flannel and mesh design provides comfort * Non-stretch &quot;Figure 8&quot; nylon straps add support, while the heel lock helps to prevent inversion/eversion * Figure 8 strap offers increased stability mimicking trainer&#39;s tape * Low profile design allows brace to be worn inside an athletic shoe * Strong durable breathable material * Recommended for stabilizing the ankle joint following cast removal or for mild to moderate sprains</p>\r\n', 'Covered By Medicare, Medicaid And Most HMO\'s', 36, '', '28', 0, '', '', 0, 'stabilized-ankle-brace', '', 'Complete Medical', '', '', '537e4151056d0e8ebe4506e7ef6b5815.jpg', '2019-02-25 09:23:41', '1', 'BH228L', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(60, '	Compressive Ankle Support', 1, 'Super Admin', 11, 'ICD10 ', 'HCPCS,A4466', 0, '<p>It is the basic elastic ankle sleeve with a twist; we have placed inside a L-shaped visco elastic insert which, when the joint is moved, provides a massaging effect and helps to improve circulation around the ankle * Elastic contours for a better fit * Helps improve circulation * Viscoelastic insert provides consistent compression and gently massages the ankle * Indicated for swollen or tender ankles * Perfect support for injuries resulting from sports as well as sprains, strains, or for post-operative rehabilitation</p>\r\n', 'Covered By Medicare, Medicaid And Most HMO\'s', 25, '', '18', 0, '', '', 0, '-compressive-ankle-support', '', 'Complete Medical', '', '', '5271016a020ed388f85e891ce204a41e.jpg', '2019-02-25 09:31:02', '1', 'BH229L', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(61, 'Drop Foot Brace,', 1, 'Super Admin', 11, 'ICD10', 'HCPCS', 0, '<p>This brace is&nbsp;fabricated in a predorsiflexed position to provide superior dorsiflexion assist * Anatomical design compensates for atrophy and avoids calcaneus irritation * Designed to fit into patient&#39;s standard shoes *</p>\r\n', 'Covered By Medicare, Medicaid And Most HMO\'S', 40, '', '28', 0, '', '', 0, 'drop-foot-brace', '', 'Complete Medical', '', '', '521b22dfcd3ae375aa45f4f281e2cac2.jpg', '2019-02-25 09:38:05', '1', 'BJ180100', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(62, 'Blue Jay Universal Gel Ankle Support w/ Hard Exterior Shel', 1, 'Super Admin', 11, 'ICD10', 'HCPCS', 0, '<p>Interior gel pad provides a comfortable, contoured fit while the exterior hard shell minimizes rolling * Upper air and lower gel pads provide a comfortable, contoured fit around the ankle * High impact shell minimizes rolling of the ankle without limiting plantar and dorsi flexion * Molded plastic shell is tapered for a comfortable fit in most shoes * Fully adjustable, movable straps can be positioned and trimmed for customized fit * Fits left or right ankle</p>\r\n', 'Covered By Medicare, Medicaid And Most HMO\'s', 40, '', '32', 0, '', '', 0, 'blue-jay-universal-gel-ankle-support-w-hard-exterior-shel', '', 'Complete Medical', '', '', '570e125887563bd8d31f292866a83364.jpg', '2019-02-25 09:42:19', '1', 'BJ215100UN', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(63, 'Velocity Ankle Brace', 1, 'Super Admin', 11, 'ICD10', 'HCPCS', 0, '<p>Provides moderate support for ankle injury prevention and treatment * Recommended to help prevent high ankle sprains, abnormal inversion/eversion and protection of ankles during impact sports * Anatomical contour for proper fit * Sturdy rigid uprights with circumferential strapping to help prevent and treat high ankle sprains and inversion/eversion injuries * Bilateral hinges for natural, unrestricted motion * Heat moldable and trimable foot plate to match shoe insoles or orthotics * Available in left or right version *</p>\r\n', 'Covered By Medicare, Medicaid And Most HMO\'s', 195, '', '150', 0, '', '', 0, 'velocity-ankle-brace', '', 'Complete Medical', '', '', 'd31a49f159a713a5316260070dd36dff.jpg', '2019-02-25 09:46:12', '1', 'DJ14902', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(64, 'Single Strap Ankle Support', 1, 'Super Admin', 11, 'ICD10', 'HCPCS', 0, '<p>SINGLE STRAP ANKLE SUPPORT,&nbsp;* FOUR WAY STRETCH SPANDEX * SLIP ON STYLE WITH OPEN HEEL * CLOSES WITH HOOK AND LOOP FOR PROPER TENSION ADJUSTMENT * WEAR OVER SOCK&nbsp;</p>\r\n', 'Covered By Medicare , Medicaid And Most HMO\'s', 20, '', '15', 0, '', '', 0, 'single-strap-ankle-support', '', 'Complete Medical', '', '', '9e4c747383837ab17409424b30688702.jpg', '2019-02-25 09:50:02', '1', 'SA0313ML', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(65, 'Double Strap Ankle Support', 1, 'Super Admin', 11, 'ICD10', 'HCPCS', 0, '<p>Double strap style offers compression to medial and lateral side of ankle * 3&quot; wide segmented straps wrap in figure eight * Wear over sock * Measurement is around ankle joint * Latex Free *</p>\r\n', 'Covered By Medicare, Medicaid And Most HMO\'S', 28, '', '20', 0, '', '', 0, 'double-strap-ankle-support', '', 'Complete Medical', '', '', '7be3dd63b6ad217bc1dc0b7d75956fa3.jpg', '2019-02-25 09:53:42', '1', 'SA0325XL', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(66, 'Universal Gel Air Ankle Stirrup Short Sportaid', 1, 'Super Admin', 11, 'ICD10', 'HCPCS', 0, '<p>Trainer 9&quot; * Allows range of motion with support * Great retail packaging * Fits left or right * Fully adjustable, movable straps * Gel air provides padded comfort plus hot or cold therapy * Worn comfortably inside lace up shoe * Cleans easily with soap and water * White high impact, high density shell * Maintains fit during high level of activity * Latex Free&nbsp;</p>\r\n', 'Covered By Medicare, Medicaid And Most HMO\'s', 55, '', '40', 0, '', '', 0, 'universal-gel-air-ankle-stirrup-short-sportaid', '', 'Complete Medical', '', '', '247d0e3b523df06d778d3f5d659111cc.jpg', '2019-02-25 09:57:40', '1', 'SA7400SHORT', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(67, 'Neoprene Slip-On Ankle Support', 1, 'Super Admin', 11, 'ICD10', 'HCPCS', 0, '<p>Fits either foot and easily into shoe * Offers warmth, flexibility and support&nbsp;</p>\r\n', 'Covered By Medicare, Medicaid And Most HMO\'s', 20, '', '15', 0, '', '', 0, 'neoprene-slip-on-ankle-support', '', 'Complete Medical', '', '', '582410c2db89153fd039dc8de7d3ebee.jpg', '2019-02-25 10:01:52', '1', 'SA9090MD', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(68, '	Ankle Brace, Quick-Tie', 1, 'Super Admin', 11, 'ICD10', 'HCPCS', 0, '<p>Two sets of adjustable lacing not only ensure upper and lower ankle support, but also allow for the ultimate in personalized fit for every size foot * Once the fit is set, the speed lacing tabs provide fast donning and doffing * Seamless bottom for extra comfort * Unique center wedge provides flexion and extension, while maintaining proper support&nbsp;</p>\r\n', 'Covered By Medicare, Medicaid And Most HMO\'s', 55, '', '40', 0, '', '', 0, '-ankle-brace-quick-tie', '', 'Complete Medical', '', '', 'ace5cf95413878590f6ac9eaa54bc55a.jpg', '2019-02-25 10:05:06', '1', 'SCT0540', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(69, 'Aircast Infrapatellar Knee Band', 1, 'Super Admin', 12, 'ICD10', 'HCPCS', 0, '<p>The unique aircell focuses compression on the patellar tendon helping to relieve symptoms of Osgood Schlatter and patella tendonitis * Focusing the pressure helps decrease stress at the tibial tubercle * Foam padding for added comfor</p>\r\n', 'Covered By Medicare, Medicaid And Most HMO\'s', 35, '', '25', 0, '', '', 0, 'aircast-infrapatellar-knee-band', '', 'Complete Medical Supply', '', '', '6d8b409d7e088e5e7a6ca0ea70af4b6f.jpg', '2019-02-26 03:22:08', '1', '08A-B', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(70, '	Knee Immobilizer', 1, 'Super Admin', 12, 'ICD10', 'HCPCS,L1830', 0, '<p>12&quot; Long, Large * Measurement 6&quot; below knee: 15.25&quot; - 18.25&quot; * Measurement 6&quot; above knee: 20.5&quot; - 23.5&quot; * White cotton sateen laminated to 3/8&quot; thick beige foam with alternating hook and loop closures * One each medial and lateral stay and three contoured posterior stays are all removable</p>\r\n', 'Covered By Medicare, Medicaid And Most HMO\'s', 40, '', '30', 0, '', '', 0, '-knee-immobilizer', '', 'Complete Medical', '', '', '2fd07c967ad8d3bca5a1fac5ded8403c.jpg', '2019-02-26 03:27:04', '1', '3112LG', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '0', '', '0', '00', ''),
(71, '	Knee Immobilizer Deluxe', 1, 'Super Admin', 12, 'ICD10', 'HCPCS,L1830', 0, '<p>&nbsp;White cotton sateen on 3/8&quot; thick foam, nylon tricot lined * One each medial and lateral stays and two contoured posterior stays are removable * Alternating loop-lock straps close with hook and loop * Two adhesive foam strips and popliteal pad included&nbsp;</p>\r\n', 'Covered By Medicare, Medicaid And Most HMO\'s', 55, '', '42', 0, '', '', 0, '-knee-immobilizer-deluxe', '', 'Complete Medical', '', '', '156491d6bdf0e2e72e852aa3b2828d5b.jpg', '2019-02-26 03:32:28', '1', '3212LG', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(72, 'Universal 3-Panel Knee Immobilizer', 1, 'Super Admin', 12, 'ICD10', 'HCPCS,L1830', 0, '<p>16&quot; Long * Beige unifoam on 3/8&quot; thick foam, loop-lock straps with hook and loop closure * Features two side panels for easy size adjustment and access to injury site * Measure circumference 6&quot; above and 6&quot; below the knee * Fits circumference: (6&quot; Above Knee): 15&quot; - 25&quot;, (6&quot; Below Knee): 12&quot; - 20&quot; * Three contoured posterior and one each medial and lateral stays are removable</p>\r\n', 'Covered By Medicare, Medicaid And Most HMO\'s', 65, '', '50', 0, '', '', 0, 'universal-3-panel-knee-immobilizer', '', 'Complete Medical', '', '', '1f66a9566ea58fdade5a97475f27143c.jpg', '2019-02-26 03:36:48', '1', '3316UN', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(73, '	Knee Immobilizer Snoopy Pediatric', 1, 'Super Admin', 12, 'ICD10', 'HCPCS,L1830', 0, '<p>Poly cotton bound foam and lined with nylon tricot * One each medial and lateral stay and three contoured posterior stays are all removable * Hook/Loop closure * Fits sizes:-10&quot; to 14&quot; (Circumference 3&quot; Above Knee)-6.5&quot; to 10&quot; * (Circumference 3&quot; Below Knee).</p>\r\n', 'Covered By Medicare, Medicaid And Most HMO\'s', 60, '', '45', 0, '', '', 0, '-knee-immobilizer-snoopy-pediatric', '', 'Complete Medical', '', '', '02dbe96662d51ab993ec140cd371df0a.jpg', '2019-02-26 04:29:58', '1', '4702', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(74, 'Palumbo Patella Tracker', 1, 'Super Admin', 12, 'ICD10', 'HCPCS', 0, '<p>Floating lateral bracing pad maintains patellar position during flexion. * Lateral elastic insert in patella strap repositions pad according to knee&#39;s ROM. * Viscoelastic insert conforms and adjusts. * Fits left or right. * 1?8&quot;- thick neoprene. * Blue. * Circ. 3&quot; above Mid-Patella: 13-1/2&quot; to 15&quot; Circ. 3&quot; below Mid-Patella: 11-1/2&quot; to 13&quot;</p>\r\n', 'Covered Medicare, Medicaid And Most HMO\'s', 125, '', '95', 0, '', '', 0, 'palumbo-patella-tracker', '', 'Complete Medical', '', '', '6d847d997dcf3e33ced0e84bf14dfb2a.jpg', '2019-02-26 05:24:20', '1', '66365', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(75, 'Hinged Knee Wrap Dual Pivot Brace', 1, 'Super Admin', 12, 'ICD10', 'HCPCS,L1810', 0, '<p>&nbsp;Open wrap knee brace design offers flexible application with the option of three high quality removable hinges * Measure slightly bent, underneath knee cap * Permits functional mobility while ensuring stability and support following postoperative ligament and meniscus surgery</p>\r\n', 'Covered By Medicare Medicaid And Most HMO\'s', 144, '', '106', 0, '', '', 0, 'hinged-knee-wrap-dual-pivot-brace', '', 'Complete Medical', '', '', 'd6ff392f287b2871ddb1d7ef26874c05.jpg', '2019-02-26 05:32:02', '0', '80277', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(76, 'Open Knee Wrap Stabilizer', 1, 'Super Admin', 12, 'ICD10', 'HCPCS', 0, '<p>&nbsp;Wrap design with velcro closure and open patella means comfort for tenderness or bruising on the kneecap * Has full-length anterior opening, popliteal cut out and unrestricted knee flexion * Side spirals give additional support * Captures body heat &amp; increases blood flow * Allows skin to ventilate &amp; release moisture * Measure slightly bent underneath knee cap</p>\r\n', 'Covered By Medicare. Medicaid And Most HMO\'s', 69, '', '52', 0, '', '', 0, 'open-knee-wrap-stabilizer', '', 'Complete Medical', '', '', '2b36a6c9a367d90594e7d58d8d71027b.jpg', '2019-02-26 05:38:06', '1', '80284', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '0', '', '0', '00', ''),
(77, 'Knee Support, Standard', 1, 'Super Admin', 1, 'ICD10', 'HCPCS', 0, '<p>Thermal support for prevention, treatment &amp; rehabilitation of the knee * Provides protection and support against general wear and tear including sprains, strains and twisted knees * Anatomically shaped in 3 pieces for more comfort and a better fit * Thermoskin increases elasticity of muscles, tendons and ligaments to reduce the risk of injury when under stress and strain * Clinically proven to increase surface skin and subcutaneous temperature between 2-3 degrees F, the optimal level to make tendons and muscles more pliable and elastic to provide optimal muscle function</p>\r\n', 'Covered By Medicare, Medicaid And Most HMO\'s', 35, '', '25', 0, '', '', 0, 'knee-support-standard', '', 'Complete Medical', '', '', '9380d0e0d7a6444ba2bddbd622956b5f.jpg', '2019-02-26 05:42:24', '1', '82208', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(78, 'Elastic Knee Stabilize', 1, 'Super Admin', 12, 'ICD10', 'HCPCS', 0, '<p>Elastic Support for Prevention, Treatment &amp; Rehabilitation of the knee * Thermoskin elastics can expand, contract and stretch and are made of a high-grade durable material that permits a full range of movement and are comfortable to wear during a range of activities * Anatomically designed, the elastic support will comfortably contour to the shape of your knee * It provides even compression and support to weakened and injured knees * It has side stabilizers to provide increased medial and laterial support</p>\r\n', 'Covered By Medicare, Medicaid And Most HMO\'s', 20, '', '16', 0, '', '', 0, 'elastic-knee-stabilize', '', 'Complete Medical', '', '', '6a1eeca48909ddf521686a67b87f9901.jpg', '2019-02-26 05:46:47', '0', '83646', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(79, 'Thermoskin Arthritic Hinged Knee Wrap', 1, 'Super Admin', 12, 'ICD10', 'HCPCS', 0, '<p>Thermoskin Arthritic Hinged Knee Wrap contains lightweight, high quality hinges for extra stability. * Hinges also help prevent hyperextension. * The Knee Wrap is easy to apply and adjust with two adjustable closure straps. * Open knee patella area is helpful if knee cap is bruised or tender. * Thermoskin&#39;s exclusive Trioxon lining is soft and comfortable against the skin while providing increased circulation and heat therapy. * Universal design means you can wear on either knee</p>\r\n', 'Covered By Medicare, Medicaid And Most HMO\'s', 80, '', '59', 0, '', '', 0, 'thermoskin-arthritic-hinged-knee-wrap', '', 'Complete Medical', '', '', '4cddffabb5096c192f0bc958a2fc675f.jpg', '2019-02-26 05:50:43', '1', '84184', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(80, 'GenuTrain P3 Knee Support', 1, 'Super Admin', 12, 'ICD10', 'HCPCS', 0, '<p>Relieves pain and swelling caused by misalignment of the kneecap (patellar lateralization), femoropatellar pain syndrome (anterior knee pain) or pain associated with patellar tip syndrome * Two integral pressure cushions (pads) and a corrective guide, stabilize the position of the kneecap and activate the musculature, thereby accelerating the healing process * Breathable knit for high wearing comfort * Together with a corrective guide, the integral, ring-shaped pad prevents any drifting, while a second, wedge-shaped pad also acts to relieve both pressure and pain * GenuTrain P3 exerts intermittent compression, thereby accelerating the reabsorption of edema and effusions * The sense of security during load-bearing is improved and muscular stabilization is achieved for the joint in addition to increased proprioception * Ideal for use in sports. It shortens the regeneration period and enables training to be resumed more quickly * Extra stretchy knit with a softer zone behind the knee, reduced pressure at the edges, breathable materials and an anatomically contoured shape * The skin is kept pleasantly cool and nothing digs in * Indications: Femoropatellar pain syndrome (chondropathy, chondromalacia), Patellar lateralization (dislocation tendency), After lateral release surgery: Osteoarthritis of the knee</p>\r\n', 'Covered By Medicare, Medicaid And Most HMO\'s', 190, '', '145', 0, '', '', 0, 'genutrain-p3-knee-support', '', 'Complete Medical', '', '', '2f5557792a80273b2cfbba271452ab88.jpg', '2019-02-26 06:51:15', '1', '8515A', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(81, 'ProStyle Knee Wrap Universal', 1, 'Super Admin', 12, 'ICD10', 'HCPCS,A4466', 0, '<p>Recommended to limit swelling and protect injured knee * Generates heat, which provides increased warmth to the knee thereby increasing circulation and decreasing pain * For treatment of arthritis, quad weakness, knee contusions, joint effusion, knee sprains and strains as well as meniscal tears * ProStyle� material adds the soothing warmth of neoprene with a soft terry-cloth lining * Maintains cool comfort while keeping the muscles of the knee warm and loose * Wrap style offers a more secure fit than sleeves * Knee support for the active person * Recommended for treatment of: arthritis, quad weakness, knee contusions, joint effusions, knee sorains and strains as well as meniscal tears</p>\r\n', 'Covered By Medicare, Medicaid And Most HMO\'s', 35, '', '25', 0, '', '', 0, 'prostyle-knee-wrap-universal', '', 'Complete Medical', '', '', '3c84eb300c9202a97994076df793f2ea.jpg', '2019-02-26 06:59:47', '1', 'BH162', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(82, 'Elastic Knee Support', 1, 'Super Admin', 12, 'ICD10', 'HCPCS,L3908', 0, '<p>Recommended for stabilization of the knee joint when ligaments or muscles have been damaged or weakened * Made of one-way stretch elastic, this elastic knee support can also be used as a preventative support for athletes * Support for weak or injured knees * Comfortable elastic, durable protection * Easily applied * Provides support while maintaining flexibility</p>\r\n', 'Covered By Medicare, Medicaid And Most Insurance', 15, '', '10', 0, '', '', 0, 'elastic-knee-support', '', 'Complete Medical', '', '', '', '2019-02-26 07:04:03', '1', 'BH193M', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(83, 'ProStyle Knee Sleeve Closed Patella', 1, 'Super Admin', 12, 'ICD10,A4466', 'HCPCS', 0, '<p>Our ProStyle Knee Sleeve provides a warming support for arthritis * Closed patella * Indications: Recommended for treatment of: arthritis, quad weakness, knee contusions, joint effusions, knee sprains and strains as well as meniscal tears&nbsp;</p>\r\n', 'Covered By Medicare, Medicaid And Most HMO\'s', 28, '', '17', 0, '', '', 0, 'prostyle-knee-sleeve-closed-patella', '', 'Complete Medical', '', '', '2d8cae9c9b61083289b16a0a3bd9dc9c.jpg', '2019-02-26 07:09:38', '1', 'BH203L', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(84, '	Knee Sleeve, ProStyle Open Patella', 1, 'Super Admin', 12, 'ICD10', 'HCPCS,A4466', 0, '<p>Bell-Horn&#39;s exclusive ProStyle Knee Supports are designed to give you the comfort of an elastic support with the therapeutic properties of heat, without the perspiration associated with neoprene * Provides a warming support for arthritis * Recommended for treatment of: arthritis, quad weakness, knee contusions, joint effusions, knee sprains and strains as well as meniscal tears</p>\r\n', 'Covered By Medicare, Medicaid And Most HMO\'s', 28, '', '18', 0, '', '', 0, '-knee-sleeve-prostyle-open-patella', '', 'Complete Medical', '', '', 'd25899d53048050c45ec3b0ec24ac1f4.jpg', '2019-02-26 07:13:40', '1', 'BH204L', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(85, 'Compressive Knee Support', 1, 'Super Admin', 12, 'ICD10', 'HCPCS , A4466', 0, '<p>It is the basic elastic knee sleeve with a twist; we have placed inside a visco elastic insert which, when the joint is moved, provides a massaging effect and helps to improve circulation around the joint * Elastic contours for a better fit * Helps improve circulation * Viscoelastic insert provides consistent compression and gently massages the knee * Indicated for swollen or tender knees * Perfect brace for injuries resulting from sports as well as sprains, strains, or for post-operative rehabilitatio</p>\r\n', 'Covered By Medicare, Medicaid And Most HMO\'s', 26, '', '15', 0, '', '', 0, 'compressive-knee-support', '', 'Complete Medical', '', '', 'aa6d68d38c2dd686a358f9334171d464.jpg', '2019-02-26 07:18:04', '1', 'BH230L', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(86, 'Hinged Patella Knee Wrap', 1, 'Super Admin', 12, 'ICD10', 'HCPCS', 0, '<p>Designed to give you the comfort of an elastic support with the therapeutic properties of heat, without the perspiration associated with neoprene * Ideal for knee sprain or strain * Wrap design allows for an easy fit * ProStyle retains heat to help keep muscle loose * Offers treatment for ACL, LCL, MCL, PCL sprains * Recommened for swollen or tender knees resulting from: sprains, strains, sports injuries or post-operative rehab * Offers treatment for Osgood-Schlatter Disease as well as patellar instability * 19&quot; - 23&quot;</p>\r\n', 'Covered By Medicare, Medicaid And Most HMO\'s', 45, '', '35', 0, '', '', 0, 'hinged-patella-knee-wrap', '', 'Complete Medical', '', '', '8a9c030ffe16f41bd77e9c3c52a1ff71.jpg', '2019-02-26 07:22:33', '1', 'BH2372X3X', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(87, 'Hinged Knee Wrap, ProStyle EZ Fit', 1, 'Super Admin', 12, 'ICD10', 'HCPCS,L1810', 0, '<p>Bell Horn&#39;s exclusive ProStyle Knee Wraps are designed to give you the comfort of an elastic support with the therapeutic properties of heat, without the perspiration associated with neoprene * These supports are ideal for knee sprain or strain * Wrap design allows for an easy fit * ProStyle retains heat to help keep muscle loose * Offers treatment for ACL, LCL, MCL, PCL sprains * Recommened for swollen or tender knees resulting from: sprains, strains, sports injuries or post-operative rehab * Offers treatment for Osgood-Schlatter Disease as well as patellar instability</p>\r\n', 'Coverd By Medicare, Medicaid And Most HMO\'s', 50, '', '38', 0, '', '', 0, 'hinged-knee-wrap-prostyle-ez-fit', '', 'Complete Medical', '', '', 'f00bf42e53cd68b321e897a1258916eb.jpg', '2019-02-26 07:26:08', '1', 'BH352S', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(88, 'Elastic Knee Support', 1, 'Super Admin', 12, 'ICD10', 'HCPCS, L1825', 0, '<p>This one way stretch elastic knee support is designed to offer basic stabilization of the knee joint and support weakened muscles * Improve knee stability, pain and swelling * Use when pain and/or swelling of the knee is present</p>\r\n', 'Covered By Medicare, Medicaid And Most HMO\'s', 10, '', '6', 0, '', '', 0, 'elastic-knee-support-1', '', 'Complete Medical', '', '', '8edd15fa9af8c13aaf3a2d82a7395c11.jpg', '2019-02-26 07:29:22', '1', 'BH99300M', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(89, 'Knee Wrap Black Universal Open Patella', 1, 'Super Admin', 12, 'ICD10', 'HCPCS,L1825', 0, '<p>Designed to provide the maximum support in a wrap of this style, we have incorporated a three-strap closure to this Knee Wrap to ensure the popliteal is as equally supported as the patella * Can be used to help Arthritis, quad weakness, knee contusions, joint effusion, knee sprains and strains as well as meniscal tears * A great solution for additonal support for injured and weak knee</p>\r\n', 'Covered By Medicare, Medicaid And Most HMO\'s', 22, '', '15', 0, '', '', 0, 'knee-wrap-black-universal-open-patella', '', 'Complete Medical', '', '', '2f288936ed874b054c6a11206e43397e.jpg', '2019-02-26 07:32:20', '1', 'BH99320', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(90, '	Extension Stop Hinged Knee Brace ', 1, 'Super Admin', 12, 'ICD10', 'HCPCS', 0, '<p>Geared precision hinge * a quick and easy scrrew adjustment allows the user to set the extension stop at 0,15, 0r 30 degrees * patella stabilization is controled by hook and loop fasteners which can be repositioned for comfort * to elastic straps allow for customization * measurement circumference around center of knee joint with leg extended and relaxed</p>\r\n', 'Covered By Medicare, Medicaid And Most HMO\'s', 55, '', '45', 0, '', '', 0, '-extension-stop-hinged-knee-brace', '', 'Complete Medical', '', '', '67175f44745d596e3dcff17ff65dde57.jpg', '2019-02-26 07:36:23', '1', 'JJ47033', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(91, 'Knee Support with Viscoelastic', 1, 'Super Admin', 12, 'ICD10', 'HCPCS', 0, '<p>&nbsp;Two-way stretch Spandex&nbsp;* Lightweight yet compressive support * Features lateral and medial spiral stays * Measurement is around knee cap&nbsp;</p>\r\n', 'Covered By Medicare, Mediciad And Most HMO\'s', 40, '', '30', 0, '', '', 0, 'knee-support-with-viscoelastic', '', 'Complete Medical', '', '', 'b81683d330900dbdd483e9184514b69f.jpg', '2019-02-26 07:40:12', '1', 'SA3627SM', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(92, '	Knee Sleeve Neoprene Open Patella', 1, 'Super Admin', 12, 'ICD10', 'HCPCS', 0, '<p>&nbsp;Two-way stretch Spandex&nbsp;* Lightweight yet compressive support * Features lateral and medial spiral stays * Measurement is around knee cap&nbsp;</p>\r\n', 'Covered By Medicare, Medicaid And Most HMO\'s', 24, '', '16', 0, '', '', 0, '-knee-sleeve-neoprene-open-patella', '', 'Complete Medical', '', '', 'e978421ee27ce37f6ae18d35e87bf753.jpg', '2019-02-26 07:44:07', '1', 'SA9050LG', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(93, 'Neoprene Open Patella Hinged Knee Brace', 1, 'Super Admin', 12, 'ICD10', 'HCPCS', 0, '<p>Excellent Retail Packaging! * Two each medial and lateral spiral stays * Opposing loop-lock stabilizing straps * Reinforced patella with adjustable buttress pad * Measurement is aorund kneecap * Latex Free</p>\r\n', 'Covered By Medicare, Medicaid And Most HMO\'s', 76, '', '55', 0, '', '', 0, 'neoprene-open-patella-hinged-knee-brace', '', 'Complete Medical', '', '', 'd7ad080b9976d5d24ed244feb01d87e1.jpg', '2019-02-26 07:47:19', '1', 'SA9063LG', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(94, '	Knee Wrap Black Neoprene Sportaid', 1, 'Super Admin', 12, 'ICD10', 'HCPCS', 0, '<p>Black neoprene provides warmth, flexibility and support * Easy application * Excellent adjustability * Measurement is around kneecap * Latex Free * Comes with 1 adjustable velcro strap on top portion (above kneecap) *</p>\r\n', 'Covered By Medicare, Medicaid And Most HMO\'s', 28, '', '20', 0, '', '', 0, '-knee-wrap-black-neoprene-sportaid', '', 'Complete Medical', '', '', '95bc83516c75da37ff0c455ca582101a.jpg', '2019-02-26 07:50:58', '1', 'SA9086LG', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(95, 'Universal Knee Wrap Sportaid', 1, 'Super Admin', 12, 'ICD10', 'HCPCS ', 0, '<p>UNIVERSAL * Excellent Retail Packaging! * Wrap around knee with reinforced patella for additional support * Hook receptive pile * Black neoprene warmth, comfort, and support * Fits either knee * Measurement is universal * Latex Free * Comes with 2 adjustable velcro straps * Maximum thigh circumference: 24&quot;&nbsp;</p>\r\n', 'Covered By Medicare, Medicaid And Most HMO\'s', 60, '', '45', 0, '', '', 0, 'universal-knee-wrap-sportaid', '', 'Complete Medical', '', '', '8e433decf521d1e4715f4f2916f6e4c9.jpg', '2019-02-26 07:53:47', '1', 'SA9177UN', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '0', '', '0', '00', ''),
(96, '	J-Brace Patellar Stabilizer ', 1, 'Super Admin', 12, 'ICD10', 'HCPCS', 0, '<p>The J-Brace Patellar Stabilizer is a 1/8th&quot; thick, 13&quot; long sleeve with two lateral and two medial spiral steel stays * It also has a tubular rubber buttress to align the patella * Laterally attached straps pull medially to displace force to the patella * The J-Brace allows compete range of motion while providing stability * 15&quot; - 16&quot; * Manufactured from DermaDry which combines the breathability and water-vapor transmission capabilities of open-cell sponge rubber with the durability, stretch and compression of neoprene * This process allows perspiration to evaporate and is further enhanced by the KwikWick treatment of the soft polyester that coats the inside and outside of the braces * A flame lamination process is used to secure the KwikWick treated polyester to the rubber, eliminating the need for industrial adhesives, a known cause of contact dermatitis * Excellent for patellar instabilities, subluxations and dislocations</p>\r\n', 'Covered By Medicare, Medicaid And Most HMO\'s', 60, '', '45', 0, '', '', 0, '-j-brace-patellar-stabilizer', '', 'Complete Medical', '', '', '9a6b8f6761a7628dee7b7451809d4733.jpg', '2019-02-26 07:57:42', '1', 'SCT0417LL', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(97, 'Aircast Armband', 1, 'Super Admin', 13, 'NA', 'NA', 0, '<p>BEIGE * 8&quot;-14&quot; * For tennis elbow from racquet sports, golf and repetitive industrial activity * A comfortable foam-filled, inelastic band focuses compression on the extensor muscle/tendon complex * Significantly reduces EMG compared with conventional armbands * Effective with 86% of patients - according to a clinical study * One size fits most adults *</p>\r\n', 'Golf-Tennis Players Elbow Support', 25, '', '15', 0, '', '', 0, 'aircast-armband', '', 'Complete Medical', '', '', '4bf644840f4e056f9994aa7c49924467.jpg', '2019-02-26 08:04:59', '1', '', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '0', '', '0', '00', ''),
(98, '	EpiTrain Elbow Support', 1, 'Super Admin', 13, 'NA', 'NA', 0, '<p>Comfortable, lightweight, breathable knitted elbow support incorporating two anatomically contoured silicone inserts surrounding the epicondyles and lying over the flexor and extensor muscles * Graduated compression at the edges prevents constriction of circulation and rolling * Does not retain heat - machine washable * Ideal for epicondylitis, elbow strains or sprains, overuse syndromes, and pre- and post-operative conditions, chronic edema * Sizing: With arm slightly bent, loosely measure the circumference of the arm 4.75&quot; below the lateral epicondyle</p>\r\n', 'Gold Tennis Elbow Support', 110, '', '85', 0, '', '', 0, '-epitrain-elbow-support', '', 'Complete Medical', '', '', 'a1bd20e4c3d69e460cd9b1f834b92ce1.jpg', '2019-02-26 08:10:08', '1', '3652100', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '0', '', '0', '00', ''),
(99, 'Thermoskin Hinged Elbow Support', 1, 'Super Admin', 13, 'NA', 'NA', 0, '<p>Hinged Elbow is designed to prevent hyperextension of the elbow * X-cross hook &amp; loop locking straps help restrict range of motion * Medial and lateral hinges provide a hyperextension stop at 0&nbsp;* Measure around elbow joint with arm extended * Small 9-10</p>\r\n', 'Golf - Tennis Elbow Support', 95, '', '70', 0, '', '', 0, 'thermoskin-hinged-elbow-support', '', 'Complete Medical', '', '', '2f0dadd81ff7dd24a27267c70aebe516.jpg', '2019-02-26 08:16:48', '0', '83137', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '0', '', '0', '00', ''),
(100, 'Elastic Elbow Support', 1, 'Super Admin', 13, 'ICD10', 'HCPCS,A4466', 0, '<p>This elbow support is elastic and effective</p>\r\n', 'Covered By Medicare, Medicaid And Most HMO\'s', 15, '', '10', 0, '', '', 0, 'elastic-elbow-support', '', 'Complete Medical', '', '', 'c9aeabe741ec104ba3d82ac7383f4cb2.jpg', '2019-02-26 08:20:36', '1', 'BH195M', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(101, 'Tennis Elbow Sleeve, ProStyle ', 1, 'Super Admin', 13, 'ICD10', 'HCPCS,A4466', 0, '<p>ProStyle Tennis Elbow Sleeve offers compressive support for joints, muscles, and ligaments * A tapered fit and loop lock compression strap assures that the correct amount of compression is applied to the elbow * Helps improve circulation * Provides support and relief to elbow joints, muscles and tendons * ProStyle support offers a terry-lined &quot;all weather&quot; neoprene for maximum comfort * Elbow sleeve with strap helps provide temporary relief of pain due to tendonitis or tennis elbow</p>\r\n', 'Covered By Medicare, Medicaid And Most HMO\'s', 25, '', '17', 0, '', '', 0, 'tennis-elbow-sleeve-prostyle', '', 'Complete Medical', '', '', '56a63060f51ab4f19f91ff49fc2bfc25.jpg', '2019-02-26 08:23:49', '1', 'BH305S', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(102, 'Protection Elbow Pad', 1, 'Super Admin', 1, 'NA', 'NA', 0, '<p>Helps reduce pressure on injured or sensitive elbows. ProStyle PROtection Elbow Sleeve with pad offers compressive support for joints, muscles, and ligaments * Features Include: Impact resistant foam pad, Contoured, streamlined for a better fit, Lightweight protection * Indications: Recommended treatment of mild sprains and strains * Protection of sudden impact related with sports activities</p>\r\n', 'Covered ', 22, '', '16', 0, '', '', 0, 'protection-elbow-pad', '', 'Complete Medical', '', '', '0ce34589a51e2e90efc412a2f690ea16.jpg', '2019-02-26 08:26:56', '1', 'BH330L', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '0', '', '0', '00', ''),
(103, 'Elbow Support Large Slip-On Sportaid', 1, 'Super Admin', 13, 'NA', 'NA', 0, '<p>Knitted elastic support * Provides intermediate compression * Elastic with varying tensions for proper fit * Latex Free&nbsp;</p>\r\n', 'Golf-Tennis Elbow Support', 15, '', '11', 0, '', '', 0, 'elbow-support-large-slip-on-sportaid', '', 'Complete Medical', '', '', '8a6fc33fabc637d8221abb51fd135561.jpg', '2019-02-26 08:29:54', '1', 'SA1953LG', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '0', '', '0', '00', ''),
(104, 'Shoulder Immobilizer', 1, 'Super Admin', 14, 'ICD10', 'HCPCS,A4565', 0, '<p>&nbsp;It has a wide elastic chest band with web straps * One humorous cuff, one forearm cuff with hook and loop closure * Female support is contoured in front for proper anatomical fit * Fits left or right arm</p>\r\n', 'Covered By Medicare, Medicaid And Most HMO\'s', 28, '', '20', 0, '', '', 0, 'shoulder-immobilizer-1', '', 'Complete Medical', '', '', '90ca8ada17caebff67a2dc6b935edfcf.jpg', '2019-02-26 08:36:44', '1', '2500FLG', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(105, 'Thermoskin Sports Shoulder Univ. Fit', 1, 'Super Admin', 1, 'NA', 'NA', 0, '<p>&nbsp;Provides protection, heat and support for the shoulder and keeps it warm and loose while playing sports * Not to be used for dislocations or bracing * Universal design fits either or right or left shoulder&nbsp;</p>\r\n', 'Shoulder Immobilizers', 110, '', '80', 0, '', '', 0, 'thermoskin-sports-shoulder-univ-fit', '', 'Complete Medical', '', '', '64a68823de46400edbf972813a7eead9.jpg', '2019-02-26 08:40:04', '1', '83230', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '0', '', '0', '00', ''),
(106, 'OmoTrain Shoulder Support', 1, 'Super Admin', 14, 'NA', 'NA', 0, '<p>Uniquely designed, knitted shoulder support guides and centers the glenohumeral joint promoting mobility but inhibiting rotation for proper therapy helping to keep the arm in the socket * Adjustable, anatomically contoured silicone insert lies on the shoulder provides intermittent compression of the soft tissue, leading to increased circulation and decreased pain, swelling and subluxation * Anatomical knit with graduated compression at the edges prevents constriction of circulation * Lightweight, breathable knit will not retain heat and sweat * Ideal for shoulder pain, rotator cuff rehab, shoulder subluxation, post surgery, osteoarthritis, and hemiparesis * Universal - Can be used on either the Right or Left Shoulder * Machine washable * Size is determined by loose circumference of the biceps, while arm is hanging loose</p>\r\n', 'Shoulder Immobilizer', 190, '', '155', 0, '', '', 0, 'omotrain-shoulder-support', '', 'Complete Medical', '', '', '7500cd5a9d19201f6732722c461ec34b.jpg', '2019-02-26 08:44:10', '1', '8511A', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '0', '', '0', '00', ''),
(107, 'Blue Jay Universal Arm Sling with Shoulder Comfort Pad-Blue', 1, 'Super Admin', 13, 'NA', 'NA', 0, '<p>Color: blue/white * Provides comfort and support * Durable cotton blend for lasting wear * Slide buckle for adjustable strap length * Neoprene shoulder pad for comfort * Size: 18&quot; x 9&quot; pouch fits most</p>\r\n', 'Arm Sling/Shoulder Immobilizer', 15, '', '8', 0, '', '', 0, 'blue-jay-universal-arm-sling-with-shoulder-comfort-pad-blue', '', 'Complete Medical', '', '', '33843a3de4708b53710da4b69215a7cd.jpg', '2019-02-26 08:46:32', '1', 'BJ215400UN', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '0', '', '0', '00', ''),
(108, 'Form Fit Shoulder Brace with Abduction', 1, 'Super Admin', 14, 'ICD10', 'HCPCS', 0, '<p>The Form Fit Shoulder Brace is designed to provide immobilization following shoulder injury/surgery * With its streamlined fit, sporty look and breathability it offers excellent comfort and ease of use * Same as its predecessor, the SmartSling�, the Form Fit Shoulder Brace also provides abduction of the shoulder (when the abduction pillow is attached), or external rotation of the shoulder (when the external rotation pillow is attached) * Optional axilla pillow (#SSAXP) helps distribute weight over a larger surface area and decreases pressure on the ulnar nerve</p>\r\n', 'Covered By Medicare, Medicaid And Most HMO\'s', 160, '', '110', 0, '', '', 0, 'form-fit-shoulder-brace-with-abduction', '', 'Complete Medical', '', '', 'd849564bd4dc698589124492d8e188da.jpg', '2019-02-27 01:22:16', '1', 'SSL', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(109, 'Thermoskin Thigh/Hamstring', 1, 'lifeline', 15, 'NA', 'NA', 0, '<p>Provides protection and support for the thigh * Useful in treating quadricep and hamstring muscle strain * Captures body heat &amp; increases blood flow * Allows skin to ventilate &amp; release moisture</p>\r\n', 'Thigh Support', 45, '', '32', 0, '', '', 0, 'thermoskin-thigh-hamstring', '', 'Complete Medical', '', '', 'ebf5ced391278615183a477fdedb015a.jpg', '2019-02-27 01:31:11', '1', '82111', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '0', '', '0', '00', ''),
(110, 'Blue Jay Adj Thumb Support w/Stabilizing Stay', 1, 'lifeline', 16, 'ICD10', 'HCPCS', 0, '<p>Color: beige * Stabilizing stay keeps the thumb in a neutral position * Low profile, lined neoprene provides warmth and comfort * Wrist strap provides additional support, yet allows for a good grip * Fits left or right hand</p>\r\n', 'Thumb Brace', 18, '', '13', 0, '', '', 0, 'blue-jay-adj-thumb-support-w-stabilizing-stay', '', 'Complete Medical', '', '', 'e009e3ea8d1b2ef37d6f7162d3b33bd8.jpg', '2019-02-27 01:36:27', '0', 'BJ215481LGXL', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(111, 'Jobst Maternity P/H Ultrasheer 8-15 mmHg', 1, 'Super Admin', 17, 'NA', 'NA', 0, '<p>Jobst Ultrasheer Supportwear 8-15 mmHg Mild Compression *Maternity Pantyhose; combining style with mild support *Lightweight fashionable appearance *Reinforced toe and sheer heel *Floral lace brief panty *Expandable tummy panel for comfort *Machine wash in a mesh laundry bag or hand wash with warm water using a mild soap or detergent designed for compression stockings *Machine dry on low heat *Latex-free, 81% nylon, 19% spandex *Small *Silky Beige *8-15 mmHg Mild Gradient Compression Indication Guide: *Discomfort from spider veins *Relief from minor leg swelling *Relief of tired aching legs *Relief of leg discomfort during pregnancy *Minor varicose veins *For wear following sclerotherapy</p>\r\n', 'Pregnancy Support', 38, '', '28', 0, '', '', 0, 'jobst-maternity-p-h-ultrasheer-8-15-mmhg', '', 'Complete Medical', '', '', '5d9d837359e5ac2ef72301c734ecf921.jpg', '2019-02-27 02:53:09', '1', '117253', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '0', '', '0', '00', ''),
(112, 'Universal Maternity Support', 1, 'lifeline', 17, 'NA', 'NA', 0, '<p>Adjust to accomodate abdommodate abdominal growth throughout pregnancy * Medical foam body applies over abdomen for optimum comfort * Plush elastic side panels for comfortable compression * Universal Sizing * Latex Free&nbsp;</p>\r\n', 'This is a perfect fit abdominal binder', 30, '', '21', 0, '', '', 0, 'universal-maternity-support', '', 'Complete Medical', '', '', '374f2efad05d01b302de7ef876ec8579.jpg', '2019-03-01 03:33:17', '1', '2348', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '0', '', '0', '00', ''),
(113, 'Maternity Support ', 1, 'Super Admin', 17, 'NA', 'NA', 0, '<p>Size based on pre-pregnancy dress size * Bell-Horn&#39;s Maternity Support lifts and supports your abdomen and transfers the weight evenly and comfortably to your spine * It adds to your natural support, reducing the strain on your tissues and providing immediate relief * Support based on a design used by doctors and therapists for years * Relieves pain in the back, legs and abdomen * Provides gentle suppor</p>\r\n', ' Maternity Support', 50, '', '35', 0, '', '', 0, 'maternity-support-1', '', 'Complete Medical', '', '', '21ebe6169806bfe16d9dee90101b49f1.jpg', '2019-03-01 03:38:07', '1', 'BH319L', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '0', '', '0', '00', '');
INSERT INTO `product_trans` (`id`, `product_name`, `seller_id`, `seller_name`, `category`, `diagnosis_code`, `item_code`, `subcategory`, `description`, `short_description`, `price`, `strip`, `sale_price`, `delivery_charge`, `user_like`, `rating`, `sale`, `slug`, `product_code`, `product_brand`, `measurement`, `measure_unit`, `product_image`, `created_date`, `status`, `tags`, `transaction_cost`, `shipping_cost`, `reviews`, `image_gallery`, `stock_status`, `stock`, `flag`, `tax`, `store_type`, `color`, `size`, `csv`, `insurance`, `insurance_name`, `product_video`, `storeprice`, `link`) VALUES
(114, 'Loving Comfort Maternity Support', 1, 'Super Admin', 17, 'NA', 'NA', 0, '<p>Loving Comfort Maternity Support is made of lightweight ventilated elastic that is cool and soft to the skin * Fastens quickly with simple VELCRO&nbsp;brand closures * Designed to grow along with you so you can wear it right through to delivery * The Loving Comfort Maternity Support is sized according to pre-pregnancy dress size&nbsp;</p>\r\n', 'Maternity Support', 45, '', '35', 0, '', '', 0, 'loving-comfort-maternity-support', '', 'Complete Medical', '', '', 'e91e96546019ef5352398edcac57f6ef.jpg', '2019-03-01 03:41:50', '1', 'SCT0230LG', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '0', '', '0', '00', ''),
(115, 'Back Maternity Support', 1, 'Super Admin', 17, 'NA', 'NA', 0, '<p>&nbsp;Size based on pre-pregnancy dress sizes * Offers relief from back discomfort during pregnancy * 8&quot; elastic pregnancy belt supports the lower abdomen, while the duo-adjustable elastic side tension offers additional support * Provides temporary stabilization of the pelvis * Measurement is dress size before pregnancy: * Latex Free *</p>\r\n', 'Maternity Support', 70, '', '55', 0, '', '', 0, 'back-maternity-support', '', 'Complete Medical', '', '', '4b0861aca973a14238b1763684a47260.jpg', '2019-03-01 03:45:15', '1', 'SCT3090RTL', '', '', '', '', 'notinstock', '1', '', '', '', '', '', '', '0', '', '0', '00', ''),
(116, 'Abdominal Support', 1, 'lifeline', 18, 'ICD10', 'HCPCS , L0625', 0, '<p>The common use for abdominal supports are for support when loss of muscle tone is indicated,however, with the Bell-Horn three panel design, this can also be used for post-surgical dressings</p>\r\n\r\n<p>* Designed for inconspicuous wear under clothing</p>\r\n\r\n<p>* For both male and female</p>\r\n\r\n<p>* Easy application</p>\r\n\r\n<p>* Recommended for use with abdominal strains as well as post surgery applications</p>\r\n', 'Abdominal Binders', 35, '', '26', 0, '', '', 0, 'abdominal-support', '', 'Complete Medical', '', '', 'd9d41c6d98e317edc9b02eaa48dedb6c.jpg', '2019-03-01 04:31:43', '1', 'BH167', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(119, 'Hernia Guard', 1, 'Super Admin', 19, 'ICD10', 'HCPCS', 0, '<p>Provides comfortable, yet constant pressure to the hernia</p>\r\n\r\n<p>* Two uniquely shaped foam pads provide gradual pressure and support</p>\r\n\r\n<p>* It is woven for more durability and comfort with hook and loop for the perineal straps and offers a plush elastic waistband for better adjustability and comfort</p>\r\n\r\n<p>* Made of an elastic wraparound waistband with flexible posterior stays and soft leg straps</p>\r\n\r\n<p>* Removable hernia pads</p>\r\n\r\n<p>* For reducible inguinal hernias</p>\r\n\r\n<p>* Bell-Horn advises to use only under the supervision of your physician</p>\r\n\r\n<p>* Specific fitting instructions should also be supplied by a physician</p>\r\n', 'Covered by Medicare, Medicaid and HMO\'S', 52, '', '38', 0, '', '', 0, 'hernia-guard', '', 'Complete Medical', '', '', 'f6ed31fd583124047bc408f3eb5edeb3.jpg', '2019-03-02 06:14:50', '1', 'BH85220L', '', '', '', '', 'instock', '5', '', '', '', '', '', '', '1', '', '0', '00', ''),
(120, 'Hernia Belt', 1, 'Super Admin', 19, 'ICD10', 'HCPCS', 0, '<p>Provides adjustable, gradual compressive support to help reduce inguinal hernias</p>\r\n\r\n<p>* Perineal straps provide comfortable compression</p>\r\n\r\n<p>* Removable foam compression pads for gentle, gradual compression</p>\r\n\r\n<p>* Treats right, left or double hernias</p>\r\n\r\n<p>* Comfortable, lightweight nylon material</p>\r\n\r\n<p>* Latex free *</p>\r\n', 'Covered by Medicare, Medicaid and HMO\'s', 51, '', '37', 0, '', '', 0, 'hernia-belt', '', 'Complete Medical', '', '', 'a5cd4d8826a14cdf8cbdbcf8fe379e10.jpg', '2019-03-02 06:22:47', '0', 'DJ97903', '', '', '', '', 'instock', '11', '', '', '', '', '', '', '1', '', '0', '00', ''),
(121, 'Universal Cervical Collar', 1, 'Super Admin', 20, 'NA', 'NA', 0, '<p>Universal</p>\r\n\r\n<p>* Excellent retail packaging</p>\r\n\r\n<p>* 1&quot; thick medium-firm foam</p>\r\n\r\n<p>* 2 1/2&quot; Wide at chin cut-out</p>\r\n\r\n<p>* Extra stockinette sleeve included</p>\r\n\r\n<p>* Hook / loop closure</p>\r\n\r\n<p>* Fits 12&quot; - 22&quot; neck</p>\r\n\r\n<p>* Latex Free</p>\r\n', 'Sportaid', 15, '', '10', 0, '', '', 0, 'universal-cervical-collar', '', 'Complete Medical', '', '', '1f8a981c7e75c1cf21a09639148ea1f4.jpg', '2019-03-02 06:32:18', '1', 'SA4518UN', '', '', '', '', 'instock', '12', '', '', '', '', '', '', '0', '', '0', '00', ''),
(122, 'Air Travel Pillow', 1, 'Super Admin', 28, 'NA', 'NA', 0, '<p>Ergonomically designed travel pillow inflates in seconds and deflates for compact storage in it&#39;s own pouch</p>\r\n\r\n<p>* Adjustable closure-fits most necks</p>\r\n\r\n<p>* Dimensions (inflated): 13-1/2&quot;W x 10&quot;D x 5-1/2&quot;H&nbsp;</p>\r\n', 'Back and Neck Therapy', 15, '', '10', 0, '', '', 0, 'air-travel-pillow', '', 'Complete Medical', '', '', '0ada488b477f270eaafd89153c3525d3.jpg', '2019-03-02 06:41:49', '1', '2055', '', '', '', '5eccf80dfc422764313495a0159be521.jpg,c16ef4edb58659579c4df31a7e3f6659.jpg', 'instock', '10', '', '', '', '', '', '', '0', '', '0', '00', ''),
(123, '	Cervical Butterfly Pillow', 1, 'Super Admin', 28, 'NA', 'NA', 0, '<p>The specially designed shape of our Butterfly Pillow gives your head and neck the support necessary for a good night&nbsp;sleep</p>\r\n\r\n<p>* Helps ease muscles and nerve tension, relieves stiff necks, pain across the back and shoulders, and morning headaches</p>\r\n\r\n<p>* Great for side or back sleepers</p>\r\n\r\n<p>* Filled with 100% soft polyester fibers</p>\r\n\r\n<p>* Machine washable white polycotton cover</p>\r\n', 'Back and Neck Therapy', 38, '', '25', 0, '', '', 0, '-cervical-butterfly-pillow', '', 'Complete Medical', '', '', '3e6c2700ed28b1fdc6e280771df3fc78.jpg', '2019-03-02 06:46:23', '1', '2039', '', '', '', '', 'instock', '10', '', '', '', '', '', '', '0', '', '0', '00', ''),
(124, 'Contoured Foam Cervical Pillow Standard w/White Cove', 1, 'Super Admin', 28, 'NA', 'NA', 0, '<p>* This pillow is anatomically designed to follow the natural contours of your head and neck for total sleeping comfort</p>\r\n\r\n<p>* It supports and aligns your spine as nature intended, so tense, tired muscles can relax, rest, and revive themselves</p>\r\n\r\n<p>* Ideal for back or side sleeping</p>\r\n\r\n<p>* Sized to fit any standard pillow case</p>\r\n\r\n<p>* Polyurethane foam with white washable cover</p>\r\n\r\n<p>* Size: 16&quot; W x 19&quot; L x 5&quot; H</p>\r\n', 'Back and Neck Therapy', 30, '', '22', 0, '', '', 0, 'contoured-foam-cervical-pillow-standard-w-white-cove', '', 'Complete Medical', '', '', '1d41cc954b6a49dcf3f1dff8e3b55379.jpg', '2019-03-02 06:48:58', '1', '2040A', '', '', '', '', 'instock', '11', '', '', '', '', '', '', '0', '', '0', '00', ''),
(125, 'Cervical Pillow- Convoluted', 1, 'Super Admin', 1, 'NA', 'NA', 0, '<p>Specially designed sleeping pillow uses convoluted foam shaped to support the neck and promote airflow</p>\r\n\r\n<p>* Special wedges inserted into each edge to provide cervical support regardless of which side you use</p>\r\n\r\n<p>* 22&quot; x 19&quot;</p>\r\n\r\n<p>* Poly/cotton blend cover included</p>\r\n\r\n<p>* This pillow does NOT compare to the Wal-Pil-O</p>\r\n\r\n<p>* The Wal-Pil-O is a 4-in-1 pillow that has been clinically proven to help reduce pain</p>\r\n', 'Back and Neck Therapy', 35, '', '25', 0, '', '', 0, 'cervical-pillow-convoluted', '', 'Complete Medical', '', '', '895774110330eee3af403b1ec952322e.jpg', '2019-03-02 06:52:22', '1', '2040C', '', '', '', '', 'instock', '13', '', '', '', '', '', '', '0', '', '0', '00', ''),
(126, 'Cervical Roll Pillow Fiber Filled Jackson Type', 1, 'Super Admin', 28, 'NA', 'NA', 0, '<p>Pillow size Size: 18&quot; x 7&quot;</p>\r\n\r\n<p>* This plush filled hypo-allergenic, high-lofted polyester fiber filled pillow maintains proper neck posture and aligns the vertebrae restoring a stress-free, normal neck contour</p>\r\n\r\n<p>* Covered in a non-removable white poly/cotton cover</p>\r\n', 'Back and Neck Therapy', 18, '', '14', 0, '', '', 0, 'cervical-roll-pillow-fiber-filled-jackson-type', '', 'Complete Medical', '', '', '665e77269f1e40c7dfebf5b1fa65f1a1.jpg', '2019-03-02 06:55:37', '1', '2044', '', '', '', '', 'instock', '14', '', '', '', '', '', '', '0', '', '0', '00', ''),
(127, 'Convalescent Recliner 3-Position', 1, 'Super Admin', 21, 'NA', 'NA', 0, '<p>Standard Size</p>\r\n\r\n<p>* Seat has a self-adjusting, elastic webbing suspension system that wont flatten or bottom out</p>\r\n\r\n<p>* 3 positions; upright, legrest/footrest elevated and deep recline</p>\r\n\r\n<p>* Fully enclosed side panel</p>\r\n\r\n<p>* Blow-molded tray which can be stored on the side of the chair</p>\r\n\r\n<p>* 5&quot; casters (2 fixed - 2 swivel with total lock brake)</p>\r\n\r\n<p>* Wide armrest slopes down to give forearm correct support in recline and semi-recline position, wrap-around scuff guards</p>\r\n\r\n<p>* Neutral color, powder-coated steel frame</p>\r\n\r\n<p>* Moisture barrier on seat board helps prevent seepage</p>\r\n\r\n<p>* 3&quot; medium density polyurethane foam in back</p>\r\n\r\n<p>* Built-in headrest</p>\r\n\r\n<p>* Seat Width: 19&quot;, Overall Width: 26&quot;</p>\r\n\r\n<p>* Weight Capacity: 275 Lbs.</p>\r\n\r\n<p>* Unit reclines by pushing down on the armpads and leaning back</p>\r\n', 'Aids to Daily Living. ', 1200, '', '890', 0, '', '', 0, 'convalescent-recliner-3-position', '', 'Complete Medical', '', '', '7b57f83ff8a029a1b17e473a8f81a659.jpg', '2019-03-02 07:14:03', '1', '10544', '', '', '', '', 'instock', '12', '', '', '', '', '', '', '0', '', '0', '00', ''),
(128, 'Seat Lift Chair Table Left Side', 1, 'Super Admin', 21, 'NA', 'NA', 0, '<p>Designed for use with a lift chair, standard recliner or couch.</p>\r\n\r\n<p>* Tabletop swivels to allow for easy access and departure.</p>\r\n\r\n<p>* Can be used for many activities such as eating, writing, crafts, working on the computer and reading.</p>\r\n\r\n<p>* Right or left positioning with 180&nbsp;rotation accommodates seating near any wall.</p>\r\n\r\n<p>* Tabletop pivots 360&nbsp;at the touch of a hand.</p>\r\n\r\n<p>* Teak wood grain laminate finish is attractive.</p>\r\n\r\n<p>* A built-in magazine rack provides added convenience.</p>\r\n', 'Lift Chair  Accessory', 355, '', '263', 0, '', '', 0, 'seat-lift-chair-table-left-side', '', 'Complete Medical', '', '', 'b2745ec124c5ed9c472850584664a8c8.jpg', '2019-03-02 07:18:40', '1', '13085LN', '', '', '', '', 'instock', '14', '', '', '', '', '', '', '0', '', '0', '00', ''),
(129, 'Drop-Arm Convalescent Recliner w/Tray', 1, 'Super Admin', 21, 'ICD10', 'HCPCS,E1031', 0, '<p>Recliner</p>\r\n\r\n<p>* Left and right arms drop to aid in transfers</p>\r\n\r\n<p>* Seat has a self-adjusting, elastic webbing suspension system that wont flatten</p>\r\n\r\n<p>* 3 positions; upright, legrest/footrest elevated and deep recline plus fully enclosed side panels</p>\r\n\r\n<p>* Blow-molded tray is stored on side</p>\r\n\r\n<p>* 5&quot; casters (2 fixed - 2 swivel with total lock)</p>\r\n\r\n<p>* Wide armrest slopes down to give forearm correct support</p>\r\n\r\n<p>* Moisture barrier on seat</p>\r\n\r\n<p>* 3&quot; medium density polyurethane foam back</p>\r\n\r\n<p>* Built-in headrest</p>\r\n\r\n<p>* Seat Width: 19&quot;, Overall Width: 26&quot;</p>\r\n\r\n<p>* Weight Capacity: 275 Lbs</p>\r\n', 'Covered by HMO\'s. Must Complete CMN ', 1700, '', '1250', 0, '', '', 0, 'drop-arm-convalescent-recliner-w-tray', '', 'Complete Medical', '', '', 'd27f548c2306507feb387f23c4c3fc65.jpg', '2019-03-02 07:25:31', '1', '527', '', '', '', '', 'instock', '15', '', '', '', '', '', '', '1', '', '0', '00', ''),
(130, '	Lumex Three Position Recliner Jade', 1, 'Super Admin', 21, 'NA', 'NA', 0, '<p>The standard of the industry and the recliner that started it all</p>\r\n\r\n<p>* This first recliner specifically designed to improve the comfort and mobility of residents in extended care facilities</p>\r\n\r\n<p>* The Lumex three position recliner easily adjusts into any one of three positions: sitting, TV or full recline</p>\r\n\r\n<p>* Recliners offer numerous therapeutic benefits including position changes that can aid in circulation and ease discomfort from respiratory, heart and other ailments</p>\r\n\r\n<p>* A position lock allows only the caregiver to secure the chair in any one of the three easily attained positions</p>\r\n\r\n<p>* Recliner encourages natural relaxation and improved blood circulation</p>\r\n\r\n<p>* Flex-o-Lator seat support system increases comfort by reducing the risk of &quot;bottoming out&quot;</p>\r\n\r\n<p>* Ergonomically designed seat and back with varied density foam construction provides correct support</p>\r\n\r\n<p>* Articulating headrest quickly adjusts to maximize individual comfort requirements</p>\r\n\r\n<p>* For safer, easier transport, the Lumex three position recliner features two, four inch swivel casters with wheel locks and four inch fixed front wheels</p>\r\n\r\n<p>* The molded activity table can be fixed in position or left unsecured for easy exit from the recliner</p>\r\n\r\n<p>* Durable welded steel epoxy coated frame is easy to clean and maintain</p>\r\n\r\n<p>* Weight bearing capacity: 250 pounds</p>\r\n\r\n<p>* Warranty on frame: Limited 2 Years; Warranty on upholstery: Limited 1 Year; Warranty on all other components: Limited 1 Year</p>\r\n', 'Geriatric Chair', 850, '', '600', 0, '', '', 0, '-lumex-three-position-recliner-jade', '', 'Complete Medical', '', '', 'e2e0038789b3d22f9910e3126f4b0664.jpg', '2019-03-02 07:31:39', '1', '537C', '', '', '', '', 'instock', '14', '', '', '', '', '', '', '0', '', '0', '00', ''),
(131, 'Designer Care Cliner', 1, 'Super Admin', 21, 'NA', 'NA', 0, '<p>Style, comfort, value, and great features make our Premier Care Cliner unlike any other</p>\r\n\r\n<p>* Contemporary style, modern form, and comfort for your patients</p>\r\n\r\n<p>* Durable and comfortably contoured urethane arms protect the upholstered finish while providing a sleek and modern style</p>\r\n\r\n<p>* The 6700 also features LiquiCell&#39;&quot; seating that makes it more comfortable, reduces fatigue, and relieves pressure over longer periods of sitting</p>\r\n\r\n<p>* Trendelenburg positioning on back with easy access handle</p>\r\n\r\n<p>* Fold-down side tables on both sides</p>\r\n\r\n<p>* 3&quot; nylon total-lock and directional-lock casters provide ease of maneuverability</p>\r\n\r\n<p>* Seat height 20.5&quot; * Seat width 22&quot;</p>\r\n\r\n<p>* Seat depth 19.5&quot;</p>\r\n\r\n<p>* Overall height 47&quot;</p>\r\n\r\n<p>* Overall width 32&quot;</p>\r\n\r\n<p>* Weight capacity 275 lbs</p>\r\n', 'Geriatric Chair', 2500, '', '1750', 0, '', '', 0, 'designer-care-cliner', '', 'Complete Medical', '', '', 'ddbf75f2aa06ec0402089d999a78ae16.jpg', '2019-03-02 07:36:44', '1', '6700', '', '', '', '', 'instock', '16', '', '', '', '', '', '', '0', '', '0', '00', ''),
(132, 'Checker Car Nebulizer Pink', 1, 'Super Admin', 22, 'ICD10', 'HCPCS', 0, '<p>Pink Nebulizer</p>\r\n\r\n<p>* Designed to appeal to children</p>\r\n\r\n<p>* Quiet Operation</p>\r\n\r\n<p>* Electrical requirements: 115VAC/ 60HZ * Operation pressure: 16 Psi * Partical size: Less than 5 Microns</p>\r\n\r\n<p>* Flow range: Less than 12 lpm</p>\r\n\r\n<p>* 3-Year Warranty</p>\r\n\r\n<p>* No case available</p>\r\n', 'Covered by Medicare, Medicaid and HMO\'S', 72, '', '55', 0, '', '', 0, 'checker-car-nebulizer-pink', '', 'Complete Medical', '', '', '628450b0d098f4c4ada3530a1abd5ca4.jpg', '2019-03-02 08:18:04', '1', '18040P', '', '', '', '84187d6fac954527d66111d7a73e7b5a.jpg', 'instock', '13', '', '', '', '', '', '', '1', '', '0', '00', ''),
(133, 'Power Neb Ultra Nebulizer', 1, 'Super Admin', 22, 'ICD10', 'HCPCS,E0570,A7003,A7013', 0, '<p>Non-Retail carton</p>\r\n\r\n<p>* One of the smallest economy neb compressors available today at only 3.2 lbs * Built in neb kit holder for hands free use</p>\r\n\r\n<p>* Delivers consistent particle size of less than 5 microns and fast treatment times</p>\r\n\r\n<p>* Comes complete with disposable neb kit</p>\r\n\r\n<p>* 5 year limited warranty</p>\r\n\r\n<p>* Specifications: Method of Nebulization Piston Compressor</p>\r\n\r\n<p>* Particle Size 0.5 m to 5 m</p>\r\n\r\n<p>* Unit Dimensions 6.3&quot; (W) x 3.0&quot; (H) x 5.3&quot; (D)</p>\r\n\r\n<p>* Weight 3.2 lbs.</p>\r\n\r\n<p>* Maximum Pressure 30 psi</p>\r\n\r\n<p>* Operating Pressure = 10 psi</p>\r\n\r\n<p>* Liter Flow = 8 lpm</p>\r\n\r\n<p>* Electrical Requirement 115 VAC 60Hz&nbsp;</p>\r\n', 'Covered by Medicare, Medicaid and HMO\'S', 35, '', '25', 0, '', '', 0, 'power-neb-ultra-nebulizer', '', 'Complete Medical', '', '', '21eba22a3790be617ac0393f67aa49e6.jpg', '2019-03-02 08:24:52', '1', '18080', '', '', '', '1bc6c2a962b9507280a0e721eb368b63.jpg', 'instock', '14', '', '', '', '', '', '', '1', '', '0', '00', ''),
(134, 'Nebulizer System, Pediatric Bunny, w/1 Disp & 1 Reuse Neb', 1, 'Super Admin', 22, 'ICD10', 'HCPCS', 0, '<p>Designed to reduce anxiety during treatments, the child-friendly Bunny Nebulizer provides effective treatments with a state-of-the-art piston compressor</p>\r\n\r\n<p>* Provides smooth, quiet treatments</p>\r\n\r\n<p>* Delivers 43 psi at maximum pressure and 16 psi operating pressure (liter flow range 5 - 8 LPM) and weighs only 3.4 pounds</p>\r\n\r\n<p>* Equipped with a built-in carrying handle and a convenient nebulizer parking post</p>\r\n\r\n<p>* Comes complete with compressor, nebulizer, child mask, tubing, angled mouthpiece, five extra filters, an instruction manual, and a five year warranty</p>\r\n\r\n<p>* Power: 120 VAC/60Hz</p>\r\n\r\n<p>* Power Consumption: 1.5 amps</p>\r\n\r\n<p>* Sound Level: less than 60dBA at 1 meter</p>\r\n\r\n<p>* Maximum Compressor Pressure: 25 to 42 psi</p>\r\n\r\n<p>* Typical Operating Pressure: 8 to 13 psi</p>\r\n\r\n<p>* Typical Operating Flow Rate: 5 ~ 8 LPM</p>\r\n\r\n<p>* Medication Capacity: 5 ml</p>\r\n\r\n<p>* Particle Size: Less than 5 microns</p>\r\n\r\n<p>* Operating Temperature: 50 degrees - 104 degrees F&nbsp;</p>\r\n', 'Covered by Medicare, Medicaid and HMO\'s', 55, '', '38', 0, '', '', 0, 'nebulizer-system-pediatric-bunny-w-1-disp-1-reuse-neb', '', 'Complete Medical', '', '', 'b5514a02e498b8318ae8eeb792c74980.jpg', '2019-03-02 08:30:23', '1', '4400A', '', '', '', 'a5360e547c2e9ac060276a5c711cdd84.jpg,568ab03d0d7a60cb0eea0a5d9bf7dd30.jpg', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(135, 'Nebulizer System, Pediatric Dinosaur, w/1Disp & 1Reuse Neb', 1, 'Super Admin', 22, 'ICD10', 'HCPCS', 0, '<p>Designed to reduce anxiety during treatments, the child-friendly Dinosaur Nebulizer provides effective treatments with a state-of-the-art piston compressor</p>\r\n\r\n<p>* Provides smooth, quiet treatments</p>\r\n\r\n<p>* Delivers 29 psi at maximum pressure and 10 psi operating pressure (liter flow range 5 - 8 LPM) and weighs only 3.4 pounds</p>\r\n\r\n<p>* Equipped with a convenient nebulizer parking post</p>\r\n\r\n<p>* Comes complete with compressor, nebulizer, child mask, tubing, angled mouthpiece, five extra filters, an instruction manual, and a five year warranty</p>\r\n\r\n<p>* Power: 120 VAC/60Hz</p>\r\n\r\n<p>* Power Consumption: 1.5 amps</p>\r\n\r\n<p>* Sound Level: less than 60dBA at 1 meter</p>\r\n\r\n<p>* Maximum Compressor Pressure: 25 to 42 psi</p>\r\n\r\n<p>* Typical Operating Pressure: 8 to 13 psi</p>\r\n\r\n<p>* Typical Operating Flow Rate: 5 ~ 8 LPM</p>\r\n\r\n<p>* Medication Capacity: 5 ml</p>\r\n\r\n<p>* Particle Size: 5 to 10 microns</p>\r\n\r\n<p>* Operating Temperature: 50 degrees - 104 degrees F&nbsp;</p>\r\n', 'Covered by Medicare, Medicaid and HMO\'s', 55, '', '38', 0, '', '', 0, 'nebulizer-system-pediatric-dinosaur-w-1disp-1reuse-neb', '', 'Complete Medical', '', '', '426ff0e106a3bd409fd24ad572b5b52d.jpg', '2019-03-02 08:35:13', '1', '4400B', '', '', '', '4b1e25900a47a822a3284284fcc9f726.jpg,e633485cfe8b85d00e24cbb326cc44d7.jpg', 'instock', '16', '', '', '', '', '', '', '1', '', '0', '00', ''),
(136, 'Nebulizer System, Pediatric Dog, w/ 1 Disp & 1 Reuse Neb', 1, 'Super Admin', 22, 'ICD10', 'HCPCS', 0, '<p>Designed to reduce anxiety during treatments, the child-friendly Dog Nebulizer provides effective treatments with a state-of-the-art piston compressor</p>\r\n\r\n<p>* Provides smooth, quiet treatments</p>\r\n\r\n<p>* Delivers 43 psi at maximum pressure and 16 psi operating pressure (liter flow range 5 - 8 LPM) and weighs only 3.4 pounds</p>\r\n\r\n<p>* Equipped with a built-in carrying handle and a convenient nebulizer parking post</p>\r\n\r\n<p>* Comes complete with compressor, nebulizer, child mask, tubing, angled mouthpiece, five extra filters, and a five year warranty</p>\r\n\r\n<p>* Power: 120 VAC/60Hz</p>\r\n\r\n<p>* Power Consumption: 1.5 amps</p>\r\n\r\n<p>* Sound Level: less than 60dBA at 1 meter</p>\r\n\r\n<p>* Maximum Compressor Pressure: 29 to 43 psi</p>\r\n\r\n<p>* Typical Operating Pressure: 10 to 16 psi</p>\r\n\r\n<p>* Typical Operating Flow Rate: 5 ~ 8 LPM</p>\r\n\r\n<p>* Medication Capacity: 5 ml</p>\r\n\r\n<p>* Particle Size: Less than 5 microns</p>\r\n\r\n<p>* Operating Temperature: 50 degrees - 104 degrees F&nbsp;</p>\r\n', 'Covered by Medicare, Medicaid and HMO\'s', 55, '', '35', 0, '', '', 0, 'nebulizer-system-pediatric-dog-w-1-disp-1-reuse-neb', '', 'Complete Medical', '', '', '7fcea7f83e31970e7dfb5c0e9c732aae.jpg', '2019-03-02 08:39:40', '1', '4400E', '', '', '', '551c861d91b8bf7850f95e9593aeb58e.jpg,b658cc427d2e23fcec40f796610e8625.jpg', 'instock', '16', '', '', '', '', '', '', '1', '', '0', '00', ''),
