(140, 'Pediatric Panda Compressor Nebulizer', 1, 'Super Admin', 22, 'ICD10', 'HCPCS', 0, '<p>Child friend design</p>\r\n\r\n<p>* Quiet - easy to use</p>\r\n\r\n<p>* Durable compressor&nbsp;</p>\r\n\r\n<p>* Metal Piston - Driven System</p>\r\n\r\n<p>* Lifetime Warranty</p>\r\n\r\n<p>* Set Includes:</p>\r\n\r\n<p>* Carrying case</p>\r\n\r\n<p>* Child mask</p>\r\n\r\n<p>* 7&#39;&#39;&nbsp;non-kink tubing</p>\r\n\r\n<p>* Pacifier applicator</p>\r\n\r\n<p>* Angled mouthpiece</p>\r\n\r\n<p>* Medication cup</p>\r\n\r\n<p>* Pacifiers sold separately</p>\r\n', 'Covered by Medicare, Medicaid and HMO\'s', 65, '', '50', 0, '', '', 0, 'pediatric-panda-compressor-nebulizer', '', 'Complete Medical', '', '', 'c1a60b8ebe8aba7d35842aca8727c001.JPG', '2019-03-02 08:57:36', '1', 'MQ6003', '', '', '', '', 'instock', '17', '', '', '', '', '', '', '1', '', '0', '00', ''),
(141, 'Flyp Portable Handheld Nebulizer', 1, 'Super Admin', 22, 'ICD10', 'HCPCS,E0574,E0570', 0, '<p>Pocket Portable</p>\r\n\r\n<p>* There are no disposable batteries, external power sources, masks, or tubes</p>\r\n\r\n<p>* Truly a nebulizer that fits in your pocket</p>\r\n\r\n<p>* A rechargeable lithium-ion battery saves you the need to constantly repurchase batteries</p>\r\n\r\n<p>* Over Flyp&#39;s life, that could mean hundreds of dollars of savings</p>\r\n\r\n<p>* Convexity engineers spent three years developing, testing and refining the Flyp nebulizer as it had to pass18 different lab tests</p>\r\n\r\n<p>* Has a precision-engineered disk with 1,000 holes so small that they are invisible to the naked eye</p>\r\n\r\n<p>* The disk vibrates at an ultrasonic speed that is 2,000 times faster than a hummingbird&#39;s wings</p>\r\n\r\n<p>* As medication passes through the disk&#39;s holes, it aerosolizes for delivery to your lungs</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'Covered by Medicare, Medicaid and HMO\'s', 220, '', '175', 0, '', '', 0, 'flyp-portable-handheld-nebulizer', '', 'Complete Medical', '', '', 'ec2dcae45e55a11295ddfab2bd30180a.jpg', '2019-03-02 09:03:59', '1', 'PE1200M', '', '', '', '6eaa3280a2b278b08500adc234247039.jpg,ff786b58da5c593b2a91386094ba2e96.jpg,2a313b2ce34c47c8e8f111a0dbcb9a72.jpg', 'instock', '16', '', '', '', '', '', '', '1', '', '0', '00', ''),
(142, '	Comp A-I-R Compressor Omron Nebulizer ', 1, 'Super Admin', 22, 'ICD10', 'HCPCS,E0570', 0, '<p>Includes: unit, nebulizer kit, mouthpiece, air tube, ac adapter, 4 air filters, storage bag, instruction manual</p>\r\n\r\n<p>* Compact and convenient; Smaller just got better</p>\r\n\r\n<p>* 3.5 times smaller than most compressor nebulizers</p>\r\n\r\n<p>* Can help minimize and reduce storage space</p>\r\n\r\n<p>* 75% lighter than most compressor nebulizers, less than 10 ounces</p>\r\n\r\n<p>* Can help reduce shipping costs</p>\r\n\r\n<p>* Easy to use, simple to operate - one- button operation</p>\r\n\r\n<p>* Convenient; smallest size and lightweight</p>\r\n\r\n<p>* Built to last</p>\r\n\r\n<p>* 3-year warranty</p>\r\n\r\n<p>* Efficient, fast and effective treatment</p>\r\n\r\n<p>* COMPRESSOR SPECIFICATIONS: Dimensions: 5 5/8&quot; (w) &nbsp;2 7/8&quot; (h) &nbsp;3 7/8&quot; (d) (142 mm &nbsp;72 mm&nbsp;&nbsp;98 mm) Weight: &nbsp;Approx. 9.5 oz. (270 g) (compressor only) Sound Level: .37.9 dBA Rating (AC Adapter): .100 - 240V ~ 350mA, 50/60 Hz Rating (Compressor Nebulizer): 12V 0.8A&nbsp;</p>\r\n', 'Covered by Medicare. Medicaid and HMO\'S', 50, '', '38', 0, '', '', 0, '-comp-a-i-r-compressor-omron-nebulizer', '', 'Complete Medical', '', '', '9b45093d35317b25b347945d1ab630e7.jpg', '2019-03-02 09:12:33', '1', 'NEC801', '', '', '', '', 'instock', '18', '', '', '', '', '', '', '1', '', '0', '00', ''),
(143, 'Pediatric Building Block Compressor Nebulizer', 1, 'Super Admin', 22, 'ICD10', 'HCPCS,E0570,A7003,A7015,A7013', 0, '<p>Complete with all accessories</p>\r\n\r\n<p>* Interactive building blocks</p>\r\n\r\n<p>* Fun for 5 yrs and older</p>\r\n\r\n<p>* Quiet - easy to use</p>\r\n\r\n<p>* Free carrying case</p>\r\n\r\n<p>* Lifetime warranty</p>\r\n', 'Covered by Medicare, Medicaid and HMO\'s', 50, '', '72', 0, '', '', 0, 'pediatric-building-block-compressor-nebulizer', '', 'Complete Medical', '', '', '0ea76d7c25200a0da52b8627f75d012a.JPG', '2019-03-02 09:17:30', '1', 'MQ7000', '', '', '', 'e08286f2b239f75eb8bfb90eeb44566d.JPG,2eb9940b3abf470bca4bb6f998aeeecc.JPG', 'instock', '15', '', '', '', '', '', '', '1', '', '0', '00', ''),
(144, 'MEDNEB Compressor Nebulizer', 1, 'Super Admin', 22, 'ICD10', 'HCPCS', 0, '<p>Includes Airial compressor, disposable nebulizer kit, 7&#39; kink resistant tubing, mouthpiece, and extra filters</p>\r\n\r\n<p>* Compact, Desk-Top Unit</p>\r\n\r\n<p>* Piston-Driven System</p>\r\n', 'Covered by Medicare, Medicaid and HMO\'s', 35, '', '45', 0, '', '', 0, 'medneb-compressor-nebulizer', '', 'Complete Medical', '', '', '52b9eeef7f8f609793874ea6c24848a1.jpg', '2019-03-02 09:21:18', '1', 'MQ5600', '', '', '', '', 'instock', '10', '', '', '', '', '', '', '1', '', '0', '00', ''),
