(146, 'Blue/White Teardrop Cool Mist Humidifier', 1, 'Super Admin', 23, 'NA', 'NA', 0, '<p>&nbsp;Increases air moisture for easier breathing and a good night&nbsp;sleep</p>\r\n\r\n<p>* Relieves cough, cold, and flu symptoms, including nasal congestion, dry cough, sinus irritation, nose bleeds, dry skin</p>\r\n\r\n<p>* 0.9 gallon water tank runs whisper quiet up to 24 hours</p>\r\n\r\n<p>* Mists up to 2.3 gallons of moisture per day</p>\r\n\r\n<p>* Effectively humidifies rooms up to 250 square feet</p>\r\n\r\n<p>* 360&nbsp;mist nozzle and variable control settings</p>\r\n\r\n<p>* Auto shutoff safety sensor</p>\r\n\r\n<p>* Uses less energy than a standard household light bulb</p>\r\n\r\n<p>* Does not require a filter</p>\r\n', 'Respiratory Care', 95, '', '75', 0, '', '', 0, 'blue-white-teardrop-cool-mist-humidifier', '', 'Complete Medical', '', '', 'c7ab3385378b03b03f1a8986f2473490.jpg', '2019-03-02 09:32:49', '1', '4430', '', '', '', '', 'instock', '11', '', '', '', '', '', '', '0', '', '0', '00', ''),
(147, 'Electric Breast Pump Finesse Pump, Ameda', 1, 'Super Admin', 24, 'ICD10', 'HCPCS', 0, '<p>Features Ameda HygienKit Milk Collection System</p>\r\n\r\n<p>* It provides numerous variations to mimic babys suckling</p>\r\n\r\n<p>* Operates on three power sources, including AC adapter, AA batteries or car adapter</p>\r\n\r\n<p>* Pump weighs only one pound</p>\r\n\r\n<p>* Eight adjustable suction levels and four cycle speeds</p>\r\n\r\n<p>* Warranty: 1yr on motor / 90 days on all else&nbsp;</p>\r\n', 'Covered by Medicaid and HMO\'s', 290, '', '205', 0, '', '', 0, 'electric-breast-pump-finesse-pump-ameda', '', 'Complete Medical', '', '', '975e0b9c48c30f5c75fb1c0c64ef9fa0.jpg', '2019-03-02 09:39:05', '1', '17070', '', '', '', '', 'instock', '11', '', '', '', '', '', '', '1', '', '0', '00', ''),
(148, 'Zomee Breast Pump Double', 1, 'Super Admin', 24, 'ICD10', 'HCPCS', 0, '<p>Unit includes Zomee Double/Single Breast Pump, 12 Volt AC Power Adapter, Detachable Power Cord Prongs, 2 Zomee Bottles, 2 Zomee Backflow Protectors, 2 Zomee Tubing, 4 Flanges (2-24mm &amp; 2-28mm)</p>\r\n\r\n<p>*Rechargeable Battery ; 1hr 30mins of charging will give 2hr 30mins of portable pumping life</p>\r\n\r\n<p>* USB port for convenient charging</p>\r\n\r\n<p>* Two Phases of Pumping; massage and express</p>\r\n\r\n<p>* Massage phase has 1-5 adjustable levelsof high frequency with weak suction to stimulate milk production</p>\r\n\r\n<p>* Breast-Express phase has 1-9 adjustable levels of low frequency with strong suction to effectively collect breast milk</p>\r\n', 'Covered by Medicaid and HMO\'s', 110, '', '80', 0, '', '', 0, 'zomee-breast-pump-double', '', 'Complete Medical', '', '', '9c73e33017149f8428651486a49726d8.jpg', '2019-03-02 09:44:10', '1', '2331', '', '', '', '87a98dfbc52a82cf702e915e5795cbde.jpg,e7733002a649656a0683110996e5113e.jpg,4301cdaa8fa6c0cb4c9a389c3e547ab2.jpg', 'instock', '13', '', '', '', '', '', '', '1', '', '0', '00', ''),
(149, 'SimplyGo Manual Breast Pump by EvenFlo', 1, 'Super Admin', 24, 'ICD10', 'HCPCS', 0, '<p>Small, handheld, portable, convenient, &amp; diaper bag ready</p>\r\n\r\n<p>* The pump has a state of the art valve that provides consistent suction for more comfortable and efficient milk expression</p>\r\n\r\n<p>* Silicone insert adds cushion comfort</p>\r\n\r\n<p>* Includes: Pump unit, 5-oz collection bottle, nipple, pump stand, hood, sealing disc, 2 breast pads w/coupon, additional overflow valve, &amp; carrying case</p>\r\n\r\n<p>* 90 day warranty for manufacturer&#39;s defects</p>\r\n', 'Covered by Medicaid and HMO\'s', 45, '', '34', 0, '', '', 0, 'simplygo-manual-breast-pump-by-evenflo', '', 'Complete Medical', '', '', '9cab56360a059ce408c9a098d3e84845.jpg', '2019-03-02 09:48:04', '1', '', '', '', '', '', 'instock', '11', '', '', '', '', '', '', '1', '', '0', '00', ''),
(150, 'Breast Pump Carry Bag', 1, 'Super Admin', 24, 'NA', 'NA', 0, '<p>Breast Pump Carry Bag</p>\r\n', 'Breast Pump Accessory', 30, '', '23', 0, '', '', 0, 'breast-pump-carry-bag', '', 'Complete Medical', '', '', '426469ff797c41df0b428311427ee6dd.jpg', '2019-03-02 09:50:21', '1', 'BP001', '', '', '', '', 'instock', '12', '', '', '', '', '', '', '0', '', '0', '00', ''),
(151, 'Perfect 3 Talking Glucometer (Blood Glucose Meter)', 1, 'Super Admin', 25, 'NA', 'NA', 0, '<p>Meter only</p>\r\n\r\n<p>* This machine is code free</p>\r\n\r\n<p>* It uses a tiny sample size .7 microliters of blood and works quickly in 7 seconds</p>\r\n\r\n<p>* It holds 1000 results in memory</p>\r\n\r\n<p>* Includes meter (with batteries), user guide, quick reference guide, log book, warranty information &amp; carrying case</p>\r\n\r\n<p>* Does not include strips or control solution</p>\r\n', 'Visual and Hearing Impaired Aids', 40, '', '30', 0, '', '', 0, 'perfect-3-talking-glucometer-blood-glucose-meter', '', 'Complete Medical', '', '', '47d46e2390ab9531773838f25744e856.jpg', '2019-03-03 04:18:54', '1', '2653', '', '', '', '', 'instock', '12', '', '', '', '', '', '', '0', '', '0', '00', ''),
(152, 'VivaGuard Ino Blood Glucose Monitoring Meter', 1, 'Super Admin', 25, 'NA', 'NA', 0, '<p>Meter only</p>\r\n\r\n<p>* Wide hematocrit range</p>\r\n\r\n<p>* Easy and accurate</p>\r\n\r\n<p>* 900-test memory</p>\r\n\r\n<p>* 0.8 L Blood required</p>\r\n\r\n<p>* 5 seconds</p>\r\n\r\n<p>* 8 electrodes</p>\r\n\r\n<p>* 900 meter mrmory with date and time, 7, 14, and 30 day averaging</p>\r\n\r\n<p>* 5 test reminders help make testing routine</p>\r\n\r\n<p>* Ketone warning and Hypo warning reduce risks caused by extreme glucose values</p>\r\n\r\n<p>* No coding technology reduces risk of miscoding (studies have found that 1 in 6 people with diabetes (16%) miscode when using manually coded meters) increasing testing confidence and user experience</p>\r\n\r\n<p>* See #2680B for Test Strips, 2680C for Lancing Devices and 2680D for Lancets</p>\r\n', 'Glucometer Only', 25, '', '18', 0, '', '', 0, 'vivaguard-ino-blood-glucose-monitoring-meter', '', 'Complete Medical', '', '', '443cf7e68919201977e32a03a52a66d0.jpg', '2019-03-03 04:23:14', '1', '2680A', '', '', '', '', 'instock', '13', '', '', '', '', '', '', '0', '', '0', '00', ''),
(153, 'Gentle Step Diabetic Shoe', 1, 'Super Admin', 26, 'ICD10', 'HCPCS,A5500', 0, '<p>* Conforms to Medicare Therapeutic Shoe Bill</p>\r\n\r\n<p>* Approved extra-depth shoe for certain patients with diabetes</p>\r\n\r\n<p>* Upper constructed of lycra to provide comfort in patients with forefoot deformities or lesions</p>\r\n\r\n<p>* Firm heel counter to provide stability and comfortable fit</p>\r\n\r\n<p>* Extra depth concealed in the molded outsole to provide a lower profile and enhanced style</p>\r\n\r\n<p>* Machine washable</p>\r\n\r\n<p>* Toe box made of lycra material to stretch over foot deformities such as hammer toes, bunions, etc.</p>\r\n\r\n<p>* One strap loop lock provides easy closure</p>\r\n\r\n<p>* Latex free</p>\r\n', 'Covered by Medicare, Medicaid and HMO\'s', 120, '', '85', 0, '', '', 0, 'gentle-step-diabetic-shoe', '', 'Complete medical', '', '', 'accb6987956fc103d787ccdfe3e6e4ba.jpg', '2019-03-03 06:42:33', '1', '1441A', '', '', '', '', 'instock', '11', '', '', '', '', '', '', '1', '', '0', '00', ''),
(154, 'Sensifoot 8 -15 Crew Diabetic Socks', 1, 'Super Admin', 27, 'NA', 'NA', 0, '<p>Shipping Carton Size: 12&quot;L x 10&quot;W x 6&quot;H</p>\r\n', 'Diabetes Care', 15, '', '10', 0, '', '', 0, 'sensifoot-8-15-crew-diabetic-socks', '', 'Complete', '', '', 'ff47f552a605d60c48bf36f62a54d818.jpg', '2019-03-03 06:51:08', '1', '110837', '', '', '', '', 'instock', '11', '', '', '', '', '', '', '0', '', '0', '00', ''),
(155, '	Diabetic Socks', 1, 'Super Admin', 27, 'NA', 'NA', 0, '<p>Ideal for those who need special foot care</p>\r\n\r\n<p>* Extra wide to keep swollen feet warm at night and to protect and cover foot cream</p>\r\n\r\n<p>* 100% cotton/ machine wash/tumble dry</p>\r\n', 'Diabetes Care', 12, '', '8', 0, '', '', 0, '-diabetic-socks-1', '', 'Complete Medical', '', '', 'e28a400cc0f265ef904533e2c3b8ffc9.jpg', '2019-03-03 06:55:25', '1', '2667D', '', '', '', '', 'notinstock', '34', '', '', '', '', '', '', '0', '', '0', '00', ''),
(156, 'MedCrew Diabetic Sock', 1, 'Super Admin', 27, 'NA', 'NA', 0, '<p>Holofiber increases circulation and oxygenated blood flow</p>\r\n\r\n<p>* Moisture wicking yarn helps keep feet dry</p>\r\n\r\n<p>* Machine Washable</p>\r\n\r\n<p>* Features cutting edge nanotechnology</p>\r\n\r\n<p>* Made of 50% HoloFiber Yarn, 34% Comfortrel, 13% Nylon, &amp; 3% Spandex&nbsp;</p>\r\n', 'Diabetes Care', 30, '', '22', 0, '', '', 0, 'medcrew-diabetic-sock', '', 'Complete Medical', '', '', '118eccc6afdc8ada8931470e4ab926a0.jpg', '2019-03-03 06:59:02', '1', '', '', '', '', '', 'instock', '12', '', '', '', '', '', '', '0', '', '0', '00', ''),
(157, 'Hand Sewn White Diabetic Socks', 1, 'Super Admin', 27, 'NA', 'NA', 0, '<p>Hand sewn non-irritating FLAT &amp; SOFT COMFORT TOE SEAM provides amazing comfort</p>\r\n\r\n<p>* Natural cotton stretches and is perfect for people who suffer from swollen feet or circulatory problems</p>\r\n\r\n<p>* Special non-binding top stays up and promotes circulation</p>\r\n\r\n<p>* Color: White</p>\r\n\r\n<p>* Materials - 95% Cotton, 5% Spandex</p>\r\n', 'Diabetes Care', 12, '', '8', 0, '', '', 0, 'hand-sewn-white-diabetic-socks', '', 'Complete Medical', '', '', '3be913bec4034a285f3117669c2c62d7.jpg', '2019-03-03 07:03:06', '1', 'BJ250100', '', '', '', '', 'instock', '13', '', '', '', '', '', '', '0', '', '0', '00', ''),
(158, 'Molded Wheelchair Cushion w/Lumbar Support 18\"x17', 1, 'Super Admin', 29, 'ICD10', 'HCPCS,E2611', 0, '<p>Improves seating posture while providing back support and comfort</p>\r\n\r\n<p>* Conforms to provide support to the lumbar region</p>\r\n\r\n<p>* Sealed liner protects foam core from moisture</p>\r\n\r\n<p>* The stabilization board secured on back of foam core prevents hammocking in sling-back wheelchairs</p>\r\n\r\n<p>* Has a non-slip vinyl back to prevent the cushion from sliding</p>\r\n\r\n<p>* Weight Capacity: 300 lbs</p>\r\n\r\n<p>* 18 Month Limited Warranty on cover and cushion</p>\r\n\r\n<p>* Notice to California Consumers: WARNING: This product contains chemicals known to the State of California to cause cancer and birth defects or other reproductive harm&nbsp;</p>\r\n', 'Covered by HMO\'s', 75, '', '55', 0, '', '', 0, 'molded-wheelchair-cushion-w-lumbar-support-18-x17', '', 'Complete Medical', '', '', '79caa75e3e9f864bd231225d0f9d067a.jpg', '2019-03-03 07:11:38', '1', '11984', '', '', '', '09c0fcadf52166181c4396b8d59b97ce.jpg,4092473fbb486744804041caa74b251e.jpg,e4e6feb2c653105695a6c2e426762db0.jpg', 'instock', '16', '', '', '', '', '', '', '1', '', '0', '00', ''),
(159, '	Lumbar Cushion w/Strap', 1, 'Super Admin', 29, 'NA', 'NA', 0, '<p>With Strap *</p>\r\n\r\n<p>* Gives vertical &amp; lateral support</p>\r\n\r\n<p>* Eases stress on back muscles</p>\r\n\r\n<p>* Size: 14&quot; x 14&quot; x 4 1/2&quot; * Corrects posture</p>\r\n\r\n<p>* Cushion has elastic strap</p>\r\n\r\n<p>* The ultimate in soothing lumbar support</p>\r\n\r\n<p>* Molded foam provides support directly to the lumbar region heping you to relax and feel instant relief</p>\r\n\r\n<p>* Features poly/cotton cover&nbsp;</p>\r\n', 'Back Therapy', 26, '', '20', 0, '', '', 0, '-lumbar-cushion-w-strap', '', 'Complete Medical', '', '', '4427a5ff71d14cc20452676d93a964d3.jpg', '2019-03-03 07:16:05', '1', '8596', '', '', '', '', 'instock', '12', '', '', '', '', '', '', '0', '', '0', '00', ''),
(160, 'ObusForme CustomAIR Backrest w/Lumbar Support', 1, 'Super Admin', 29, 'NA', 'NA', 0, '<p>Retail boxed</p>\r\n\r\n<p>* Our award winning backrest support transforms ordinary chairs into ergonomically correct seating</p>\r\n\r\n<p>* The &quot;S&quot; shape of the ObusForme Backrest Support molds your spine into a more anatomically correct position and helps to enhance overall posture by supporting proper spinal alignment</p>\r\n\r\n<p>* Features &amp; Benefits: Engineered shape conforms to natural spinal curvature Integrated, adjustable lumbar support adjusts vertically to provide a full range of support from the thoracic to the lumbar regions of the spine</p>\r\n\r\n<p>* Hand-held pump and valve enable customizable inflation/deflation of the lumbar support to suit personal requirements</p>\r\n\r\n<p>* Accommodates regular changes of posture, which helps alleviate stress on the lumbar region Pump, deflation valve and hose store neatly in pocket when not in use Lightweight and portable, turns any chair into an ergonomic seating system</p>\r\n\r\n<p>* Use at home, work, or in a vehicle</p>\r\n', 'Back Therapy', 150, '', '98', 0, '', '', 0, 'obusforme-customair-backrest-w-lumbar-support', '', 'Complete Medical', '', '', '5804bee8390efec2b84ffbb3931f7521.jpg', '2019-03-03 07:22:26', '1', 'CLPROF01', '', '', '', '51bf50a29136af0ea84934e7fb5ff3d5.jpg,04007b00e002d744b3b122aae776dbf3.jpg,e5f736cb177a9b377f4615000b72a00c.jpg', 'instock', '12', '', '', '', '', '', '', '0', '', '0', '00', ''),
(161, 'Bucketseat Sitback Rest Lumbar Support', 1, 'Super Admin', 29, 'NA', 'NA', 0, '<p>Specifically designed with side wings to fit snugly inside your car&#39;s bucket style seat</p>\r\n\r\n<p>* Side support wings provide maximum comfort and support while driving</p>\r\n\r\n<p>* Fits most standard bucketseats</p>\r\n\r\n<p>* Positioning belt included</p>\r\n\r\n<p>* Durable cotton blend cover</p>\r\n\r\n<p>* 13&quot;x 14&quot; (33cm x 36cm)</p>\r\n\r\n<p>* Contour cut foam and side-support wings contour to your body for medium to firm support, to keep you in the correct position</p>\r\n\r\n<p>* Use at home, office or in your car</p>\r\n', 'Back Therapy', 60, '', '45', 0, '', '', 0, 'bucketseat-sitback-rest-lumbar-support', '', 'Complete Medical', '', '', '4dc48bbfb3430258ce2dfdab01348ba5.jpg', '2019-03-03 07:30:47', '1', 'CR405BLK', '', '', '', '', 'instock', '14', '', '', '', '', '', '', '0', '', '0', '00', ''),
(162, 'ObusformeB Ultra Premium Backrest Support ', 1, 'Super Admin', 29, 'NA', 'NA', 0, '<p>&nbsp;Construction for ultra comfort with advanced ergonomic support for your back</p>\r\n\r\n<p>* Designed to increase comfort by aligning your spine and supporting correct posture</p>\r\n\r\n<p>* Unlike traditional &quot;L&quot; shaped chairs, the &quot;S&quot; shaped frame of the Obusforme molds your spine into proper anatomical alignment</p>\r\n\r\n<p>* Muscles relax, leaving you more comfortable and energized</p>\r\n\r\n<p>* Features molded, impact resistant, lightweight polycarbonate frame</p>\r\n\r\n<p>* Durable polyurethane foam protects frame and provides cushy comfort</p>\r\n\r\n<p>* Hypoallergenic cover can be removed and spot washed</p>\r\n\r\n<p>* Double straps with lock buckles to secure to your seat</p>\r\n\r\n<p>* Use together with any Obusforme seat</p>\r\n\r\n<p>* Beautiful impact retail packaging</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'Back Therapy', 105, '', '70', 0, '', '', 0, 'obusformeb-ultra-premium-backrest-support', '', 'Complete Medical', '', '', '6c64bf63e9b30eb423007c9985befc7e.jpg', '2019-03-03 07:36:57', '1', 'OFUF-MD', '', '', '', '1477b0d9581be163d99c55042be300b3.jpg,86f29c1282278614e3923a647f385cb8.jpg', 'instock', '17', '', '', '', '', '', '', '0', '', '0', '00', ''),
(163, 'Deep Kneading Shiatsu Cushion w/Heat', 1, 'Super Admin', 29, 'NA', 'NA', 0, '<p>A complete and full massage experience</p>\r\n\r\n<p>* Deep Kneading Shiatsu Cushion with Heat</p>\r\n\r\n<p>* Traveling massage mechanism moves up and down the back for a relaxing massage</p>\r\n\r\n<p>* Soothing heat enhances your massage experience</p>\r\n\r\n<p>* 3 Massage Programs -choose Full Back or isolate massage to Upper Back or Lower Back only</p>\r\n\r\n<p>* Corded remote control, lets you customize your massage</p>\r\n\r\n<p>* Easy to use, integrated strapping system fits most chairs</p>\r\n\r\n<p>* Notice to California Consumers: WARNING: This product contains chemicals known to the State of California to cause cancer and birth defects or other reproductive harm</p>\r\n', 'Lumbar Therapy', 160, '', '120', 0, '', '', 0, 'deep-kneading-shiatsu-cushion-w-heat', '', 'Complete Medical', '', '', '43ba9363ec854a77c839f6a646d16e5b.jpg', '2019-03-03 07:41:55', '1', 'SMSMC05', '', '', '', '6f3ab3ee5f3346e00c9bdd713de34b3d.jpg,5996eb97f472770c3dc8c891dbb37ec0.jpg,fbcfebee916f95fd9392356c8fe0ac08.jpg', 'instock', '17', '', '', '', '', '', '', '0', '', '0', '00', ''),
(164, 'Back Posture Cushion w/Strap', 1, 'Super Admin', 29, 'NA', 'NA', 0, '<p>Even back support</p>\r\n\r\n<p>* Designed to cradle your back so your left and right side is evenly supported</p>\r\n\r\n<p>* Lower back support: The micro beads are strategically located on each side of the cushion to provide firm support for your lower back area</p>\r\n\r\n<p>* Pelvic area support: The cushion&#39;s base helps position your lower back to best support your pelvic area</p>\r\n\r\n<p>* Secure the cushion: The adjustable straps helps secure the cushion onto your chair&nbsp;</p>\r\n', 'Lumbar Therapy', 22, '', '16', 0, '', '', 0, 'back-posture-cushion-w-strap', '', 'Complete Medical', '', '', '1087f22e9a03037e1140c2e060a1fadf.jpg', '2019-03-03 07:45:07', '0', 'RET7929', '', '', '', '', 'instock', '15', '', '', '', '', '', '', '0', '', '0', '00', ''),
(165, 'Suction Catheters 10 French Bx/1', 1, 'Super Admin', 30, 'ICD10', 'HCPCS', 0, '<p>10 French Bx/10</p>\r\n\r\n<p>* Sterile, straight packed suction catheters with Safe-T-Vac Valve</p>\r\n\r\n<p>* Touch-trol reverse angle valve helps minimize the chance of contact with sputum</p>\r\n\r\n<p>* Plastic glide finsih minimizes friction and facilitates secretion removal</p>\r\n\r\n<p>* According to the manufacturer, these will work with most suction units.</p>\r\n', 'Covered by Medicare Part B , Medicaid and most HMO\'s Plans', 13, '', '9', 0, '', '', 0, 'suction-catheters-10-french-bx-1', '', 'Complete Medical', '', '', 'ddc508488b39136045dbad7254542025.jpg', '2019-03-03 08:48:34', '1', '137A', '', '', '', '', 'instock', '14', '', '', '', '', '', '', '1', '', '0', '00', ''),
(166, 'Suction Catheter Kits 12 Fr Bx/10', 1, 'Super Admin', 30, 'ICD10', 'HCPCS', 0, '<p>12 French Bx/10</p>\r\n\r\n<p>* For convenient, affordable respiratory suctioning procedures</p>\r\n\r\n<p>* Each kit includes: Sterile coil suction catheter with SAFE-T-VAC Valve, (2) walleted Safeskin purple nitrile latex free gloves and a pop-up solution cup in a sterile inner wrap&nbsp;</p>\r\n', 'Covered by Medicare Part B, Medicaid and most HMO\'s Plans', 20, '', '14', 0, '', '', 0, 'suction-catheter-kits-12-fr-bx-10', '', 'Complete Medical', '', '', '235cf8be8d044be276d98d7b93ec67c8.jpg', '2019-03-03 08:53:30', '1', '14008C', '', '', '', '', 'instock', '12', '', '', '', '', '', '', '1', '', '0', '00', ''),
(167, 'Bardex Lubricath Latex Foley Catheter 14 French, 5cc', 1, 'Super Admin', 30, 'ICD10', 'HCPCS', 0, '<p>14 French, 5cc -Each</p>\r\n\r\n<p>* Lubricious coating</p>\r\n\r\n<p>* Two opposing eyes</p>\r\n\r\n<p>* Short length, round tip</p>\r\n', 'Covered by Medicare Part B, Medicaid and most HMO\'s Plans', 16, '', '12', 0, '', '', 0, 'bardex-lubricath-latex-foley-catheter-14-french-5cc', '', 'Complete Medical', '', '', '8baa79155c1b80491c10578608f482f5.jpg', '2019-03-03 08:56:57', '1', '165L14', '', '', '', '', 'instock', '10', '', '', '', '', '', '', '1', '', '0', '00', ''),
(168, 'Touchless Unisex Catheter Kit 14fr Red Rubber W/1100cc Bag', 1, 'Super Admin', 30, 'ICD10', 'HCPCS', 0, '<p>14 French * Kit contains: 1100cc collection collection chamber with glove and alcohol wipe, dispenser pack, red rubber catheter, lubricant, povidone iodine swabs * Catheter 16&quot; long*</p>\r\n', 'Covered by Medicare Part B, Medicaid and most HMO\'s Plans', 10, '', '7', 0, '', '', 0, 'touchless-unisex-catheter-kit-14fr-red-rubber-w-1100cc-bag', '', 'Complete Medical', '', '', '428a9c1a2622b4d687030174bdb91639.jpg', '2019-03-03 08:59:15', '1', '', '', '', '', '', 'instock', '12', '', '', '', '', '', '', '1', '', '0', '00', '');
