(169, 'Bard Red Rubber All-Purpose Urethral Catheter 16 Fr. (Ea', 1, 'Super Admin', 30, 'ICD10', 'HCPCS', 0, '<p>16 French</p>\r\n\r\n<p>* All-purpose urethal catheter</p>\r\n\r\n<p>* Radiopaque red rubber catheter with a round hollow tip</p>\r\n\r\n<p>* Can be used as a Robinson or a Nelaton catheter</p>\r\n\r\n<p>* Two opposing drainage eyes</p>\r\n\r\n<p>* 1&quot; Long</p>\r\n\r\n<p>* Single-use, sterile</p>\r\n', 'Covered by Medicare Part B, Medicaid and most HMO\'s Plans', 4, '', '2', 0, '', '', 0, 'bard-red-rubber-all-purpose-urethral-catheter-16-fr-ea', '', 'Complete Medical', '', '', 'cb91ce7e13074dc4d25838416d2564b5.jpg', '2019-03-03 09:02:59', '1', '802416', '', '', '', '', 'instock', '16', '', '', '', '', '', '', '1', '', '0', '00', ''),
(170, 'Vinyl Catheters Female 6 1/2\"L x 14Fr. Box/50', 1, 'Super Admin', 30, 'ICD10', 'HCPCS', 0, '<p>Robinson Vinyl, (PVC), Urethral Catheters 6 Fr/Ch-18 Fr/Ch</p>\r\n\r\n<p>*PVC</p>\r\n\r\n<p>* Staggered eyes</p>\r\n\r\n<p>* Latex Free</p>\r\n\r\n<p>* Maximize urine flow</p>\r\n', 'Covered by Medicare Plan B, Medicaid and most HMO\'s Plans', 55, '', '45', 0, '', '', 0, 'vinyl-catheters-female-6-1-2-l-x-14fr-box-50', '', 'Complete Medical', '', '', '3dfaff083f67b3085563ca8efd06e60d.jpg', '2019-03-03 09:06:48', '1', '8887660903', '', '', '', '', 'instock', '15', '', '', '', '', '', '', '1', '', '0', '00', ''),
(171, 'Catheter,Foley,100% Silicone 22FR, 10ML, 10/case', 1, 'Super Admin', 30, 'ICD10', 'HCPCS', 0, '<p>Maximize safety and comfort with our 100% silicone Foley catheters.</p>\r\n\r\n<p>* Completely inert for less tissue irritation and encrustation during extended periods of indwelling use.</p>\r\n\r\n<p>* Easy insertion and less buckling with the bullet-shaped tip.</p>\r\n\r\n<p>* Larger inner lumen for better drainage.</p>\r\n\r\n<p>* Clear for easy visualization of clots, mucous and urine flow.</p>\r\n\r\n<p>* Radiopaque strip for easy visualization during scans.</p>\r\n\r\n<p>* Symmetrical balloon shape for improved reliability.</p>\r\n\r\n<p>* Not made with natural rubber latex</p>\r\n', 'Covered by Medicare, Medicaid and most HMO\'s Plans', 90, '', '70', 0, '', '', 0, 'catheter-foley-100-silicone-22fr-10ml-10-case', '', 'Complete Medical', '', '', '65029be07f91d095fa842f06c5f556ce.jpg', '2019-03-03 09:12:32', '1', 'DYND11505', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(172, 'Self Cath Catheter 10fr 16\" Sterile w/Funnel End Box/30', 1, 'Super Admin', 30, 'ICD10', 'HCPCS', 0, '<p>SOFT</p>\r\n\r\n<p>* 10 Fr 16&quot; Funnel End Bx/30</p>\r\n\r\n<p>* For intermittent Self-Catheterization</p>\r\n', 'Covered by Medicare Part B, Medicaid and most HMO\'s Plans', 55, '', '40', 0, '', '', 0, 'self-cath-catheter-10fr-16-sterile-w-funnel-end-box-30', '', 'Complete Medical', '', '', '5c7ab34ac021cec4abd064594d62ef37.jpg', '2019-03-03 09:19:53', '1', 'MEN110', '', '', '', '', 'instock', '17', '', '', '', '', '', '', '1', '', '0', '00', ''),
(173, 'Catheter Self 14fr 6\" Female Str Tip-Funnel End Bx/30', 1, 'Super Admin', 30, 'ICD10', 'HCPCS', 0, '<p>Straight Tipped - Female 14 Fr6&quot; Funnel End Bx/30</p>\r\n\r\n<p>* For intermittent self-catheterization&nbsp;</p>\r\n', 'Covered by Medicare Part B, Medicaid and most HMO\'s Plans', 50, '', '38', 0, '', '', 0, 'catheter-self-14fr-6-female-str-tip-funnel-end-bx-30', '', 'Complete Medical', '', '', 'a4da7db8bd80df46509d8be8fa28d9a4.jpg', '2019-03-03 09:23:45', '1', 'MEN214', '', '', '', '', 'instock', '18', '', '', '', '', '', '', '1', '', '0', '00', ''),
(174, 'FitRight Extra Briefs 20 per Bag/4 Bags/cs', 1, 'Super Admin', 31, 'ICD10', 'HCPCS', 0, '<p>Fit Right&nbsp;Extra Briefs promote a better fit as well as comfort and dignity</p>\r\n\r\n<p>* 4D-Core with odor protection helps wick fluid away to promote dryness and help maintain skin integrity</p>\r\n\r\n<p>* Skin-safe closures provide secure, safe and repeated refastenability</p>\r\n\r\n<p>* Ultra-soft cloth-like backsheet provides a discreet, garment-like, natural feel</p>\r\n\r\n<p>* Breathable side panels increase airflow and maximize patient comfort</p>\r\n\r\n<p>* Moisture alert wetness indicator changes color when the garment has been soiled</p>\r\n\r\n<p>* Absorbency 6 - Heavy Latex Free - Yes Odor Control Product - Yes Outer Material - Clothlike Packaging - Retail Bags Disposable Tape Tab Hook and loop</p>\r\n', 'Covered by Medicare Part B, Medicaid and most HMO\'s', 80, '', '60', 0, '', '', 0, 'fitright-extra-briefs-20-per-bag-4-bags-cs', '', 'Complete Medical', '', '', '3d5869bd95479a0e0c92012f11bacd79.jpg', '2019-03-03 09:32:46', '1', 'FITEXTRALG', '', '', '', '', 'instock', '15', '', '', '', '', '', '', '1', '', '0', '00', ''),
(175, 'Protect Extra Underwear (20 Bags/4 Case)', 1, 'Super Admin', 31, 'ICD10', 'HCPCS', 0, '<p>Breathable soft non-woven back sheet is comfortable against skin, minimizing the risk of skin irritation and heat build up</p>\r\n\r\n<p>* Extra absorbency core for optimal dryness and protection</p>\r\n\r\n<p>* Body-contoured anatomical design for added comfort and fit with the feel of underwear</p>\r\n\r\n<p>* Acquisition and dryness layer helps keep moisture away from skin</p>\r\n\r\n<p>* Size printed on the back sheet to improve product identification and ease of care</p>\r\n\r\n<p>* Absorbency 4 - Moderate Anti-Leak Guard -- No Bag Appearance -- Retail Latex Free</p>\r\n', 'Covered by Medicare Part B, Medicaid and most HMO\'s Plans', 60, '', '45', 0, '', '', 0, 'protect-extra-underwear-20-bags-4-case', '', 'Complete Medical', '', '', 'a7c68400e7825c7742c826e1b8570e03.jpg', '2019-03-03 09:37:02', '1', 'MSC13005A', '', '', '', '', 'instock', '16', '', '', '', '', '', '', '1', '', '0', '00', ''),
(176, '	Aloe Vesta 3-N-1 Protective Ointment 8 oz.', 1, 'Super Admin', 31, 'ICD10', 'HCPCS', 0, '<p>ConvaTec Aloe Vesta 3-in-1 Skin Protection Ointment soothes red, sore or irritated skin from urine burns, diaper rash, feces, or wound drainage</p>\r\n\r\n<p>*ConvaTec Aloe Vesta 3-in-1 Skin Protection Ointment soothes red, sore or irritated skin from urine burns, diaper rash, feces, or wound drainage</p>\r\n\r\n<p>*The ointment provides protection as a moisture barrier</p>\r\n\r\n<p>*Aloe Vesta 3-in-1 Skin Protection Ointment conditions the skin while repelling moisture</p>\r\n\r\n<p>*ConvaTec Aloe Vesta 3-in-1 Skin Protection Ointment is hypoallergenic and free of irritating dyes and fragrances</p>\r\n\r\n<p>*The ointment provides protection as a moisture barrier. Aloe Vesta 3-in-1 Skin Protection Ointment conditions the skin while repelling moisture</p>\r\n\r\n<p>*ConvaTec Aloe Vesta 3-in-1 Skin Protection Ointment is hypoallergenic and free of irritating dyes and fragrances</p>\r\n', 'Covered by Medicare Part B, Medicaid and most HMO\'s Plans', 30, '', '20', 0, '', '', 0, '-aloe-vesta-3-n-1-protective-ointment-8-oz', '', 'Complete Medical', '', '', '56e022bdb35d83c011cad7ad379e8643.jpg', '2019-03-03 09:40:33', '1', '324908', '', '', '', '', 'instock', '13', '', '', '', '', '', '', '1', '', '0', '00', ''),
