(186, 'Latex Exam Gloves Powder-Free Bx/100', 1, 'Super Admin', 33, 'NA', 'NA', 0, '<p>Professionals who require greater sensitivity for administering medical care or instrument manipulation find these fully textured powder-free latex exam gloves a perfect fit</p>\r\n\r\n<p>* Powder-free to help reduce the risk of skin irritation, these gloves feature tapered fingertips for greater comfort and advanced processing for easier donning</p>\r\n\r\n<p>* Powder-Free Latex Exam Gloves have beaded, tear-resistant cuffs for added performance</p>\r\n', 'Latex Gloves', 10, '', '8', 0, '', '', 0, 'latex-exam-gloves-powder-free-bx-100', '', 'Complete Medical', '', '', '05ba3f08cc3c3e6cb96cac5f0dd2e2ff.jpg', '2019-03-04 00:36:17', '0', '1023A', '', '', '', '', 'instock', '13', '', '', '', '', '', '', '0', '', '0', '00', ''),
(187, 'Nitrile Latex-Free/Powder-Free Exam Gloves - Bx/100', 1, 'Super Admin', 33, 'NA', 'NA', 0, '<p>&nbsp;Blue Nitrile Powder-Free Virtual Skin exam glove uses Soft Stretch Modulus Technology to provide a second-skin comfort level</p>\r\n\r\n<p>* This latex-free, powder-free, textured glove offers the very best in tactile sensitivity, chemical resistance, and blood-borne pathogen protection</p>\r\n\r\n<p>* Nitrile Powder-Free Virtual Skin exam glove reduces hand fatigue and has superior tensile strength</p>\r\n', 'Nitrile Gloves ', 12, '', '9', 0, '', '', 0, 'nitrile-latex-free-powder-free-exam-gloves-bx-100', '', 'Complete Medical', '', '', '8ccfe70909316dffa393755d39ca48be.jpg', '2019-03-04 00:40:48', '1', '1024A', '', '', '', '', 'instock', '12', '', '', '', '', '', '', '0', '', '0', '00', ''),
(188, 'Blood Drawing Chair w/Drawer', 1, 'Super Admin', 33, 'NA', 'NA', 0, '<p>With Drawer</p>\r\n\r\n<p>* Provides a comfortable, efficient means of collecting blood from ambulatory patients</p>\r\n\r\n<p>* 2 full length, height-adjustable armrests support the arm in the optimum position for vein puncture and prevent back-bending of the elbow and subsequent flattening of the vein</p>\r\n\r\n<p>* Armrests are interchangeable, left to right, with the drawer placed at either side of the chair and the moveable portion angled to either side</p>\r\n\r\n<p>* Neutral gray, powder coated steel frame and black, one piece polypropylene seat are designed for maintenance-free service</p>\r\n\r\n<p>* Seat height: 17 1/4&quot;</p>\r\n\r\n<p>* Seat width: 17&quot;</p>\r\n\r\n<p>* Weight capacity: 250 Lbs.&nbsp;</p>\r\n', 'Blood Drawing Chairs', 550, '', '450', 0, '', '', 0, 'blood-drawing-chair-w-drawer', '', 'Complete Medical', '', '', 'ad19364c5724d50a38d2d188f81bb304.jpg', '2019-03-04 00:55:14', '1', '11602', '', '', '', '', 'instock', '17', '', '', '', '', '', '', '0', '', '0', '00', ''),
(189, 'Blood Drawing Chair Bariatric w/o Cabinet', 1, 'Super Admin', 33, 'NA', 'NA', 0, '<p>Seat Height 19.5 inches</p>\r\n\r\n<p>* Seat Width 24 inches</p>\r\n\r\n<p>* Overall Height 35 inches</p>\r\n\r\n<p>* Overall Width 33 inches</p>\r\n\r\n<p>* Overall Depth 24 inches</p>\r\n\r\n<p>* Width 30.5 inches</p>\r\n\r\n<p>* Weight 50 lbs</p>\r\n\r\n<p>* Armrest adjustable height 27.5 to 37 inches</p>\r\n\r\n<p>* Weight capacity 450 lbs</p>\r\n\r\n<p>* Color choices: Royal Blue, Taupe, Moss Green, Hunter Green, Gray, Burgundy and Mauve</p>\r\n', 'Blood Drawing Chairs', 1200, '', '850', 0, '', '', 0, 'blood-drawing-chair-bariatric-w-o-cabinet', '', 'Complete Medical', '', '', '5d2caa5d09eb9bf16099fb704503a423.jpg', '2019-03-04 01:02:28', '1', '11602A', '', '', '', '', 'instock', '14', '', '', '', '', '', '', '0', '', '0', '00', ''),
(190, '	Universal V-Neck Scrub Top Reversible Ceil', 1, 'Super Admin', 35, 'NA', 'NA', 0, '<p>Unisex</p>\r\n\r\n<p>Made of AngelStat&nbsp;fabric, a cotton-rich, 55% cotton / 45% polyester blend that gets softer and softer the more it&#39;s washed</p>\r\n\r\n<p>* Reversible unisex V-neck scrub top has a color- coded neck bias</p>\r\n\r\n<p>* Generous cut allows for extra roominess across the back</p>\r\n\r\n<p>* Featuring a left breast pocket inside and out, and set-in sleeves</p>\r\n', 'Scrubs', 20, '', '15', 0, '', '', 0, '-universal-v-neck-scrub-top-reversible-ceil', '', 'Complete Medical', '', '', 'b2d173118a724b88eda3f446e00f7c86.jpg', '2019-03-04 01:10:12', '1', '2153A', '', '', '', '', 'instock', '11', '', '', '', '', '', '', '0', '', '0', '00', ''),
