(192, 'Touch-Free Thermometer Infrared (09-348)', 1, 'Super Admin', 33, 'NA', 'NA', 0, '<p>1-second results</p>\r\n\r\n<p>* Proven clinically accurate</p>\r\n\r\n<p>* Measures body and object/liquid temperatures</p>\r\n\r\n<p>* Body temperature measurements taken at forehead</p>\r\n\r\n<p>* Comparable to oral readings</p>\r\n\r\n<p>* Wide-range readout: 50F - 122F (10C - 50C) person</p>\r\n\r\n<p>* 32F - 221F (0C - 105C) object/liquid</p>\r\n\r\n<p>* Backlit display</p>\r\n\r\n<p>* Memory recall of last 30 readings</p>\r\n\r\n<p>* Fever alert display icon</p>\r\n\r\n<p>* Fahrenheit/Celsius measurements</p>\r\n\r\n<p>* Automatic shut-off</p>\r\n\r\n<p>* Low-battery indicator</p>\r\n\r\n<p>* No tip covers required</p>\r\n\r\n<p>* Meets ASTM Standard E1965-98</p>\r\n\r\n<p>* Latex-free</p>\r\n\r\n<p>* Batteries included: 2 AAA</p>\r\n\r\n<p>* Detailed English/Spanish instructions and quick start guide</p>\r\n\r\n<p>* 3-Year limited warranty</p>\r\n', 'Thermometers', 60, '', '45', 0, '', '', 0, 'touch-free-thermometer-infrared-09-348', '', 'Complete Medical', '', '', '91101e3371f7692857bb6fd82a695faa.jpg', '2019-03-04 01:18:39', '1', 'Complete Medical', '', '', '', '', 'instock', '11', '', '', '', '', '', '', '0', '', '0', '00', ''),
(193, 'Electronic Digital Thermometer Dual Scale W/ Beeper', 1, 'Super Admin', 33, 'NA', 'NA', 0, '<p>60-Second Digital Thermometer</p>\r\n\r\n<p>* Clinical accuracy to 2/10ths of a degree F.</p>\r\n\r\n<p>* Peak temperature tone, last-reading memory recall and fever alert for temperatures above 99.5F.</p>\r\n\r\n<p>* Fahrenheit/Celsius measurements</p>\r\n\r\n<p>* Clinical rigid tip</p>\r\n\r\n<p>* Oral, rectal or underarm use</p>\r\n\r\n<p>* Waterproof for sanitary cleaning</p>\r\n\r\n<p>* Automatic shut-off and low-battery indicator</p>\r\n\r\n<p>* Includes: thermometer, 2-piece full storage case, 5 probe covers, long-life LR41 battery and English/Spanish instructions</p>\r\n', 'Thermometers', 10, '', '7', 0, '', '', 0, 'electronic-digital-thermometer-dual-scale-w-beeper', '', 'Complete Medical', '', '', '1bd16e3f0497250f9a709932c0e54164.jpg', '2019-03-04 01:22:29', '1', '2183', '', '', '', '', 'instock', '13', '', '', '', '', '', '', '0', '', '0', '00', ''),
