(196, 'Suture Removal Kit- Sterile - Bx/10 Kits', 1, 'Super Admin', 33, 'NA', 'NA', 0, '<p>Bx/10 Kit</p>\r\n\r\n<p>* Disposable sterile suture removal kits offer convenience and extra protection against cross infection</p>\r\n\r\n<p>* Plastic tray provides sterile field</p>\r\n\r\n<p>* Removable Tyvek lid</p>\r\n\r\n<p>* Kit contents: Littauer scissors, 4&quot; forceps and gauze sponge</p>\r\n', 'Suture Removal Kits', 20, '', '16', 0, '', '', 0, 'suture-removal-kit-sterile-bx-10-kits', '', 'Complete Medical', '', '', '9ebd13344a75b9b7dba0e4c22f57c901.jpg', '2019-03-04 01:33:19', '1', '3035', '', '', '', '', 'instock', '12', '', '', '', '', '', '', '0', '', '0', '00', ''),
(197, 'Alcohol Prep Pads- Bx/200 Medium Sterile', 1, 'Super Admin', 33, 'NA', 'NA', 0, '<p>For topical disinfection prior to injection or venipuncture</p>\r\n\r\n<p>* Soft &amp; non woven medium applicator</p>\r\n\r\n<p>* 1 1/4&quot; x 1 1/4&quot; - 1 Ply</p>\r\n\r\n<p>* 70% Isopropyl alcohol</p>\r\n\r\n<p>* Non-sterile Shipping Carton Size: 8&quot;L x 6&quot;W x 4&quot;H</p>\r\n', 'Alcohol Prep Pads', 6, '', '4', 0, '', '', 0, 'alcohol-prep-pads-bx-200-medium-sterile', '', 'Complete Medical', '', '', '9b61fc018c540a9c175ddc3ebbaa515f.jpg', '2019-03-04 01:38:48', '1', '3015', '', '', '', '', 'instock', '11', '', '', '', '', '', '', '0', '', '0', '00', ''),
(198, 'Alcohol Prep Pads Large Bx/100', 1, 'Super Admin', 33, 'NA', 'NA', 0, '<p>LARGE * 2&quot; x 2-1/2&quot; Bx/100</p>\r\n\r\n<p>* For topical disinfection prior to injection or venipuncture</p>\r\n\r\n<p>* Soft &amp; non woven medium applicator</p>\r\n\r\n<p>* 1 Ply</p>\r\n\r\n<p>* 70% Isopropyl alcohol</p>\r\n\r\n<p>* Shipping Carton Size: 8&quot;L x 6&quot;W x 4&quot;H</p>\r\n', 'Alcohol Prep Pads', 8, '', '6', 0, '', '', 0, 'alcohol-prep-pads-large-bx-100', '', 'Complete Medical', '', '', 'ccc7f416394b77f75254ee525c016ac7.jpg', '2019-03-04 01:41:47', '1', '3015B', '', '', '', '', 'instock', '13', '', '', '', '', '', '', '0', '', '0', '00', ''),
(199, 'Electrode Skin Prep Pads Bx/100', 1, 'Super Admin', 33, 'NA', 'NA', 0, '<p>Bx/100</p>\r\n\r\n<p>* Pumice removes excess skin oil enhancing electrode to skin contact for EKG testing</p>\r\n\r\n<p>* Better adhesion of electrode for stress testing&nbsp;</p>\r\n', 'Skin Preps & Cleaners', 18, '', '13', 0, '', '', 0, 'electrode-skin-prep-pads-bx-100', '', 'Complete Medical', '', '', '67964f0f563a7f45f02b022c427db9ec.jpg', '2019-03-04 01:43:55', '1', '3019', '', '', '', '', 'instock', '15', '', '', '', '', '', '', '0', '', '0', '00', ''),
(200, '3m Littman Master Classic Veterinary Stethoscope', 1, 'Super Admin', 33, 'NA', 'NA', 0, '<p>A tunable diaphragm allows the user to conveniently alternate between the low- and high-frequency sounds without turning over the chestpiece</p>\r\n\r\n<p>* Portable convenience of single-sided chestpiece</p>\r\n\r\n<p>* High-performance, single-lumen tubing for excellent acoustic performance in a range of attractive colors</p>\r\n\r\n<p>* Excellent acoustic seal and comfortable fit with patented 3M Littmann&nbsp;Snap Tight Soft-Sealing Eartips</p>\r\n\r\n<p>* Comfortably angled, anatomically correct headset</p>\r\n\r\n<p>* Used as a diagnostic aid as part of the physical assessment of a patient</p>\r\n\r\n<p>* 32 inch (81.3cm)</p>\r\n\r\n<p>* Single-sided chestpiece</p>\r\n\r\n<p>* Navy Blue tube</p>\r\n\r\n<p>* Patient-friendly, nonchill rim and diaphragm.</p>\r\n\r\n<p>* Three-year warranty</p>\r\n', '3M Littmann & WA Steths Stethscope', 210, '', '150', 0, '', '', 0, '3m-littman-master-classic-veterinary-stethoscope', '', 'Complete Medical', '', '', '14644863c5a69824626560ae849e41d0.jpg', '2019-03-04 05:49:15', '1', '3M1392', '', '', '', '', 'instock', '12', '', '', '', '', '', '', '0', '', '0', '00', ''),
(201, '3m Littman Pediatric Black Stethoscope', 1, 'Super Admin', 33, 'NA', 'NA', 0, '<p>Black, 28&quot;</p>\r\n\r\n<p>* One inch traditional pediatric bell combined with a floating diaphragm</p>\r\n\r\n<p>* Sold stainless steel chestpiece</p>\r\n\r\n<p>* Excellent acoustic seal and comfortable fit with patented Littmann Snap Tight soft- sealing eartips</p>\r\n\r\n<p>* Comfortably angled, anatomically correct headset</p>\r\n\r\n<p>* Patient-friendly, nonchill rim and diaphragm</p>\r\n\r\n<p>* Single lumen tubing in a range of attractive colors</p>\r\n\r\n<p>* 3 year warranty</p>\r\n\r\n<p>* NOTE: Classic II Infant Stethoscopes also available upon request</p>\r\n', '3M Littmann & WA Stethoscope', 215, '', '155', 0, '', '', 0, '3m-littman-pediatric-black-stethoscope', '', 'Complete Medical', '', '', 'b20793454f3917def1f2bc9585ea7d21.jpg', '2019-03-04 05:55:14', '1', '3M2113', '', '', '', '', 'instock', '11', '', '', '', '', '', '', '0', '', '0', '00', ''),
(202, '3m Littman Master Card Black Stethoscope', 1, 'Super Admin', 33, 'NA', 'NA', 0, '<p>Black 27&quot;</p>\r\n\r\n<p>* The ultimate acoustical stethoscope</p>\r\n\r\n<p>* Tunable diaphragm conveniently alternates between low and high frequency sounds without the need to turn over the chestpiece</p>\r\n\r\n<p>* Handcrafted sold stainless steel chestpiece</p>\r\n\r\n<p>* 2-in-1 tube design eliminates tube rubbing noise</p>\r\n\r\n<p>* Portable convenience of a single-sided chestpiece</p>\r\n\r\n<p>* Excellent acoustic seal and comfortable fit with patented Littmann Snap Tight soft-sealing eartips</p>\r\n\r\n<p>* Comfortably angled, anatomically correct headset</p>\r\n\r\n<p>* Patient-friendly, nonchill rim and diaphragm. Special procedures adaptor for difficult site or pediatric ausculation</p>\r\n\r\n<p>* Available in a selection of classic tube colors</p>\r\n\r\n<p>* 7 year warranty</p>\r\n', '3M Littmann & WA Stethoscope', 450, '', '350', 0, '', '', 0, '3m-littman-master-card-black-stethoscope', '', 'Complete Medical', '', '', '81b4c6224ba2a2d4574ecea81bbd2b8b.jpg', '2019-03-04 06:01:08', '1', '3M2160', '', '', '', '', 'instock', '14', '', '', '', '', '', '', '0', '', '0', '00', ''),
(203, '	Littmann Lightweight II S.E. Stethoscope', 1, 'Super Admin', 33, 'NA', 'NA', 0, '<p>Lightweight and easy-to-carry</p>\r\n\r\n<p>* 28&quot; tubing</p>\r\n\r\n<p>* Chestpiece shape designed around blood pressure cuffs and body contours</p>\r\n\r\n<p>* Bell with tuneable diaphragm that alternates between low &amp; high frequency sounds without the need to turn over the chestpiece</p>\r\n\r\n<p>* Single lumen tubing in a range of colors</p>\r\n\r\n<p>* 2 year warranty</p>\r\n\r\n<p>* Shipping Carton Size: 12&quot;L x 10&quot;W x 6&quot;H</p>\r\n', '3M Littmann & WA Stethoscope', 105, '', '75', 0, '', '', 0, '-littmann-lightweight-ii-s-e-stethoscope', '', 'Complete Medical', '', '', '3f9fc7f07eabb254e11a9c60f68a9ee3.jpg', '2019-03-04 06:08:26', '1', '3M2450', '', '', '', '', 'instock', '11', '', '', '', '', '', '', '0', '', '0', '00', ''),
(204, '	Littmann Electronic Stethoscope Black Tube 27\"', 1, 'Super Admin', 33, 'NA', 'NA', 0, '<p>When you want the best for yourself and your patients, look no further than the 3MTM Littmann&nbsp;Electronic Stethoscope Model 3200. It redefines what a stethoscope can do for you</p>\r\n\r\n<p>*Allows you to hear critical body sounds with 3MTM Littmann&nbsp;Stethoscope&#39;s proprietary ambient noise reduction technology which eliminates, on average, 85% of distracting background noises, without filtering out critical body sounds</p>\r\n\r\n<p>*Provides extra listening power when a heart, lung or body sound is especially faint such as of an obese patient or when clothing restricts your listening experience with its ability to amplify sounds 24X the sound level of a Littmann cardiology stethoscope</p>\r\n\r\n<p>*Let your patient listen to their own sounds; record multiple sounds in one patient and compare them or save up to twelve 30-second sounds on your stethoscope of multiple patients and file them electronically at your convenience; Seek a peer&#39;s opinion with the 12-track recording capabilities</p>\r\n\r\n<p>*Listen more carefully to sounds at half or full speed; in bell, diaphragm or extended range modes after they are recorded</p>\r\n\r\n<p>*Visualize your patient&#39;s heart sounds as a phonocardiogram</p>\r\n\r\n<p>*Analyze sounds with peers, attach sounds to medical records or review them online with colleagues by transmitting the sounds utilizing Bluetooth&nbsp;technology software included FREE with purchase</p>\r\n\r\n<p>*Comfortable and surprisingly lightweight like non-electronic cardiology stethoscopes (bul) Helps you focus on what you need to hear through its frictional noise reduction technology</p>\r\n\r\n<p>*Helps you focus on what you need to hear through its frictional noise reduction technology</p>\r\n\r\n<p>*Hear life-like sounds with the state-of-the-art sound sensor</p>\r\n\r\n<p>*Easy to operate</p>\r\n\r\n<p>*Withstands the rigors of your busy work day with its rugged design and two-year warranty</p>\r\n\r\n<p>*Patient comfort is assured when polymer versus metal is applied to your patient when using the nonchill rim and diaphragm</p>\r\n\r\n<p>*Excellent acoustic seal and comfortable fit with patented 3MTM Littmann&nbsp;Snap-Tight Soft Seal Eartips</p>\r\n\r\n<p>*Made in the U.S.A.</p>\r\n\r\n<p>*Warranty Period 2 years</p>\r\n', 'Electronic Stethoscopes', 915, '', '650', 0, '', '', 0, '-littmann-electronic-stethoscope-black-tube-27', '', 'Complete Medical', '', '', '2347249503e8d5a03924deae57bb10db.jpg', '2019-03-04 06:14:39', '1', '3M3200BK27', '', '', '', '', 'instock', '11', '', '', '', '', '', '', '0', '', '0', '00', ''),
(205, 'Sprague Rappaport-Type Stethoscopes', 1, 'Super Admin', 33, 'NA', 'NA', 0, '<p>Durable, chrome-plated zinc alloy rotating chestpiece features two inner drum seals, effectively preventing audio leakage * Includes: 5-in-1 interchangeable chest piece, stethoscope with soft vinyl eartips, three bell sizes, two spare diaphragm sizes, two spare eartip sets in two styles, chestpiece key for easy diaphragm replacement and accessory pouch * Latex-Free * Thick-walled vinyl tubing * Tube length: 22&quot;; total length: 30&quot; * Lifetime limited warranty</p>\r\n', 'Sprague-Rappaport Stethoscopes', 16, '', '12', 0, '', '', 0, 'sprague-rappaport-type-stethoscopes', '', 'Complete Medical', '', '', '574dca6347b0b269c7d87565a2b4dc5e.jpg', '2019-03-04 06:20:12', '1', '4015RBL', '', '', '', '', 'instock', '11', '', '', '', '', '', '', '0', '', '0', '00', ''),
(206, 'Dual Head Sethoscope 22\"', 1, 'Super Admin', 33, 'NA', 'NA', 0, '<p>22&quot;</p>\r\n\r\n<p>* Dual head stethoscope</p>\r\n\r\n<p>* 22&quot; tubing * Simple turn of stem quickly changes to non-chill Ford bell&nbsp;</p>\r\n', 'Dual Head Stethoscopes', 10, '', '6', 0, '', '', 0, 'dual-head-sethoscope-22', '', 'Complete Medical', '', '', '439f38efcf970b90df98434f31266520.jpg', '2019-03-04 06:23:51', '1', '4023', '', '', '', '', 'instock', '14', '', '', '', '', '', '', '0', '', '0', '00', ''),
(207, 'ADSCOPE Adult Acoustic Scope Lavender', 1, 'Super Admin', 33, 'NA', 'NA', 0, '<p>Combination adult size chestpiece precisely machined to exacting tolerances from surgical stainless steel for outstanding performance and rugged durability</p>\r\n\r\n<p>* Extra large bell (13/8&quot; diameter) for unsurpassed low frequency response</p>\r\n\r\n<p>* Ultra-sensitive diaphragm (17/8&quot; diameter) for greater amplification and crisper high frequency response</p>\r\n\r\n<p>* Color coordinated non-chill bell and diaphragm retaining rim for patient comfort</p>\r\n\r\n<p>* Stainless steel binaurals with double leaf internal spring fixed at 15&nbsp;angle for greater comfort</p>\r\n\r\n<p>* Reinforcing yoke molded into flexible 22&quot; PVC &quot;Y&quot; tubing</p>\r\n\r\n<p>* Adsoft deluxe PVC eartips (in small and large) for the ultimate in wearing comfort and acoustic seal</p>\r\n\r\n<p>* Spare diaphragm included</p>\r\n\r\n<p>* Scope ID Tag included</p>\r\n\r\n<p>* Weighs 6.5 oz.</p>\r\n\r\n<p>* Overall length 31&quot;</p>\r\n\r\n<p>* Lifetime Warranty&nbsp;</p>\r\n', 'Dual Head Stethoscopes', 80, '', '60', 0, '', '', 0, 'adscope-adult-acoustic-scope-lavender', '', 'Complete Medical', '', '', '839524eb20f1d6f45b5b0027a57be229.jpg', '2019-03-04 06:28:42', '1', 'ADC603LV', '', '', '', '', 'instock', '11', '', '', '', '', '', '', '0', '', '0', '00', ''),
(208, 'Pediatric Beam Scale With Tray & Tape (lbs/kgs)', 1, 'Super Admin', 33, 'NA', 'NA', 0, '<p>With Tray &amp; Measuring Tape</p>\r\n\r\n<p>* Heavy-duty steel base for improved strength and durability</p>\r\n\r\n<p>* Factory-calibrated to ensure accuracy</p>\r\n\r\n<p>* Easy-to-clean trays and seats guarantee long-lasting reliability</p>\r\n\r\n<p>* Rotating poise bars for dual reading of pounds and kilograms. Poise bar lock-in for error-free operation</p>\r\n\r\n<p>* Sanitary, ABS plastic tray with built-in measuring tape provides safety, reads up to 23&quot; x 1/4&quot; (58 cm x 1 cm)</p>\r\n\r\n<p>* Weight capacity: 130 Lbs x 1 Oz</p>\r\n\r\n<p>* 1 Year Limited Warranty</p>\r\n\r\n<p>* Shipping Carton Size: 13&quot;L x 11&quot;W x 4&quot;H&nbsp;</p>\r\n', 'Baby Scales', 890, '', '680', 0, '', '', 0, 'pediatric-beam-scale-with-tray-tape-lbs-kgs', '', 'Complete Medical', '', '', '6760f771ae034ee0e2331d6fd5231ca4.jpg', '2019-03-04 06:33:03', '1', '1522KL', '', '', '', '', 'instock', '12', '', '', '', '', '', '', '0', '', '0', '00', ''),
(209, '1524KL', 1, 'Super Admin', 33, 'NA', 'NA', 0, '<p>With Child Seat</p>\r\n\r\n<p>* Heavy-duty steel base for improved strength and durability</p>\r\n\r\n<p>* Factory-calibrated to ensure accuracy</p>\r\n\r\n<p>* Easy-to-clean trays and seats guarantee long-lasting reliability</p>\r\n\r\n<p>* Rotating poise bars for dual reading of pounds and kilograms. Poise bar lock-in for error-free operation</p>\r\n\r\n<p>* Sanitary, ABS plastic tray with built-in measuring tape provides safety, reads up to 23&quot; x 1/4&quot; (58 cm x 1 cm)</p>\r\n\r\n<p>* Weight capacity: 130 Lbs x 1 Oz</p>\r\n\r\n<p>* 1 Year Limited Warranty</p>\r\n\r\n<p>* Shipping Carton Size: 13&quot;L x 11&quot;W x 4&quot;H &nbsp;</p>\r\n\r\n<p>* Seat dimensions: 25&quot;L x 13&quot;W x 6 3/4&quot;D</p>\r\n', 'Baby Scales', 1050, '', '800', 0, '', '', 0, '1524kl', '', 'Complete Medical', '', '', 'ecd19ec87279bdf4bd5154c8676dff52.jpg', '2019-03-04 06:36:15', '1', '1524KL', '', '', '', '', 'instock', '12', '', '', '', '', '', '', '0', '', '0', '00', ''),
(210, 'ProPlus Clinical Scale w/Rail', 1, 'Super Admin', 33, 'NA', 'NA', 0, '<p>When patients are less mobile, our built-in, heavy-duty wheels help this scale move easily to them</p>\r\n\r\n<p>* Extremely durable and safe, the easy grip handrail and non-skid, oversized platform provide added support to unsteady patients</p>\r\n\r\n<p>* 180 degree swivel head for side read * Keypad entry with customizable 1&quot; backlit LCD display readout</p>\r\n\r\n<p>* Computer interface with a 270 patient memory</p>\r\n\r\n<p>* Motion-sensing weighing technology</p>\r\n\r\n<p>* 6 D alkaline batteries &amp; 120 AC adapter</p>\r\n\r\n<p>* Weight capacity: 1000 Lbs</p>\r\n\r\n<p>* 1 Year Warranty&nbsp;</p>\r\n', 'Specialty Scales', 4300, '', '3100', 0, '', '', 0, 'proplus-clinical-scale-w-rail', '', 'Complete Medical', '', '', '07627a9315876ec42b92b828a47a8393.jpg', '2019-03-04 06:40:19', '1', '2101KL', '', '', '', '', 'instock', '13', '', '', '', '', '', '', '0', '', '0', '00', ''),
(211, 'Bariatric Digital Chair Scale', 1, 'Super Admin', 33, 'NA', 'NA', 0, '<p>Motion sensing weighing technology</p>\r\n\r\n<p>* Large 1&quot; LCD display</p>\r\n\r\n<p>* Reweigh, LB/KG, On/Off buttons</p>\r\n\r\n<p>* Low battery Indicator and Auto-Off features</p>\r\n\r\n<p>* Movable arms for easy access, sanitary cushioned seat</p>\r\n\r\n<p>* Folding foot rest and side arms for patient comfort during weighing</p>\r\n\r\n<p>* 6 C-cell batteries (not included) &amp; 120V AC adapter power supply (included) (2595KL)</p>\r\n\r\n<p>* Heavy-duty wheels for mobility</p>\r\n\r\n<p>* 3 Year Warranty (2595KL)</p>\r\n\r\n<p>* Weight Capacity: 600 Lbs&nbsp;</p>\r\n', 'Specialty Scales', 2600, '', '1850', 0, '', '', 0, 'bariatric-digital-chair-scale', '', 'Complete Medical', '', '', '3f3cf6410cee00a1eb7c7fc980e9cf85.jpg', '2019-03-04 06:43:48', '1', '2595KL', '', '', '', '', 'instock', '12', '', '', '', '', '', '', '0', '', '0', '00', ''),
(212, 'Talking Body Fat Scale', 1, 'Super Admin', 33, 'NA', 'NA', 0, '<p>World&#39;s first talking body fat scale</p>\r\n\r\n<p>* Extra large, sturdy platform and speaks in clear unaccented American English</p>\r\n\r\n<p>* The Phoenix uses strain gauge technology to be incredibly accurate and precise</p>\r\n\r\n<p>* Talking feature can be turned on or off (for those times you may not want to hear it) * Perfect for anyone with poor eyesight</p>\r\n\r\n<p>* 10-User Memory personal data storage</p>\r\n\r\n<p>* Works in both weigh-only and body fat modes</p>\r\n\r\n<p>* Easy to use and program</p>\r\n\r\n<p>* Scuff-resistant Stainless Steel foot pads</p>\r\n\r\n<p>* 200kg x 0.1kg - 440lb x 0.2lb</p>\r\n\r\n<p>* Power: 4-AA batteries (included)</p>\r\n\r\n<p>* MODES: lb, kg</p>\r\n\r\n<p>* Scale Size 15.75&quot; x 12.75&quot; x 1.25&quot;</p>\r\n', 'Body Fat Analyzer/Scales', 160, '', '120', 0, '', '', 0, 'talking-body-fat-scale', '', 'Complete Medical', '', '', '3fc55271c661d2a5a92a220d947b3bc1.jpg', '2019-03-04 06:46:51', '1', '2629', '', '', '', '', 'instock', '15', '', '', '', '', '', '', '0', '', '0', '00', ''),
(213, 'ProPlus Wheelchair Ramp Digital Scale', 1, 'Super Admin', 33, 'NA', 'NA', 0, '<p>Pounds &amp; Kilograms</p>\r\n\r\n<p>* This scale has exclusive technology to compensate for any movement - critical to weighing patients in wheelchairs</p>\r\n\r\n<p>* Extremely durable, with state-of-the-art technology, this scale is a &quot;must-have&quot; for any long-term and acute facility</p>\r\n\r\n<p>* Large, oversized platform provides added support to unsteady patients and can be used with chairs, wheelchairs or as a stand-on scale</p>\r\n\r\n<p>* 180 degree swivel head for side read</p>\r\n\r\n<p>* Keypad entry with customizable 1&quot; backlit LCD display readout</p>\r\n\r\n<p>* USB and Serial Ports (2) for computer interface with a 270 patient memory and user-friendly menu screen</p>\r\n\r\n<p>* Motion-sensing weighing technology</p>\r\n\r\n<p>* 6 D size alkaline batteries &amp; 120 volt AC adapter</p>\r\n\r\n<p>* Weight capacity: 1000 Lbs x .2 Lb</p>\r\n\r\n<p>* 3 Year Limited Warranty&nbsp;</p>\r\n', 'Wheelchair Scales', 4700, '', '3800', 0, '', '', 0, 'proplus-wheelchair-ramp-digital-scale', '', 'Complete Medical', '', '', '', '2019-03-04 06:50:40', '1', '2500KL', '', '', '', '', 'instock', '12', '', '', '', '', '', '', '0', '', '0', '00', ''),
(214, 'Physicians Digital Waist High Scale 600 Lb Capacity', 1, 'Super Admin', 33, 'NA', 'NA', 0, '<p>BMI (easy scroll method)</p>\r\n\r\n<p>* Hold/Release, Zero, KG/LB, Clear, Enter functions</p>\r\n\r\n<p>* Auto-Zero, 5 minute auto-off (AC mode disabled), low battery indicator</p>\r\n\r\n<p>* Wheels and handle for maximum portability</p>\r\n\r\n<p>* Updatable firmware</p>\r\n\r\n<p>* RS232 Output Port</p>\r\n\r\n<p>* 6 C-cell batteries (not included) or 120V AC adapter (included)</p>\r\n\r\n<p>* Metallic Gray</p>\r\n\r\n<p>* Weight capacity: 600 lb / 272kg</p>\r\n\r\n<p>* 1 Year Warranty</p>\r\n\r\n<p>* Specifications Capacity: 600 lb / 272 kg Resolution: 0.2 lb / 0.1 kg Platform Size: 14 1/4&quot; (w) x 14 1/4&quot;(d) x 2 5/8&quot; (h)/362mm (w) x 362mm (d) x 67mm (h) Height Rod: Optional 499KLROD Display: 1&quot; LCD, 350&nbsp;Swivel Wheels: (2) Wheels for ease of movement Power Source: 110-240V adapter included, 6 C-cell batteries (not included) Connectivity: USB Warranty: 2 Year Limited Warranty</p>\r\n', 'Doctors/Physicians Scales', 1200, '', '820', 0, '', '', 0, 'physicians-digital-waist-high-scale-600-lb-capacity', '', 'Complete Medical', '', '', '352f8e2e9b66b16ef242b4d99b62c5f5.jpg', '2019-03-04 06:55:24', '1', '599KL', '', '', '', '', 'instock', '12', '', '', '', '', '', '', '0', '', '0', '00', ''),
(215, 'Seca 755 Mechanical Scale w/BMI', 1, 'Super Admin', 33, 'NA', 'NA', 0, '<p>The Seca 755 is one of the first mechanical column scales which, in addtion to displaying the weight, also displays the respective nutritional condition of the patient with the BMI function</p>\r\n\r\n<p>* When the patient mounts the scale, a &quot;BMI disc&quot; of contrasting color is set in motion below the very precise weight display in the large, clear dial</p>\r\n\r\n<p>* It is visible in a small window next to which a height scale is printed</p>\r\n\r\n<p>* Once the weight has been determined, it is easy to read the BMI range, with contrasting colors, is split up into underweight, normal and overweight as well as adiposity (abnormally overweight)</p>\r\n\r\n<p>* A flat tread area and practical transport castors are further advantages of the Seca 755</p>\r\n\r\n<p>* It can also be converted into a complete measuring and weighing station by fitting the optional measuring rod Seca 220</p>\r\n\r\n<p>* Weight Capacity: 350 lbs</p>\r\n\r\n<p>* Graduation: 1 lbs/500 g</p>\r\n\r\n<p>* Function: BMI</p>\r\n\r\n<p>* Alternative: kg/lbs version also available&nbsp;</p>\r\n', 'Scales Dial-Waist High', 1450, '', '980', 0, '', '', 0, 'seca-755-mechanical-scale-w-bmi', '', 'Complete Medical', '', '', '4bb87e4282f681d16fc8414467808681.jpg', '2019-03-04 06:58:33', '1', '6280', '', '', '', '', 'instock', '15', '', '', '', '', '', '', '0', '', '0', '00', ''),
(216, 'Chair Scale Detecto #475 (Lbs', 1, 'Super Admin', 32, 'NA', 'NA', 0, '<p>BEAM</p>\r\n\r\n<p>* Pounds Mfg.#475</p>\r\n\r\n<p>* Beam scale weight capacity: 350 Lbs x 4 Oz</p>\r\n\r\n<p>* Display: .7&quot; high contrast LCD</p>\r\n\r\n<p>* Lift away arms and footrests</p>\r\n\r\n<p>* Oversized wheels for transportation</p>\r\n\r\n<p>* Color: White with black seat &amp; armrests</p>\r\n\r\n<p>* Die cast beam (#475) readable from both sides</p>\r\n\r\n<p>* 1 Year Warranty&nbsp;</p>\r\n', 'Doctors/Physicians Scales', 1250, '', '905', 0, '', '', 0, 'chair-scale-detecto-475-lbs', '', 'Complete Medical', '', '', '6e4ce9a18d9c9ea83e15f56f1841607a.jpg', '2019-03-04 07:01:26', '1', '6293', '', '', '', '', 'instock', '14', '', '', '', '', '', '', '0', '', '0', '00', ''),
(217, 'Lens Paper Booklet (Each) (50 sheets)', 1, 'Super Admin', 33, 'NA', 'NA', 0, '<p>Soft and thin paper</p>\r\n\r\n<p>* 50 sheets per book * 4&quot; x 6&quot;</p>\r\n', 'Diagnostic - Microscope & Accessories', 5, '', '3', 0, '', '', 0, 'lens-paper-booklet-each-50-sheets', '', 'Complete Medical', '', '', '47c11e2472193c4681f8ce24cbde4708.jpg', '2019-03-04 07:05:35', '1', '215', '', '', '', '', 'instock', '12', '', '', '', '', '', '', '0', '', '0', '00', ''),
(218, 'Microscope Slides- Plain Pk/72', 1, 'Super Admin', 33, 'NA', 'NA', 0, '<p>Plain Bx/72</p>\r\n\r\n<p>* 3&quot; x 1&quot; x 1mm</p>\r\n\r\n<p>* Polished rounded corners&nbsp;</p>\r\n', 'Diagnostic -Microscope & Accessories', 10, '', '8', 0, '', '', 0, 'microscope-slides-plain-pk-72', '', 'Complete Medical', '', '', 'e634b3bae1386bff602d201ee0e3bd7c.jpg', '2019-03-04 07:08:11', '1', '217', '', '', '', '', 'instock', '13', '', '', '', '', '', '', '0', '', '0', '00', ''),
(219, 'Diagnostic Set Deluxe In Fitted Case', 1, 'Super Admin', 33, 'NA', 'NA', 0, '<p>*Set includes: an ophthalmoscope, otoscope with 3 aural &amp; 1 nasal specula, laryngeal and 2 post-nasal mirrors, metal tongue depressor and a bent arm throat lamp in a plastic carry case</p>\r\n', 'Diagnostic - Combined Otoscope & Opthal. Sets', 230, '', '175', 0, '', '', 0, 'diagnostic-set-deluxe-in-fitted-case', '', 'Complete Medical', '', '', '171511f8e140741ca619c6ec1e2fbca1.jpg', '2019-03-04 07:11:37', '1', '9740', '', '', '', '', 'instock', '12', '', '', '', '', '', '', '0', '', '0', '00', ''),
(220, 'Binocular Microscope w/Infinit Plan Achromat Obj.(#3000LED)', 1, 'Super Admin', 33, 'NA', 'NA', 0, '<p>Binocular viewing head, inclined 30, rotatable 360&nbsp;</p>\r\n\r\n<p>* HWF Plan 10x/20mm focusing eyepieces (paired - one w/pointer), with eyeguards * Reversed quadruple nosepiece</p>\r\n\r\n<p>* Infinity Plan achromat 4x, 10x, 40xR and 100xR oil objectives</p>\r\n\r\n<p>* Mechanical stage, 140 X 132mm</p>\r\n\r\n<p>* Abbe condenser, N.A. 1.25 with iris diaphragm (with slot for sliders)</p>\r\n\r\n<p>* Coaxial coarse and fine focusing controls</p>\r\n\r\n<p>* 3 watt LED variable illuminator</p>\r\n\r\n<p>* Dust cover, power cord, immersion oil and instruction manual</p>\r\n\r\n<p>* AS3000 has a 5 year limited warranty (this does not include the bulbs and fuses</p>\r\n', 'Diagnostic - Microscope & Accessories', 1700, '', '1250', 0, '', '', 0, 'binocular-microscope-w-infinit-plan-achromat-obj-3000led', '', 'Complete Medical', '', '', '6b231210f72151caf138de14ddb8cf00.jpg', '2019-03-04 07:15:12', '1', 'AS3000', '', '', '', '', 'instock', '11', '', '', '', '', '', '', '0', '', '0', '00', ''),
(221, 'Binocular Microscope w/Slider Phase Set 10x,40xR(3000LEDSPH)', 1, 'Super Admin', 33, 'NA', 'NA', 0, '<p>Binocular Microscope with Slider Phase Set 10x and 40xR</p>\r\n\r\n<p>* Binocular viewing head, inclined 30, rotatable 360&nbsp;</p>\r\n\r\n<p>* HWF Plan 10x/20mm focusing eyepieces (paired - one w/pointer), with eyeguards</p>\r\n\r\n<p>* Reversed quadruple nosepiece</p>\r\n\r\n<p>* Plan phase contrast 10x and 40xR objectives</p>\r\n\r\n<p>* Mechanical stage, 140 X 132mm</p>\r\n\r\n<p>* Abbe condenser, N.A. 1.25 with (1) phase slider with 10x &amp; 40x annuli and Brightfield position, green filter and centering telescope</p>\r\n\r\n<p>* Coaxial coarse and fine focusing controls</p>\r\n\r\n<p>* 3 watt LED variable illuminator</p>\r\n\r\n<p>* Dust cover, power cord, immersion oil and instruction manual</p>\r\n', 'Diagnostic - Microscope & Accessories', 1850, '', '1400', 0, '', '', 0, 'binocular-microscope-w-slider-phase-set-10x-40xr-3000ledsph', '', 'Complete Medical', '', '', 'f392e430f3a84374e3b998a5b92adadc.jpg', '2019-03-04 07:21:57', '1', 'AS3000PH', '', '', '', '', 'instock', '12', '', '', '', '', '', '', '0', '', '0', '00', '');
