(222, 'Trinocular Microscope With Slider Phase Set-10x and 40xR', 1, 'Super Admin', 33, 'NA', 'NA', 0, '<p>Trinocular Microscope with Silder Phase Set - 10x and 40xR</p>\r\n\r\n<p>* With trinocular viewing head (50/50 light split)</p>\r\n\r\n<p>* HWF Plan 10x/20mm focusing eyepieces (paired - one w/pointer), with eyeguards</p>\r\n\r\n<p>* Reversed quadruple nosepiece</p>\r\n\r\n<p>* Plan phase contrast 10x and 40xR objectives</p>\r\n\r\n<p>* Mechanical stage, 140 X 132mm</p>\r\n\r\n<p>* Abbe condenser, N.A. 1.25 with (1) phase slider with 10x &amp; 40x annuli and Brightfield position, green filter and centering telescope</p>\r\n\r\n<p>* Coaxial coarse and fine focusing controls 3 watt LED variable illuminator Dust cover, power cord, immersion oil and instruction manua</p>\r\n', 'Diagnostic - Microscope & Accessories', 2100, '', '1450', 0, '', '', 0, 'trinocular-microscope-with-slider-phase-set-10x-and-40xr', '', 'Complete Medical', '', '', 'cdef18614764f28e682ae46bb7a3e569.jpg', '2019-03-04 07:24:44', '1', 'AS3001PH', '', '', '', '', 'instock', '13', '', '', '', '', '', '', '0', '', '0', '00', ''),
(223, 'Cardiovit AT-1 ECG Machine With Interpretation-3 Channel', 1, 'Super Admin', 33, 'NA', 'NA', 0, '<p>3 channel representation of all 12 simultaneously acquired leads</p>\r\n\r\n<p>* Automatic and manual mode</p>\r\n\r\n<p>* Multiple report formats, copy function, various recording speeds</p>\r\n\r\n<p>* Integrated rechargeable battery and integrated power supply</p>\r\n\r\n<p>* One button operation</p>\r\n\r\n<p>* Built-in thermal printer</p>\r\n\r\n<p>* Lightweight (2.9 kg/6.7 lbs)</p>\r\n', 'Diagnostic - ECG- Electrocardiograph', 4200, '', '3200', 0, '', '', 0, 'cardiovit-at-1-ecg-machine-with-interpretation-3-channel', '', 'Complete Medical', '', '', 'f45005efc831c611b8988bedf5330b4e.jpg', '2019-03-04 07:28:08', '1', 'AT1', '', '', '', '', 'instock', '13', '', '', '', '', '', '', '0', '', '0', '00', ''),
(224, 'Welch Allyn Pan Optic Ophthalmoscope', 1, 'Super Admin', 33, 'NA', 'NA', 0, '<p>With Cobalt-Blue Filter And Add-On Corneal Magnifying Lens</p>\r\n\r\n<p>* The revolutionary PanOptic provides easy entry into the eye, together with a wider field of view to more easily observe conditions such as hypertension, diabetic retinopathy, and papilledema</p>\r\n\r\n<p>* Fast entry into undilated pupils</p>\r\n\r\n<p>* 5x larger view of the fundus vs. standard scopes in an undilated eye</p>\r\n\r\n<p>* 25 degree field of view vs. the standard 5o field of view</p>\r\n\r\n<p>* Greater working distance improves comfort for both practitioner and patient</p>\r\n\r\n<p>* Detect with cobalt blue fiber and magnifying lens corneal abrasions</p>\r\n\r\n<p>* Compatible with all existing Welch Allyn 3.5v power sources&nbsp;</p>\r\n', 'Diagnostic - Opthalmoscopes Heads', 1300, '', '860', 0, '', '', 0, 'welch-allyn-pan-optic-ophthalmoscope', '', 'Complete Medical', '', '', 'c5550a39721d64fd9afec0a38c0ab705.jpg', '2019-03-04 08:25:52', '1', 'WA11810', '', '', '', '', 'instock', '13', '', '', '', '', '', '', '0', '', '0', '00', ''),
(225, 'elch Allyn PanOptic Ophthalmoscope', 1, 'Super Admin', 33, 'NA', 'NA', 0, '<p>With Cobalt-Blue Filter And Add-On Corneal Magnifying Lens</p>\r\n\r\n<p>* The revolutionary PanOptic provides easy entry into the eye, together with a wider field of view to more easily observe conditions such as hypertension, diabetic retinopathy, and papilledema</p>\r\n\r\n<p>* Fast entry into undilated pupils</p>\r\n\r\n<p>* 5x larger view of the fundus vs. standard scopes in an undilated eye</p>\r\n\r\n<p>* 25 degree field of view vs. the standard 5o field of view</p>\r\n\r\n<p>* Greater working distance improves comfort for both practitioner and patient</p>\r\n\r\n<p>* Detect with cobalt blue fiber and magnifying lens corneal abrasions</p>\r\n\r\n<p>* Compatible with all existing Welch Allyn 3.5v power sources</p>\r\n', 'Diagnostic - Opthalmoscopes Heads', 1300, '', '880', 0, '', '', 0, 'elch-allyn-panoptic-ophthalmoscope', '', 'Complete Medical', '', '', '80bb7f375b9c01c17453237e92fa06f4.jpg', '2019-03-04 08:32:11', '1', 'WA11810', '', '', '', '', 'instock', '14', '', '', '', '', '', '', '0', '', '0', '00', ''),
(226, 'Bed Pan Stainless Steel', 1, 'Super Admin', 32, 'NA', 'NA', 0, '<p>Stainless Steel</p>\r\n\r\n<p>* Resistant to stains &amp; cracks</p>\r\n\r\n<p>* 350# weight capacity</p>\r\n\r\n<p>* 14&quot; x 12&quot; x 4&quot;&nbsp;</p>\r\n', 'Bed Pans', 85, '', '65', 0, '', '', 0, 'bed-pan-stainless-steel', '', 'Complete Medical', '', '', 'a5f2c5cf649ed47eba5b9295abfdceb0.jpg', '2019-03-06 03:46:06', '1', '7089', '', '', '', '', 'instock', '12', '', '', '', '', '', '', '0', '', '0', '00', ''),
(227, 'Advair', 1, 'Super Admin', 36, 'NA', 'NA', 0, '<p>Advair is a combination of&nbsp;fluticasone propionate, a corticosteroid and salmeterol, a beta2-adrenergic bronchodilator. It is available as a metered-dose inhaler (HFA) or as an inhalation powder (Diskus).</p>\r\n\r\n<p>Advair Diskus&nbsp;is specifically indicated for the treatment of asthma in patients aged 4 years and older and the maintenance treatment of airflow obstruction and reducing exacerbations in patients with chronic obstructive pulmonary disease. Advair HFA is specifically indicated&nbsp;for treatment of asthma in patients aged 12 years and older.</p>\r\n\r\n<p>Advair Diskus is supplied as an inhalation powder for&nbsp;oral inhalation only. The recommended dose for the treatment of asthma in patients aged 12 years and older is 1 inhalation of Advair Diskus&nbsp;100/50, Advair Diskus&nbsp;250/50, or Advair Diskus&nbsp;500/50 twice daily. Starting dosage is based on asthma severity. The recommended dose for the treatment of asthma in patients aged 4 to 11 years is 1 inhalation of Advair Diskus&nbsp;100/50 twice daily. The recommended dose for the maintenance treatment of COPD is 1 inhalation of Advair Diskus&nbsp;250/50 twice daily.</p>\r\n\r\n<p>Adviar HFA is supplied as a metered dose inhaler for&nbsp;oral inhalation only. The recommended dose for the treatment of asthma in patients aged 12 years and older is 2 inhalations of Advair HFA 45/21, 115/21, or 230/21 twice daily. The starting dosage is based on asthma severity.</p>\r\n', 'Advair Diskus 500 Mcg-50 Mcg/Dose Powder For Inhalation', 25, '', '25', 0, '', '', 0, 'advair', '', 'Bloomtown', '', '', '198e7454b0ffa0df578b120722f212c0.jpg', '2019-03-08 06:51:48', '1', '', '', '', '', '', 'instock', '11', '', '', '', '', '', '', '1', '', '0', '50', ''),
(228, 'Accolate', 1, 'Super Admin', 37, 'NA', 'NA', 0, '<p>For the use of Accolate 10 mg oral Tablets for the prophylaxis and chronic treatment of asthma in pediatric patients 7 - 11 years of age.</p>\r\n', 'Accolate 10 Mg Tablet', 25, '', '15', 0, '', '', 0, 'accolate', '', 'Bloomtown', '', '', '061a477fa13db822b6ce1c9118d4053f.jpg', '2019-03-08 06:58:31', '1', '', '', '', '', '', 'instock', '12', '', '', '', '', '', '', '1', '', '0', '35', ''),
(229, 'Standard Manual wheelchair', 146, 'Shaka', 3, 'NA', 'NA', 0, '<p>Testing</p>\r\n', 'Testing', 15, '', '12', 0, '', '', 0, 'standard-manual-wheelchair', '', 'Bloomtown', '', '', '6ec6018ae2e255bc3f5202296ccdd711.jpg', '2019-03-08 07:02:55', '1', '3', '', '', '', '', 'instock', '12', '', '', '', '', '', '', '1', '', '0', '25', ''),
(230, 'Pediasure Pack of 16', 1, 'Super Admin', 34, 'ICD10', 'HCPCS', 0, '<ul>\r\n	<li>A source of complete, balanced nutrition especially designed for children 2 to 13 years of age.</li>\r\n	<li>#1 Pediatrician recommended brand.</li>\r\n	<li>Meets or exceeds 100% of the DRIs for protein and 25 essential vitamins and minerals\r\n	<ul>\r\n		<li>in 1000 mL for children 2 to 8 years of age.</li>\r\n		<li>in 1500 mL for children 9 to 13 years of age.</li>\r\n	</ul>\r\n	</li>\r\n	<li>Antioxidants (vitamins C &amp; E and selenium) to support the immune system.</li>\r\n	<li>DHA Omega-3&dagger;&nbsp;for brain and eye health.6</li>\r\n	<li>Halal.</li>\r\n	<li>Kosher.</li>\r\n	<li>Gluten-free.</li>\r\n	<li>Suitable for lactose intolerance.</li>\r\n	<li>Come in&nbsp;different flavors</li>\r\n</ul>\r\n', 'Most HMO\'s Plans Accepted', 40, '', '30', 0, '', '', 0, 'pediasure-pack-of-16', '', 'Abbott', '', '', 'a6101c460c73763f44c72ce7bea82804.png', '2019-03-08 09:52:44', '1', '4', '', '', '', '', 'instock', '12', '', '', '', '', '', '', '1', '', '0', '45', ''),
(231, 'Transport Wheelchair Bariatric 20\" Wide Blue', 1, 'Super Admin', 3, 'ICD10', 'HCPCS,E1039', 0, '<p>20&quot; Seat Width</p>\r\n\r\n<p>* Blue Frame and Black Upholstery</p>\r\n\r\n<p>* Dual, reinforced steel cross braces</p>\r\n\r\n<p>* Reinforced steel frame provides added support</p>\r\n\r\n<p>* Heavy-duty, nylon reinforced upholstery with a back carry pouch</p>\r\n\r\n<p>* Removable, reversible desk length arms</p>\r\n\r\n<p>* Adjustable leg support</p>\r\n\r\n<p>* 12&quot; flat free rear wheels</p>\r\n\r\n<p>* Weight Capacity: 450 lbs</p>\r\n\r\n<p>* Limited Lifetime Warranty&nbsp;</p>\r\n\r\n<p>Overall width: 24.5&quot; (open), 9&quot; (closed)</p>\r\n\r\n<p>* Overall height: 37&quot;</p>\r\n\r\n<p>* Seat to floor height: 19.5&quot;</p>\r\n\r\n<p>* Back height: 16&quot;</p>\r\n\r\n<p>* Seat depth: 18&quot;</p>\r\n\r\n<p>* Overall length w/ riggings: 38&quot;</p>\r\n\r\n<p>* Product weight: 45 lbs</p>\r\n\r\n<p>* Carton shipping weight: 50 lbs</p>\r\n', 'Most HMO\'s Plan accepted', 500, '', '378', 0, '', '', 0, 'transport-wheelchair-bariatric-20-wide-blue', '', 'Complete Medical', '', '', '5273c290004b881b71c9b953fdc3b705.jpg', '2019-03-10 05:52:19', '1', '10952A', '', '', '', '', 'instock', '11', '', '', '', '', '', '', '1', '', '0', '00', ''),
(232, 'Wheelchair Transport Lightweight Red 19\"', 1, 'Super Admin', 3, 'ICD10', 'HCPCS,E1038', 0, '<p>19&quot; BlACK UPHOLSTERY</p>\r\n\r\n<p>* Red Frame</p>\r\n\r\n<p>* Aluminum frame is lightweight and strong</p>\r\n\r\n<p>* Composite 8&quot; wheels are lightweight and maintenance free</p>\r\n\r\n<p>* Both 17&quot; and 19&quot; come with swing-away footrests</p>\r\n\r\n<p>* Padded armrests provide additional comfort</p>\r\n\r\n<p>* Nylon upholstery is comfortable, lightweight and easy to clean.</p>\r\n\r\n<p>* Aluminum casted back release hinge allows back to fold down for easy storage and transport</p>\r\n\r\n<p>* Standard rear wheel locks</p>\r\n\r\n<p>* Overall width w/ 17&quot; seat: 20&quot; (open), 9&quot; (closed)</p>\r\n\r\n<p>* Overall width w/ 19&quot; seat: 22&quot; (open), 9&quot; (closed)</p>\r\n\r\n<p>* Overall height: 39.5&quot;</p>\r\n\r\n<p>* Seat to floor height: 19&quot;</p>\r\n\r\n<p>* Back height: 18&quot;</p>\r\n\r\n<p>* Seat depth: 16&quot;</p>\r\n\r\n<p>* Overall length w/ riggings: 33&quot;</p>\r\n\r\n<p>* Weighs only 19 lbs</p>\r\n\r\n<p>* Carton shipping weight: 24 lbs</p>\r\n\r\n<p>* Weight Capacity: 300 lbs</p>\r\n\r\n<p>* Limited Lifetime Warranty</p>\r\n', 'Most HMO\'s Plan Accepted. Must Complete CMN for This Order', 210, '', '166', 0, '', '', 0, 'wheelchair-transport-lightweight-red-19', '', 'Complete Medical', '', '', '8497f20bdcc2c7289767ce6bacd2f4af.jpg', '2019-03-10 05:59:32', '1', '10950J', '', '', '', 'c8d5e204672a307adcc6bbd88ea1515a.jpg,fb1a2d33807142634a911c48d90b34f4.jpg,1def3a656fd0dab2b2c7fba9cd5a79e4.jpg', 'instock', '12', '', '', '', '', '', '', '1', '', '0', '00', ''),
(233, 'Wheelchair Transport Lightweight Silver 17\"', 1, 'Super Admin', 3, 'ICD10', 'HCPCS', 0, '<p>17&quot; BlACK UPHOLSTERY</p>\r\n\r\n<p>* Silver Frame</p>\r\n\r\n<p>* Weighs only 19 lbs</p>\r\n\r\n<p>* Aluminum frame is lightweight and strong</p>\r\n\r\n<p>* Composite 8&nbsp;wheels are lightweight and maintenance free</p>\r\n\r\n<p>* Both 17&quot; and 19&quot; come with swing-away footrests with heel loops</p>\r\n\r\n<p>* Padded armrests provide additional comfort</p>\r\n\r\n<p>* Nylon upholstery is comfortable, lightweight and easy to clean</p>\r\n\r\n<p>* Aluminum casted back release hinge allows back to fold down for easy storage and transport</p>\r\n\r\n<p>* Standard rear wheel locks</p>\r\n\r\n<p>* Includes Seat Belt</p>\r\n\r\n<p>* Limited Lifetime Warranty</p>\r\n\r\n<p>* Weight Capacity: 275 Lbs.&nbsp;</p>\r\n', 'Most HMO\'s Accepted. Must Complete CMN for Insurance Payment Option.', 210, '', '152', 0, '', '', 0, 'wheelchair-transport-lightweight-silver-17', '', 'Complete Medical', '', '', 'ee94560a14674b1161deb6c43811dd9d.jpg', '2019-03-10 06:12:23', '1', '10950S', '', '', '', '99fad8eafe55f9ef02694577f30b8d75.jpg,f9d79d68a6d0589fd00f8d6272120e93.jpg,5ced5623a1a7cbe6e96ee984347682c1.jpg,23f616be55d77fbf23f0f862262f1ca7.jpg', 'instock', '12', '', '', '', '', '', '', '1', '', '0', '00', ''),
(234, 'Transport Wheelchair Bariatric 22\" Wide Blue', 1, 'Super Admin', 3, 'ICD10', 'HCPCS,E1039', 0, '<p>22&quot; SEAT WIDTH</p>\r\n\r\n<p>* Blue Frame and Black Upholstery</p>\r\n\r\n<p>* Dual, reinforced steel cross braces</p>\r\n\r\n<p>* Reinforced steel frame provides added support</p>\r\n\r\n<p>* Heavy-duty, nylon reinforced upholstery with a back carry pouch</p>\r\n\r\n<p>* Removable, reversible desk length arms</p>\r\n\r\n<p>* Adjustable leg support</p>\r\n\r\n<p>* 12&quot; flat free rear wheels</p>\r\n\r\n<p>* Weight Capacity: 450 lbs</p>\r\n\r\n<p>* Limited Lifetime Warranty</p>\r\n\r\n<p>&nbsp;* Overall width: 26.5&quot; (open), 11.5&quot; (closed)</p>\r\n\r\n<p>* Overall height: 35.5&quot;</p>\r\n\r\n<p>* Seat to floor height: 19.5&quot;</p>\r\n\r\n<p>* Back height: 16&quot; * Seat depth: 18&quot;</p>\r\n\r\n<p>* Overall length w/ riggings: 38&quot;</p>\r\n\r\n<p>* Product weight: 49 lbs</p>\r\n\r\n<p>* Carton shipping weight: 54 lbs</p>\r\n', 'Most HMO\'s Plans are Accepted. Must Complete CMN for Insurance Payment Option Processing', 500, '', '355', 0, '', '', 0, 'transport-wheelchair-bariatric-22-wide-blue', '', 'Complete Medical', '', '', '30fb6e6b19f9970c86b5a06d3e404141.jpg', '2019-03-10 06:17:47', '1', '10952D', '', '', '', '6fe01e6e55a0c0e88d5c4636d6f2f637.JPG', 'instock', '13', '', '', '', '', '', '', '1', '', '0', '00', ''),
(235, 'Wheelchair, Sentra Heavy Duty Extra Wide, 30\"', 1, 'Super Admin', 3, 'ICD10', 'HCPCS', 0, '<p>700 lb. Weight Capacity</p>\r\n\r\n<p>* Carbon steel frame with TRIPLE coated chrome for an attractive, chip-proof, maintainable finish</p>\r\n\r\n<p>* Reinforced steel gussets at all weight bearing points provide additional strength</p>\r\n\r\n<p>* Durable reinforced nylon upholstery</p>\r\n\r\n<p>* Extra large, padded armrests provide comfort and support</p>\r\n\r\n<p>* Steel, spoke wheels are strong and maintenance free</p>\r\n\r\n<p>* Precision sealed wheel bearings in front and rear ensure long lasting performance and reliability</p>\r\n\r\n<p>* Extra large heavy duty, aluminum footplates provide maximum support, are attractive and crack proof</p>\r\n\r\n<p>* Heavy duty, flat free 8&quot; front casters are adjustable in 3 positions</p>\r\n\r\n<p>* Extra heavy duty front forks</p>\r\n\r\n<p>* Reinforced side frame, caster journals and dual cross bars</p>\r\n\r\n<p>* Comes with push to lock wheel locks</p>\r\n\r\n<p>* Limited Lifetime Warranty&nbsp;</p>\r\n', 'Most HMO\'s Plans accepted. Must Complete CMN for Insurance Payment Option Processing', 1300, '', '980', 0, '', '', 0, 'wheelchair-sentra-heavy-duty-extra-wide-30', '', 'Complete Medical', '', '', '9e4388b4fd504b573e76ae97fd28efb0.jpg', '2019-03-10 06:24:22', '1', '10956Q', '', '', '', '', 'instock', '14', '', '', '', '', '', '', '1', '', '0', '00', ''),
(236, 'Bariatric Wheelchair Rem Full Arms 22\" Wide w/ ELR', 1, 'Super Admin', 3, 'ICD10', 'HCPCS,K0007,K0195,E0990', 0, '<p>REMOVABLE FULL ARMS</p>\r\n\r\n<p>* 22&quot;</p>\r\n\r\n<p>* Product weight 56 lbs</p>\r\n\r\n<p>* Weight Capcity 500 lbs</p>\r\n\r\n<p>* Carbon-steel frame with triple coated chrome for an attractive, chip-proof, maintainable finish</p>\r\n\r\n<p>* Reinforced steel gussets at all weight bearing points, provide additional strength</p>\r\n\r\n<p>* Durable, heavy-gauge naugahyde upholstery</p>\r\n\r\n<p>* Padded armrests add to patient comfort</p>\r\n\r\n<p>* Composite Mag-style wheels are lightweight and maintenance free</p>\r\n\r\n<p>* Comes with carry pocket in backrest</p>\r\n\r\n<p>* 8&quot; front casters and precision sealed wheel bearings in front and rear ensure long lasting performance and reliability</p>\r\n\r\n<p>* Aluminum footplates are attractive, crack-proof and lightweight</p>\r\n\r\n<p>* Standard dual axle provides easy transition of seat to hemi-level</p>\r\n\r\n<p>* Reinforced side frame, caster journals and dual cross bars</p>\r\n\r\n<p>* Black upholstery and chrome frame</p>\r\n\r\n<p>* Limited Lifetime Warranty</p>\r\n\r\n<p>* Weight Capacity: 500 Lbs.</p>\r\n', 'Most HMO\'s Plans Accepted. Must Complete CMN for Insurance Payment Option Processing', 700, '', '500', 0, '', '', 0, 'bariatric-wheelchair-rem-full-arms-22-wide-w-elr', '', 'Complete Medical', '', '', 'f547ffa9e3050e386d3a8c3a87bd27dc.jpg', '2019-03-10 06:31:16', '1', '10959M', '', '', '', '7f43b2f7e74d8a6f3fd1622e277666ac.JPG', 'instock', '12', '', '', '', '', '', '', '1', '', '0', '00', ''),
(237, 'Viper Plus GT 16\" Wheelchair w/Adj Height Desk Arms & ELR', 1, 'Super Admin', 3, 'ICD10', 'HCPCS', 0, '<p>Adjustable seat rail extension and upholstery with 2&quot; extension easily adjusts from 16&quot; to 18&quot; (patent pending)</p>\r\n\r\n<p>* Deluxe high strength, lightweight, all aluminum frame.</p>\r\n\r\n<p>* Dual axle allows for multiple seat to floor height positions</p>\r\n\r\n<p>* Adjustable height, flip back, removable, padded arms</p>\r\n\r\n<p>* Weighs under 32 lbs. (excluding front rigging)</p>\r\n\r\n<p>* Over center cross brace eliminates seat guides, works with seating and positioning accessories</p>\r\n\r\n<p>* Adjustable angle back easily adjusts from 5&nbsp;- 20&nbsp;</p>\r\n\r\n<p>* Adjustable height back adjusts from 17&quot; - 19&quot; in 1&quot; increments, easily adaptable for individual patient needs</p>\r\n\r\n<p>* Adjustable height arms extend from 10&quot; to 14&quot;</p>\r\n\r\n<p>* Durable, heavy gauge, flame retardant, nylon upholstery with Velcro modesty flaps resists mildew and bacteria</p>\r\n\r\n<p>* Quick release, 24&quot; composite Mag-style wheels are lightweight and maintenance free</p>\r\n\r\n<p>* Precision sealed wheel bearings in front and rear ensure long lasting performance and reliability</p>\r\n\r\n<p>* Adjustable angle caster forks have 3 height adjustments and angle adjustability</p>\r\n\r\n<p>* Tool free adjustable swing away footrests also feature easy to access release handles</p>\r\n\r\n<p>* Urethane rear tires and casters offer superior performance, smoother ride and are lightweight</p>\r\n\r\n<p>* Adjustable anti-tipper with flip-up wheels that never needs to be removed</p>\r\n\r\n<p>* Comes with push to lock wheel locks</p>\r\n\r\n<p>* Limited Lifetime warranty</p>\r\n\r\n<p>* Weight capacity: 300 lbs</p>\r\n', 'Most HMO\'s Plans Accepted. Must Complete CMN for Insurance Payment Option Processing', 800, '', '650', 0, '', '', 0, 'viper-plus-gt-16-wheelchair-w-adj-height-desk-arms-elr', '', 'Complete Medical', '', '', '9cf8cc735a9787aa9187c2bd462c03fd.jpg', '2019-03-10 06:37:01', '1', '10960J', '', '', '', '', 'instock', '14', '', '', '', '', '', '', '1', '', '0', '00', ''),
(238, 'Wheelchair Full Reclining 22\" W/Removable Desk Arms', 1, 'Super Admin', 3, 'ICD10', 'HCPCS', 0, '<p>DESK ARMS</p>\r\n\r\n<p>* 22&quot;</p>\r\n\r\n<p>* Weight 55 lbs</p>\r\n\r\n<p>* Weight Capcity 450 lbs</p>\r\n\r\n<p>* New state-of-the-art hydraulic reclining mechanism allows for infinite adjustments up to 180 degrees</p>\r\n\r\n<p>*Padded armrests provide added patient comfort</p>\r\n\r\n<p>* Comes standard with swing-away elevating legrests</p>\r\n\r\n<p>* Wheels set back on frame prevents tipping</p>\r\n\r\n<p>* Precision sealed wheel bearings in front and rear ensure long lasting performance and reliability</p>\r\n\r\n<p>* Standard dual axle provides easy transition of seat to hemi-level</p>\r\n\r\n<p>* Aluminum footplates are atractive, crack-proof and lightweight</p>\r\n\r\n<p>* Front caster forks are adjustable in 3 positions</p>\r\n\r\n<p>* Rear anti-tippers standard</p>\r\n\r\n<p>* Weight Limit: 4500 Lbs.&nbsp;</p>\r\n', 'Most HMO\'s Plan Accepted. Must Complete CMN for Insurance Payment Processing', 1400, '', '990', 0, '', '', 0, 'wheelchair-full-reclining-22-w-removable-desk-arms', '', 'Complete Medical', '', '', '129f27546283a273e673f13812883e42.jpg', '2019-03-10 06:43:04', '1', '10966P', '', '', '', '', 'instock', '11', '', '', '', '', '', '', '1', '', '0', '00', ''),
(239, 'Desk Arms 12\"  Light weigh Wheelchair  w/ELR/Ew/Flip-Bk Rem ', 1, 'Super Admin', 3, 'ICD10', 'HCPCS', 0, '<p>The Drive Medical Viper is a versatile wheelchair right out of the box and it is easier to propel and transport than an average weight wheelchair</p>\r\n\r\n<p>*The Viper comes standard with adjustable padded arms, multiple seat to floor height positions, anti-tippers with flip-up wheels which never have to be removed and push to lock wheel locks</p>\r\n\r\n<p>*The back is height adjustable to provide added patient comfort</p>\r\n\r\n<p>*The carbon steel frame is high strength while remaining lightweight</p>\r\n\r\n<p>*The wheelchair upholstery is made of durable nylon which is flame retardant and resists mildew and bacteria for long lasting comfort and cleanliness</p>\r\n\r\n<p>*These comfort options make the Viper from Drive Medical an ideal wheelchair for anybody that needs to be in a wheelchair for extended periods of time</p>\r\n\r\n<p>*This wheelchair is available with various arm styles, seat widths, and swing away footrests or elevating legrests</p>\r\n\r\n<p>*Features: *8&quot; front casters have 3 height adjustments</p>\r\n\r\n<p>*Back height adjustable from 18&quot; - 20&quot;</p>\r\n\r\n<p>*Carbon steel black powder coated frame double coated for an attractive, chip-proof, maintainable finish</p>\r\n\r\n<p>*Comes standard with flip up anti tippers *Comes with push to lock wheel locks</p>\r\n\r\n<p>*Comes with swing-away footrests or elevating legrests with tool-free adjustable length riggings</p>\r\n\r\n<p>*Composite footplates with heel loops are durable and lightweight *Composite mag-style wheels with aluminum hand rims are lightweight and maintenance free</p>\r\n\r\n<p>*Composite steel lined front receiver is angled so the arm will lock into place every time</p>\r\n\r\n<p>*Dual axle provides easy transition of seat height to hemi level</p>\r\n\r\n<p>*Durable, flame retardant nylon upholstery resists mildew and bacteria</p>\r\n\r\n<p>*Easier to propel and transport</p>\r\n\r\n<p>*Flip-back arms, allow for easy transfer</p>\r\n\r\n<p>*Frame style eliminates seat guides and allows for custom backs and accessories</p>\r\n\r\n<p>*Nylon padded armrests provide added patient comfort</p>\r\n\r\n<p>*Precision sealed wheel bearings in front and rear ensure long lasting performance and reliability</p>\r\n\r\n<p>*The front mounted release lever can be flipped up or down depending on the patients needs</p>\r\n\r\n<p>*Urethane rear tires and casters offer superior performance, smoother ride and are lightweight</p>\r\n\r\n<p>* Viper weighs 32 lbs (Excluding front rigging)</p>\r\n', 'Most HMO\'s Plans Accepted. Must Complete CMN for Insurance Payment Processing', 730, '', '595', 0, '', '', 0, 'desk-arms-12-light-weigh-wheelchair-w-elr-ew-flip-bk-rem', '', 'Complete Medical', '', '', '108085ab0df5b468eb2edff11cd67ddc.jpg', '2019-03-10 06:53:39', '1', '10967A-ELR', '', '', '', '', 'instock', '15', '', '', '', '', '', '', '1', '', '0', '00', ''),
(240, '	Combination Rollator & Transport Wheelchair', 1, 'Super Admin', 2, 'ICD10', 'HCPCS', 0, '<p>* Combines the features of a rollator with a transport chair all in one unit</p>\r\n\r\n<p>* An individual can ambulate independently or be pushed safely by a caregiver</p>\r\n\r\n<p>* The footrests flip-down and the padded backrest is reversible depending on whether you are using it as a rollator or transport chair</p>\r\n\r\n<p>* Equipped large non-marring 8&quot; black casters with soft grip tires, ideal for both indoor and outdoor use</p>\r\n\r\n<p>* Easy-to-operate ergonomic hand brakes</p>\r\n\r\n<p>* Water-resistant nylon pouch attaches under seat for added privacy and security of personal items</p>\r\n\r\n<p>* Fold-strap for easy storage and transport</p>\r\n\r\n<p>* Designed to meet all your patients&nbsp;fundamental needs</p>\r\n\r\n<p>* Height adjustable for a custom fit</p>\r\n\r\n<p>* Supports patient weights up to 250 pounds</p>\r\n\r\n<p>* Lightweight aluminum frame</p>\r\n\r\n<p>* Reversible padded backrest for easy conversion from rollator to transport mode</p>\r\n\r\n<p>* Comfortable, flip-up padded seat</p>\r\n\r\n<p>* Overall Width: 24&quot;</p>\r\n\r\n<p>* Width between Hand Grips: 19&quot;</p>\r\n\r\n<p>* Seat Dimensions: 14.25&quot; (W) x 13.25&quot; (D)</p>\r\n\r\n<p>* Seat-to-Floor Height: 21.75&quot;</p>\r\n\r\n<p>* Weight Capacity: 250 lb</p>\r\n\r\n<p>* Wheel Size: 8&quot; * Product Weight: 22 lb</p>\r\n\r\n<p>* Carton Dimensions: 25&quot; x 10.2&quot; x 34.25&quot;</p>\r\n\r\n<p>* Shipping Weight: 25 lb</p>\r\n\r\n<p>* Warranty: Limited lifetime on frame, One year on all parts&nbsp;</p>\r\n', 'Covered by Medicare Part B, Medicaid, and Most HMO\'s', 220, '', '130', 0, '', '', 0, '-combination-rollator-transport-wheelchair', '', 'Complete Medical', '', '', '9819d8bec5b690f85c3d7fe301957737.jpg', '2019-03-10 07:00:15', '1', '11040A', '', '', '', '', 'instock', '13', '', '', '', '', '', '', '1', '', '0', '00', ''),
(241, 'Knee Walker Adult', 1, 'Super Admin', 2, 'ICD10', 'HCPCS', 0, '<p>Adult knee walker</p>\r\n\r\n<p>* Conveniently folds for storage and transport</p>\r\n\r\n<p>* Brake can be adjusted for either right or left handed use</p>\r\n\r\n<p>* Quick and easy adjustments for right or left leg support</p>\r\n\r\n<p>* Leg height and handles adjusts to fit the height of the user</p>\r\n\r\n<p>* Ideal for individuals recovering from foot surgery, breaks, sprains, amputation and ulcers of the foot</p>\r\n\r\n<p>* Deluxe lever brake ensures safety</p>\r\n\r\n<p>* Tool free height adjustment</p>\r\n\r\n<p>* Tool free left to right/right to left leg adjustment</p>\r\n\r\n<p>* 8&quot; casters ideal for indoor/outdoor use</p>\r\n\r\n<p>* Limited Lifetime Warranty</p>\r\n\r\n<p>* Weight capacity: 300 Lbs</p>\r\n', 'Covered by Medicare Part B, Medicaid and Most HMO\'s ', 410, '', '305', 0, '', '', 0, 'knee-walker-adult', '', 'Complete Medical', '', '', 'cd74653ed4a2b9832cb4be2ede7d49af.jpg', '2019-03-10 07:27:05', '1', '1089', '', '', '', '7a20e68e6cf39feea513dd02bcbfe00e.jpg,9c0fbe2bde2b724e0104b92393574dfa.jpg,d50ce65c1073961197b8bb974f19c4fb.jpg', 'instock', '12', '', '', '', '', '', '', '1', '', '0', '00', ''),
(242, 'Steerable Knee Walker', 1, 'Super Admin', 2, 'ICD10', 'HCPCS', 0, '<p>Knee walker can be steered for increased maneuverability</p>\r\n\r\n<p>* Ideal for individuals recovering from foot surgery, breaks, sprains, amputation and ulcers of the foot</p>\r\n\r\n<p>* New, two-piece padded leg pad provides comfort Deluxe braking system</p>\r\n\r\n<p>* Removable front basket Durable, steel frame with silver vein finish</p>\r\n\r\n<p>* Tool free height adjustment</p>\r\n\r\n<p>* 7&quot; casters are ideal for indoor/outdoor use</p>\r\n', 'Medicare Part B, Medicaid and Most HMO\'s Plans Accepted', 375, '', '295', 0, '', '', 0, 'steerable-knee-walker', '', 'Complete Medical', '', '', '119b66e9fca848c857a536ce633be223.jpg', '2019-03-10 07:32:11', '1', '1089D', '', '', '', '', 'instock', '12', '', '', '', '', '', '', '1', '', '0', '00', ''),
(243, 'Knee Walker, Adult, Steerable', 1, 'Super Admin', 2, 'ICD10', 'HCPCS', 0, '<p>New foldable steering column allows for easy storage</p>\r\n\r\n<p>* Knee walker can be steered for increased maneuverability</p>\r\n\r\n<p>* Ideal for individuals recovering from foot surgery, breaks, sprains, amputation and ulcers of the foot</p>\r\n\r\n<p>* Deluxe lever brake ensures safety</p>\r\n\r\n<p>* Tool free height adjustment</p>\r\n\r\n<p>* Foldable</p>\r\n\r\n<p>* 8&quot; casters are ideal for indoor/outdoor use</p>\r\n\r\n<p>* Limited Lifetime Warranty</p>\r\n\r\n<p>*1 year Warranty on brake cable</p>\r\n\r\n<p>* Weight Capacity 300 lbs</p>\r\n\r\n<p>* Handle Height 33&quot; - 37.5&quot;</p>\r\n\r\n<p>* Unit Dimensions 17&quot; (W) x 32&quot; (D)</p>\r\n\r\n<p>* Knee Pad Height 17.5&quot; - 21.5&quot;</p>\r\n\r\n<p>* Pad Dimensions 7.25&quot; (W) x 14.25&quot; (D)</p>\r\n\r\n<p>* Weight 19 lbs.</p>\r\n\r\n<p>* Shipping weight 26 lb</p>\r\n', 'Covered by Most HMO\'s Plans', 400, '', '275', 0, '', '', 0, 'knee-walker-adult-steerable', '', 'Complete Medical', '', '', '1f4711e6a87f65c5ab98ed35ad8da0ff.jpg', '2019-03-10 07:41:54', '1', '1089S', '', '', '', 'ba6fe604dc27f8c8d77dbf1ba035bbe6.jpg,d33372f3b1b0f07b40157adb6ac3d6b0.jpg', 'instock', '13', '', '', '', '', '', '', '1', '', '0', '00', ''),
(244, 'Povidone Iodine Solution- Gallon', 1, 'Super Admin', 33, 'NA', 'NA', 0, '<p>Gallon, Prep Solution</p>\r\n\r\n<p>* 10% povidone iodine, U.S.P. equivalent to 1% available iodine</p>\r\n\r\n<p>* For antiseptic treatment of skin and mucosa</p>\r\n\r\n<p>* Surgical site preparation</p>\r\n\r\n<p>* Veinpuncture</p>\r\n\r\n<p>* Care of abrasions, lacerations and minor burns&nbsp;</p>\r\n', 'Skin Preps & Cleaners', 45, '', '35', 0, '', '', 0, 'povidone-iodine-solution-gallon', '', 'Complete Medical', '', '', '469f1dbccb6f2477d660e1d67228dc33.jpg', '2019-03-10 09:20:20', '1', '233', '', '', '', '', 'instock', '12', '', '', '', '', '', '', '0', '', '0', '00', ''),
(245, 'Bariatric Adult Folding Walker w/Wheels, Double Button', 1, 'Super Admin', 2, 'ICD10', 'HCPCS,E0148', 0, '<p>Walker with wheels</p>\r\n\r\n<p>* For adult Bariatric use</p>\r\n\r\n<p>* Wider and deeper frame design accommodates individuals up to 500 lbs</p>\r\n\r\n<p>* Vinyl contoured hand grip</p>\r\n\r\n<p>* Precision design provides additional strength while adding minimal weight</p>\r\n\r\n<p>* Includes rear glide caps, (item #1085B) allowing use on all surfaces.</p>\r\n\r\n<p>* Limited Lifetime Warranty</p>\r\n\r\n<p>* Width (Inside Hand Grips) 20&quot;</p>\r\n\r\n<p>* Overall width 27&quot;</p>\r\n\r\n<p>* Depth 24&quot;</p>\r\n\r\n<p>* Height 32&quot; - 39</p>\r\n', 'Covered by Medicare Part B, Medicaid and Most HMO\'s Plans', 160, '', '120', 0, '', '', 0, 'bariatric-adult-folding-walker-w-wheels-double-button', '', 'Complete Medical', '', '', 'ea2447bcb36297bece337534cc5918ee.jpg', '2019-03-10 09:25:11', '1', '1056C', '', '', '', '', 'instock', '13', '', '', '', '', '', '', '1', '', '0', '00', ''),
(246, 'Walker, Folding, Adult, Trigger Release', 1, 'Super Admin', 2, 'ICD10', 'HCPCS', 0, '<p>Trigger release feature allows the user to close the walker without removing their hands from the handle and is ideal for individuals with limited finger dexterity</p>\r\n\r\n<p>* Trigger release can be reached with hands of all sizes</p>\r\n\r\n<p>* Durable, composite trigger release resists cracking and breaking</p>\r\n\r\n<p>* Sturdy 1&quot; diameter anodized, extruded aluminum construction ensures maximum strength while remaining lightweight</p>\r\n\r\n<p>* Replacement wheels 5&quot; &nbsp;</p>\r\n\r\n<p>* Includes rear glide caps, and glide covers&nbsp;</p>\r\n\r\n<p>allowing use on all surfaces</p>\r\n\r\n<p>* Patented</p>\r\n\r\n<p>* Limited Lifetime Warranty</p>\r\n\r\n<p>* 350 lb. weight capacity. *</p>\r\n', 'Covered by Medicare Part B, Medicaid and Most HMO\'s Plans', 45, '', '35', 0, '', '', 0, 'walker-folding-adult-trigger-release', '', 'Complete Medical', '', '', 'a9da889cd4e3f324eaa2f2c17db0707a.jpg', '2019-03-10 09:29:14', '1', '1073F', '', '', '', '5ef6e52936e938065abbd6817f72828f.jpg', 'instock', '12', '', '', '', '', '', '', '1', '', '0', '00', ''),
(247, 'Deluxe Folding Travel Walker Red', 1, 'Super Admin', 2, 'ICD10', 'HCPCS', 0, '<p>Easily folds tool free to 1/4 the size of a traditional walker</p>\r\n\r\n<p>* Comes with 5&quot; front wheels and rear glide skis that are ideal for most surfaces</p>\r\n\r\n<p>* Two side storage pouches with large pockets for personal items are held in place by Velcro tabs to both side frames</p>\r\n\r\n<p>* Sturdy 1&quot; diameter anodized, extruded aluminum construction ensures maximum strength while remaining lightweight</p>\r\n\r\n<p>* Limited Lifetime Warranty *</p>\r\n', 'Covered by Medicare Part B, Medicaid and Most HMO\'s Plans', 150, '', '110', 0, '', '', 0, 'deluxe-folding-travel-walker-red', '', 'Complete Medical', '', '', 'b46c3626806a496d1fda2b8ee4139f0c.jpg', '2019-03-10 09:34:22', '1', '1075M', '', '', '', '123502f6662ce86d1ded9d2e1d8a1d09.jpg,ac8d692d978b103a822bfe025da9b156.jpg,844703059c3f5647c020259b4c532126.jpg', 'instock', '11', '', '', '', '', '', '', '1', '', '0', '00', ''),
(248, 'Free2GoTM Rollator', 1, 'Super Admin', 2, 'ICD10', 'HCPCS', 0, '<p>Combines the benefits of a raised toilet seat, toilet safety frame and rolling walker</p>\r\n\r\n<p>* Hygienic - no more soiled undergarments or sitting on public toilet seats</p>\r\n\r\n<p>* Prevents life-threatening accidents</p>\r\n\r\n<p>* Promotes independence</p>\r\n\r\n<p>* Reduces social isolation</p>\r\n\r\n<p>* Portable, lightweight and discreet</p>\r\n\r\n<p>* 3-in-1 benefits make it compact and ideal for travel</p>\r\n\r\n<p>* It&#39;s easy to use! Simply push the rollator over any height toilet</p>\r\n\r\n<p>* Key feature: restores dignity!</p>\r\n\r\n<p>* Weight Capacity: 300 lbs</p>\r\n\r\n<p>* Product Weight: 20.2 lbs</p>\r\n\r\n<p>* Seat Measurements: 15&quot; (W) x 15 &quot; (D)</p>\r\n\r\n<p>* Seat-to-Floor Height: 23 &quot; (top of seat)</p>\r\n\r\n<p>* Seat-to-Floor Height: 22 &quot; (top of toilet seat)</p>\r\n\r\n<p>* Toilet Seat Opening: 8 &nbsp;&quot;x 9 &quot;</p>\r\n\r\n<p>* Unit Width: 24&quot;</p>\r\n\r\n<p>* Adjustable Handle Height: 33 &quot; - 38&quot;</p>\r\n\r\n<p>* 8&quot; Wheels</p>\r\n\r\n<p>* Warranty on Frame: Limited Lifetime</p>\r\n', 'Covered by Medicare Part B, Medicaid and Most HMO\'s Plans', 370, '', '280', 0, '', '', 0, 'free2gotm-rollator', '', 'Complete Medical', '', '', '53526ba0d93e8cf9611066248fba2c30.jpg', '2019-03-10 09:41:47', '1', '11036', '', '', '', '9943e678da4f789bfdc7988a173780c7.jpg,4907ec2ef565345e6a0feca13d0c7128.jpg,f873ada280faad50b8961a8258f5dfa5.jpg,50ea2322f716443c9be5c1837ed8b4bc.jpg,477f34cd635b0bd95890e0cc246fdf75.jpg,faf60e6e836429c3cba14d5a99a60f71.jpg', 'instock', '13', '', '', '', '', '', '', '1', '', '0', '00', ''),
(249, 'Static Air Mattress', 1, 'Super Admin', 6, 'ICD10', 'HCPCS,E0198', 0, '<p>MATTRESS</p>\r\n\r\n<p>* 32&quot;W x 72&quot;L</p>\r\n\r\n<p>* Reduces interface pressure for the patient</p>\r\n\r\n<p>* Features 55 air holes that allow air circulation, reducing heat build-up while providing a dry sleeping surface * Pumps can be purchased to ease inflation&nbsp;</p>\r\n\r\n<p>* Notice to California Consumers: WARNING: This product contains chemicals known to the State of California to cause cancer and birth defects or other reproductive harm *</p>\r\n', 'Covered by Most HMO\'s. Must Complete CMN for Insurance Order Processing', 60, '', '45', 0, '', '', 0, 'static-air-mattress', '', 'Complete Medical', '', '', '50256aca9de562b94235f10412f82770.jpg', '2019-03-14 04:54:20', '1', '10760', '', '', '', '88040a4c9bbdabb6b873476542374bb9.jpg,38134d2cfac080f5e047fda8f8e713f6.jpg', 'instock', '11', '', '', '', '', '', '', '1', '', '0', '00', ''),
(250, 'PressureGuard Easy Air Mattress', 1, 'Super Admin', 6, 'ICD10', 'HCPCS,E0277', 0, '<p>Low-air-loss Therapy with Alternating Pressure</p>\r\n\r\n<p>* Clinicians choose low air loss systems to address maceration, the weakening of the skin due to excess moisture</p>\r\n\r\n<p>* The new PressureGuard Easy Air is independently documented to outperform every leading low air loss system in this key performance area</p>\r\n\r\n<p>* Remarkably, it does so with none of the compromises low air loss users have come to accept, thanks to its exclusive Air Diffusion Matrix technology and PressureGuard air/foam design</p>\r\n\r\n<p>* Easy Air won&#39;t lose inflation in a power outage</p>\r\n\r\n<p>* Its stable surface won&#39;t &quot;swallow up&quot; the user</p>\r\n\r\n<p>* And its Safety Edge won&#39;t collapse like air-only mattresses can, making transfers safer</p>\r\n\r\n<p>* It won&#39;t make the user too hot or cold</p>\r\n\r\n<p>* Ultra-simple to set up, clean and use</p>\r\n\r\n<p>* Dial sets the comfort level &quot;On/off&quot; buttons control air flow and alternating pressure feature</p>\r\n\r\n<p>* Weight limit: 500 lbs. on standard model</p>\r\n\r\n<p>* Mattress weight: 22 lbs</p>\r\n\r\n<p>* Warranty: 2-years, non-prorated</p>\r\n\r\n<p>* UL listed * The PressureGuard&nbsp;</p>\r\n\r\n<p>* Notice to California Consumers: WARNING: This product contains chemicals known to the State of California to cause cancer and birth defects or other reproductive harm&nbsp;</p>\r\n', 'Covered by most HMO\'s. CMN must be completed for Insurance processing', 9000, '', '6500', 0, '', '', 0, 'pressureguard-easy-air-mattress', '', 'Complete Medical', '', '', '4d864c34143934ab6210c7c1a3354fc4.jpg', '2019-03-14 05:02:11', '1', '1839A', '', '', '', '', 'instock', '13', '', '', '', '', '', '', '1', '', '0', '00', ''),
(251, 'Patriot Semi Electric Bed Bed Only', 1, 'Super Admin', 6, 'ICD10', 'HCPCS', 0, '<p>Bed Only</p>\r\n\r\n<p>* Introducing the new Patriot Semi-Electric Homecare Bed with a grid sleep surface</p>\r\n\r\n<p>*Sleep surface and motors are MADE IN THE USA</p>\r\n\r\n<p>*The motor unit and bed design provide the ultimate in quiet, smooth operation</p>\r\n\r\n<p>*Complete welded steel frame construction</p>\r\n\r\n<p>*The head and foot sections can be raised or lowered simultaneously or independently with one hand control</p>\r\n\r\n<p>*During a power failure the motor unit can lower both the head and foot section with just a single standard 9 volt battery</p>\r\n\r\n<p>*Assembles easily with just 5 components</p>\r\n\r\n<p>*Meets the requirements of HCPCS codes</p>\r\n\r\n<p>*Maximum patient weight 350 lbs</p>\r\n\r\n<p>*450 lbs evenly distributed total weight capacity including patient, mattress, rails, and accessories</p>\r\n\r\n<p>*Bed Height: Min. 15&quot;, Max. 24&quot; (at deck level)</p>\r\n\r\n<p>*Lift Range: Head - 60, Knee - 30&nbsp;</p>\r\n\r\n<p>*Overall Bed Size: 87&quot; L x 36&quot; W</p>\r\n\r\n<p>*No external pinch points</p>\r\n\r\n<p>*Slots in frame to ensure proper rail placement</p>\r\n\r\n<p>*Locking pins secure bed ends to sleep deck</p>\r\n\r\n<p>*Attached lanyards prevent loss while moving or storing</p>\r\n\r\n<p>*The only homecare bed to offer optional corner mattress retainers</p>\r\n\r\n<p>*Grid Deck offers the following advantages: Much stronger frame, better mattress support, no spring sag or bottoming out with heavier patients, easier to clean, and no connecting links or springs to lose</p>\r\n\r\n<p>*2 year warranty for defects in workmanship and materials of technical components, frame, and electronics</p>\r\n\r\n<p>*During the warranty period, defective items will be repaired or replaced at manufacturers option</p>\r\n\r\n<p>*The warranty does not include any labor charges incurred in replacement part(s) installation or any associated freight or shipping charges to the manufacture</p>\r\n', 'Covered by most HMO\'s. Must complete CMN for Insurance Processing', 700, '', '1000', 0, '', '', 0, 'patriot-semi-electric-bed-bed-only', '', 'Complete Medical', '', '', '9a6ea9a75210cd60904569ce345cd535.jpg', '2019-03-14 05:19:57', '1', '1801A', '', '', '', '', 'instock', '12', '', '', '', '', '', '', '1', '', '0', '00', ''),
(252, 'Combination TENS/EMS Digital Unit w/Time', 1, 'Super Admin', 25, 'NA', 'NA', 0, '', 'Electrotherapy', 95, '', '70', 0, '', '', 0, 'combination-tens-ems-digital-unit-w-time', '', 'Complete Medical', '', '', '2868da286830884922ae37c84fee509e.jpg', '2019-03-15 04:19:28', '1', '3162', '', '', '', '', 'instock', '13', '', '', '', '', '', '', '0', '', '0', '00', ''),
(253, 'OTC TENS Unit Dual Channel', 1, 'Super Admin', 25, 'NA', 'NA', 0, '<p>No prescription required</p>\r\n\r\n<p>* 8 automatic therapy modes</p>\r\n\r\n<p>* Small and lightweight</p>\r\n\r\n<p>* Includes: TENS unit, 2 wires, 4 electrodes and 2 &quot;AAA&quot; batteries</p>\r\n\r\n<p>* Retail packaged</p>\r\n', 'Electrotherapy', 45, '', '32', 0, '', '', 0, 'otc-tens-unit-dual-channel', '', 'Complete Medical', '', '', '18f1af7ae617c891e26c7a0eec9c476c.jpg', '2019-03-15 04:29:20', '1', '3150', '', '', '', 'f62a31ecb93a5e02cd67cba53e16a5e2.jpg,ac65814ef6896597f449915d107ca7a7.jpg', 'instock', '11', '', '', '', '', '', '', '1', '', '0', '00', ''),
(254, 'Tens Unit Dual Channel 3 Mode w/Time', 1, 'Super Admin', 25, 'ICD10', 'HCPCS', 0, '<p>System includes device, lead wires, four self-adhesive reusable electrodes, 9V battery, hard plastic carrying case and instruction manual</p>\r\n\r\n<p>* 3 Modes: Standard, Modulate and Burst</p>\r\n\r\n<p>* Dual Channel</p>\r\n\r\n<p>* 30 and 60 minutes or continuous timer</p>\r\n\r\n<p>* Adjustable Pulse Width: 50-250 Microseconds</p>\r\n\r\n<p>* Pulse Rate: 2-150 Hz</p>\r\n\r\n<p>* Pulse Amplitude: 0-80 mA each channel</p>\r\n\r\n<p>* Waveform: Asymmetrical biphasic square pulse</p>\r\n\r\n<p>* One year warranty</p>\r\n\r\n<p>* FDA approved</p>\r\n', 'Covered by most HMO\'s', 52, '', '38', 0, '', '', 0, 'tens-unit-dual-channel-3-mode-w-time', '', 'Complete Medical', '', '', '800b0bb9fc1635947f2c740604f81f08.jpg', '2019-03-15 04:34:04', '1', '3166D', '', '', '', '', 'instock', '12', '', '', '', '', '', '', '1', '', '0', '00', ''),
(255, 'Microcurrent Tens Unit Micro II', 1, 'Super Admin', 25, 'ICD10', 'HCPCS,E0745', 0, '<p>Kit contains one dual channel tens stimulator, carry case, set of lead wires, instruction manual, 9V battery and set of electrodes</p>\r\n\r\n<p>* Channels: Dual isolated between channels</p>\r\n\r\n<p>* Pulse amplitude: 12 V, Output Volt, No load</p>\r\n\r\n<p>* Pulse frequency: 0.5, 8, 80 Hz selected</p>\r\n\r\n<p>* Pulse width (microseconds): 6250 Fixed</p>\r\n\r\n<p>* Wave form: Asymmetrical bi-phasic square pulse</p>\r\n\r\n<p>* Timer: 10, 20 and 40 minutes</p>\r\n\r\n<p>* Mode selector: None</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'Covered by most HMO\'s', 100, '', '56', 0, '', '', 0, 'microcurrent-tens-unit-micro-ii', '', 'Complete Medical', '', '', '4c694a62b820c6dacca18a2ed67b4717.jpg', '2019-03-15 04:38:12', '1', '3166K', '', '', '', '', 'instock', '13', '', '', '', '', '', '', '1', '', '0', '00', ''),
(256, 'UltraTens II Unit Ultrasound and TENS Combo', 1, 'Super Admin', 25, 'NA', 'NA', 0, '<p>The UltraTENS II combines the two most proven modalities, ultrasound and TENS technology for pain relief into one compact sleek device</p>\r\n\r\n<p>* Deep heat from the therapeutic ultrasound and TENS therapy can be used simultaneously to help patients treat chronic and acute muscular pain</p>\r\n\r\n<p>* New innovative design features an increased duty cycle of 50% with three easy-to-use mode presets, plus 30 mA of TENS therapy</p>\r\n\r\n<p>* This versatile portable unit comes with carry case, AC adaptor and ultrasound gel for office or mobile use</p>\r\n\r\n<p>* 1 MHz with 3 power levels * Beam Non-uniformity Ration (BNR) 5:1 max</p>\r\n\r\n<p>* 3 Treatment times</p>\r\n\r\n<p>* Auto-off after10 min</p>\r\n\r\n<p>* Includes: device, 2&quot; x 4&quot; cloth, electrode, lead wire, AC adapter, gel, quick start guide, manual</p>\r\n', 'Electrotherapy', 260, '', '180', 0, '', '', 0, 'ultratens-ii-unit-ultrasound-and-tens-combo', '', 'Complete Medical', '', '', '6783a3ddefb999f6121ce89356d66280.jpg', '2019-03-15 04:44:36', '1', 'DU6012', '', '', '', 'bcd1c75aeb9db50c7f5a9b68dd1a9547.jpg,ababdfe485dc35eb62cb44c7b2d35a90.jpg,2033a94254bfb8838145bdddf591b6fa.jpg,132e37ce46d26a75652c55b6e2995502.jpg', 'instock', '11', '', '', '', '', '', '', '0', '', '0', '00', ''),
(257, 'Azulfidine', 1, 'Super Admin', 38, 'ICD10', 'CPT', 0, '<p>Common Uses:&nbsp;It is used to treat rheumatoid arthritis. It is used to treat ulcerative colitis. It is used to help keep ulcerative colitis flares from coming back. It may be given to you for other reasons. Talk with the doctor</p>\r\n\r\n<p>Ingredient Name: Sulfasalazine Delayed-Release Tablets&nbsp;</p>\r\n\r\n<p>Drug Manufacturer: PFIZER</p>\r\n\r\n<p>Generic Available: SULFASALAZINE EC 500MG DR TABLETS</p>\r\n', 'AZULFIDINE 500MG EN TABS.  PRICE PER TABLET\r\n\r\n', 3, '', '2', 0, '', '', 0, 'azulfidine', '', 'Bloomtown', '', '', 'b1378dae983e4f799342cbf500c3f806.jpg', '2019-03-15 07:33:49', '1', '32', '', '', '', '', 'instock', '11', '', '', '', '', '', '', '1', '', '0', '2', ''),
(258, 'Celebrex', 1, 'Super Admin', 38, 'ICD10', 'CPT', 0, '<p>Ingredient Name:&nbsp;Celecoxib</p>\r\n\r\n<p>Drug Manufacturer: PFIZER</p>\r\n\r\n<p>Generic Available: CELECOXIB 100MG CAPSULES</p>\r\n\r\n<p>Common Uses:&nbsp;It is used to ease pain and swelling. It is used to treat arthritis. It is used to ease painful period (menstrual) cycles. It is used to treat ankylosing spondylitis. It may be given to you for other reasons. Talk with the doctor.</p>\r\n', 'Available in 50,  100, 200, 300, 400 and 500 mg Capsules. Contact Provider for pricing', 0, '', '00', 0, '', '', 0, 'celebrex', '', 'Bloomtown', '', '', '6b9524487c10b46356c08edc7fa1144e.jpg', '2019-03-15 07:47:40', '1', '12', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(259, 'Diclofenac 1% Gel 100gm', 1, 'Super Admin', 38, 'ICD10', 'CPT', 0, '<p>Ingredient Name: Diclofenac Gel (1%) (dye KLOE fen ak)</p>\r\n\r\n<p>Drug Manufacturer:&nbsp;AMNEAL PHARMACEUTICALS</p>\r\n\r\n<p>Common Uses:&nbsp;This medication is used to relieve joint pain from arthritis.&nbsp;Diclofenac&nbsp;belongs to a class of drugs known as nonsteroidal anti-inflammatory drugs.</p>\r\n', 'Copay prices depends on insurance plan. ', 65, '', '50', 0, '', '', 0, 'diclofenac-1-gel-100gm', '', 'Bloomtown', '', '', '6f6b8f781563441581babad14b15aca2.jpg', '2019-03-15 08:00:55', '1', '34', '', '', '', '', 'instock', '11', '', '', '', '', '', '', '1', '', '0', '50', ''),
(260, 'Monoject Insulin Syringes 1/2cc 28g Bx/100', 1, 'Super Admin', 26, 'ICD10', 'HCPCS', 0, '<p>1/2cc 28 Gauge Bx/100</p>\r\n\r\n<p>* Individually wrapped for maximum protection</p>\r\n', 'Insulin Syringes', 35, '', '25', 0, '', '', 0, 'monoject-insulin-syringes-1-2cc-28g-bx-100', '', 'Complete Medical', '', '', '47438ed1c5e9e848c0d1b216136c3297.jpg', '2019-03-17 06:02:15', '1', '2451A', '', '', '', '', 'instock', '11', '', '', '', '', '', '', '1', '', '0', '00', ''),
(261, 'Monolet Style Lancets Bx/100 Twist Top 28G', 1, 'Super Admin', 26, 'ICD10', 'HCPCS', 0, '<p>Fine gauge, tri-bevel tip for virtually painless sampling</p>\r\n\r\n<p>* Consistent depth penetration</p>\r\n\r\n<p>* Unique design fits almost all lancing devices</p>\r\n\r\n<p>* 100 sterile lancets</p>\r\n', 'Covered by Medicare Part B, Medicaid and HMO\'s', 6, '', '4', 0, '', '', 0, 'monolet-style-lancets-bx-100-twist-top-28g', '', 'Complete Medical', '', '', '2a4f7279a19cd36d2215bf72aef25378.jpg', '2019-03-17 06:07:14', '1', '2697', '', '', '', '', 'instock', '12', '', '', '', '', '', '', '1', '', '0', '00', ''),
(262, 'Pressure Activated Lancets 26g 1.8mm Yellow (Bx/100)', 1, 'Super Admin', 26, 'ICD10', 'HCPCS', 0, '<p>26 gauge - 1.8 mm Depth, Pressure Activated</p>\r\n\r\n<p>* SensiLance Pressure Activated Lancets</p>\r\n\r\n<p>* For capillary blood samples</p>\r\n\r\n<p>* Ready to use - no loading needed</p>\r\n\r\n<p>* Needle automatically retracts</p>\r\n\r\n<p>* Latex Free</p>\r\n', 'Covered by Medicare Part B, Medicaid and HMO\'s', 24, '', '16', 0, '', '', 0, 'pressure-activated-lancets-26g-1-8mm-yellow-bx-100', '', 'Complete Medical', '', '', 'caf7a23422b54208b4dfc288e3495690.jpg', '2019-03-17 06:09:59', '1', '2700A', '', '', '', '', 'instock', '13', '', '', '', '', '', '', '1', '', '0', '00', ''),
(263, 'Prodigy Preferred Blood Glucose No Coding Strips,Bx/50', 1, 'Super Admin', 26, 'ICD10', 'HCPCS', 0, '<p>Do not use GDH-PQQ Technology</p>\r\n\r\n<p>* Offers Alternate Site Testing (AST) palm, forearm, upper arm, thigh or calf</p>\r\n\r\n<p>* Requires a tiny blood sample</p>\r\n\r\n<p>* Designed with capillary action that automatically draws in blood sample</p>\r\n', 'Covered by Medicare Part B, Medicaid and HMO\'s', 26, '', '18', 0, '', '', 0, 'prodigy-preferred-blood-glucose-no-coding-strips-bx-50', '', 'Complete Medical', '', '', '5d8e0e09c1c08250cccc1415381518e9.jpg', '2019-03-17 06:13:28', '1', '52800', '', '', '', '', 'instock', '13', '', '', '', '', '', '', '1', '', '0', '00', ''),
(264, 'Control Solution \'Low\' 4 ml. for Prodigy Glucometers', 1, 'Super Admin', 26, 'ICD10', 'HCPCS', 0, '<p>&nbsp; Used to check accuracy of the low sugar results of Prodigy glucometers</p>\r\n\r\n<p>* If your machine can read your results properly, then you can be assured your machine is working correctly</p>\r\n', 'Covered by Medicare Part B, Medicaid and HMO\'s', 8, '', '6', 0, '', '', 0, 'control-solution-low-4-ml-for-prodigy-glucometers', '', 'Complete Medical', '', '', '3685299f302ebe49a826a0a39a962bdb.jpg', '2019-03-17 06:16:18', '1', '53310', '', '', '', '', 'instock', '13', '', '', '', '', '', '', '1', '', '0', '00', '');
