(265, 'Care Touch Insulin Syringes 30G, 0.5cc, 1/2 in. Bx/100', 1, 'Super Admin', 26, 'ICD10', 'HCPCS', 0, '<p>Care Touch Insulin Syringes 30G,.5cc, 5/16&quot;, 8mm, Box 100</p>\r\n', 'Covered by Medicare, Medicaid and HMO\'S', 18, '', '12', 0, '', '', 0, 'care-touch-insulin-syringes-30g-0-5cc-1-2-in-bx-100', '', 'Complete Medical', '', '', '0da7f6147c73c8b5ebc255307b22e31b.jpg', '2019-03-17 06:19:26', '1', 'CT30101', '', '', '', '5799ecf2fe58d76d227b03b351591f47.jpg', 'instock', '13', '', '', '', '', '', '', '1', '', '0', '00', ''),
(266, 'Care Touch Syringe Only 1ml with Luer Slip Tip Bx/100', 1, 'Super Admin', 26, 'ICD10', 'HCPCS', 0, '<p>1ml Syringe Only with Luer Slip Tip - Box of 100 Syringes</p>\r\n\r\n<p>* Individually wrapped * High barrel clarity</p>\r\n\r\n<p>* Easy readability</p>\r\n\r\n<p>* Accurate and clear scale marking</p>\r\n\r\n<p>* Non-Toxic, Pryogen Free</p>\r\n\r\n<p>* Sterile</p>\r\n', 'Covered by Medicare, Medicaid and HMO\'s', 16, '', '12', 0, '', '', 0, 'care-touch-syringe-only-1ml-with-luer-slip-tip-bx-100', '', 'Complete Medical', '', '', 'f68ae5e3c39264dfbc1c833b34866340.jpg', '2019-03-17 06:22:31', '1', 'CT50101', '', '', '', 'cfbdf25f54e2030e8965cd6b5e46fe8d.jpg', 'instock', '1', '', '', '', '', '', '', '1', '', '0', '00', ''),
(267, 'Abilify 10mg Tablets', 1, 'Super Admin', 39, 'ICD10', 'CPT', 0, '<p>Ingredient Name: Aripiprazole Tablets</p>\r\n\r\n<p>Drug Manufacturer: BMS</p>\r\n\r\n<p>Generic Available: ARIPIPRAZOLE 10MG TABLETS</p>\r\n\r\n<p>Common Uses:&nbsp;It is used to treat schizophrenia. It is used to treat bipolar problems. It is used to treat low mood. It is used to treat certain behavior problems in patients with autism. It is used to treat Tourette&#39;s syndrome. It may be given to you for other reasons. Talk with the doctor</p>\r\n', 'Covered by Medicare, Medicaid and HMO\'o Plans', 0, '', '00', 0, '', '', 0, 'abilify-10mg-tablets', '', 'Bloomtown', '', '', '757d646ca5ceddbc604e4b9db538404a.jpg', '2019-03-17 07:01:33', '1', '23', '', '', '', '', 'instock', '13', '', '', '', '', '', '', '1', '', '0', '00', ''),
(268, 'Rollator Cushion w/Sherpa Top Black 13\" x 14\" x 2\"', 1, 'Super Admin', 2, 'NA', 'NA', 0, '<p>With Sherpa top</p>\r\n\r\n<p>* 13&quot;L x 14&quot; W x 2&quot;H&nbsp;</p>\r\n\r\n<p>* The Rollator cushion has the sherpa top on one side and the black poly-cotton on the other side</p>\r\n\r\n<p>* Comfort cushion for any firm rollator seat</p>\r\n\r\n<p>* Attaches easily with two hook and loop straps</p>\r\n\r\n<p>* Removable washable stretch cover</p>\r\n', 'Rollator Accessory', 50, '', '35', 0, '', '', 0, 'rollator-cushion-w-sherpa-top-black-13-x-14-x-2', '', 'Complete Medical', '', '', '770eaefc7e9d1d1c1ebece8ee115051d.jpg', '2019-03-17 07:41:07', '1', '11044C', '', '', '', '', 'instock', '12', '', '', '', '', '', '', '0', '', '0', '00', ''),
(269, 'Transport Chair, 22\" Bariatric Red,w/12\"Rear Flat Free Wheel', 1, 'Super Admin', 3, 'ICD10', 'HCPCS', 0, '<p>Lightweight - weighs only 33 lbs.</p>\r\n\r\n<p>* Supports individuals up to 450 lbs.</p>\r\n\r\n<p>* Attachable push bar with padded foam grip makes it easier to push</p>\r\n\r\n<p>* 12&quot; rear flat-free wheels</p>\r\n\r\n<p>* Comes with swing-away footrests</p>\r\n\r\n<p>* Adjustable leg support</p>\r\n\r\n<p>* Fixed, full length arms</p>\r\n\r\n<p>* Padded armrests provide additional comfort</p>\r\n\r\n<p>* Heavy duty, nylon reinforced upholstery with two carry handles</p>\r\n\r\n<p>* Comes with lever and companion activated wheel locks</p>\r\n\r\n<p>* Limited lifetime warranty *</p>\r\n', 'Covered by Most HMO\'s. Must Complete CMN for Insurance Payment Processing', 700, '', '480', 0, '', '', 0, 'transport-chair-22-bariatric-red-w-12-rear-flat-free-wheel', '', 'Complete Medical', '', '', '961f942d9ba96f67c0bcf821f1652c7f.jpg', '2019-03-17 07:51:28', '1', 'ATC22R', '', '', '', '', 'instock', '13', '', '', '', '', '', '', '1', '', '0', '00', ''),
(270, 'Cirrus Plus Power Wheelchair Folding Lightweight 16', 1, 'Super Admin', 4, 'ICD10', 'HCPCS, KO822', 0, '<p>16&quot;</p>\r\n\r\n<p>* Elevating legrest available</p>\r\n\r\n<p>* Optional arm available</p>\r\n\r\n<p>* Foldable, lightweight frame makes portability and transportation easy and convenient</p>\r\n\r\n<p>* Intergrated, programmable PG controller</p>\r\n\r\n<p>* Adjustable height flip back arms and detachable arms</p>\r\n\r\n<p>* Attractive carbon steel frame with silver vein finish</p>\r\n\r\n<p>* Flat free, 12.5&quot; black drive wheels</p>\r\n\r\n<p>* Front 8&quot; flat free black casters</p>\r\n\r\n<p>* T-style adjustable arm optional</p>\r\n\r\n<p>* Anti tippers, standard</p>\r\n\r\n<p>* Elevating legrests optional</p>\r\n\r\n<p>* Adjustable tension back</p>\r\n\r\n<p>* Comes standard with seat belt, seat cushion with pouch, calf straps and heel loops</p>\r\n\r\n<p>* Folding battery tray * Back is height adjustable</p>\r\n\r\n<p>* Padded back upholstery and cushioned seat</p>\r\n\r\n<p>* Adjustable length joystick mount</p>\r\n\r\n<p>* Wheel locks</p>\r\n\r\n<p>* Comes with two U1, 34 AMP batteries</p>\r\n\r\n<p>* Has been tested and surpassed the ANSI RESNA testing requirement</p>\r\n\r\n<p>* Six months warranty on battery (from date of installation)</p>\r\n\r\n<p>* Limited Lifetime Warranty on power chair frame (from date of installation)</p>\r\n\r\n<p>* One Year Limited Warranty on electronics and drive train components</p>\r\n\r\n<p>* 300 lb. Weight Capacity&nbsp;</p>\r\n', ' Most HMO\'s accepted. Must Complete CMN and Face to Face for Insurance Payment Processing', 2800, '', '1950', 0, '', '', 0, 'cirrus-plus-power-wheelchair-folding-lightweight-16', '', 'Complete Medical', '', '', '9c6ae960228c92f045cfcf5cc3951bcb.jpg', '2019-03-17 08:01:25', '1', 'CPN16FBA', '', '', '', '', 'instock', '12', '', '', '', '', '', '', '1', '', '0', '00', ''),
(271, 'LiteRider PTC Power WC Red Rear Wheel Drive', 1, 'Super Admin', 4, 'ICD10', 'HCPCT', 0, '<p>Rear wheel drive</p>\r\n\r\n<p>* Unique design incorporates a basket under the seat for valuables</p>\r\n\r\n<p>* Comfortable, full size stadium seat and non-marking black tires on steel rims with shiny hubcabs</p>\r\n\r\n<p>* Weight capacity: 275 lbs</p>\r\n\r\n<p>* Maximum Speed: 3.5 mph</p>\r\n\r\n<p>* Operating Range: 9.5 miles</p>\r\n\r\n<p>* Ground Clearance: 2.5&quot;</p>\r\n\r\n<p>* Turning Radies: 26&quot; Type Batteries: 2-18 AH</p>\r\n\r\n<p>* Color: Red body with black seat</p>\r\n\r\n<p>* Freewheel Mode: Yes *Electronic Speed Control: Yes</p>\r\n\r\n<p>* Electro-Mechanical Brakes: Yes</p>\r\n\r\n<p>* Charger: Off-Board</p>\r\n\r\n<p>* Controller: PG VR-2, 50 Amp Remote</p>\r\n\r\n<p>*Length: 33&quot;</p>\r\n\r\n<p>* Width: 22.5&quot;</p>\r\n\r\n<p>* Height: 34.5&quot; - 36.5&quot;</p>\r\n\r\n<p>* Ground to Top of Seat: 20.9&quot;</p>\r\n\r\n<p>* Number of Seat Height Positions: 3</p>\r\n\r\n<p>* Size of increments: 1.0&quot;</p>\r\n\r\n<p>* Weight of Unit: 114 lbs</p>\r\n\r\n<p>* Tires: Flat Free</p>\r\n\r\n<p>* Rear tires: 9.5&quot;, Casters: 6&quot;</p>\r\n\r\n<p>* Standard Seat: 18&quot; x 15&quot;</p>\r\n\r\n<p>* Footrests are both height and angle adjustable</p>\r\n\r\n<p>* Five Year Warranty on Frame</p>\r\n\r\n<p>* Thirteen Month Warranty on Drive Train and Electronics</p>\r\n', 'Most HMO\'s accepted. Must Complete CMN and Face to Face for Insurance payment option processing.', 2200, '', '1550', 0, '', '', 0, 'literider-ptc-power-wc-red-rear-wheel-drive', '', 'Complete Medical', '', '', '66230451371f1b96f5026d0b40e135b1.jpg', '2019-03-17 08:08:55', '1', 'GP160', '', '', '', '', 'instock', '12', '', '', '', '', '', '', '1', '', '0', '00', ''),
(272, 'Intrepid Mid Wheel Drive Power Wheelchair 20\" Midnight Blue', 1, 'Super Admin', 4, 'ICD10', 'HCPCS, K0823', 0, '<p>Equipped with 20&quot; Captains Seat, Blue</p>\r\n\r\n<p>* QuadraSpring suspension system for ultimate in smooth-riding stability</p>\r\n\r\n<p>* Standard comfortable and durable Captains Seats feature deep-contoured cushions and backs for maximum comfort and superior user positioning and lateral support</p>\r\n\r\n<p>* Captains Seats swivel and feature a fold-down backrest with 25 degrees of recline and an adjustable height headrest</p>\r\n\r\n<p>* Seats have four height adjustments, from 20&quot; to 23&quot;</p>\r\n\r\n<p>* Padded, flip-up armrests allow for easy transfers and user access</p>\r\n\r\n<p>* Armrests are also removable and height and width adjustable for positioning, support and width adjustable for positioning, support and adaptability to the size of the user</p>\r\n\r\n<p>* Adjustable length controller mount can be affixed to either the left or right armrest and can be fitted with an optional swingaway arm for additional flexibility</p>\r\n\r\n<p>* Standard non-slip footplate can be flipped up out of the users way and adjusted in both height and angle</p>\r\n\r\n<p>* Chair can be fitted with optional Elevating Leg Rests allowing the user to travel comfortably with raised legs; a necessity for those with some medical conditions, such as edema</p>\r\n\r\n<p>* Standard positioning belt for added user security</p>\r\n\r\n<p>* Mid-wheel drive allows for tight 18&quot; turning radius, making it ideal for indoor maneuverability</p>\r\n\r\n<p>* Extra strong steel frame for long-lasting durability</p>\r\n\r\n<p>* Programmable controller with common connectors is easy to service and setup and can be personalized for individuals with special requirements</p>\r\n\r\n<p>* Flat-free, non-marking tires offer worry-free travel</p>\r\n\r\n<p>* Motor assemblies offer easy freewheel operation, allowing the chair to be pushed, which can be helpful for transport</p>\r\n\r\n<p>* Weight Capacity 300 lbs</p>\r\n\r\n<p>* Batteries Two 12V x 35AH (U1)</p>\r\n\r\n<p>* Battery Charger 5 Amp, Offboard</p>\r\n', 'Covered by most HMO\'s. Must Complete CMN and Face to Face for Insurance Payment Processing', 2900, '', '2100', 0, '', '', 0, 'intrepid-mid-wheel-drive-power-wheelchair-20-midnight-blue', '', 'Complete Medical', '', '', '336af8b7285f03c9b5eda444e1924392.jpg', '2019-03-18 05:10:54', '1', 'INB002', '', '', '', '', 'instock', '12', '', '', '', '', '', '', '1', '', '0', '00', ''),
(273, 'K3 Lightweight Wheelchair 16\" w/DDA & ELR\'s Cruiser III', 1, 'Super Admin', 3, 'ICD10', 'HCPCS,K0003', 0, '<p>DETACHABLE DESK ARMS</p>\r\n\r\n<p>* 16&quot; With Elevating Leg Rests</p>\r\n\r\n<p>* Weighs under 36 lbs. (excluding riggings)</p>\r\n\r\n<p>* Removable flip back arms allow for easy transfer</p>\r\n\r\n<p>* Carbon steel frame with silver vein finish</p>\r\n\r\n<p>* New frame style eliminates seat guides and allows for custom back inserts and accessories</p>\r\n\r\n<p>* Tool free adjustable front riggings (footrests, legrests)</p>\r\n\r\n<p>* Composite, Mag-style wheels are lightweight and maintenance free</p>\r\n\r\n<p>* Precision sealed wheel bearings in front and rear ensure long lasting performance and reliability</p>\r\n\r\n<p>* Dual axle provides easy transition of seat height to hemi level</p>\r\n\r\n<p>* 8&quot; front casters are adjustable in 3 positions</p>\r\n\r\n<p>* Comes with push to lock wheel locks</p>\r\n\r\n<p>* Lightweight, Dual Axle&nbsp;</p>\r\n\r\n<p>* All the above come with Swing-Away Footrests or Elevated Leg Rests&nbsp;</p>\r\n', 'Covered by Medicare, Medicaid and most HMO\'s. Must complete CMN and Face to for Insurance processing', 270, '', '210', 0, '', '', 0, 'k3-lightweight-wheelchair-16-w-dda-elr-s-cruiser-iii', '', 'Complete Medical', '', '', 'efd3004a21c8f37d651c3ac44c34d4a8.jpg', '2019-03-18 05:20:24', '1', 'K316DDA-ELR', '', '', '', '533a8b5928cae8133e28d74b9f7c7474.jpg,4ab37a9dd180b082e452a27c5a920f38.jpg,58e4727b8f482d5498c0225881eb0543.jpg', 'instock', '13', '', '', '', '', '', '', '1', '', '0', '00', ''),
(274, 'Retroback Back Support System', 1, 'Super Admin', 3, 'ICD10', 'HCPCS,E2611', 0, '<p>* Simply clip Retroback onto the existing sling upholstery and lift it off every time a wheelchair needs to be folded or stored</p>\r\n\r\n<p>* No tools or hardware needed</p>\r\n\r\n<p>* This rugged back support system weighs only 3 pounds (1 kg), making it easy to attach and remove from a wheelchair</p>\r\n\r\n<p>* Includes: Cushioned back support pad with attachment clip, cover, and instruction manual</p>\r\n\r\n<p>* The removable, water-resistant cover is made of a flexible, durable, washable fabric</p>\r\n\r\n<p>* Clip on and clip off</p>\r\n\r\n<p>* Improves comfort</p>\r\n\r\n<p>* Supports posture</p>\r\n\r\n<p>* Weight Capacity: 300 lbs</p>\r\n\r\n<p>* 12-month Limited Warranty&nbsp;</p>\r\n', 'Covered by Medicare, Medicaid and most HMO\'s. Must complete CMN and face to Face for Insurance. \r\n', 360, '', '260', 0, '', '', 0, 'retroback-back-support-system', '', 'Complete Medical', '', '', 'a7b6291ab5718fd8a15329c78c661de3.jpg', '2019-03-18 05:27:50', '1', 'RETRO16C', '', '', '', '', 'instock', '14', '', '', '', '', '', '', '1', '', '0', '00', ''),
(275, 'Transport Chair, Super-Light Folding with Carry Bag', 1, 'Super Admin', 3, 'ICD10', 'HCPCS', 0, '<p>Silver Frame and Blue Upholstery</p>\r\n\r\n<p>* Padded, flip back armrests</p>\r\n\r\n<p>* Weighs only 18 lbs</p>\r\n\r\n<p>* Easy to push or transport</p>\r\n\r\n<p>* Aluminum frame is lightweight and strong</p>\r\n\r\n<p>* Composite wheels are lightweight and maintenance free</p>\r\n\r\n<p>* Folds like a conventional folding chair for added convenience</p>\r\n\r\n<p>* Comes with carry bag</p>\r\n\r\n<p>* Fold down footrests</p>\r\n\r\n<p>* Standard rear wheel locks</p>\r\n\r\n<p>* Attractive frame with durable, lightweight nylon upholstery</p>\r\n\r\n<p>* Weight capacity 300 lbs</p>\r\n\r\n<p>* Limited Lifetime Warranty&nbsp;</p>\r\n', 'Covered by most HMO\'s. Must Complete CMN and Face to Face for Insurance processing', 500, '', '350', 0, '', '', 0, 'transport-chair-super-light-folding-with-carry-bag', '', 'Complete Medical', '', '', '960d0c383d10a8689f7a362f360f5b9f.jpg', '2019-03-18 05:33:11', '1', 'SL18', '', '', '', '', 'instock', '14', '', '', '', '', '', '', '1', '', '0', '00', ''),
(276, 'Wheelchair - Transport With Commode ', 1, 'Super Admin', 3, 'ICD10', 'HCPCS,E0163', 0, '<p>Chrome plated steel tubing frame with welded construction</p>\r\n\r\n<p>* Drop arm allows for safe lateral patient transfers to and from commode</p>\r\n\r\n<p>* Swing away and detachable footrests (Sold separately)</p>\r\n\r\n<p>* Injection molded large plastic toilet seat, 7.5 quart bucket and cover come standard</p>\r\n\r\n<p>* Back can be easily removed without tools</p>\r\n\r\n<p>* Rust resistant, swivel casters (2 with locks)</p>\r\n\r\n<p>* Can be shipped UPS</p>\r\n\r\n<p>* Comes standard with padded seat</p>\r\n\r\n<p>* Limited LifetimeWarranty</p>\r\n\r\n<p>* Weight capacity: 350 Lbs</p>\r\n\r\n<p>* Width between arms: 18&quot;</p>\r\n\r\n<p>* Outside width: 22&quot;</p>\r\n\r\n<p>* Seat width: 17&quot;</p>\r\n\r\n<p>* Seat depth: 17&quot;</p>\r\n\r\n<p>* Seat height: 20&quot;</p>\r\n\r\n<p>* Product weight: 35 lbs</p>\r\n\r\n<p>* Shipping weight: 42 lbs</p>\r\n\r\n<p>* Weight limit: 350 lbs&nbsp;</p>\r\n', 'Most HMO\'s Accepted. Must complete CMN for Insurance processing', 300, '', '220', 0, '', '', 0, 'wheelchair-transport-with-commode', '', 'Complete ', '', '', 'bcf22b652387a097878b9f382301e33e.jpg', '2019-03-18 05:54:42', '1', '10960A', '', '', '', '', 'instock', '12', '', '', '', '', '', '', '1', '', '0', '00', ''),
(277, 'Image EC Mid Wheel Drive Blue 20', 1, 'Super Admin', 4, 'ICD10', 'HCPCS', 0, '<p>Mfgr #2800ECBL-RCL-20</p>\r\n\r\n<p>* Mid Wheel drive allows for tighter turning radius</p>\r\n\r\n<p>* PG Controller with diagnostic fault codes</p>\r\n\r\n<p>* Off board charger</p>\r\n\r\n<p>* Joystick can be mounted on either side</p>\r\n\r\n<p>* Front swivel anti-tippers have true independent adjustable suspension</p>\r\n\r\n<p>* Helps prevent the drive wheels from losing contact with the ground</p>\r\n\r\n<p>* Drive mid wheels are flat free including coil spring tension suspension</p>\r\n\r\n<p>* Uniquely designed Dynamic Drive suspension for greater climbing ability and comfort when traveling forward and in reverse</p>\r\n\r\n<p>* Front and Rear semi-pneumatic swivel wheels</p>\r\n\r\n<p>* Foot plate is angle, height and depth adjustable</p>\r\n\r\n<p>* 18&quot; Deluxe height adjustable swivel captain&#39;s seat</p>\r\n\r\n<p>* Positioning belt standard</p>\r\n\r\n<p>* Arms are angle, height and depth adjustable</p>\r\n\r\n<p>* Standard headrest is height adjustable</p>\r\n\r\n<p>* Seat reclines for comfort and folds down for portability</p>\r\n\r\n<p>* Has been tested and surpassed the ANSI RESNA testing requirement</p>\r\n\r\n<p>* Batteries (Item # U1)</p>\r\n\r\n<p>* Batteries are accessible from the rear of the chair</p>\r\n\r\n<p>* 300 lb. Weight Capacity</p>\r\n', 'Most HMO\'s accepted. Must complete CMN and Face to Face for Insurance processing', 3400, '', '2500', 0, '', '', 0, 'image-ec-mid-wheel-drive-blue-20', '', 'Complete Medical', '', '', 'c7c6db61265f4dfa75008ff614080ea2.jpg', '2019-03-18 06:03:16', '1', '2800BL', '', '', '', '', 'instock', '13', '', '', '', '', '', '', '1', '', '0', '00', ''),
(290, 'Product wheelchair', 170, 'pradnya', 1, 'A100', 'ite', 0, '<p>Description Of data</p>\r\n', 'wheelchair description', 450, '', '100', 0, '', '', 0, 'product-wheelchair', '', 'wheel', '', '', '', '2019-04-16 13:01:11', '0', 'wheelchair', '', '', '', '', 'instock', '1', '', '', '', '', '', '', '0', '', '0', '', ''),
(297, 'Deluxe Full Face CPAP Mask and Headgear', 1, 'Super Admin', 41, 'ICD10', 'HCPCS', 0, '<p>* Maximizes compliance by using a soft silicone cushion with frame stabilizer that redistributes pressure evenly over a large surface area</p>\r\n\r\n<p>* The 100 FD series of masks conforms comfortably to the user&#39;s face without the need for forehead pad, allowing the user the ability to read, watch TV and feel less confined during PAP therapy</p>\r\n', 'The ultimate in comfort and performance for PAP therapy', 85, '', '60,50', 0, '', '', 0, 'deluxe-full-face-cpap-mask-and-headgear', '', 'Complete Medical', '', '', 'b45c51023e22cb82ee75be7e0ae5e45d.jpg', '2019-07-11 16:40:51', '1', '3803A', '', '', '', '', 'instock', '11', '', '', '', '', '', '', '1', '', '0', '', ''),
(298, 'DreamEasy Full Face CPAP Mask', 1, 'Super Admin', 41, 'ICD10', 'HCPCS', 0, '<p>* Quick-release clips allow for easy mask removal without the need for headgear readjustments</p>\r\n\r\n<p>* Equipped with a 360 rotational elbow, the DreamEasy allows for freedom of movement when sleeping for a comfortable night&#39;s rest</p>\r\n\r\n<p>* Full face design is perfect for patients whose therapy is compromised by mouth breathing</p>\r\n\r\n<p>* Extremely lightweight and durable</p>\r\n\r\n<p>* Headgear with Velcro fasteners provide maximum versatility and movement</p>\r\n\r\n<p>* 360 rotational elbow with standard 22 mm tubing connector</p>\r\n\r\n<p>* The comfort cushion is made with medical liquid silicone that is completely odorless and latex free</p>\r\n\r\n<p>* Comfort cushion can be removed for easy cleaning</p>\r\n\r\n<p>* Ergonomic design is airtight</p>\r\n\r\n<p>* Vent hole provides effective CO2 washout</p>\r\n\r\n<p>* Dishwasher safe for easy cleaning</p>\r\n\r\n<p>* 90-day limited warranty with 30-day money-back guarantee&nbsp;</p>\r\n', 'The DreamEasy full face CPAP mask provides a superior seal with its removable Comfort Cushion which conforms around the nose and facial contours reducing the risk for mask leaks', 60, '', '52', 0, '', '', 0, 'dreameasy-full-face-cpap-mask', '', 'Complete Medical', '', '', 'ad49cb424a013449e8537855d0fb63c2.jpg', '2019-07-11 16:46:34', '1', '3815A', '', '', '', '', 'instock', '12', '', '', '', '', '', '', '1', '', '0', '', ''),
(299, 'Cock-Up Elastic Wrist Splint', 192, 'Funso', 16, 'ICD10', 'L3908', 0, '<ul style=\"list-style-type:circle\">\r\n	<li>Ultra lightweight style wrist brace.</li>\r\n	<li>Removable and adjustable palmar stay for maximum support.</li>\r\n	<li>Velcro&trade; closure for easy adjustment.</li>\r\n	<li>7&quot; length.</li>\r\n</ul>\r\n', 'Recommended for Carpal tunnel syndrome, sprains, strains, tendonitis, wrist immobilization, post cast healing', 0, '', 'NA', 0, '', '', 0, 'cock-up-elastic-wrist-splint', '', 'Accord', '', '', 'ef392265bffedc280fbdf4872143bf75.jpg', '2019-08-07 15:42:13', '1', 'OC058', '', '', '', 'a4f8942832ce961e3fb1cdd8fceb170e.jpg', 'instock', '11', '', '', '', '', '', '', '1', '', '0', 'NA', ''),
(300, 'Alante Sport', 192, 'Funso', 4, 'ICD10', 'K0823', 0, '<ul style=\"list-style-type:disc\">\r\n	<li>Full-size charcoal gray captain&rsquo;s seat standard</li>\r\n	<li>50 amp, PG controller standard</li>\r\n	<li>Black, non-scuffing tires with silver rims</li>\r\n	<li>Available in Red</li>\r\n	<li>300 lb. weight capacity</li>\r\n	<li>Impressive 25&rdquo; turning radius</li>\r\n	<li>Front wheel drive with in-line motors</li>\r\n	<li>Maximum speed 3.5 mph at 300 lbs.</li>\r\n	<li>Range 16.5 miles</li>\r\n	<li>Optional 20&rdquo;x18&rdquo; seat available</li>\r\n</ul>\r\n', 'This versatile motorized wheelchair will improve patient activities of daily living.', 0, '', 'NA', 0, '', '', 0, 'alante-sport', '', 'Golden', '', '', '565ea332c96cc0387496e287b49e1467.jpg', '2019-08-11 12:56:13', '1', 'WA100', '', '', '', '', 'instock', '11', '', '', '', '', '', '', '1', '', '0', 'NA', ''),
(301, 'Chrome Sport Full-Reclining Wheelchair', 192, 'Funso', 3, 'ICD10', 'K0001/E1226-1, K0001 OR K0002+E1226+E0966+E0990 OR K0195', 0, '<ul style=\"list-style-type:disc\">\r\n	<li>Hydraulic reclining mechanism allows for infinite adjustments up to 180&deg;.</li>\r\n	<li>Arms have support extension for reclining position.</li>\r\n	<li>Comfortable, lightweight, easy-to-clean vinyl upholstery.</li>\r\n	<li>Attractive chrome frame.</li>\r\n	<li>Dual axle position for the rear Mag-Style wheels.</li>\r\n	<li>Lightweight, maintenance-free, Composite Mag-Style wheels.</li>\r\n	<li>8&quot; front casters.</li>\r\n	<li>Padded armrests provide added patient comfort.</li>\r\n	<li>Wheels are positioned at the back of the frame for additional stability.</li>\r\n	<li>Added rigidity bar keeps the back from hammocking.</li>\r\n	<li>Precision sealed wheel bearings in front and rear ensure long-lasting performance and reliability.</li>\r\n	<li>Rear anti-tippers standard.</li>\r\n	<li>Headrest extension with cushioned head immobilizer standard.</li>\r\n	<li>Comes standard with swing-away elevating leg rests.</li>\r\n	<li>Metal foot plates.</li>\r\n	<li>Comes with push-to-lock wheel locks.</li>\r\n</ul>\r\n', 'We process orders with Prescription only', 0, '', 'NA', 0, '', '', 0, 'chrome-sport-full-reclining-wheelchair', '', 'Drive', '', '', '61c4d09581dd49603f3f4cbf323a4eae.jpg', '2019-08-11 13:22:12', '1', 'WA019', '', '', '', '', 'instock', '12', '', '', '', '', '', '', '1', '', '0', 'NA', ''),
(302, 'Super Light, Folding Transport Chair with Carry Bag and Flip-Back Arms', 192, 'Funso', 3, 'ICD10', 'E1038', 0, '<p>&nbsp;</p>\r\n\r\n<ul style=\"box-sizing: border-box; color: rgb(0, 0, 0); font-family: verdana,sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: 400; letter-spacing: normal; list-style-position: initial; list-style-type: disc; margin-bottom: 15px; margin-left: 0px; margin-right: 0px; margin-top: 0px; orphans: 2; padding-bottom: 0px; padding-left: 16px; padding-right: 0px; padding-top: 0px; text-align: left; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-text-stroke-width: 0px; white-space: normal; word-spacing: 0px;\">\r\n	<li style=\"box-sizing: border-box;\">Padded flip-back armrests</li>\r\n	<li style=\"box-sizing: border-box;\">Fold-down footrests</li>\r\n	<li style=\"box-sizing: border-box;\">Weighs only 19 lbs</li>\r\n	<li style=\"box-sizing: border-box;\">Easy to push or transport</li>\r\n	<li style=\"box-sizing: border-box;\">Aluminum frame with lightweight nylon upholstery</li>\r\n	<li style=\"box-sizing: border-box;\">Composite wheels are lightweight and maintenance free</li>\r\n	<li style=\"box-sizing: border-box;\">Folds like a conventional folding chair</li>\r\n	<li style=\"box-sizing: border-box;\">Comes with carry bag (item #835) with shoulder strap</li>\r\n	<li style=\"box-sizing: border-box;\">Standard rear wheel locks and seat belt</li>\r\n</ul>\r\n', 'We process orders with Prescription only', 0, '', 'NA', 0, '', '', 0, 'super-light-folding-transport-chair-with-carry-bag-and-flip-back-arms', '', 'Drive', '', '', 'ff28360be5c71308422b6b8179ecbbab.jpg', '2019-08-11 13:28:02', '1', 'WA050', '', '', '', '', 'instock', '12', '', '', '', '', '', '', '1', '', '0', 'NA', ''),
(303, 'Avalon LP Back Support', 192, 'Funso', 10, 'ICD10', 'L0627/ L0642', 0, '<ul style=\"list-style-type:disc\">\r\n	<li>Great economic solution to low back support.</li>\r\n	<li>Comprised from a durable elastic and featuring a 10&rdquo; posterior panel with &ldquo;classic&rdquo; elastic compression pulls</li>\r\n	<li>A&nbsp;great low-profile spine support designed to fit in any budget</li>\r\n	<li>Recommended for: Spinal Stenosis, Spondylolisthesis, Spondylolysis, Chronic Back Pain, Spinal Instability, Post-Op Disk Surgery, Facet Syndrome, Degenerative, Herniated/ Bulging Disc, or Post-Operative Lumber Fusion</li>\r\n</ul>\r\n', 'We process orders with Prescription only', 0, '', 'NA', 0, '', '', 0, 'avalon-lp-back-support', '', 'Comfortland', '', '', '80656177c3f0162a81371ee239cbbb5d.jpg', '2019-08-11 13:48:16', '1', 'OC056', '', '', '', '', 'instock', '12', '', '', '', '', '', '', '1', '', '0', 'NA', ''),
(304, 'T.L.S.O. Back Support', 192, 'Funso', 10, 'ICD10', 'LO450', 0, '<ul style=\"list-style-type:disc\">\r\n	<li>Moderate control of unwanted neck flexion /extension</li>\r\n	<li>Treat mid-neck strains and sprains</li>\r\n	<li>Recommended for posture correction, for people who suffer from Scoliosis or other spine problems, for those who spend long hours sitting without much movement</li>\r\n</ul>\r\n', 'We process orders with Prescription only', 0, '', 'NA', 0, '', '', 0, 't-l-s-o-back-support', '', 'Advanced Orthopaedics', '', '', '563f104601a44172e166a216828c03a7.jpg', '2019-08-11 13:56:05', '1', 'BB26', '', '', '', '', 'instock', '12', '', '', '', '', '', '', '1', '', '0', 'NA', ''),
(305, 'DV8 Steerable Aluminum Knee Walker', 192, 'Funso', 2, 'ICD10', 'E0118', 0, '<ul style=\"list-style-type:disc\">\r\n	<li>Knee walker can be steered for increased maneuverability</li>\r\n	<li>Ideal for individuals recovering from foot surgery, breaks, sprains, amputation and ulcers of the foot</li>\r\n	<li>Deluxe dual-braking system</li>\r\n	<li>Sturdy dual frame adds stability and durability</li>\r\n	<li>New basket allows the user to transport personal items</li>\r\n	<li>Contoured leg pad provides extra balance</li>\r\n	<li>New leg pad cover provides added comfort</li>\r\n	<li>New tiller lock provides added safety and security</li>\r\n	<li>Tiller can be easily folded for storage and transportation</li>\r\n	<li>Foldable steering column allows for easy storage</li>\r\n	<li>Tool-free height adjustment of seat and handle</li>\r\n	<li>8&quot; casters are ideal for indoor/outdoor use</li>\r\n</ul>\r\n', 'We process orders with Prescription only', 0, '', 'NA', 0, '', '', 0, 'dv8-steerable-aluminum-knee-walker', '', 'Drive', '', '', '5a437537c042336e51912a3704ff2ae1.jpg', '2019-08-11 14:36:32', '1', 'RL117', '', '', '', '', 'instock', '11', '', '', '', '', '', '', '1', '', '0', 'NA', ''),
(306, 'Folding Walker, Two Button with 5\" inch Wheels', 192, 'Funso', 2, 'ICD10', 'E0143', 0, '<ul style=\"list-style-type:disc\">\r\n	<li>Easy push-button mechanisms may be operated by fingers, palms or side of the hand</li>\r\n	<li>Each side operates independently to allow easy movement through narrow spaces and greater stability while standing</li>\r\n	<li>Unique U-shaped frame design creates greater clearance</li>\r\n	<li>The patient is able to bring the walker closer to assist in standing because of the improved cross frame</li>\r\n	<li>Sturdy 1&quot; diameter, aluminum construction ensures maximum strength while remaining lightweight</li>\r\n</ul>\r\n', 'We process orders with Prescription only', 0, '', 'NA', 0, '', '', 0, 'folding-walker-two-button-with-5-inch-wheels', '', 'Drive', '', '', '272e993f682a7a1319eb71ee73f66ad3.jpg', '2019-08-11 14:40:06', '1', 'RL118', '', '', '', '', 'instock', '11', '', '', '', '', '', '', '1', '', '0', 'NA', ''),
(307, 'Nimbo Posterior Walker with Seat', 192, 'Funso', 2, 'ICD10', 'E1399', 0, '<ul style=\"list-style-type:disc\">\r\n	<li>Now available in 3 fun colors! (Extra large only available in black)</li>\r\n	<li>New smooth texture handgrip increases comfort</li>\r\n	<li>Reverse style aluminum walker that easily adjusts in height</li>\r\n	<li>Includes Flip down seat</li>\r\n	<li>5&quot; Front and Rear wheels</li>\r\n	<li>Soft rubber wheels grip any surface and will not slide backward</li>\r\n	<li>Durable Aluminum one-directional mechanism</li>\r\n	<li>One-directional override bracket allows for forward and reverse mobility</li>\r\n	<li>Easy to use front wheel swivel lock</li>\r\n	<li>Folds easily for transportation</li>\r\n</ul>\r\n', 'We process orders with Prescription only', 0, '', 'NA', 0, '', '', 0, 'nimbo-posterior-walker-with-seat', '', 'Nimbo', '', '', 'b8db3c61a6eb55cf25f05332ea61e7e1.jpg', '2019-08-11 14:45:00', '1', 'RL124XSWP', '', '', '', '', 'instock', '12', '', '', '', '', '', '', '1', '', '0', 'NA', ''),
(308, 'Mimi Lite Rollator Walker', 192, 'Funso', 2, 'ICD10', 'E0143, E0156', 0, '<ul style=\"list-style-type:disc\">\r\n	<li>6&quot; casters with soft-grip tires are ideal for indoor and outdoor use</li>\r\n	<li>Comes standard with pouch</li>\r\n	<li>Comfortable padded seat</li>\r\n	<li>Easy, one hand folding</li>\r\n	<li>Handles are adjustable in height</li>\r\n	<li>Optional basket available</li>\r\n	<li>Special loop lock made of internal aluminum casting operates easily and ensures safety</li>\r\n	<li>Tool Free removable padded back rest for comfort</li>\r\n</ul>\r\n', 'We process orders with Prescription only', 0, '', 'NA', 0, '', '', 0, 'mimi-lite-rollator-walker', '', 'Drive', '', '', '83a2db323a6f44bb9af3ac6ea278ce87.jpg', '2019-08-11 14:48:59', '1', 'RL123', '', '', '', '', 'instock', '12', '', '', '', '', '', '', '1', '', '0', 'NA', ''),
(309, 'Pelvic Stabilizer Walker', 192, 'Funso', 2, 'ICD10', 'E1399-1, E1399', 0, '<ul style=\"list-style-type:disc\">\r\n	<li>Pelvic stabilizer is adjustable in width</li>\r\n	<li>Features back and lateral pads and a support belt</li>\r\n	<li>Recommended for users who have an asymmetrical posture when standing or walking and, therefore, cannot stay centered in the gait trainer</li>\r\n</ul>\r\n', 'We process orders with Prescription only', 0, '', 'NA', 0, '', '', 0, 'pelvic-stabilizer-walker', '', 'Nimbo', '', '', '52d821f8d7bbbcbf21714b88cec7d34e.jpg', '2019-08-11 14:52:11', '1', 'RL131', '', '', '', '', 'instock', '13', '', '', '', '', '', '', '1', '', '0', 'NA', ''),
(310, 'Low Profile Air Walker (Low Top)', 192, 'Funso', 42, 'ICD10', 'L4360, L4361', 0, '<ul style=\"list-style-type:disc\">\r\n	<li>Inflatable bladder incorporated into liner for increased immobilization of the lower leg, ankle, and foot.</li>\r\n	<li>Designed for the treatment of stable fractures and ankle sprains.</li>\r\n	<li>Lightweight, low rocker profile design for greater patient comfort.</li>\r\n	<li>Cushioned heel for greater energy absorption.</li>\r\n	<li>Wider rocker bottom design promotes smooth energy conserving gait.</li>\r\n	<li>Fits either left or right.</li>\r\n	<li>Designed for the treatment of stable fractures and ankle sprains.</li>\r\n	<li>Recommended for: Soft tissue injuries, grade 2 and 3 sprains, stable fractures, post-operative stabilization, Helps to reduce pain, swelling, and edema of foot and ankle.</li>\r\n</ul>\r\n', 'We process orders with Prescription only', 0, '', 'NA', 0, '', '', 0, 'low-profile-air-walker-low-top', '', 'Advanced Ortho', '', '', '831304477b165733e3c04c51c223d605.jpg', '2019-08-11 15:08:05', '0', 'FCCAM004S', '', '', '', '', 'instock', '12', '', '', '', '', '', '', '1', '', '0', 'NA', ''),
(311, 'Pediatric Cam Walker', 192, 'Funso', 42, 'ICD10', 'L4386, L4387', 0, '<ul style=\"list-style-type:disc\">\r\n	<li>Helps prevent sports injuries.</li>\r\n	<li>Designed for the treatment of stable fractures and ankle sprains</li>\r\n	<li>Lace &ndash; up closure allows for an intimate medial and lateral fit.</li>\r\n	<li>Figure 8 strapping configuration provides extra stability.</li>\r\n	<li>Fits either left or right foot.</li>\r\n	<li>Recommended for :&nbsp;Soft tissue injuries, Grade 2 and 3 sprains</li>\r\n</ul>\r\n', 'We process orders with Prescription only', 0, '', 'NA', 0, '', '', 0, 'pediatric-cam-walker', '', 'Advanced Ortho', '', '', 'a4b7d5ad1642c2e831ee4d572a822fbe.jpg', '2019-08-11 15:14:38', '1', 'FCCAM002', '', '', '', '', 'instock', '11', '', '', '', '', '', '', '1', '', '0', 'NA', ''),
(312, 'Universal Wrist/Forearm Brace', 192, 'Funso', 16, 'ICD10', 'L3908', 0, '<ul style=\"list-style-type:square\">\r\n	<li>Removable and adjustable palmar stay for maximum support.</li>\r\n	<li>Brace can be removed and put back on easily once properly fitted.</li>\r\n	<li>Velcro&trade; closure for easy adjustment.</li>\r\n	<li>11&quot; length.</li>\r\n</ul>\r\n', 'We process orders with Prescription only', 0, '', 'NA', 0, '', '', 0, 'universal-wrist-forearm-brace', '', 'Accord', '', '', '4a18efcf62f73236528fd6cc55f3abea.jpg', '2019-08-11 17:38:57', '0', 'OC059', '', '', '', '', 'instock', '11', '', '', '', '', '', '', '1', '', '0', 'NA', ''),
(313, 'ACL Knee Brace', 192, 'Funso', 12, 'ICD10', 'L1845', 0, '<ul style=\"list-style-type:disc\">\r\n	<li>Provides stability and support following injury or reconstruction of the ACL, PCL, MCL, LCL and menisci</li>\r\n	<li>Can be used prophylactically to prevent hyperextension injuries</li>\r\n	<li>Strong, lightweight composite frame</li>\r\n	<li>User-friendly ROM hinge for quick and easy adjustment</li>\r\n</ul>\r\n', 'We process orders with Prescription only', 0, '', 'NA', 0, '', '', 0, 'acl-knee-brace', '', 'Advanced Orthopaedics', '', '', '0c467edc8379b42ba3c2318ba75cdab2.jpg', '2019-08-11 17:43:33', '1', 'KB01', '', '', '', '', 'instock', '12', '', '', '', '', '', '', '1', '', '0', 'NA', ''),
(314, 'Hinged Knee Support Sleeve', 192, 'Funso', 12, 'ICD10', 'L1832, L1833', 0, '<ul style=\"list-style-type:disc\">\r\n	<li>The Drytex hinged knee suppoprt, is a Neoprene alternative constructed of a unique nylon core and polyester Lycrar fabric that allows for improved airflow</li>\r\n	<li>Provides compression and support, yet allows for breathability ideal in warm weather climates</li>\r\n	<li>Designed for mild to moderate medial lateral stability Measurements taken 6&quot; above mid-patella, knee joint line, and 6&quot; below mid-patella circumference</li>\r\n</ul>\r\n', 'We process orders with Prescription only', 0, '', 'NA', 0, '', '', 0, 'hinged-knee-support-sleeve', '', 'Complete Medical ', '', '', '74dab6b4fb58bb76e01837eeb1cfb977.jpg', '2019-08-11 17:47:30', '1', 'KB37', '', '', '', '', 'instock', '13', '', '', '', '', '', '', '0', '', '0', 'NA', ''),
(315, '5 Low Air Loss & APP Overlay Mattress System', 192, 'Funso', 6, '', 'E0372', 0, '<ul style=\"list-style-type:disc\">\r\n	<li>5&quot; Deep For use in the prevention and treatment of pressure sores</li>\r\n	<li>High Volume pump produces 8 liters per minute pressure to allow fast inflation</li>\r\n	<li>LED indicators provide critical performance data and alert caregiver when pressure falls below 5 mmHg</li>\r\n	<li>Comes with quick fill adapter</li>\r\n	<li>Mattress has 20 Nylon air cells</li>\r\n	<li>Spring-loaded air tubes prevent kinks and disruption of air pressure</li>\r\n	<li>CPR valves provide fast release of air from the mattress to conduct CPR 8</li>\r\n	<li>Water-proof cover provides mattress protection and ventilation Includes carry bag for easy transport</li>\r\n</ul>\r\n', 'We process orders with Prescription only', 0, '', 'NA', 0, '', '', 0, '5-low-air-loss-app-overlay-mattress-system', '', 'Complete Medica', '', '', '17ca94dea0ed576c5061613ef667547d.jpg', '2019-08-11 17:52:45', '1', 'BA010', '', '', '', '', 'instock', '12', '', '', '', '', '', '', '1', '', '0', 'NA', ''),
(316, 'Full Electric Bed', 192, 'Funso', 6, 'ICD10', 'E0297', 0, '<ul style=\"list-style-type:disc\">\r\n	<li>Quiet, smooth operation, w/Easy-to-use Hand Pendant electrically controls Head/Foot Section positioning and overall height of the bed frame for maximum comfort and versatility for the patient or caregiver.</li>\r\n	<li>Easy to set up. Bed ships in two cartons. Shaft stores under frame when unassembled.</li>\r\n	<li>Channel frame construction provides superior strength and reduced weight.</li>\r\n	<li>Reinforced frame resists twisting and bending. Zinc-coated spring deck for Pt comfort.</li>\r\n	<li>Heavy-duty bed ends; attractive, easy to maintain, interchangeable w/Invacare&reg;/Sunrise&reg;.</li>\r\n	<li>Clip-on pendant mounts on bed rail, operate Head and Foot section simultaneously.</li>\r\n	<li>Half rails and full rails available. (Sold separately) .</li>\r\n	<li>Motor is UL Approved, Manufactured in ISO9001 facility.</li>\r\n</ul>\r\n', 'We process orders with Prescription only', 0, '', 'NA', 0, '', '', 0, 'full-electric-bed', '', 'Accord', '', '', '3c3aa5262d72948380ffeeb0a0a20b4c.jpg', '2019-08-11 18:13:33', '1', 'BD103', '', '', '', '', 'instock', '12', '', '', '', '', '', '', '1', '', '0', 'NA', ''),
(317, 'Med-Aire Essential 8\" Alternating Pressure and Low Air Loss Mattress System', 192, 'Funso', 6, 'ICD10', 'E0277', 0, '<ul style=\"list-style-type:disc\">\r\n	<li>This combination&nbsp;therapy mattress system provides both alternating pressure and low air loss to optimize pressure redistribution and manage skin maceration.</li>\r\n	<li>Designed to prevent, treat and manage pressure ulcers in the home or long term care setting.</li>\r\n	<li>The Med-Aire Essential incorporates a system of (18) 8&quot; deep individual bladders to maximize immersion and envelopment.</li>\r\n	<li>The pump offers a static feature as well as adjustable comfort settings by patient weight.</li>\r\n	<li>The removable cover is quilted for comfort, low shear, anti-microbial, water-resistant and vapor permeable.</li>\r\n	<li>CPR valve allows for rapid deflation</li>\r\n	<li>Recommended for &nbsp;Stage 1, 2, 3, 4 ulcer</li>\r\n</ul>\r\n', 'We process orders with Prescription only', 0, '', 'NA', 0, '', '', 0, 'med-aire-essential-8-alternating-pressure-and-low-air-loss-mattress-system', '', 'Accord', '', '', 'e65a8349cf89aa45df962df31070315e.jpg', '2019-08-11 18:18:12', '1', 'BA007', '', '', '', '', 'instock', '12', '', '', '', '', '', '', '1', '', '0', 'NA', ''),
(318, 'Compass HD Motorized Wheel Chair', 192, 'Funso', 4, 'ICD10', 'K0825', 0, '<ul style=\"list-style-type:disc\">\r\n	<li>Offers a stable, center-wheel-drive platform</li>\r\n	<li>Articulating chassis for stability over tough terrain</li>\r\n	<li>Bigger, beefier version of the popular Compass Sport</li>\r\n	<li>450 lb. weight capacity</li>\r\n	<li>20-inch turning radius</li>\r\n	<li>Comes standard with a captain&rsquo;s seat</li>\r\n	<li>Exclusive fold-flat seat hinge design for easy transport</li>\r\n</ul>\r\n', 'We process orders with Prescription only', 0, '', 'NA', 0, '', '', 0, 'compass-hd-motorized-wheel-chair', '', 'Golden', '', '', '09cc044dde25730d7d5411ecc7a20fac.jpg', '2019-08-11 18:23:19', '1', 'WA400', '', '', '', '', 'instock', '12', '', '', '', '', '', '', '1', '', '0', 'NA', ''),
(319, 'Motorized Wheelchair', 195, 'Olu', 4, 'ICD 10', '', 0, '<ul>\r\n	<li>300 lb weight capacity</li>\r\n	<li>Improved battery range of 19.5 miles</li>\r\n	<li>Turning radius 19.5&rdquo;</li>\r\n	<li>Dynamic Linx Smart Controller (40 amp)</li>\r\n	<li>Side-mounted charging port</li>\r\n	<li>Adjustable-depth seat / Swivel seat</li>\r\n	<li>Height adjustable headrest</li>\r\n	<li>Armrest height, width and angle adjustable</li>\r\n	<li>Designed exclusively for Golden, imported product</li>\r\n</ul>\r\n', 'Golden Technologies’ Compass Sport is a versatile electric wheelchair. It is durable and reliable. \r\nWe accept Insurance payment options orders for this product.', 0, '', 'NA', 0, '', '', 0, 'motorized-wheelchair', '', 'Golden Technologies Compass Sport', '', '', 'd6c5c30746b7bfe6071f31528fcdc53d.jpg', '2019-08-20 16:58:09', '1', 'na', '', '', '', '', 'instock', '11', '', '', '', '', '', '', '1', '', '0', 'NA', ''),
(320, 'Competitor™ Semi-Electric Bed', 192, 'Funso', 6, 'ICD10', 'E0261-1', 0, '<p>. Adjustable-height bed, deck height is adjustable without tools.</p>\r\n\r\n<p>&middot;&nbsp; Complete with full side rails and frame mounted retractable receiver&nbsp; bracket to eliminate cross braces and ensure proper placement to reduce loss</p>\r\n\r\n<p>&middot;&nbsp; Large glow in the dark hand pendant has easy-to-use controls, built in battery backup and troubleshooting light.</p>\r\n\r\n<p>&middot;&nbsp; Ultra-compact single carton (36&quot; x 9&quot; x 45&quot;) for easy handling.</p>\r\n\r\n<p>&middot;&nbsp; Safety lock slides over hanger pins to prevent disengaging.</p>\r\n\r\n<p>&middot;&nbsp; Self-contained motor for reduced weight and noise (same as Delta&trade; Ultra Light 1000).</p>\r\n\r\n<p>&middot;&nbsp; UL approved Motor can be installed and removed with patient in bed.</p>\r\n\r\n<p>&middot;&nbsp; Casters are an option.</p>\r\n\r\n<p>&middot;&nbsp; Head and foot frame weigh only 42 lbs. each.</p>\r\n\r\n<p>&middot;&nbsp; Head and foot boards are interchangeable.</p>\r\n\r\n<p>&middot;&nbsp; Optional trapeze available Bed Height Minimum Without Casters 11&quot; - 20&quot; Bed Height Maximum With Casters 14&quot; - 23&quot;</p>\r\n\r\n<p>&middot;&nbsp; Unit Dimensions 35&quot; (W) x 84&quot; (L) Weight 143 lbs. Carton Shipping Weight 151 lbs.</p>\r\n\r\n<p>&middot;&nbsp; User Weight Limit 450 lbs</p>\r\n\r\n<p>&middot;&nbsp; Maximum weight limit includes weight of occupant, all accessories such as mattress, side/assist rails, trapeze, any personal affects, etc.</p>\r\n\r\n<p>&middot;&nbsp; Warranty (Original Purchaser) 5 Years on Motor and Hand Control, Limited Lifetime on Welds and Frame, 1 Year on All Other Parts and Components</p>\r\n\r\n<p>&middot;</p>\r\n', 'We process orders with Prescription only', 0, '', 'NA', 0, '', '', 0, 'competitor-semi-electric-bed', '', 'Drive', '', '', '21d1c3c52d28f000d07356d9c8ab5398.jpg', '2019-08-28 15:37:52', '1', 'BD102', '', '', '', '', 'instock', '14', '', 'NA', '', '', '', '', '1', '', '0', 'NA', ''),
(321, '5 Low Air Loss & A.P.P. Mattress System', 192, 'Funso', 6, 'ICD10', 'E0372', 0, '<ul>\r\n	<li>5&quot; Deep</li>\r\n	<li>For use in the prevention and treatment of pressure sores</li>\r\n	<li>High Volume pump produces 8 liters per minute pressure to allow fast inflation</li>\r\n	<li>LED indicators provide critical performance data and alert caregiver when pressure falls below 5 mmHg</li>\r\n	<li>Comes with quick fill adapter Mattress has 20 Nylon air cells</li>\r\n	<li>Spring-loaded air tubes prevent kinks and disruption of air pressure</li>\r\n	<li>CPR valves provide fast release of air from the mattress to conduct CPR 8 Water-proof cover provides mattress protection and ventilation</li>\r\n	<li>Includes carry bag for easy transport</li>\r\n</ul>\r\n', 'We process orders with Prescription only', 0, '', 'NA', 0, '', '', 0, '5-low-air-loss-a-p-p-mattress-system', '', 'Drive', '', '', '8e42dd9cf8741182b7a47c745921eb55.jpg', '2019-08-28 15:43:35', '1', 'BA010', '', '', '', '', 'instock', '14', '', 'NA', '', '', '', '', '1', '', '0', 'NA', ''),
(322, 'Viper Wheelchair with Flip Back Removable Arms', 192, 'Funso', 3, 'ICD10', 'K0004,E1236+K0195,E0990', 0, '<ul>\r\n	<li>8&quot; front casters have 3 height adjustments</li>\r\n	<li>Back height adjustable from 18&quot; - 20&quot;</li>\r\n	<li>Carbon steel black powder coated frame double coated for an attractive, chip-proof, maintainable finish</li>\r\n	<li>Comes standard with flip up anti tippers</li>\r\n	<li>Comes with push to lock wheel locks</li>\r\n	<li>Comes with swing-away footrests or elevating legrests with tool-free adjustable length riggings</li>\r\n	<li>Composite footplates with heel loops are durable and lightweight</li>\r\n	<li>Composite mag-style wheels with aluminum hand rims are lightweight and maintenance free</li>\r\n	<li>Composite steel lined front receiver is angled so the arm will lock into place every time</li>\r\n	<li>Dual axle provides easy transition of seat height to hemi level</li>\r\n	<li>Durable, flame retardant nylon upholstery resists mildew and bacteria</li>\r\n	<li>Easier to propel and transport</li>\r\n	<li>Flip-back arms, allow for easy transfer</li>\r\n	<li>Frame style eliminates seat guides and allows for custom backs and accessories</li>\r\n	<li>Nylon padded armrests provide added patient comfort</li>\r\n	<li>Precision sealed wheel bearings in front and rear ensure long lasting performance and reliability</li>\r\n	<li>The front mounted release lever can be flipped up or down depending on the patients needs</li>\r\n	<li>Urethane rear tires and casters offer superior performance, smoother ride and are lightweight</li>\r\n	<li>Viper weighs 32 lbs (Excluding front rigging)</li>\r\n</ul>\r\n', 'We process orders with Prescription only', 0, '', 'na', 0, '', '', 0, 'viper-wheelchair-with-flip-back-removable-arms', '', 'Drive', '', '', '57289f76b0f18ea5331a8057ee6b4bbd.jpg', '2019-08-28 16:17:13', '1', 'WA500', '', '', '', '', 'instock', '14', '', 'na', '', '', '', '', '1', '', '0', 'na', ''),
(323, 'Sentra Full-Reclining Wheelchair', 192, 'Funso', 3, 'ICD10', 'K0001 / E1226-1,K0001 OR K0002,E1226,E0990,K0195', 0, '<ul>\r\n	<li>8&quot; front casters</li>\r\n	<li>Aluminum footplates are attractive, crack-proof and lightweight</li>\r\n	<li>Black upholstery, chrome frame</li>\r\n	<li>Carbon Steel frame with triple coated chrome for an attractive, chip-proof, maintainable finish</li>\r\n	<li>Carry pocket standard</li>\r\n	<li>Chrome plated hand rims</li>\r\n	<li>Comes standard with swing-away elevating leg rests</li>\r\n	<li>Comes with push to lock wheel locks</li>\r\n	<li>Composite Mag-style wheels with chrome hand rims are lightweight and maintenance free</li>\r\n	<li>Durable, heavy gauge naugahyde upholstery</li>\r\n	<li>Front caster forks are adjustable in 3 positions</li>\r\n	<li>Headrest extension with cushioned head immobilizer standard</li>\r\n	<li>New state-of-the-art hydraulic reclining mechanism allows for infinite adjustments up to 180 degrees</li>\r\n	<li>Padded armrests provide added patient comfort</li>\r\n	<li>Precision sealed wheel bearings in front and rear ensure long lasting performance and reliability</li>\r\n	<li>Rear anti-tippers standard</li>\r\n	<li>Standard dual axle provides easy transition of seat to hemi-level</li>\r\n	<li>Wheels set back on frame prevents tipping</li>\r\n</ul>\r\n', 'We process orders with Prescription only', 0, '', 'NA', 0, '', '', 0, 'sentra-full-reclining-wheelchair', '', 'Drive', '', '', 'ecbe89be2188f31091ad7798d1150e1b.jpg', '2019-08-28 16:29:24', '1', 'WA021', '', '', '', '', 'instock', '13', '', 'NA', '', '', '', '', '1', '', '0', 'NA', ''),
(324, 'NATROX OXYGEN WOUND THERAPY', 1, 'Super Admin', 1, '', '', 0, '<p>1. The NATROX Oxygen Generator is a battery-operated device which delivers 98% pure humidified oxygen to the wound bed through water electrolysis. It is supplied with two rechargeable batteries and a charging kit, thus allowing the user complete freedom of movement.</p>\r\n\r\n<p>2. The NATROX Oxygen Delivery System is a sterile, single-use wound interface. Its &ldquo;web&rdquo; like design allows free passage of wound exudate into the secondary dressing whilst optimising the flow and diffusion of oxygen across the wound bed. It has a 1 m long thin flexible tube which connects directly to the NATROX Oxygen Generator. The NATROX Oxygen Delivery System should be changed at each dressing change in accordance with good clinical practice. However, it can remain in place for up to 7 days if clinically appropriate.</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'The NATROX Oxygen Wound Therapy System is a class II medical device licensed under Medical Device Directive 93/42/EEC. The system consists of two main elements; the NATROX Oxygen Generator and the NATROX Oxygen delivery system.', 3500, '', '3200', 0, '', '', 0, 'natrox-oxygen-wound-therapy', '', 'NATROX', '', '', 'e070d57c41ee49f9cc9bb602acb64e8d.jpg', '2019-11-27 02:52:20', '1', '', '', '', '', '', 'instock', '11', '', '282', '', '', '', '', '1', '', '0', '', ''),
(325, 'Belt', 178, 'Amar', 57, '5656', '123456', 0, '<p>lsdmf/asdflkasdfasdkf;lsdkfl;asd</p>\r\n', 'asdkfhasdkjfhas;kdjfhasdkjfaksdjf.', 52, '', '50', 0, '', '', 0, 'belt-2', '', 'Nissan', '', '', '9dcb98089844849cbbfd8a521bff211a.png', '2020-06-10 10:11:58', '1', 'alsdfjaklsdjfaksdf', '', '', '', 'a0b03c0a10bd13eb83399558dd507cd2.png', 'instock', '20', '', '2', '', '', '', '', '0', 'asdfasdasdf', '0', '50', '');
