INSERT INTO `question` (`id`, `title`, `sub_title`, `status`) VALUES
(6, 'How do I know items that may be covered by my health Insurance provider and plan?', '<p>They are marked insurance by providers.</p>\n', 'active'),
(7, 'How long does it take for orders made with Insurance to be approved?', '<p>It depends on Patients Health Insurance provider.</p>\n', 'active'),
(8, 'I do not have a favorite provider, who will process my order?', '<p>Select MSM Admin to&nbsp;process your order</p>\n', 'active'),
(9, 'My favorite provider products are not listed?', '<p>Ask your favorite provider to register as a provider and list their products.</p>\n', 'active'),
(10, 'Do I need to upload prescription or additional documents to order?', '<p>Some items require prescription while some items do not. Provider will notify you if an item need prescription or any additional documents for processing. All Insurance payment option orders requires prescription and, in most cases, additional documentation.</p>\n', 'active'),
(11, 'Do I need to upload Insurance to order?', '<p>You need to upload Insurance card if order payment is to be processed with Patients&rsquo; Health Insurance.</p>\n\n<p>&nbsp;</p>\n', 'active'),
(12, 'How do I know my co-payment amount? ', '<p>You will receive notifications after submitting your order for processing or notice in the mail.</p>\n', 'active'),
(13, 'How do I Manage eprescription', '<p>If your Physician has sent or will send an eprescription. Use our Manage eprescription app to process your order.</p>\n', ''),
(14, 'How do I order for my patients as a doctor', '<p>Registered doctors can order for registered patients by entering patient details using our Make A&nbsp;Quick Order&nbsp;app. Patient will receive order notifications, history and status in&nbsp;their account.</p>\n', ''),
(15, 'How do I create a Provider account', '<p>It is easy&nbsp;to creat a Provider account online. No technical skill is needed. Click on our Provider icon and follow instructions. You can start posting your products and receiving orders online once your account is approved and activated.</p>\n', '');
